INSERT INTO `charismalatestnews` VALUES ('1', 'Charisma University is pleased to announce its articulation agreement with Bellevue University. Under this articulation agreement, students who have attended Charisma University are eligible to utilize and are subject to the academic credit transfer options published in Bellevue University course catalog.', '2015-07-21 22:37:59');
INSERT INTO `charismalatestnews` VALUES ('2', 'Charisma University is pleased to announce its articulation agreement with Apollos University. This articulation agreement allows credits earned by Apollos University students credited in Charisma University, and vice versa. Charisma University and Apollos University believe that an articulation agreement would significantly benefit our future graduates particularly in terms of course completion within their desired timeframes. Thus, this articulation agreement is to ensure that students would save time and cost in completing their degree programs.', '2015-07-21 22:37:50');
