INSERT INTO `org_certificatecontent` VALUES ('1', 'Associate In Project Management', '<strong>APM-001</strong>', '<p>Project management isn’t just for construction engineers and military logistics experts anymore. Today, in addition to the regular duties of your job, you are often expected to take on extra assignments – and to get that additional job done well, done under budget, and done on time. This E-Course and Certification is not intended to take you from a supervisory or administrative position to that of a project manager. However, the Associate in Project Management (APM) E-Course and Certification will familiarize you with the most common terms and the most current thinking about projects. Associate in Project Management (APM) is an important globally recognized credential in the field of Project Management. Passing the exam and obtaining the APM credential will demonstrate your commitment to project management excellence.</p>\r\n<p>The Associate in Project Management (APM) certificate is an entry level certification in the field of Project Management Framework, The APM certificate demonstrates that the candidate has a required knowledge in the field of Project Management confining to the entry level of project management, candidate who have little or no knowledge of project management can appear for the APM certification.</p>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 50 Multiple Choice Questions out of which the candidate needs to score 70% (35 out of 50 correct) to pass the exam.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<strong>Closed book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<ol>\r\n<h6>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n</h6><h6>\r\n    </h6><h6>\r\n<li>The exam can be taken any number of times.</li>\r\n</h6>\r\n</ol>\r\n<strong>Certification Validity</strong>\r\n<h6>The Associate in Project Management (APM) Certificate is valid for life</h6>\r\n<p><span style=\"color: #ff0000;\">Note: The <strong>Associate in Project Management (APM)<strong>™</strong> </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam</span>.<br>\r\n</p>\r\n', '<h6><strong>Module 1 – Project Management Fundamentals</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Defining a project and project management</li>\r\n<li>How projects can benefit you and your organization</li>\r\n<li>Project life cycles</li>\r\n<li>Selling your own project ideas</li>\r\n<li>Role &amp; skills of the project manager</li>\r\n<li>Creating a vision</li>\r\n<li>Setting project goals</li>\r\n<li>Project planning worksheets</li>\r\n<li>The statement of work</li>\r\n</ul></h6>\r\n<h6><strong>Module 2 – Project Management Training</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>What a project is</li>\r\n<li>Project management basics</li>\r\n<li>How projects can help you</li>\r\n<li>A project’s life cycle</li>\r\n<li>Selling and preparing a project</li>\r\n<li>The role of a project manager</li>\r\n<li>Project goals</li>\r\n<li>Laying out a project</li>\r\n<li>Project risks and contingency planning</li>\r\n<li>The work breakdown structure</li>\r\n<li>Planning tools and budgets</li>\r\n<li>Teamwork and development</li>\r\n<li>Communication</li>\r\n<li>Closing out a project</li>\r\n<li>Team meetings</li>\r\n<li>Project presentations</li>\r\n</ul></h6>\r\n<h6><strong>Module 3 – Intermediate Project Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>What really needs to be done?</li>\r\n<li>Scheduling your project</li>\r\n<li>The Work Breakdown Structure and other planning tools</li>\r\n<li>Budgeting</li>\r\n<li>Project risks</li>\r\n<li>Schedule and budget compression</li>\r\n<li>Change control process</li>\r\n<li>Closing out a project</li>\r\n</ul></h6>', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<h6>Managers and project team members, students at the graduate or undergraduate level, and/or entry level practitioners, as well as anyone who has an expressed interest in project management as a career or wants to improve their effectiveness in a project management environment</h6>\r\n<h6><strong>The APM certification is suitable for you if you:</strong><br>\r\n</h6>\r\n<h6>\r\n<ul>\r\n<li>Have a basic or limited understanding of project management</li>\r\n<li>Are working in a project environment</li>\r\n<li>Require knowledge for APM Certification Exam</li>\r\n<li>What an internationally recognised project management qualification</li>\r\n</ul></h6>\r\n', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '175 $', '70 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=(APM-001)', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=APM-001', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'apm.jpg', '1', '1');
INSERT INTO `org_certificatecontent` VALUES ('2', 'Professional in Project Management', '<strong>PPM-001</strong>', '<p> Projects and project management has become the foundation for success in the public and private sectors. Enterprises achieve their goals through projects and effective project management. Successful project management requires achieving the scope (e.g., intended result), cost and schedule. In addition, the increasing complexity of work and demands for â€œmore with lessâ€ place special demands on the project manager.</p>\r\n<p>These programs go beyond the â€œWhat is project management and practicesâ€ to providing practical â€œHow Toâ€ guidance, tools and techniques, and processes to implement in todayâ€™s working world.</p>\r\n<p>The Professional in Project Management (PPM)â„¢ certification comprises of project management modules including â€“ how to plan, execute, control and complete projects. The core focus on key trends in managing projects and demands on the project managers, the PPMâ„¢ project is very useful for project schedules, develop project measures and approaches to project control; and how to develop, lead and motivate project teams.</p>\r\n<p>The Professional in Project Management (PPM)â„¢ is a demonstration by an independent third party that standard requirements of knowledge and experience have been met that are recognized throughout the business community.</p>\r\n<p>The Professional in Project Management (PPM)â„¢ shows that you have pledged time, energy and effort to the project management profession. This overt evidence of a commitment to the profession can lead to opportunities in the corporate domain, increased responsibilities and a growth in earnings.</p>\r\n<p>While most project managers obtain a great deal of project management knowledge and experience through on the job training, a certificate of Professional in Project Management (PPM)â„¢ professional body of knowledge invariably leads to an assimilation of new knowledge and technique.</p>\r\n<p>By earning the Professional in Project Management (PPM)â„¢ appellation, professionals boost their self-confidence and gain the respect and recognition of their peers.<br>\r\n</p>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 150 Multiple Choice Questions out of which the candidate needs to score 75% to pass the exam, the PPMâ„¢ certification is considered to be one of the most difficult exam for Project Mangers to pass, generally 7 out of 10 project managers fail the exam in their first attempt.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>The total duration of the exam is 2 hours (120 Minutes)</h6>\r\n<strong>Closed book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<strong>Certification Validity</strong>\r\n<h6>\r\n<ol>\r\n<li>The validity period of Professional in Project Management (PPM)â„¢ Certificate is for five (5) years, the candidate needs to either retake the exam or can complete the E-Course for PPM to accrue the number of continuing education units (CEUs) to renew the Certificate. Renewing the certificate will allow the candidate to retain the professional stature and credentials intact.</li>\r\n<li>Certificates must be renewed on or before the expiration date (when they become inactive) to be current.</li>\r\n</ol></h6>\r\n<strong>Credits </strong>\r\n<h6>Successfully passing the PPM exam will also earn candidates a total of 80 Credits towards MBA in Project Management (Masterâ€™s Degree) offered by Charisma University. </h6>\r\n<p><span style=\"color: red;\">Note: The <strong>Professional in Project Management (PPM) </strong>Certification requires a mandatory E-Course completion requirement. Once the candidate completes the E-Course, they will receive a GAQM Learner ID. This ID is required at the time of scheduling an exam at a Pearson Vue Testing Center. For more information, you can send an E-mail to <a href=\"mailto:support@gaqm.org\">support@gaqm.org</a> </span><br>\r\n</p>', '<strong>Module 1 â€“ Project Management Fundamentals</strong>\r\n<ul>\r\n<h6>\r\n<li>Defining a project and project management</li>\r\n<li>How projects can benefit you and your organization</li>\r\n<li>Project life cycles</li>\r\n<li>Selling your own project ideas</li>\r\n<li>Role &amp; skills of the project manager</li>\r\n<li>Creating a vision</li>\r\n<li>Setting project goals</li>\r\n<li>Project planning worksheets</li>\r\n<li>The statement of work</li>\r\n</h6></ul>\r\n<h6><strong>Module 2 â€“ Project Management Training</strong></h6> \r\n<ul>\r\n<h6>\r\n<li>What a project is</li>\r\n<li>Project management basics</li>\r\n<li>How projects can help you</li>\r\n<li>A projectâ€™s life cycle</li>\r\n<li>Selling and preparing a project</li>\r\n<li>The role of a project manager</li>\r\n<li>Project goals</li>\r\n<li>Laying out a project</li>\r\n<li>Project risks and contingency planning</li>\r\n<li>The work breakdown structure</li>\r\n<li>Planning tools and budgets</li>\r\n<li>Teamwork and development</li>\r\n<li>Communication</li>\r\n<li>Closing out a project</li>\r\n<li>Team meetings</li>\r\n<li>Project presentations</li>\r\n</h6></ul>\r\n<h6><strong>Module 3 â€“ Intermediate Project Management</strong></h6>\r\n<ul>\r\n<h6>\r\n<li>What really needs to be done?</li>\r\n<li>Scheduling your project</li>\r\n<li>The Work Breakdown Structure and other planning tools</li>\r\n<li>Budgeting</li>\r\n<li>Project risks</li>\r\n<li>Schedule and budget compression</li>\r\n<li>Change control process</li>\r\n<li>Closing out a project</li>\r\n</h6></ul>\r\n<h6><strong>Module 4 â€“ Effective Planning &amp; Scheduling </strong></h6>\r\n<ul>\r\n<h6>\r\n<li>Projects and schedules</li>\r\n<li>The Work Breakdown Structure (WBS)</li>\r\n<li>Estimating activity durations</li>\r\n<li>Identifying task dependencies</li>\r\n<li>Aligning resources with activities</li>\r\n<li>Project planning</li>\r\n<li>Scheduling software</li>\r\n<li>Uncertainty and risk management</li>\r\n<li>Communication</li>\r\n<li>Creating a viable schedule</li>\r\n<li>Updating and monitoring the schedule</li>\r\n</h6></ul>\r\n<h6><strong>Module 5 â€“ Advanced Project Management</strong></h6>\r\n<ul>\r\n<h6>\r\n<li>Choosing the Project Team</li>\r\n<li>Scheduling Your Project</li>\r\n<li>Building a Winning Team</li>\r\n<li>Team meetings</li>\r\n<li>Nine Easy Ways to Reward Your Team</li>\r\n<li>Developing a Communication Plan</li>\r\n<li>Communicating with Sponsors and Executives</li>\r\n<li>Dealing with Problem Team Members</li>\r\n</h6></ul>\r\n<h6><strong>Module 6 â€“ Team Building</strong></h6>\r\n<ul>\r\n<h6>\r\n<li>Types of teams</li>\r\n<li>The TORI model</li>\r\n<li>The Team Player Survey</li>\r\n<li>Organizations Today</li>\r\n<li>The Stages of Team Development</li>\r\n<li>Communication Skills</li>\r\n<li>Shared Leadership</li>\r\n<li>DeBonoâ€™s Thinking Hats</li>\r\n<li>Managing Team Conflict</li>\r\n<li>The Trust/Relationship Model</li>\r\n<li>Obtaining Consensus</li>\r\n<li>Team-Shaping Factors</li>\r\n<li>Team Problem-Solving</li>\r\n<li>SWOT Analysis</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Module 7 â€“ Building Better Teams</strong></h6>\r\n<ul>\r\n<h6>\r\n<li>Defining teams</li>\r\n<li>Establishing team norms</li>\r\n<li>Working as a team</li>\r\n<li>Your team player type</li>\r\n<li>Building team trust</li>\r\n<li>The stages of team development</li>\r\n<li>Team building with TORI</li>\r\n<li>Communication</li>\r\n<li>Becoming a good team player</li>\r\n</h6></ul>\r\n<h6><strong>Module 8 â€“ Risk Management</strong></h6>\r\n<ul>\r\n<h6>\r\n<li>Understanding risk</li>\r\n<li>Risk management activities</li>\r\n<li>Assessing risk</li>\r\n<li>Responding to risks</li>\r\n<li>Resourcing controls</li>\r\n<li>Reaction planning</li>\r\n<li>Reporting and monitoring</li>\r\n<li>Communication</li>\r\n<li>Reviewing and evaluating the framework</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Module 9 â€“ Crisis Management </strong></h6>\r\n<ul>\r\n<h6>\r\n<li>What is crisis management?</li>\r\n<li>Training leaders and staff</li>\r\n<li>Conducting the crisis audit</li>\r\n<li>Performing a risk level analysis</li>\r\n<li>Developing a response process</li>\r\n<li>Consulting with the experts</li>\r\n<li>Incident management techniques</li>\r\n<li>Working through the issues</li>\r\n<li>Establishing an emergency operations center</li>\r\n<li>Building business continuity and recovery</li>\r\n<li>Recovering and moving on</li>\r\n<li>Plenty of case studies and practice opportunities</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Module 10 â€“ Time Management </strong></h6>\r\n<ul>\r\n<h6>\r\n<li>The Power of a Change</li>\r\n<li>Changing Our Perspective</li>\r\n<li>Setting Goals</li>\r\n<li>Planning Tips and Tricks</li>\r\n<li>Setting a Routine</li>\r\n<li>Doing it Right</li>\r\n<li>Putting an End to Procrastination</li>\r\n<li>Getting Organized</li>\r\n<li>Organizing Your Files</li>\r\n<li>Managing Your Workload</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Module 11 â€“ Leadership Skills </strong></h6>\r\n<ul>\r\n<h6>\r\n<li>Managing your time and energy</li>\r\n<li>What makes a good leader?</li>\r\n<li>Communication as a leadership tool</li>\r\n<li>The commitment curve</li>\r\n<li>Employee development models</li>\r\n<li>Dealing with conflict and difficult issues</li>\r\n<li>What successful leaders do</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Module 12 â€“ Self-Leadership </strong></h6>\r\n<ul>\r\n<h6>\r\n<li>What is self-leadership?</li>\r\n<li>Knowing who you are</li>\r\n<li>Change management</li>\r\n<li>Knowing what you do</li>\r\n<li>Motivation for optimists</li>\r\n<li>Using what you know</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Module 13 â€“ Communication Strategies </strong></h6>\r\n<ul>\r\n<h6>\r\n<li>Creating positive relationships</li>\r\n<li>Growing our self-awareness</li>\r\n<li>Communication basics and barriers</li>\r\n<li>Asking questions and listening skills</li>\r\n<li>Body language</li>\r\n<li>Communication styles</li>\r\n<li>Creating a positive self-image</li>\r\n<li>Frame of reference</li>\r\n<li>Techniques for the workplace</li>\r\n<li>Assertiveness</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Module 14 â€“ Knowledge Management </strong></h6>\r\n<ul>\r\n<h6>\r\n<li>Definitions of knowledge management, tacit knowledge, explicit knowledge, and KMBOK</li>\r\n<li>The business case for knowledge management<br>\r\n(WBS)</li>\r\n<li>The knowledge management mix</li>\r\n<li>The knowledge management framework</li>\r\n<li>Knowledge management models</li>\r\n<li>The knowledge management toolkit</li>\r\n<li>Implementing knowledge management initiatives</li>\r\n<li>Designing a chief knowledge officer position</li>\r\n<li>Case studies and success stories</li>\r\n</h6></ul>\r\n', '<strong>Target Audience</strong>\r\n<ul>\r\n<h6>\r\n<li>Program managers, project managers, HR Managers, Business Mangers, Marketing Managers, Entrepreneurs and project leaders with at least two (2) years of experience managing project teams</li>\r\n</h6>\r\n<p></p></ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '340 $', '100 $', '210 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=PPM-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28PPM-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'ppm.jpg', '1', '1');
INSERT INTO `org_certificatecontent` VALUES ('3', 'Certified Project Director (CPD)', '<strong>CPD-001</strong>', '<p>The Certified Project Director (CPD)â„¢ is globally recognized and is considered to be the most prestigious level of project management credential, which is designed for senior and experienced project management executives, who want to go beyond the PPM and other business / project management certifications.</p>\r\n<p>The CPD certification allows experienced senior managers and executives to acquire new skills and advanced techniques in managing and controlling todayâ€™s complex project and management issues â€“ from managing risks and quality to managing scope and budgets.</p>\r\n<p>Whether you are managing a group of project managers, managing multiple projects or looking for a career path towards being a Project Director, youâ€™re on the right track! With common challenges in managing scope, risk, budgets and cost, a project team can be directed to be more focused and successful.</p>\r\n<p>Senior and experienced project and management executives who want to go beyond the Professional level in Project Management certification to become globally recognized can seriously consider this certification.</p>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 80% to pass the exam, the CPDâ„¢ certification is considered to be one of the most difficult exam for Project Mangers (both mid level and high level) to pass.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>The total duration of the exam is 70 minutes (1 hour 10 Minutes)</h6>\r\n<strong>Closed book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol>\r\n<strong>FAQâ€™s on CPD credential</strong>\r\n<h6><strong>Steps in order to attain the CPD credential.</strong></h6>\r\n<h6>The candidate must meet all the following prerequisites as mentioned below</h6>\r\n<h6>\r\n<ul>\r\n<li>The candidate must hold a Bachelorâ€™s university degree; OR Post-graduate / Masterâ€™s university degree or above, or globally equivalent.</li>\r\n<li>The candidate must achieve a qualifying score in the exam delivered via Pearson Vue</li>\r\n</ul></h6>\r\n<h6>Apart from the above prerequisites, additionally the candidate must hold any one of the below mentioned certification/credential and must submit the soft copy certificate to candidate.registrations@gaqm.org</h6>\r\n<h6>\r\n<ol>\r\n<li>Professional in Project Management (PPM)â„¢ from <a href=\"http://www.gaqm.org/professional-in-project-management\" target=\"_blank\">Global Association for Quality Management (GAQM)</a></li>\r\n<li>Project Management Professional (PMP)<sup>Â® </sup>from <a href=\"http://www.pmi.org\" target=\"_blank\">Project Management Institute (PMI)</a></li>\r\n<li>Prince2<sup>Â® </sup>Practitioner from <a href=\"http://www.apmg-international.com/en/qualifications/prince2/\" target=\"_blank\">APMG</a></li>\r\n<li>Certified Project Manager (CPM) from <a href=\"http://www.giac.org/certification/certified-project-manager-gcpm\" target=\"_blank\">Global Information Assurance Certification (GIAC)</a></li>\r\n</ol></h6>\r\n<strong>Certification Validity</strong>\r\n<h6>\r\n<ol>\r\n<li>The validity period of Certified Project Director (CPD)â„¢ Certificate is for five (5) years, the candidate needs to either retake the exam or can complete the E-Course for CPD to accrue the number of continuing education units (CEUs) to renew the Certificate. Renewing the certificate will allow the candidate to retain the professional stature and credentials intact.</li>\r\n<li>Certificates must be renewed on or before the expiration date (when they become inactive) to be current.</li>\r\n</ol></h6>\r\n<strong>Credits </strong>\r\n<h6>Successfully passing the CPD exam will also earn candidates a total of 25 Credits towards MBA in Project Management (Masterâ€™s Degree) offered by Charisma University. </h6>\r\n<p><span style=\"color: red;\">Note: The <strong>Certified Project Director (CPD) </strong>Certification requires a mandatory E-Course completion requirement. Once the candidate completes the E-Course, they will receive a GAQM Learner ID. This ID is required at the time of scheduling an exam at a Pearson Vue Testing Center. For more information, you can send an E-mail to <a href=\"mailto:support@gaqm.org\">support@gaqm.org</a> </span></p>', '<strong>Module 1 â€“ Introduction</strong>\r\n<h6>\r\n<ul>\r\n<li>When is a project a project and not an organizational activity?</li>\r\n<li>What additional information would make the â€œprojectsâ€ become â€œoperational activitiesâ€?</li>\r\n<li>Project Lifecycle phases?</li>\r\n<li>Project Processes</li>\r\n<li>Project Management Fundamentals</li>\r\n<li>Top 10 qualities of a Project Manager</li>\r\n<li>The Project Teamâ€™s Key Players</li>\r\n<li>Scope</li>\r\n<li>What is a Scope Creep?</li>\r\n<li>Five Scope Management Process for a Project Director</li>\r\n<li>Budgets and Cost (Estimate Costs, Determine Budgets, Control Costs)</li>\r\n<li>Fundamentals of the Project Life Cycle</li>\r\n</ul></h6>\r\n<h6><strong>Module 2 â€“ Aligning Goals, Projects and Competencies</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>The Alignment Matrix</li>\r\n<li>Rank the Priorities</li>\r\n<li>Identify the top 3 skills needed to Manage each Project</li>\r\n<li>Establish the Organizations 10 Core Competencies</li>\r\n<li>Align the Project Skills by relating it to a Competency Value</li>\r\n<li>Comparing listed strengths versus project skills to complete the Matrix</li>\r\n<li>Comparing listed strengths versus project skills to complete the Matrix</li>\r\n<li>Identifying gaps and Utilizing strengths</li>\r\n</ul></h6>\r\n<h6><strong>Module 3 â€“ Organizing Multi-Project Communications</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>The Delivery of Information involving Multiple, Ongoing Projects</li>\r\n<li>Influences on Communicating</li>\r\n<li>Getting the Information to the Right People The Right Way</li>\r\n<li>Completing and Simplifying the Communication Matrix</li>\r\n<li>Communicating Issues; and, Managing and Documenting Change</li>\r\n<li>Issue Log Document</li>\r\n</ul></h6>\r\n<h6><strong>Module 4 â€“ Managing Risk Communications</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction to Managing Risk</li>\r\n<li>â€˜What is it and Whereâ€™ can I find it?</li>\r\n<li>Probability and Impact</li>\r\n<li>Risk Matrix</li>\r\n<li>Tools for Managing Multiple Projects</li>\r\n<li>Project Management Technology</li>\r\n<li>Technology Needs Assessments</li>\r\n</ul></h6>\r\n<h6><strong>Module 5 â€“ Tools for Managing Multiple Projects</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Project Management Technology</li>\r\n<li>Technology Needs Assessments</li>\r\n</ul></h6>\r\n<h6><strong>Module 6 â€“ Leadership</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Establishing Goals</li>\r\n<li>Examining the Role of a Project Director</li>\r\n<li>Project or Practice Management Roles</li>\r\n<li>Project Accounting Roles</li>\r\n<li>Examining the Qualities of an Effective Leader</li>\r\n<li>Professional Qualities for a successful Project Director</li>\r\n<li>Career Path Competencies for a successful Project Director</li>\r\n<li>Organizational Responsibilities</li>\r\n</ul></h6>\r\n', '<strong>Target Audience</strong>\r\n<ul>\r\n<h6>\r\n<li>\r\nProject Managers who manage multiple projects, Project Sponsors, Project Steering Group/ Project Board members, Project/Business Owners and Senior Stakeholder</li>\r\n</h6>\r\n<p></p></ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '280 $', '100 $', '210 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CPD-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CPD-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'certified_project_director.jpg', '1', '1');
INSERT INTO `org_certificatecontent` VALUES ('4', 'Certified Data Centre Professional', '<strong>CDCP-001</strong>', '<p> The Certified Data Centre Professional (CDCP)â„¢ exam certification indicates a foundational knowledge of critical physical infrastructure in the Data Center. The Certified Data Centre Professionalâ€™s have to demonstrate a base level proficiency in the elements of: cooling, fire safety and protection, racks, cabling, management and physical security.</p>\r\n<p>The candidateâ€™s who are appearing for the CDCP exam must have sufficient knowledge in data center design and cabling strategies.</p>\r\n<p>The CDCP certification can significantly increase productivity and proficiency because certified professionals have the knowledge to successfully overcome obstacles faced in data center design, build and operations.</p>\r\n<p>GAQM provides an international, vendor-neutral credential (CDCP) with a global standard for measuring competency in the core elements of a data center.<br>\r\n</p>\r\n', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score 65% (26 out of 40 correct) to pass the exam.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<strong>Closed book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<ol>\r\n<h6>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n</h6><h6>\r\n    </h6><h6>\r\n<li>The exam can be taken any number of times.</li>\r\n</h6>\r\n</ol>\r\n<strong>Certification Validity</strong>\r\n<h6>The Certified Data Centre Professional (CDCP)â„¢ Certificate is valid for life</h6>\r\n', '<strong>Module 1 â€“ Fundamentals of Availability</strong>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Measuring Business Value</li>\r\n<li>Five 9â€™s of Availability </li>\r\n<li>Limitations of 99.999%</li>\r\n<li>Factors affecting Availability</li>\r\n<li>A/C Power Conditions</li>\r\n<li>Cooling Issues</li>\r\n<li>Equipment Failures</li>\r\n<li>Natural and Artificial Disasters</li>\r\n<li>Human Errors</li>\r\n<li>Cost of Downtime</li>\r\n<li>Calculating Cost of Downtime</li>\r\n</ul></h6>\r\n<strong>Module 2 â€“ Examining Fire protection methods in the Data Center </strong>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>National Fire Protection Association</li>\r\n<li>Prevention </li>\r\n<li>System Objectives of Data Center Fire Protection System</li>\r\n<li>Fire Triangle</li>\r\n<li>Classes of Fire</li>\r\n<li>Stages of Combustion</li>\r\n<li>Fire Detection Devices</li>\r\n<li>Smoke Detectors</li>\r\n<li>ISTD</li>\r\n<li>Fire Extinguishers</li>\r\n<li>Methods of Fire Supression</li>\r\n<li>Water Sprinkler System</li>\r\n<li>Water Mist Suppression System</li>\r\n</ul></h6>\r\n<h6><strong>Module 3 â€“ Fundamentals of Cabling strategies for Data Centers</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Cabling</li>\r\n<li>Overview of Cables </li>\r\n<li>Cabling Installation</li>\r\n<li>Cable Layout Architectures</li>\r\n<li>Cable Management</li>\r\n<li>Managing Cables</li>\r\n<li>Cable Maintenance Practices</li>\r\n</ul></h6>\r\n<h6><strong>Module 4 â€“ Fundamentals of Cooling I</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Evolution</li>\r\n<li>Data Center Cooling </li>\r\n<li>Physics of Cooling</li>\r\n<li>Heat Transfer Methods</li>\r\n<li>Airflow in IT Spaces</li>\r\n<li>Heat Generation</li>\r\n<li>Gas Law</li>\r\n<li>Evaporation</li>\r\n<li>Compression</li>\r\n<li>Condensation</li>\r\n<li>Expansion</li>\r\n<li>Evaporator</li>\r\n</ul></h6>\r\n<h6><strong>Module 5 â€“ Fundamentals of cooling II : Humidilty in the Data Center</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Cooling Related Devices</li>\r\n<li>Humidity and Static Electricity </li>\r\n<li>Nature of Humidity</li>\r\n<li>Humidity Control in Data Center</li>\r\n<li>Relative Humidity Control</li>\r\n<li>Dew Point Control</li>\r\n<li>Humidification System</li>\r\n<li>Converted Office Space</li>\r\n<li>OSPâ€™s</li>\r\n<li>Short Cycling</li>\r\n</ul></h6>', '<strong>Target Audience</strong>\r\n<ul>\r\n<li>System integrators involved in data centre IT operations activities, serving their own data centre or as owned by their customers</li>\r\n<li>Commercial customer who have to maintain their own data centre</li>\r\n<li>Personnel working in commercial companies who are responsible for data centre IT operations</li>\r\n<li>IT, facilities or Data Centre Operations professional</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '175 $', '80 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CDCP-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CDCP-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'data-center-professional.jpg', '3', '1');
INSERT INTO `org_certificatecontent` VALUES ('5', 'Certified Data Centre Specialist', '<strong>CDCS-001</strong>', '<p> The Certified Data Centre Specialist (CDCS)â„¢ exam is the next step after the Certified Data Centre Professional exam.</p>\r\n<p>Frequent or rapid changes in business dynamics require enterprises to be increasingly agile. The Certified Data Specialist (CDCS) Certification enables candidates to coupe enterprise needs scalable space, power, network capabilities and reliable security to efficiently manage growth and control expenses.</p>\r\n<p>The participant needs to be aware of Advanced Data Center topics such as Selecting the Power, Space and Network Connectivity Right for the organization, DC power and redundant cooling systems, Concurrently maintaining power and cooling systems (N+1 AC power, N+1 cooling), Site Monitoring, Biometric Authentication, Key Cards, On-site guards, Enhanced Security, enterprise-ready high-density cabinets apart from this the candidate has to be proficient in Data Centre Networking like Reducing Latency, Backbone Technologies, Global cloud and virtualization services, IT convergence etc.</p>\r\n<p>CDCS will further increase attendees to a level being a compatible sparring partner with suppliers and they will be able to verify offers provided by vendors for correctness, effectiveness and efficiency.<br>\r\n</p>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (28 out of 40) to pass the exam.</h6>\r\n<strong>Duration of exam<br>\r\n</strong>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<strong>Closed book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<ol>\r\n<h6>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n</h6><h6>\r\n    </h6><h6>\r\n<li>The exam can be taken any number of times.</li>\r\n</h6>\r\n</ol>\r\n<strong>Certification Validity</strong>\r\n<h6>The Certified Data Centre Specialist (CDCS)â„¢ Certificate is valid for life</h6>', '<strong>Module 1 â€“ Fundamentals of Security</strong>\r\n<h6>\r\n<ul>\r\n<li>Physical Security</li>\r\n<li>Identifying assets</li>\r\n<li>Physical Security Identification Methods and Devices</li>\r\n<li>Other Physical Security Methods</li>\r\n<li>Overall Considerations for Physical Security</li>\r\n<li>Control Access</li>\r\n<li>Risk Tolerance versus Cost</li>\r\n<li>Evaluation</li>\r\n</ul></h6>\r\n<h6><strong>Module 2 â€“ Fundamentals of Power</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Key Terms</li>\r\n<li>Electrical Load</li>\r\n<li>Power Types</li>\r\n<li>Powers Factors</li>\r\n<li>Power System Failures</li>\r\n<li>Circuit Breakers and Outlets</li>\r\n<li>Physical security measures</li>\r\n<li>Power Distribution Components</li>\r\n</ul></h6>\r\n<h6><strong>Module 3 â€“ Generator Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Identifying Main Components</li>\r\n<li>Standby Generators</li>\r\n<li>Internal Combustion Engine</li>\r\n<li>Filters</li>\r\n<li>Grounding</li>\r\n<li>Voltage Regulator</li>\r\n<li>Regulations</li>\r\n<li>Switchgear and Distribution</li>\r\n<li>Maintenance Measures</li>\r\n</ul></h6>\r\n<h6><strong>Module 4 â€“ Cooling Layouts for Data Center</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Types of Cooling System</li>\r\n<li>Air Distribution System</li>\r\n<li>Data Center Heat Removal Approaches</li>\r\n<li>Air Cooled Self-Contained Systems</li>\r\n<li>Water Systems</li>\r\n<li>Mounting Types</li>\r\n<li>Cooling Arrangements</li>\r\n<li>Technology Compaction</li>\r\n<li>Rack Arrangements</li>\r\n</ul></h6>', '<strong>Target Audience</strong>\r\n<ul>\r\n<li>Data Centre Operations Managers, Data Centre Designers, Facilities Managers, IT Service Delivery Managers, IT Technical Marketing &amp; Technical Sales Reps, IT Department Managers, etc.</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '200 $', '100 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CDCS-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=(CDCS-001)', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'data-center-specialist.jpg', '3', '1');
INSERT INTO `org_certificatecontent` VALUES ('6', 'Certified Data Centre Expert', '<strong>CDCE-001</strong>', '<p> With few exceptions, enterprises today rely on IT for the delivery of business or mission critical services â€“ often directly to the end consumer. It is vitally important therefore, that a mission critical Data Centre be designed, maintained, and operated with guaranteed high-availability and efficiency in mind. Fact is however, that most Data Centre do not meet the full availability, capacity, safety or efficiency requirements demanded by the enterprise.</p>\r\n<p><strong>About CDCE Exam</strong></p>\r\n<p>The candidates who are appearing for this exam should be a Data Centre Owner/Investor, Data Centre Facilities and/or Operations Manager, IT professional working in and around the Data Centre, having oversight accountability or responsibility for achieving and improving high availability and manageability of the Data Centre and will be involved in the design/build, renovation or relocation of a mission critical Data Centre.</p>\r\n<p><strong>Prerequisite</strong></p>\r\n<h6>The candidate must hold Certified Data Centre Specialist (CDCS)â„¢ certificate in order to be able to register for the CDCE certification exam.</h6>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (28 out of 40) to pass the exam.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Non-Proctored</span></strong></span></h6>\r\n<h6>The CDCE Exam is currently available via Online Mode, You will need to schedule testing appointment by sending an email to candidate.registrations@gaqm.org once you are done with the E-Course. You can schedule an exam appointment date before forty eight (48) hours.</h6>\r\n<h6><strong>Kindly Note: </strong></h6>\r\n<h6>1) After you schedule your examination, if you need to reschedule or cancel your examination date, you may do so up until 48 hours before the scheduled date and time without penalty. If you cancel within 48 hours of your appointment you will forfeit your examination fee and be required to pay a new examination fee in order to reschedule, the cost would be 80$.</h6>\r\n<h6>2) To cancel or to reschedule the exam, you need to send us an email at candidate.registrations@gaqm.org</h6>\r\n<h6>3) Non-proctored exams are available to be taken online whenever the candidate wishes to take them.</h6>\r\n<strong>Retaking of exam</strong>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<strong>Certification Validity</strong>\r\n<h6>The Certified Data Centre Expert (CDCE)â„¢ Certificate is valid for life</h6>\r\n', '<h6><strong>Module 1 â€“ Power Redundancy in the Data Center</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>UPS</li>\r\n<li>Types of UPS</li>\r\n<li>Standby UPS</li>\r\n<li>Line Interactive UPS</li>\r\n<li>Standby-Ferro UPS</li>\r\n<li>Double Conversion On-Line UPS</li>\r\n<li>Delta Conversion On-Line</li>\r\n<li>UPS System Design Configuration</li>\r\n<li>The Concept of â€œNâ€</li>\r\n<li>Types of Redundancies</li>\r\n<li>UPS Rightsizing</li>\r\n<li>Power Environments</li>\r\n<li>Standby Generators</li>\r\n</ul></h6>\r\n<strong>Module 2 â€“ Power Distribution I</strong>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Power Transmission Overview</li>\r\n<li>Nominal Vs Normal Voltage</li>\r\n<li>Transformer</li>\r\n<li>Type of Transformers</li>\r\n<li>Service Entrance</li>\r\n<li>Main Electrical Service Panel</li>\r\n<li>Facility Transformers</li>\r\n<li>Sub-Panels</li>\r\n<li>Feeders</li>\r\n<li>Branch Circuits</li>\r\n<li>Receptacles</li>\r\n</ul></h6>\r\n<strong>Module 3 â€“ Physical Infrastructure Management Basics </strong>\r\n<h6>\r\n<ul>\r\n<li>What is Management?</li>\r\n<li>Physical Infrastructure Management Challenges</li>\r\n<li>Incident Management</li>\r\n<li>Availability Management</li>\r\n<li>Capacity Management</li>\r\n<li>Physical Infrastructure Management Strategy</li>\r\n<li>Management Focus</li>\r\n<li>Physical Infrastructure Management Standards</li>\r\n<li>Management Approaches</li>\r\n<li>Element Managers</li>\r\n<li>Enterprise Management System</li>\r\n<li>Building Management System</li>\r\n<li>Integrating Physical Infrastructure Management</li>\r\n<li>Physical Infrastructure Element Manager</li>\r\n</ul></h6>\r\n<h6><strong>Module 4 â€“ Rack Fundamentals</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>The 19 Inch Standard</li>\r\n<li>Earthquake Standards</li>\r\n<li>Open Frame Rack</li>\r\n<li>Advantages and Disadvantages of Open Frames</li>\r\n<li>Server Enclosure</li>\r\n<li>Networking Enclosure</li>\r\n<li>Seismic Enclosure</li>\r\n<li>Wall Mount Enclosure</li>\r\n<li>Industry Survey Results</li>\r\n<li>Lifecycle Costs</li>\r\n<li>Availability</li>\r\n<li>Improving Airflow: Door Ventilation</li>\r\n<li>Improving Airflow: Blanking Panels</li>\r\n<li>Improving Airflow: ADU</li>\r\n<li>Improving Airflow: SADU</li>\r\n<li>Improving Airflow: ARU</li>\r\n<li>Maintenance and Serviceability</li>\r\n<li>Adaptability and Scalability</li>\r\n<li>Manageability</li>\r\n<li>Floor Plan</li>\r\n</ul></h6>\r\n<h6><strong>Module 5 â€“ Cooling System</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Rack based Cooling</li>\r\n<li>Room based Cooling </li>\r\n<li>Row based Cooling</li>\r\n<li>Hybrid Cooling</li>\r\n</ul></h6>\r\n', '<strong>Target Audience</strong>\r\n<h6>\r\n<ul>\r\n<li> Data Centre Operations Managers, Data Centre Designers, Facilities Managers, IT Service Delivery Managers, IT Technical Marketing &amp; Technical Sales Reps, IT Department Managers</li>\r\n</ul></h6>\r\n', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', '-', '-', '-', '40 Days', '20 Days', '-', '-', '-', '220 $', '85 $', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CDCE-001%29', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CDCE-001', '-', '-', '-', 'data-center-expert.jpg', '3', '1');
INSERT INTO `org_certificatecontent` VALUES ('7', 'Certified Data Centre Facilities Operations Manager', '<strong> CDCFOM</strong>', '<p> Managing the facilities of todayâ€™s hi-end and hi-availability data centers is an extremely demanding and complex task which is often under estimated. There is often very little appreciation and understanding of the complexities of managing mission critical data centers especially since many of the data centres are operating at, or near, their design limits and downtime is never an option.</p>\r\n<p>The way a data center is managed at the facilities layer makes all the difference and even a data center designed to Tier-4 as per the ANSI/TIA-942 standard could still experience many unscheduled down time events due to poor planning, operations, maintenance and management processes.</p>\r\n<p><strong>About CDCFOM Exam</strong></p>\r\n<p>The candidates who are appearing for this exam should have gained in-depth knowledge in managing data center operation which includes the following key subject matters such as; Capacity planning, latest Green initiatives, how to properly commission and de-commission equipment, Compliance to Safety Standards, Statutory Compliance and International Standards, Managing People, Vendor Management, handling Incident/Crisis Management as well the how to keep operations really simple, manageable, effective and efficient and much more.</p>\r\n<p><strong>Prerequisite</strong></p>\r\n<p>It would be advisable for the participants to have some experience in data centre operations although it is not required, there is no prerequiste to appear for this exam.<br>\r\n</p>', '<strong>Exam Codes</strong>\r\n<p>In order to receive the CDCFOM certification, you must pass three exams; CDCP-001, CDCS-001 and CDCE-001 or you can take a single CDCFOM exam.</p>\r\n<h6><a href=\"http://www.gaqm.org/certified-data-centre-professional\" target=\"_blank\">1) CDCP-001</a></h6>\r\n<h6><a href=\"http://www.gaqm.org/certified-data-centre-specialist\" target=\"_blank\">2) CDCS-001</a></h6>\r\n<h6><a href=\"http://www.gaqm.org/certified-data-centre-expert-cdce\" target=\"_blank\">3) CDCE-001</a></h6>\r\n<strong>Passing Score</strong>\r\n<h6>1) CDCP-001 exam comprises of 40 questions out of which the candidate needs to score 65% (26 out of 40 correct) to pass.</h6>\r\n<h6>2) CDCS-001 exam comprises of 40 questions out of which the candidate needs to score 70% (28 out of 40 correct) to pass.</h6>\r\n<h6>3) CDCE-001 exam comprises of 40 questions out of which the candidate needs to score 70% (84 out of 120 correct) to pass.</h6>\r\n<p>or</p>\r\n<h6>1) CDCFOM-001 exam comprises of 120 questions out of which the candidate needs to score 70% (84 out of 120 correct) to pass.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>1)  The total duration of CDCP-001 exam is 1 hour (60 Minutes)</h6>\r\n<h6>2)  The total duration of CDCS-001 exam is 1 hour (60 Minutes)</h6>\r\n<h6>3)  The total duration of CDCE-001 exam is 1 hour (60 Minutes)</h6>\r\n<p>or</p>\r\n<h6>1)  The total duration of CDCFOM-001 exam is 2 hours (120 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Non-Proctored</span></strong></span></h6>\r\n<h6>The CDCP-001, CDCS-001 and CDCE-001 exams or CDCFOM-001 are available via Online Mode, You will need to schedule testing appointment by sending an email to candidate.registrations@gaqm.org once you are done with the E-Course. You can schedule an exam appointment date before forty eight (48) hours.</h6>\r\n<strong>Kindly Note: </strong>\r\n<h6>1) After you schedule your examination, if you need to reschedule or cancel your examination date, you may do so up until 48 hours before the scheduled date and time without penalty. If you cancel within 48 hours of your appointment you will forfeit your examination fee and be required to pay a new examination fee in order to reschedule, the cost would be 80$.</h6>\r\n<h6>2) To cancel or to reschedule the exam, you need to send us an email at candidate.registrations@gaqm.org</h6>\r\n<h6>3) Non-proctored exams are available to be taken online whenever the candidate wishes to take them.</h6>\r\n<p><strong>Retaking of exam</strong>\r\n</p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<strong>Taking the Exam </strong>\r\n<h6>1) You need to qualify in all the three exams to receive CDCFOM Credential/Certification. </h6>\r\n<h6>2) Exams can be taken separately (one at a time) and in any sequence.</h6>\r\n<h6> 3) You may retake any examination as often as necessary. </h6>\r\n<strong>Certification Validity</strong>\r\n<h6>The Centre Facilities Operations Manager (CDCFOM) Certificate is valid for life</h6>\r\n', 'CDCFOM', '<strong>Target Audience</strong>\r\n<ul>\r\n<li>The primary audience for this course is a Data Centre Owner/Investor, Data Centre Facilities and/or Operations Manager, IT professional working in and around the Data Centre, having oversight accountability or responsibility for achieving and improving high availability and manageability of the Data Centre and will be involved in the design/build, renovation or relocation of a mission critical Data Centre</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', '-', '-', '-', '-', '40 Days', '-', '-', '-', '-', '340 $', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CDCFOM', '-', '-', '-', '-', 'cdcfom.jpg', '3', '1');
INSERT INTO `org_certificatecontent` VALUES ('8', 'Linux Certified Professional', '<strong>LCP-001</strong>', '<p>With the ever increasing ubiquity of Linux in both the server and embedded markets, The Linux course provide both companies and individuals with a variety of training options to increase their knowledge and use of Linux. Our Linux Certified Professional (LCP) is a vendor-neutral and as the company that employs Linux founder Linus Torvalds, our training has been created with the actual leaders of the Linux Administrators Community. </p>\r\n\r\n<p>Whether time-to-market or the high performance of Linux are critical to your business, The Linux Certified Professional (LCP) Certification E-Course provide a unique return on investment opportunity that will pay for itself many times over. For individuals, the demand for Linux talent is at an all time high. The Linux Certified Professional (LCP) Certification provides Linux developers and Linux system administrators with the opportunity to to capitalize on the talent gap.</p>', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 50 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (35 out of 50 correct) to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam</strong></span></h6>\r\n\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Closed Book</span></strong></span></h6>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Retaking of exam</strong></span></h6>\r\n\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Certification Validity</strong></span></h6>\r\n\r\n<h6>The Linux Certified Professional (LCP) Certificate is valid for life</h6>\r\n\r\n', '<h6><strong>Module 1</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Overview of Operating System</li>\r\n<li>Why Unix in Testing is required</li>\r\n<li>Unix File System Architecture (Boot Block, Super Block, Inode Block and Data Block)</li>\r\n<li>Installation</li>\r\n</ul>\r\n</h6>\r\n\r\n<h6><strong>Module 2</strong></h6>\r\n\r\n<ul>\r\n<li>The Directory Structure</li>\r\n<li>Listing files and directories</li>\r\n<li>File compression</li>\r\n<li>Different Unix commands</li>\r\n<li>Communication commands</li>\r\n<li>Networking commands</li>\r\n</ul>\r\n\r\n<h6><strong>Module 3</strong></h6>\r\n\r\n<ul>\r\n<li>Backup and disk utilities</li>\r\n<li>Pipes and filters</li>\r\n<li>Grep</li>\r\n<li>Process and job control</li>\r\n<li>Editing files</li>\r\n<li>Vi editor</li>\r\n\r\n</ul>\r\n\r\n', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>Existing Administrators</li>\r\n<li>Beginners , intermediates and anyone who would like to know about linux</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '150 $', '70 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=LCP-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28LCP-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'linux_professional.jpg', '19', '2');
INSERT INTO `org_certificatecontent` VALUES ('9', 'Certified Cloud Computing Professional', '<strong>CCCP-001</strong>', '<p>Cloud computing has a lot in store in terms of <strong>future job creation</strong>. It is anticipated that cloud computing will lead to a generation of an estimated 14 million novel job opportunities across the world in the span of the coming three years. Surprising enough, the scope of the fresh jobs may extend beyond the IT sector. The estimates are an outcome of research carried out by IDC funded by the <strong>Microsoft Corporation</strong>. Fourteen million expected jobs sure is a promising number in itself, but when stacked against the current volume of the available global workforce (a little greater than 3 billion to be exact) it equals a shy half a percent â€“ a mere droplet compared against the pail. So take your exam today and Get Certified for your future.</p>\r\n\r\n<p>In science, cloud computing is a synonym for distributed computing over a network, and means the ability to run a program or application on many connected computers at the same time. The phrase also more commonly refers to network-based services, which appear to be provided by real server hardware, and are in fact served up by virtual hardware, simulated by software running on one or more real machines.</p>\r\n\r\n<p><strong>Certified Cloud Computing Professional (CCCP)â„¢ includes</strong></p>\r\n\r\n<ul>\r\n<li>Demonstration of professional development in the area of Cloud Computing.</li>\r\n<li>A technical understanding of the foundations of Cloud Computing as compared to traditional IT.</li>\r\n<li>Understanding of how business can integrate Cloud Computing into their IT infrastructure.</li>\r\n<li>Ability to create economic value within a business organization through the implementation of Cloud innovations.</li>\r\n<li>Understanding of the issues associated with integrating Cloud Computing into an organizationâ€™s existing compliance, risk and regulatory framework.</li>\r\n<li>Job seekers looking to find employment in IT infrastructure department of various companies, students generally wanting to improve their skill set and make their CV stronger and existing employees looking for a better role can prove their employers the value of their skills through this certification</li>\r\n</ul>\r\n', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (28 out of 40 correct) to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam<br>\r\n</strong></span></h6>\r\n\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Closed Book</span></strong></span></h6>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Retaking of exam</strong></span></h6>\r\n\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Certification Validity</strong></span></h6>\r\n\r\n<h6>The Certified Cloud Computing Professional (CCCP)â„¢ Certificate is valid for life</h6>', '<h6><strong>Module 1 â€“ Introduction to Cloud Computing</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Basic Concepts and Overview of Cloud Computing</li>\r\n<li>Five Characteristics of Cloud</li>\r\n<li>IT Utility</li>\r\n<li>Examples of Cloud</li>\r\n<li>Deployment Models</li>\r\n<li>Private Cloud and Data Center</li>\r\n<li>Public Cloud</li>\r\n<li>Community Cloud</li>\r\n<li>Hybrid Cloud</li>\r\n<li>Types of Cloud Services (SaaS, Paas, Iaas) </li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Evolution towards Cloud</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Mini Computers</li>\r\n<li>Local Area Networks (LAN)</li>\r\n<li>Networks and Servers</li>\r\n<li>Virtualization</li>\r\n<li>Types of Virtualization</li>\r\n<li>Types of Virtualization in Private Cloud</li>\r\n<li>Full vs Paravirtualization</li>\r\n<li>Managed Services in the Cloud</li>\r\n<li>Managed Services</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 3 â€“ History of Cloud</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Technologies (Grid Computing,Utility Computing,Cluster Computing, Virtualization </li>\r\n<li>Cloud Evolution</li>\r\n<li>Examples of Cloud Providers (Bigdata, Azure, Salesforce etc.</li>\r\n<li>Cloud enabling technologies</li>\r\n<li>Virtualization with a Host Operating System</li>\r\n<li>Tired Architecture</li>\r\n<li>Multi-tenancy Architecture</li>\r\n<li>Service-Oriented Architecture</li>\r\n<li>Service-Oriented Architecture and Cloud</li>\r\n<li>Service-Oriented Architecture Criteria</li>\r\n<li>Benefits and Limitations of Cloud Computing</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 4 â€“ Implementing and Managing Cloud Computing</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Building a local cloud environment</li>\r\n<li>Principles of managed cloud services</li>\r\n<li>Why to own a cloud environment?</li>\r\n<li>Main components and their interconnection</li>\r\n<li>Architectural considerations</li>\r\n<li>Virtual Private Network Access</li>\r\n<li>Risk Factors</li>\r\n<li>Data Protection and Partitioning</li>\r\n<li>ITSM Principles in Cloud Environment</li>\r\n<li>IT Governance</li>\r\n<li>Managing Service Levels in Cloud Environment</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 5 â€“ Using the Cloud</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Overview of Accessing the Cloud</li>\r\n<li>Accessing Web Applications through a Browser</li>\r\n<li>Cloud Web Access Architecture</li>\r\n<li>The Internet</li>\r\n<li>OSI Model</li>\r\n<li>Standard Protocols</li>\r\n<li>Web Applications</li>\r\n<li>Overview of Mobile Devices in Accessing the Cloud</li>\r\n<li>Mobile Web Enabled Devices</li>\r\n<li>How Cloud Computing can support Business Process?</li>\r\n<li>Role of Standard Applications</li>\r\n<li>Impact of Cloud Computing in Primary Business</li>\r\n<li>Content Management System</li>\r\n<li>Service Providers using the Cloud</li>\r\n<li>Benifits and Risks of Providing Cloud based Services</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 6 â€“ Security and Compliance</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Overview of Security and Compliance</li>\r\n<li>Security Risks in the Cloud</li>\r\n<li>Measures Mitigating Security Risks</li>\r\n<li>The CIA Security Objectives</li>\r\n<li>Maintaining Cloud Computing Availability Issues</li>\r\n<li>Mitigating Data Loss and Risks</li>\r\n<li>Cloud Computing and Perimeter Security</li>\r\n<li>Overview of Mobile Devices in Accessing the Cloud</li>\r\n<li>Security Layers in the Cloud</li>\r\n<li>Viruses and Mal-ware in Cloud Computing</li>\r\n<li>Best Practices to Prevent Mal-ware</li>\r\n<li>Overview of Managing Identity and Privacy</li>\r\n<li>Authentication, PII</li>\r\n<li>International Privacy Compliance</li>\r\n<li>Safeguards</li>\r\n</ul></h6>', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>Anyone one who wants to learn about cloud computing and its implementation</li>\r\n<li>Professionals who want to Demonstrate development in the area of Cloud Computing.</li>\r\n<li>Professional who want to improve technical understanding of the foundations of Cloud Computing as compared to traditional IT.</li>\r\n<li>Job seekers looking to find employment in IT infrastructure department of various companies, students generally wanting to improve their skill set and make their CV stronger and existing employees looking for a better role can prove their employers the value of their skills through this certification</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '175 $', '85 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CCCP-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CCCP%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cloud-professional-logo.jpg', '20', '2');
