INSERT INTO `org_subcategory` VALUES ('4', 'Certified General Manager', '1', '<strong>CGM-001</strong>', '1', '1', '<p>General Management studies help in understanding the managerial, functional and operational demands of commercial organizations to trigger production effectively and efficiently. This subject extensively covers several topics on marketing, investment, functional administration, human resource, sales, advertising etc. Imbibing the core tenets of this module will enable transformation into an effective business manager to understand the nuances of optimizing capital growth.</p>\r\n<p>General Management and further develops the key concepts, principles and practices of management that will enable learners to lead, manage, organise and control first line managers and team leaders.</p>\r\n<p>The learners will typically be managers who have other junior managers or team leaders reporting to them. In smaller organisations or entities, the managers could primarily be responsible for managing the supervisors and staff within their section, division or business unit </p>\r\n<p>The scope of generic management covers five domains: leadership, managing the environment, managing relations, managing knowledge and the practice of management. This Certification addresses each of these domains with generic competencies, so that it allows learning programmes to be contextualized for specific sectors and industries.</p>\r\n<p>Certified General Manager (CGM) Certification provides opportunities for learners to transfer between various specialisations within management. This leads to the strengthening of management competencies and will enable managers at this level to manage successfully systems, processes, resources, managers and teams in their various occupations and contexts.</p>\r\n<p>This qualification is further intended to empower learners to acquire the knowledge, skills, attitudes and values required to operate confidently as individuals in international communities and to respond to the challenging economic environment and constantly changing world of work.</p>\r\n<p>Ultimately, this qualification is aimed at improving the effectiveness and leadership abilities of middle managers in various occupations globally, in private and public business entities as well as non-governmental organisations. For this reason, the word â€˜entityâ€™ includes a company, business unit, public institution, small business or non-profit organisation.</p>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass the exam.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>The total duration of the exam is 2 hours (120 Minutes)</h6>\r\n<strong>Closed Book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<strong>Certification Validity</strong>\r\n<h6>The Certified General Manager (CGM) Certificate is valid for life</h6>\r\n<strong>Credits</strong>\r\n<h6>Successfully passing the CGM exam will also earn candidates a total of 137 Credits towards MBA in General Management (Masterâ€™s Degree) offered by Charisma University.</h6>\r\n', '<h6><strong>Module 1 â€“ People Management</strong> â€“ Build teams to achieve goals and objectives; â€“ Lead people development and talent management; â€“ Devise and apply strategies to establish and maintain workplace relationships; â€“ Manage a diverse work force to add value; â€“ Apply the principles of ethics to improve organisational culture.</h6>\r\n<h6><strong>Module 2 â€“ Workplace Management</strong> â€“ Develop, implement and evaluate an operational plan; â€“ Formulate recommendations for a change process; â€“ Analyse leadership and related theories in a work context; â€“ Apply mathematical analysis to economic and financial information; â€“ Use communication techniques effectively. </h6>\r\n<h6><strong>Module 3 â€“ Decision Making</strong> â€“ Apply a systems approach to decision making; â€“ Apply the principles of knowledge management; â€“ Create and manage an environment that promotes innovation; â€“ Monitor and evaluate team members against performance standards; â€“ Monitor, assess and manage risk; Unit 6 â€“ Select and coach first line managers;</h6>\r\n<h6><strong>Module 4 â€“ Unit Management</strong> â€“ Develop, implement and evaluate a project plan; â€“ Manage the finances of a unit; â€“ Recognise areas in need of change, make recommendations and implement change in the team, department or division; â€“ Develop and implement a strategy and action plans for a team, department or division; â€“ Apply financial analysis.</h6>\r\n<h6><strong>Module 5 â€“ Strategic Management</strong></h6>\r\n<ul>\r\n<li> Evaluate and plan the role of self as leader in a function</li>\r\n<li> Manage relationships with strategic partners to improve the performance of a function</li>\r\n<li> Manage the information and institutional knowledge within a function</li>\r\n<li> Manage and improve communication processes in a function</li>\r\n<li> Appraise, develop and retain human capital for a function</li>\r\n<p><!--\r\n<li>What is domain knowledge?</li>\r\n<li>How to adapt with different domains</li>\r\n<p>-->\r\n</p></ul>\r\n', '<strong>Target Audience</strong>\r\n<p>The CGM Certification is aimed at potential managers, entrepreneurs and investment professionals who are interested in addressing the needs of low-income populations, especially in developing countries. The course seeks to provide an understanding of how business approaches can address low income markets that represent the largest components of developing economies, both in numbers of people as well as total income. The course materials explore the commercial viability of such markets, and looks at the impact of such commercial approaches on the social development of the populations involved, as well as the profits of the enterprise.</p>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '220 $  ', '100 $', '170 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CGM001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CGM-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'img22.png');
INSERT INTO `org_subcategory` VALUES ('5', 'Certified Sports Manager', '1', '<strong>CSM-002</strong>', '1', '1', '<p>Sport and its associated industries of recreation and fitness have entered a period of rapid growth. The recent Skills Audit conducted by the Tourism, Hospitality and Sport Sector Education and Training Authority in 2007, highlights the need for capacity building in sport to promote competence in managing sport organisations, tournaments and events, sport teams and sport facilities. The bridging of the current skills gap will have a positive impact on the management of sport organisations and sport teams as well as the growth of sport at all levels across the globe.</p>\r\n<p>In addition, the sport marketing industry represents a multi-million dollar industry and the current ten TV channels dedicated to sport are evident of its reach and public demand in terms of access. Managerial competencies are acquired in a variety of contexts, ranging from private fitness facilities and sport clubs to local government initiatives in sport and recreation and on to the marketing and promotional world of sport sponsorships, media, athlete representation as well as sport tourism.</p>\r\n<p>Increased pressure to deliver efficient and effective management of sport entities, athletes, facilities and events comes from participants, federations, spectators and the media as well as athletes with special needs.</p>\r\n<p>The industry specific technical skills required within the operational sport and related environments require specific contextualisation within the operational environment in particular for the areas for which specialization streams were designed within the qualification.</p>\r\n<p>The Certified Sports Manager (CSM)<sup>Â®</sup> is aimed at developing specific competencies in a range of self-organisational and life-long learning skills with an in depth knowledge of sport requirements and technical know-how applicable to a sport specific context.</p>\r\n<p>The Certified Sports Manager (CSM)<sup>Â®</sup> will enable the assuming of job responsibilities as a sport manager in schools, clubs and private institutions in a range of areas, which includes, but is not limited to sport team management, federation management or facility management.</p>\r\n<p>Candidates will be exposed to establishing of commitment, policy and planning to achieve racial, disability and gender equity through sport programmes whilst maintaining a safe environment for sport activities, events and tournaments within the selected operational environment and community. Candidates meeting the requirements of this qualification will be positioned to further their learning, practice, experience and career within the sport or fitness industries, either at further levels or in other areas of practice.</p>\r\n<p>This Certification will serve as a stepping-stone to equip the learner to specialise in one of the various disciplines of choice in order to take up a leadership role and expand training and development into the area of management.</p>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass the exam.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>The total duration of the exam is 2 hours (120 Minutes)</h6>\r\n<strong>Closed Book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<strong>Certification Validity</strong>\r\n<h6>The Certified Sports Manager (CSM)<sup>Â®</sup> Certificate is valid for life</h6>\r\n<strong>Credits</strong>\r\n<h6>Successfully passing the CSM<sup>Â®</sup> exam will also earn candidates a total of 162 Credits towards MBA in Sports Management (Masterâ€™s Degree) offered by Charisma University.</h6>\r\n', '<h6><strong>Module 1 â€“ Sports Business Administration</strong> Create, maintain and update record keeping systems; Manage project finances; Manage the business components of a sport organisation; Monitor and maintain health, safety and security; Manage a sport or recreation facility.</h6>\r\n<h6><strong>Module 2 â€“ Communication, Customer Care and Self-development</strong> Conduct communication within a business environment; Utilise personal development training for personal growth; Care for Customers; Facilitate learning using a variety of given methodologies. </h6>\r\n<h6><strong>Module 3 â€“ Fitness Participation and Disabilities</strong> Manage participants with disabilities in sport; Support sport or fitness participation for people living with HIV/AIDS; Explain the principles of physical activity in the context of sport or fitness.</h6>\r\n<h6><strong>Module 4 â€“ Marketing, volunteer management and tournament planning</strong> Apply principles of marketing to sport; Manage Volunteers in sports; Organise and administer a sport tournament; Organise and administer a sport tournament.</h6>\r\n<h6><strong>Module 5 â€“ Governance, Structures and Ethical Behaviour in Sport</strong></h6>\r\n<ul>\r\n<li>Establish sustainable organisational structures for sport</li>\r\n<li>Explain the role of governance structures in sport</li>\r\n<li>Promote an understanding of diversity and equity in sport and fitness organisations</li>\r\n<li>Develop and implement team ethical behaviour and discipline</li>\r\n<p><!--\r\n<li>What is domain knowledge?</li>\r\n<li>How to adapt with different domains</li>\r\n<p>-->\r\n</p></ul>\r\n\r\n', '<strong>Target Audience</strong>\r\n<ul>\r\n<li>Sport team managers</li>\r\n<li>Sport event managers</li>\r\n<li>Sport tournament managers</li>\r\n<li>Sport facility managers</li>\r\n<li>Fitness facility managers</li>\r\n<li>Sport sponsorship managers</li>\r\n<li>Sport Project managers</li>\r\n<li>Sport organisation managers</li>\r\n<li>Volunteer managers</li>\r\n<li>Gym Managers</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '220 $', '100 $', '170 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CSM002', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSM-002%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'img11.png');
INSERT INTO `org_subcategory` VALUES ('6', 'Business Management Professional', '1', '<strong>BMP-001</strong>', '1', '1', '<p>The Business Management Professional (BMP)â„¢ certificate validates the business professional by providing industry-neutral advanced business skills. The certification measures competency by major institutions and organizations.</p>\r\n<p>The Business Management Professional (BMP)â„¢ Certification program is geared towards persons interested in pursuing a career in management or improving their managerial skills. The certificate demonstrates the essential information and skills required by professionals who have to make decisions that are important to the direction and performance of an organization or business. It also demonstrates that a candidate has the required practical approach to manage business in any environment.</p>\r\n<p>Owning a business requires a vision balanced with attention to detail. You need to be a generalist who understands the multiple aspects of running a business, as well as the ability to step back and see the big picture and to reach into the future. The business environment is a complex place to be. Whether you wish to work as a consultant or freelancer, establish a corporation, or set up an operation that meets a need for very particular type of customer, there is a tremendous amount of information that you need to know and to apply. The E-Learning blended E-Course from the GAQMBok (Body of Knowledge) provides essential learning for new business owners, whether the business is just in the idea stage or you have already begun and need to fill in the gaps.</p>\r\n<p>The Examination comprises of business management and essential skills in business needed to address these challenges and be successful at managing. It also gives direction as to how to organize, prioritize and delegate tasks, including utilizing some of the technological tools that computer technology offers to increase managerial effectiveness and efficiency, it also comprises of how to hire and manage people for optimum work performance and finally it makes the managers aware of the risk.</p>\r\n<p>Change is a hallmark of todayâ€™s business world. In particular, our workforce is constantly changing â€“ people come and go, and move into new roles within the company. Succession planning can help you make the most of that change by ensuring that when someone leaves, there is someone new to take their place.<br>\r\n</p>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass the exam.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>\r\nThe total duration of the exam is 1 hour 30 Minutes (90 Minutes)</h6>\r\n<strong>Closed book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n<h6><span style=\"text-decoration: underline;\"><strong>Retaking of exam</strong></span></h6>\r\n<ol>\r\n<h6>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</h6>\r\n</ol>\r\n<h6><span style=\"text-decoration: underline;\"><strong>Certification Validity</strong></span></h6>\r\n<h6>The Business Management Professional (BMP)<strong>â„¢</strong> Certificate is valid for life</h6>\r\n<strong>Credits </strong>\r\n<h6>Successfully passing the BMP exam will also earn candidates a total of 50 Credits towards MBA in Business Management (Masterâ€™s Degree) offered by Charisma University. </h6>', '<strong>Module 1 â€“ Business Management Fundamentals</strong>\r\n<h6>\r\n<ul>\r\n<li>Who are you and what are you about?</li>\r\n<li>Designing your organizational structure</li>\r\n<li>Introduction to operations management</li>\r\n<li>Understanding financial terms and budgeting</li>\r\n<li>Getting the right people in place</li>\r\n<li>Getting your product together</li>\r\n<li>Building a corporate brand</li>\r\n<li>Marketing and selling your product</li>\r\n<li>Planning for the future</li>\r\n<li>Ethics 101 and leadership essentials</li>\r\n<li>Building a strong customer care team</li>\r\n<li>Training employees for success</li>\r\n</ul></h6>\r\n<h6><strong>Module 2 â€“ Business Leadership </strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Learning organizations</li>\r\n<li>Peter Sengeâ€™s learning disciplines</li>\r\n<li>What leadership is and is not (including servant leadership)</li>\r\n<li>Kouzes and Posnerâ€™s five leadership practices</li>\r\n<li>Core skills</li>\r\n<li>Understanding the trust cycle and building trust</li>\r\n<li>Managing change</li>\r\n<li>SWOT analysis and problem solving</li>\r\n<li>Giving effective, constructive feedback</li>\r\n<li>Building good relationships</li>\r\n</ul></h6>\r\n<h6><strong>Module 3 â€“ Core Negotiation Skills </strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Define negotiation.</li>\r\n<li>Use key success strategies.</li>\r\n<li>Apply different negotiation approaches.</li>\r\n<li>Establish rules that lead to effective negotiation.</li>\r\n<li>Effectively prepare the research that is required to negotiate, including your BATNA, WATNA, WAP, and ZOPA</li>\r\n<li>Set limits.</li>\r\n<li>Maintain composure when things get heated.</li>\r\n<li>Collaborate and foster cooperation.</li>\r\n<li>Remain focused.</li>\r\n<li>Keep an open mind.</li>\r\n<li>Decide what kind of relationship we wish to foster.</li>\r\n<li>Use additional resources and expertise.</li>\r\n<li>Keep an open mind.</li>\r\n<li>Create a sustainable agreement.</li>\r\n<li>Incorporate everyoneâ€™s perspective</li>\r\n<li>Gain consensus.</li>\r\n</ul></h6>\r\n<h6><strong>Module 4 â€“ Business Succession Planning </strong></h6>\r\n<h6>\r\n<ul>\r\n<li>A need for succession planning</li>\r\n<li>Define a succession planning</li>\r\n<li>Identifying resources and analyzing risks</li>\r\n<li>Defining roles, responsibilities and functions</li>\r\n<li>Gathering information and forecasting needs</li>\r\n<li>Putting the plan together</li>\r\n<li>Putting the plan into action</li>\r\n<li>Evaluating and reviewing the plan</li>\r\n</ul>\r\n</h6>\r\n<h6><strong>Module 5 â€“ Conflict Resolution </strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Defining conflict</li>\r\n<li>Types of conflict</li>\r\n<li>Benefits of conflict</li>\r\n<li>Costs of conflict</li>\r\n<li>The role of anger in conflict</li>\r\n<li>The five stages of conflict</li>\r\n<li>The LECSR tool</li>\r\n<li>Setting norms and rules</li>\r\n<li>Seven steps to ironing things out</li>\r\n<li>Using mediation and facilitation</li>\r\n<li>Confrontational facilitation</li>\r\n<li>Managing differences collaboratively</li>\r\n<li>Asking questions</li>\r\n<li>Listening skills</li>\r\n<li>Non-verbal communication</li>\r\n<li>Problem Solving Tools</li>\r\n<li>Managing anger and stress</li>\r\n<li>Stress management techniques</li>\r\n<li>Stress management through Positive self talk</li>\r\n</ul></h6>\r\n<h6><strong>Module 6 â€“ Dealing With Difficult People</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Conflict as communication</li>\r\n<li>Benefits of confrontation</li>\r\n<li>Preventing problems</li>\r\n<li>Getting focused</li>\r\n<li>Dealing with anger (yours and others)</li>\r\n<li>Dealing with problems</li>\r\n<li>The three step conflict resolution model</li>\r\n<li>Changing yourself</li>\r\n<li>Why donâ€™t people do what they are supposed to?</li>\r\n<li>De-stress options to use when things get ugly</li>\r\n</ul>\r\n</h6>', '<strong>Target Audience</strong>\r\n<ul>\r\n<li>Business Owners</li>\r\n<li>Managers and Supervisors</li>\r\n<li>Department Heads</li>\r\n<li>Intermediate-level Professionals</li>\r\n<li>Entry-level Professionals</li>\r\n<li>New College Graduates</li>\r\n<li>New High School Graduates</li>\r\n<li>Aspiring Professionals, Managers, Supervi-sors and Department Heads</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '255 $', '85 $', '170 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=BMP-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28BMP-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'business_management1.jpg');
INSERT INTO `org_subcategory` VALUES ('7', 'Business Process Manager', '1', '<strong>BPM-001</strong>', '1', '1', '<p>Business Process Manager (BPM)â„¢ Certification helps organizations leverage processes to achieve their goals and be successful. Once processes are implemented, they must be monitored, evaluated, and optimized to make sure they are still meeting the goals that they were designed to accomplish. A business that can successfully manage its processes is able to maintain a competitive edge, while increasing productivity and efficiency and decreasing costs.</p>\r\n<p>The  e-course will introduce participants to business process management. Participants will learn how business processes can help improve their companyâ€™s bottom line by providing a higher level of quality and consistency for customers.<br>\r\n</p>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 50 Multiple Choice Questions out of which the candidate needs to score 70% (35 out of 50) to pass the exam.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<strong>Closed book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;color: #303030\"><strong>Retaking of exam</strong></span></p>\r\n<ol>\r\n<h6>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</h6>\r\n</ol>\r\n<p><span style=\"text-decoration: underline;color: #303030\"><strong>Certification Validity</strong></span></p>\r\n<h6>The Business Process Manager (BPM)â„¢ Certificate is valid for life.</h6>\r\n<strong>Credits </strong>\r\n<h6>Successfully passing the BPM exam will also earn candidates a total of 15 Credits towards MBA in Business Management (Masterâ€™s Degree) offered by Charisma University. </h6>\r\n', '<strong>The Fundamentals of Business Process Management</strong>\r\n<ul>\r\n<h6>\r\n<li>What is Business Analysis?</li>\r\n<li>What is Enterprise Content Management?</li>\r\n<li>Enterprise Content Management Model</li>\r\n<li>What is Business Process Re-Engineering?</li>\r\n<li>Business Process Re-Engineering Model</li>\r\n</h6></ul>\r\n<p><span style=\"color: #333333;\"><strong>Defining Business Process Management</strong></span></p>\r\n<ul>\r\n<li>What is Business Process Management?</li>\r\n<li>Brief History of Business Process Management</li>\r\n<li>What are the Benefits of Business Process Management?</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>Reflecting on Processes</strong></span></p>\r\n<p><span style=\"color: #333333;\"><strong>The Business Process Life Cycle</strong></span></p>\r\n<p><span style=\"color: #333333;\"><strong>The Vision Phase</strong></span></p>\r\n<ul>\r\n<li>Creating a Vision and Seeing the Big Picture</li>\r\n<li>Sharing Your Vision</li>\r\n<li>Dreaming Big</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>The Design Phase</strong></span></p>\r\n<ul>\r\n<li>Gathering Information</li>\r\n<li>Defining Your Problem</li>\r\n<li>Identifying Existing and Future Processes</li>\r\n<li>About Process Mapping</li>\r\n<li>Creating a Process Map with a Flow Chart</li>\r\n<li>Creating a Process Map with a Swimlane Diagram</li>\r\n<li>Map it Out</li>\r\n<li>Defining Improvements</li>\r\n<li>Establishing Functions and Identifying Function Leaders</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>The Modeling Phase</strong><span></span></span></p>\r\n<ul>\r\n<li>Performing What-if Analysis</li>\r\n<li>Test Driving</li>\r\n<li>Testing the Design</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>The Execution Phase</strong></span></p>\r\n<ul>\r\n<li>Implementing Processes</li>\r\n<li>Exploring Automation</li>\r\n<li>Automating Processes</li>\r\n<li>Understanding Business Rules</li>\r\n<li>Making Connections</li>\r\n<li>The Role of Workflow Engines</li>\r\n<li>Case Studie</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>The Monitoring Phase</strong></span></p>\r\n<ul>\r\n<li>Implementing Measures</li>\r\n<li>What is Business Activity Monitoring (BAM)?</li>\r\n<li>The Balanced Scorecard</li>\r\n<li>Creating a Balanced Scorecard</li>\r\n<li>Identifying Gaps with Process Mining</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>The Optimizing Phase</strong></span></p>\r\n<ul>\r\n<li>What Itâ€™s All About</li>\r\n<li>Business Process Improvement</li>\r\n<li>Introduction to Lean</li>\r\n<li>Cut Out the Waste</li>\r\n<li>Introduction to Six Sigma</li>\r\n</ul>\r\n', '<strong>Target Audience</strong>\r\n<h6>\r\n<ul>\r\n<li>Technology consultants</li>\r\n<li>System administrators</li>\r\n<li>Process Onwers</li>\r\n<li>Process Designers</li>\r\n<li>Business Leaders</li>\r\n<li>Senior Executives</li>\r\n<li>Team Leaders</li>\r\n<li>Business Analysts Onwers</li>\r\n<li>Decision Makers</li>\r\n<li>Middle- and Senior-level Line-of-business managers</li>\r\n<li>Those who are new to BPM or have only had a limited exposure</li>\r\n</ul></h6>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Premium Package with E-Course and Two (2) Exam Vouchers', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '40 Days', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '140 $', '210 $', '85 $', '128 $', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=BPM-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28BPM%29', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=BPM-001%20%28E-Course%20Only%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', 'bpm.jpg');
INSERT INTO `org_subcategory` VALUES ('8', 'Certified Business Analyst Foundation', '1', '<strong>CBAF-001</strong>', '1', '1', '<strong>About Business Analyst</strong>\r\n<p>Business analysts study the overall business and IT needs of an organization in order to develop appropriate solution strategies. As the key liaison between business and information technology departments, the business analyst is responsible for gathering and documenting business requirements and translating them into functional system design specifications that can be successfully executed by IT development teams.</p>\r\n<p>A Business Analyst is someone who analyses change requirements and produces a justifiable set of analysis deliverables that are used to design and implement the solution. A Business Analyst is (or should!) be measured on delivery of the benefits specified in the project objectives.</p>\r\n<p>Job rankings reports over the past few years (including ones by CNN Money and job search engine Indeed.com) rank Business Analyst as a â€˜hot jobâ€™ for the future. And survey data spanning from 2008 to 2010 from Blueprint Systems reports that 37% of BAs now use some kind of purpose-built requirements software tool in their role.</p>\r\n<p><strong>About Business Analysis</strong></p>\r\n<p>Business Analysis is a straight forward process of analyzing business change requirements. Why, then, are there so many methods, approaches, techniques and tools for doing what is â€“ essentially â€“ the same job? In order to understand this, we need to rewind a bit in time to look at where Business Analysis came from, where it currently is and projections for where it will go.</p>\r\n<p><strong>The History Bit</strong></p>\r\n<p>Business Analysis was born out of the fact that IT change projects started to go wrong in the 1980s. Before that, IT change projects could solve a limited set of problems in a limited way because the only options were to turn paper based data into electronic data and have simple programs automate the use of that data. There were many limitations such as:</p>\r\n<ul>\r\n<li>were many limitations such as: storage of the electronic data was expensive</li>\r\n<li>the way data was stored was cumbersome (flat files read sequentially in one direction only).</li>\r\n<li>programs were difficult to write in abstract languages</li>\r\n<li>there was only a limited set of functionality based around mainframe processes</li>\r\n<li>user interfaces were delivered on basic green-screens</li>\r\n</ul>', '<strong>Exam Pattern</strong>\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score 70% (28 out of 40 correct) to pass the exam.</h6>\r\n<strong>Duration of exam</strong>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<strong>Closed book</strong>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<strong>Certification Validity</strong>\r\n<h6>The Certified Business Analyst (CBA)â„¢ â€“ Foundation Certificate is valid for life</h6>\r\n<strong>Credits </strong>\r\n<h6>Successfully passing the CBAF exam will also earn candidates a total of 20 Credits towards MBA in Business Management (Masterâ€™s Degree) offered by Charisma University. </h6>', '<strong>Module 1 â€“ Introduction to Business Process Analysis</strong>\r\n<h6>\r\n<ul>\r\n<li>Introduction to Business Process Analysis</li>\r\n<li>Why Business Analysis </li>\r\n<li>Roles and responsibilities of a Business Analyst </li>\r\n<li>Key concept of business analysis</li>\r\n<li>What is domain knowledge?</li>\r\n<li>How to adapt with different domains</li>\r\n</ul></h6>\r\n<h6><strong>Module 2 â€“ Business Process Analysis Planning and Stakeholder Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>BPA activities planning </li>\r\n<li>Business communication scheduling</li>\r\n<li>Performance Monitoring of Business Analysts</li>\r\n<li>Estimation</li>\r\n<li>Stakeholder Identification and Management</li>\r\n<li>RASCI Matrix</li>\r\n<li>Stakeholder spreadsheet</li>\r\n</ul></h6>\r\n<h6><strong>Module 3 â€“ Business Requirements Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>What is requirement?</li>\r\n<li>Requirements Elicitation</li>\r\n<li>Requirements Management</li>\r\n<li>Requirements Organization</li>\r\n<li>Requirements Prioritization</li>\r\n<li>Requirements Communication</li>\r\n</ul></h6>\r\n<h6><strong>Module 4 â€“ Organizational Analysis</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Risk Analysis and Management</li>\r\n<li>Root Cause Analysis</li>\r\n<li>GAQP Analysis</li>\r\n<li>Swot Analysis</li>\r\n<li>Decision Analysis</li>\r\n<li>Strategy Analysis</li>\r\n</ul></h6>\r\n<h6><strong>Module 5 â€“ Business Solutions Evaluation and Implementation</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Business Solutions</li>\r\n<li>Solutions Assessment</li>\r\n<li>Solution Validation</li>\r\n<li>Solution Evaluation</li>\r\n<li>Solution Implementation</li>\r\n</ul></h6>\r\n<h6><strong>Module â€“ 6 Business Analyst Competencies</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Business Communication</li>\r\n<li>Supplier Management</li>\r\n<li>Leadership</li>\r\n<li>Conflict Management</li>\r\n</ul></h6>', '<strong>Target Audience</strong>\r\n<h6>The Foundation level is suitable for business and system analysts, requirements engineers, product owners and product managers.</h6>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '175 $', '85 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CBAF-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CBAF-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cba.jpg');
INSERT INTO `org_subcategory` VALUES ('9', 'Certified Supply Chain Manager', '1', '<strong>CSCM-001</strong>', '1', '1', '<p>Supply Chain Management improves the coordination and relationship between Suppliers, Producers, and Customers. It must be kept at a high level of organization to be successful in todayâ€™s global economy. Goods and services are now pieced together from all over the world, and this process can be hectic and complicated if not managed correctly.</p>\r\n<p>With Supply Chain Management, your company and employees will be on target to lower costs, improving efficiency, and increase customer satisfaction. This E-course will provide your employees with the understanding of how Supply Chain Management can improve and help almost any type of business.</p>\r\n<p>Our Certified Supply Chain Manager (CSCM)â„¢ certification also comprises of Inventory management with most companies carry too much inventory. â€œYou canâ€™t sell from an empty wagon,â€ is usually the reasoning. Being over-stocked means the company will likely not run out of anything. But what about the inventory that has celebrated a few birthdays in the warehouse? Has anyone stopped to calculate the true cost of worrying about â€œrunning out?â€</p>\r\n<p>The costs of maintaining excessive inventory usually far outweigh the true cost of not being able to quickly deliver a particular item to a customer once in a very long while. A balance must be struck between inventory levels and turnover. Good inventory managers know what stock moves at what rate. They carefully plan re-order levels to ensure that the chances of running out are minimized while the turnover rate is maximized<br>\r\n</p>\r\n', '<strong>Exam Pattern</strong>\r\n<p></p>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 70% (70 out of 100) to pass the exam.</h6>\r\n<strong>Duration of exam</strong>\r\n<p></p>\r\n<h6>The total duration of exam is 2 hours (120 minutes)</h6>\r\n<strong>Closed book</strong>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<p></p>\r\n<ol>\r\n<h6>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n</h6>\r\n<h6>\r\n<li>The exam can be taken any number of times.</li>\r\n</h6>\r\n<p></p></ol>\r\n<strong>Certification Validity</strong>\r\n<p></p>\r\n<h6>The Certified Supply Chain Manager (CSCM)â„¢ Certificate is valid for life.</h6>\r\n<strong>Credits </strong>\r\n<p></p>\r\n<h6>Successfully passing the CSCM exam will also earn candidates a total of 25 Credits towards MBA in Wholesale and Retail Operations (Masterâ€™s Degree) offered by Charisma University. </h6>\r\n', '<strong>Module 1 â€“ Supply Chain Management</strong>\r\n<h6>\r\n<ul>\r\n<li>Why Supply Chain Management</li>\r\n<li>Key Terms</li>\r\n<li>Key Terms (II)</li>\r\n<li>Three Levels of Supply Chain Management</li>\r\n<li>Five Stages of Supply Chain Management</li>\r\n<li>The Flows of Supply Chain Management</li>\r\n<li>Inventory Management (Foundation)</li>\r\n<li>Supply Chain Groups</li>\r\n<li>Tracking and Monitoring</li>\r\n<li>Supply Chain Event Management</li>\r\n</ul>\r\n</h6>\r\n<h6><strong>Module 2 â€“ Inventory Management</strong></h6>\r\n<ul>\r\n<li>What is inventory?</li>\r\n<li>Types of inventory</li>\r\n<li>Key players</li>\r\n<li>Setting up the warehouse</li>\r\n<li>What makes a good inventory management system?</li>\r\n<li>The warehouse inventory cycle</li>\r\n<li>Identifying demand</li>\r\n<li>Validating inventory</li>\r\n<li>The put-away and receiving process</li>\r\n<li>Maintaining inventory accuracy</li>\r\n<li>The outbound process</li>\r\n<li>Industry trends</li>\r\n\r\n</ul>\r\n', '<strong>Target Audience</strong>\r\n<p></p>\r\n<h6>\r\n<ul>\r\n<li>You are a manager or someone who is challenged with the intricacies of the supply chain and logistics of your company and you wish to improve your decision-making skills in these areas.</li>\r\n<li>Transport Managers</li>\r\n<li>Supply Chain Practitioners within the public sector</li>\r\n</ul></h6>\r\n', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '170 $', '85 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSCM-001%29', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CSCM-001', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cscm.jpg');
INSERT INTO `org_subcategory` VALUES ('10', 'Certified Risk and Crisis Manager', '1', '<strong>CRCM-001</strong>', '1', '1', '<strong>About Risk and Crisis Management</strong>\r\n<p>Risk management has long been a key part of project management, but in recent years, it has become an increasingly important part of organizational best practices. Corporations have realized that effective risk management can not only reduce the negative impact of crises; it can provide real benefits and cost savings.</p>\r\n\r\n<p>The risk management framework provided in this Certification which is flexible enough for any organization. You can apply it to a single project, a department, or use it as a basis for an enterprise-wide risk management program.</p>\r\n\r\n<p>Viable organizations need to be ready for emergencies because they are a fact of doing business. The worst plan is not to have any kind of plan at all, and the best plans are tested and adjusted so that they work over time. Fortunately, you do not need separate plans for fire, weather disasters, and all the different kinds of crises that can occur. One solid plan will help you to prevent, respond, and recover from all crises. The Certified Risk and Crisis Managers will help you ensure your organization is ready to manage any kind of crisis.<br>\r\n</p>\r\n', '<strong>Exam Pattern</strong>\r\n<p></p>\r\n<h6>The exam comprises of 50 Multiple Choice Questions out of which the candidate needs to score 70% (35 out of 50 correct) to pass the exam.</h6>\r\n<strong>Duration of exam<br>\r\n</strong>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Closed Book</span></strong></span></h6>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<strong>Retaking of exam</strong>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<strong>Certification Validity</strong>\r\n<p></p>\r\n<h6>The Certified Risk and Crisis Manager (CRCM) Certificate is valid for life</h6>\r\n', '<h6><strong>Module â€“ 1 Risk Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<h6>\r\n<li>Understanding risk</li>\r\n<li>Risk management activities</li>\r\n<li>Assessing risk</li>\r\n<li>Responding to risks</li>\r\n<li>Resourcing controls</li>\r\n<li>Reaction planning</li>\r\n<li>Reporting and monitoring</li>\r\n<li>Reviewing and evaluating the framework</li>\r\n</h6>\r\n</ul>\r\n</h6>\r\n<h6><strong>Module 2 â€“ Crisis Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>What is crisis management?</li>\r\n<li>Training leaders and staff</li>\r\n<li>Conducting the crisis audit</li>\r\n<li>Performing a risk level analysis</li>\r\n<li>Developing a response process</li>\r\n<li>Consulting with the experts</li>\r\n<li>Incident management techniques </li>\r\n<li>Working through the issues</li>\r\n<li>Establishing an emergency operations center</li>\r\n<li>Building business continuity and recovery</li>\r\n<li>Recovering and moving on</li>\r\n<li>Practice opportunities</li>\r\n</ul></h6>\r\n<p></p>\r\n', '<strong>Target Audience</strong>\r\n<p></p>\r\n<ul>\r\n<li>This certification aims at risk professionals, or those who interface with risk management disciplines on a very regular basis, who want to improve and expand their knowledge in risk and Crisis Management.</li>\r\n<li>Those who are in charge of critical units or company subsidiaries.</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '150 $', '50 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CRCM-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CRCM-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'crcm.jpg');
INSERT INTO `org_subcategory` VALUES ('11', 'Certified Problem and Change Manager', '1', '<strong>CPCM-001</strong>', '1', '1', '<p> We make decisions and solve problems continually. We start making decisions before we even get out of bed (shall I get up now or not?). Sometimes, we will have made as many as 50 decisions by the time we leave for work. Despite all the natural decision making that goes on and the problem solving we do, some people are very uncomfortable with having to make decisions. You may know someone who has a hard time making decisions about what to eat, never mind the internal wrestling they go through in order to take on major decisions at work. Likewise, we’ve probably all looked at a solution to something and said, “I could have thought of that.” The key to finding creative solutions is not just creativity, although that will certainly help. The answer rests in our ability to identify options, research them, and then put things together in a way that works. Having a process to work through can take the anxiety out of problem solving and make decisions easier. That’s what the CPCM is all about.</p>\r\n\r\n<p>Change is something that excites people who love opportunities for growth, to see and learn about new things, or who like to shift the status quo. Some changes, however, are harder to adjust to and lead to expressions of resistance and anger. We can take concrete steps to make change more palatable by understanding people’s hesitation, enlisting the help of others, setting up plans, and managing stressors. These steps can also ensure that desired changes are implemented successfully.</p>\r\n\r\n<p>Our E-Course, will teach you how to manage and cope with change and how to help those around you too.</p>\r\n\r\n<p>There is a huge demand in the market for Problem and Change Managers, an individual who has relevant skills in managing problems and change can take this exam.</p>', '<strong>Exam Pattern</strong>\r\n<p></p>\r\n<h6>The exam comprises of 40 Multiple Choice Questions, 70% (28 out of 40 correct) in order to pass the Certified Problem and Change Manager (CPCM) exam, this exam is best suited for the people who are at a functional post for resolving problems and managing changes.</h6>\r\n\r\n<strong>Duration of exam</strong>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n\r\n<strong>Closed book</strong>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6></ul>\r\n\r\n<strong>Retaking of exam</strong>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<strong>Certification Validity</strong>\r\n\r\n<h6>The Certified Problem and Change Manager (CPCM) Certificate is valid for life</h6>\r\n\r\n<strong>Credits </strong>\r\n\r\n<h6>Successfully passing the CPCM exam will also earn candidates a total of 20 Credits towards MBA in Business Management (Master’s Degree) offered by Charisma University. </h6>', '<h6><strong>Module 1 – Problem Management</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Problem-solving definitions</li>\r\n<li>Making decisions</li>\r\n<li>Problem solving model and toolkit</li>\r\n<li>Getting into It</li>\r\n<li>SWOT Analysis</li>\r\n<li>Making good group decisions</li>\r\n<li>Analyzing and selecting solutions</li>\r\n<li>Planning and organizing</li>\r\n<li>Hands-on case studies and exercises</li>\r\n</ul>\r\n</h6>\r\n\r\n<h6><strong>Module 2 – Change Management</strong></h6>\r\n\r\n<ul>\r\n<li>What is change?</li>\r\n<li>The change cycle</li>\r\n<li>The human reaction to change</li>\r\n<li>The pace of change</li>\r\n<li>The four room apartment</li>\r\n<li>Dealing with resistance</li>\r\n<li>Adapting to change</li>\r\n<li>Strategies for dealing with anger</li>\r\n<li>Managing stress</li>\r\n</ul>\r\n\r\n<h6><strong>Module 3 – Secrets of Change Management</strong></h6>\r\n\r\n<ul>\r\n<li>What is change? </li>\r\n<li>The Bridges change model   </li>\r\n<li>The Conner change model  </li>\r\n<li>The Janssen change model  </li>\r\n<li>Six reactions to change</li>\r\n<li>Identifying the need for change </li>\r\n<li>Identifying the cost and benefit </li>\r\n<li>Setting the vision and goal </li>\r\n<li>Responding to change   </li>\r\n<li>Creating and implementing a strategy </li>\r\n<li>Planning for change  </li>\r\n<li>Communication skills </li>\r\n<li>Empowering employees    </li>\r\n<li>Building resiliency</li>\r\n<li>Acknowledging reactions </li>\r\n<li>Dealing with emotions </li>\r\n<li>Managing negative stress </li>\r\n<li>Exploring your options </li>\r\n<li>Examining the reality </li>\r\n\r\n</ul>\r\n\r\n', '<strong>Target Audience</strong>\r\n\r\n<ul>\r\n<li>Problem or Change Managers</li>\r\n<li>Aspiring Problem or Change managers already working in education and seeking career progression</li>\r\n<li>Aspiring Problem or Change managers working in the private sector looking for a change of career direction</li>\r\n</ul>\r\n', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '213 $', '75 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CPCM-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CPCM-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cpcm.jpg');
INSERT INTO `org_subcategory` VALUES ('12', 'Certified Call Centre Associate', '1', '<strong>CCCA-001</strong>', '1', '1', '<p>Whether we choose to embrace them or cannot stand being interrupted by their calls, call centers are a business element that is here to stay. This certification will help call center agents learn to make the most of their telephone-based work, including understanding the best ways to listen and be heard. Each phone interaction has elements of sales and customer service skills, which we will explore in detail throughout this energizing and practical via our E-Course</p>\r\n\r\n<p>While many companies promise to deliver an incredible customer experience, some are better at delivering than others. The CCCA Certification is also designed around six critical elements of customer service that, when the company lives them, bring customers back to experience service that outdoes the competition.<br>\r\n</p>', '<strong>Exam Pattern</strong>\r\n\r\n<h6>The exam comprises of 50 Multiple Choice Questions out of which the candidate needs to score 70% (35 out of 50 correct) to pass the exam.</h6>\r\n\r\n<strong>Duration of exam</strong>\r\n\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n\r\n<strong>Closed book</strong>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n\r\n<strong>Retaking of exam</strong>\r\n\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<strong>Certification Validity</strong>\r\n\r\n<h6>The Certified Call Center Associate (CCCA) Certificate is valid for life</h6>\r\n\r\n<strong>Credits </strong>\r\n\r\n<h6>Successfully passing the CCCA exam will also earn candidates a total of 20 Credits towards MBA in Sales and Marketing (Masterâ€™s Degree) offered by Charisma University. </h6>', '<h6><strong>Module 1 â€“ Call Center Training</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Verbal communication techniques</li>\r\n<li>Who are your customers?</li>\r\n<li>Listening skills</li>\r\n<li>Asking the right questions and saying no</li>\r\n<li>Taking messages and using voice mail effectively</li>\r\n<li>Vocal exercises</li>\r\n<li>Cold and warm calls, including developing a script</li>\r\n<li>Going above and beyond and high impact moments</li>\r\n<li>Handling objections and closing the sale</li>\r\n<li>Negotiation techniques </li>\r\n<li>Tips for challenging callers</li>\r\n<li>Phone tag and getting the call back</li>\r\n<li>Stress busting</li>\r\n<li>Call center trends</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Customer Service Training</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>What is customer service? Who are your customers? </li>\r\n<li>Meeting expectations</li>\r\n<li>Setting goals</li>\r\n<li>Communication skills and telephone techniques</li>\r\n<li>Dealing with difficult customers and people</li>\r\n<li>Dealing with challenges assertively</li>\r\n<li>Dealing with stress</li>\r\n<li>The first critical element: A customer service focus</li>\r\n<li>The second critical element: Defined in your organization</li>\r\n<li>The third critical element: Given life by employees</li>\r\n<li>The fourth critical element: Be a problem solver</li>\r\n<li>The fifth critical element: Measure it</li>\r\n<li>The sixth critical element: Reinforce it</li>\r\n<li>Demonstrate a customer service approach </li>\r\n<li>Understand how your own behavior affects the behavior of others</li>\r\n<li>Demonstrate confidence and skill as a problem solver</li>\r\n<li>Apply techniques to deal with difficult customers</li>\r\n<li>Make a choice to provide customer service</li>\r\n</ul></h6>\r\n\r\n', '<strong>Target Audience</strong>\r\n\r\n<h6>\r\n<ul>\r\n<li>Customer Service Representative</li>\r\n<li>Call Center Agents and Managers</li>\r\n<li>This certification is also ideal for anyone seeking training in customer service and customer care</li>\r\n</ul></h6>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '175 $', '85 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CCCA-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CCCA-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'ccca.jpg');
INSERT INTO `org_subcategory` VALUES ('13', 'Certified Finance Manager', '1', '<strong>CFM-001</strong>', '1', '1', '<p> Most of us flinch when we hear terms like depreciation, cash flow, balance sheet, and (worst of all!) budgets. However, these are all important concepts to understand if youâ€™re going to succeed in todayâ€™s business world, particularly as a supervisor. Even better, financial terms are not as scary as they seem! The Certified Finance Manager (CFM) Certification is designed to enhance the capabilities of finance professionals and also serves as a first step in the Finance Management profession.</p>\r\n\r\n<p>For managers in todayâ€™s business world, itâ€™s essential to have a working knowledge of finance. We all play a role in our organizationâ€™s financial health, whether we realize it or not. If you donâ€™t have training or a background in finance, you may be at a disadvantage as you sit around the management table. Understanding the cycle of finance will help you figure out where you fit into your companyâ€™s financial structure, and how to keep your department out of the red. Our E-Course will help you take the Certified Finance Manager (CFM) Certification Exam with confidence.<br>\r\n</p>\r\n', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score 70% (28 out of 40 correct) to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n\r\n<h6>The Certified Finance Manager (CFM) Certificate is valid for life</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Credits </strong></p>\r\n\r\n<h6>Successfully passing the CFM exam will also earn candidates a total of 20 Credits towards MBA in Human Resource Management (Masterâ€™s Degree) offered by Charisma University. </h6>', '<h6><strong>Module 1 â€“ Accounting</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>The Accounting Cycle</li>\r\n<li>The Key Reports</li>\r\n<li>A Review of Financial Terms</li>\r\n<li>Understanding Debits and Credits</li>\r\n<li>Your Financial Analysis Toolbox</li>\r\n<li>Identifying High and Low Risk Companies</li>\r\n<li>The Basics of Budgeting</li>\r\n<li>Working Smarter</li>\r\n<li>People and Numbers</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Budgets and Managing Money</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Finance Jeopardy</li>\r\n<li>The Fundamentals of Finance</li>\r\n<li>The Basics of Budgeting</li>\r\n<li>Parts of a Budget</li>\r\n<li>The Budgeting Process</li>\r\n<li>Budgeting Tips and Tricks</li>\r\n<li>Monitoring and Managing Budgets</li>\r\n<li>Crunching the Numbers</li>\r\n<li>Getting Your Budget Approved</li>\r\n<li>Comparing Investment Opportunities</li>\r\n<li>ISO 9001:2008</li>\r\n<li>Directing the Peerless Data Corporation</li>\r\n</ul></h6>\r\n\r\n', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>Any one who is a part of the Department of Finance and Deregulation Financial Management and Budgeting</li>\r\n<li>Anyone needing to develop their understanding of finance, budgeting and accounts.</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '213 $', '70 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CFM-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CFM-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cfm.jpg');
INSERT INTO `org_subcategory` VALUES ('14', 'Certified Human Resources Manager', '1', '<strong>CHRM-001</strong>', '1', '1', '<p> The human resource issues facing todayâ€™s business owners and managers. You do not always have the expertise to deal with the many employee relationship issues you face, and yet you will be expected to make decisions that are both effective and legal. This Certified Human Resources Manager (CHRM)â„¢ Certification will walk you through the hiring process, from performing a skills inventory to conducting the interview; discuss orientation; and cover some issues that arise after the hiring process (such as diversity issues, compensation, and discipline).</p>\r\n\r\n<p>The Module two of CHRMâ„¢ will familiarize you with a workplace situation where a supervisor has made a decision that you didnâ€™t agree with? Did you wish that you could ask someone else what they thought of the decision; whether they would have done the same thing? The peer review process offers employees just that chance, using a formalized procedure to ask, consider, and resolve just these sorts of questions. This one-day workshop will teach you everything you need to know about employee dispute resolution through mediation.</p>\r\n\r\n<p>Organizations recognize that they do better business when their people are engaged, motivated, and yes, talented. Having the right people in place at the right time is a key aspect to continued growth, success, or even just stability. The Module 3 of CHRMâ„¢ will provide you with just what it takes to have the right people ready. It will help you create a program to measure the talents of your people and how to help them grow in preparation for the future. It will also help you support and grow your organization by teaching you how to apply the most current research and adapt your organization to the ever-changing marketplaces.</p>\r\n\r\n<p>The Module 4 of CHRMâ„¢ details with Performance reviews as they are an essential component of employee development. The performance review meeting is an important aspect of career planning, and the outcomes of the meeting should be known to the employee and supervisor before the meeting actually takes place. Remember what the German philosopher Goethe said: â€œTreat people as if they were what they ought to be and you help them become what they are capable of being.â€</p>\r\n\r\n<p>Setting goals and objectives to aim for will give both supervisors and employees a focus, and is one of the key aspects to meeting overall company objectives. Supervisors must also learn how to give feedback, both positive and negative, on a regular and timely basis so that employees can grow and develop. Performance appraisals involve all these activities.</p>\r\n\r\n<p>Many people see conflict as a negative experience. In fact, conflict is a necessary part of our personal growth and development. Think of when you were trying to choose your major in college, for example, or trying to decide between two jobs. However, conflict becomes an issue when the people involved cannot work through it. They become engaged in a battle that does not result in growth. When this type of conflict arises, negative energy can result, causing hurt feelings and damaged relationships. The Module 5 of CHRMâ„¢ course will give participants the tools that will help you resolve conflict successfully and produce a win-win outcome.</p>\r\n\r\n<p>Module 6 of CHRMâ„¢ deals with Anger Management. Anger is a universal experience. Dogs get angry, bees get angry, and so do humans. You donâ€™t have to be a psychologist to know that managing anger productively is something few individuals, organizations, and societies do well. Yet research tells us that those who do manage their anger at work are much more successful than those who donâ€™t. The co-worker who can productively confront his teammate about his negative attitude increases his teamâ€™s chance of success as well as minimizes destructive conflicts. The customer service agent who can defuse the angry customer not only keeps her customers loyal but makes her own day less troublesome.<br>\r\n</p>', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n\r\n<h6>The total duration of the exam is 1 hour 30 minutes (90 Minutes)</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n\r\n<h6>The Certified Human Resources Manager (CHRM)â„¢ Certificate is valid for life</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Credits </strong></p>\r\n\r\n<h6>Successfully passing the CHRM exam will also earn candidates a total of 55 Credits towards MBA in Human Resource Management (Masterâ€™s Degree) offered by Charisma University. </h6>', '<h6><strong>Module 1 â€“ HR Training for the Non HR Managers</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Defining Human Resources</li>\r\n<li>Skills Inventory</li>\r\n<li>Forecasting</li>\r\n<li>Job Analysis</li>\r\n<li>Job Competencies</li>\r\n<li>Position Profiles and Job Descriptions</li>\r\n<li>Do You Really Need to Hire?</li>\r\n<li>Finding Candidates</li>\r\n<li>Advertising Guidelines</li>\r\n<li>Screening Resumes</li>\r\n<li>Preparing for the Interview</li>\r\n<li>Conducting the Interview</li>\r\n<li>After the Interview</li>\r\n<li>Employee Orientation</li>\r\n<li>Planning Training</li>\r\n<li>Working with External Providers</li>\r\n<li>Performance Reviews</li>\r\n<li>Absenteeism</li>\r\n<li>Diversity</li>\r\n<li>Privacy Issues</li>\r\n<li>Compensation and Benefits</li>\r\n<li>Discipline</li>\r\n<li>Termination</li>\r\n<li>Exit Interviews</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Employee Dispute Resolution</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>What is Peer Review?</li>\r\n<li>Initiating the Process</li>\r\n<li>The Peer Review Panel</li>\r\n<li>Asking Questions</li>\r\n<li>The Peer Review Process</li>\r\n<li>Panel Walkthrough</li>\r\n<li>Why Does the Process Fail?</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 3 â€“ Talent Management</strong><p></p>\r\n<ul>\r\n<li>Talent management, performance management, and succession planning</li>\r\n<li>Creating a talent management plan</li>\r\n<li>Competency-based programs</li>\r\n<li>Identifying talent</li>\r\n<li>Conducting talent assessments</li>\r\n<li>Keeping people interested</li>\r\n<li>Talent review meetings</li>\r\n<li>Compensation and benefits</li>\r\n<li>Communicating with high potentials</li>\r\n<li>Development strategies</li>\r\n<li>Fostering engagement</li>\r\n<li>Evaluating the plan</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 4 â€“ Conducting Effective Performance Reviews</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Common errors and solutions</li>\r\n<li>Types of performance reviews</li>\r\n<li>The performance management process</li>\r\n<li>Setting standards and goals</li>\r\n<li>Creating a performance development plan</li>\r\n<li>Feedback and communication skills</li>\r\n<li>Accepting criticism</li>\r\n<li>Appraisal preparation</li>\r\n<li>Planning and conducting the interview</li>\r\n<li>Coaching and maintaining performance</li>\r\n<li>Terminating an employee</li>\r\n<li>Performance management checklists</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 5 â€“ Conflict Resolution</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Defining conflict and types of conflict</li>\r\n<li>Spontaneous and reflective action</li>\r\n<li>The Johari window</li>\r\n<li>Stages of conflict</li>\r\n<li>Conflict resolution style questionnaire</li>\r\n<li>The role of communication in conflict resolution (including information on active listening, paraphrasing, asking questions, and body language)</li>\r\n<li>The conflict/opportunity test</li>\r\n<li>Conflict and its resolution</li>\r\n<li>Helping others through conflict</li>\r\n</ul>\r\n</h6>\r\n\r\n<h6><strong>Module 6â€“ Anger Management</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>What is anger?</li>\r\n<li>Costs and pay-offs</li>\r\n<li>Using an anger log</li>\r\n<li>The anger process</li>\r\n<li>How does anger affect our thinking?</li>\r\n<li>Understanding behavior types</li>\r\n<li>Managing anger</li>\r\n<li>Communication tips and tricks</li>\r\n</ul></h6>', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>Team Leaders</li>\r\n<li>Supervisors</li>\r\n<li>Human Resources Directors</li>\r\n<li>Organizational Development Directors</li>\r\n<li>Employees and non-HR Managers</li>\r\n</ul>\r\n', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '255 $', '100 $', '170 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CHRM-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CHRM-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'chrm.jpg');
INSERT INTO `org_subcategory` VALUES ('15', 'Certified Team Leader', '1', '<strong>CTL-001</strong>', '1', '1', '<p> Your success as a manager can often depend on how well your team operates. How are their problem-solving skills? Are they enthusiastic and motivated to do their best? Do they work well together? There have been hundreds of studies demonstrating that human beings function better and learn better in groups. If you want to develop your team leadership skills and unleash the talent of your individual team members, this E-Course is a practical look at current leadership practices that work.</p>\r\n\r\n<p>Teams are an important building block of successful organizations. Whether the focus is on service, quality, cost, value, speed, efficiency, performance, or other similar goals, teams are the basic unit that supports most organizations. With teams at the core of corporate strategy, your success as an organization can often depend on how well you and other team members operate together. How are your problem-solving skills? Is the team enthusiastic and motivated to do its best? Do you work well together?</p>\r\n\r\n<p>Leaders also represent an important force in the North American economy. You have the power to turn on or turn off the productivity of the people who work for you. You are the crucial interface between the employee on the shop floor or the service desk and the managers of the organization. You usually have more experience and more skill than the employees you supervise, because management tends to look for super people to fill those roles.</p>\r\n\r\n<p>Our E-Course also covers Self-leadership which puts together taking responsibility for our outcomes, setting direction for our lives, and having tools to manage priorities. Self-leaders work at all levels of an organization. They are front-line workers in every possible role, middle managers, and CEOs. Self-leaders like Walt Disney and Wayne Gretzky worked hard to achieve their dreams without using the term self-leadership. However, they have clearly demonstrated that being in control of their behavior and results, focus, practice, and learning were necessary to achieve their goals.</p>\r\n\r\n<p>Self-leadership requires a commitment from individuals to decide what they want from life and to do whatâ€™s necessary to get the results they want. This one-day workshop will help participants internalize the four pillars of self-leadership and to make meaningful, empowered choices while taking action to get where they want to go.<br>\r\n</p>', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 70 Multiple Choice Questions out of which the candidate needs to score 80% (56 out of 70 correct) to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n\r\n<ol>\r\n<h6>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</h6>\r\n</ol>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n\r\n<h6>The Certified Team Leader (CTL) Certificate is valid for life</h6>\r\n\r\n', '<h6><strong>Module 1 â€“ Team Building </strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Types of teams</li>\r\n<li>The TORI model</li>\r\n<li>The Team Player Survey</li>\r\n<li>Organizations Today</li>\r\n<li>The Stages of Team Development</li>\r\n<li>Communication Skills</li>\r\n<li>Shared Leadership </li>\r\n<li>DeBonoâ€™s Thinking Hats</li>\r\n<li>Managing Team Conflict</li>\r\n<li>The Trust/Relationship Model</li>\r\n<li>Obtaining Consensus</li>\r\n<li>Team-Shaping Factors</li>\r\n<li>Team Problem-Solving</li>\r\n<li>SWOT Analysis</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Building Better Teams</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Defining teams</li>\r\n<li>Establishing team norms</li>\r\n<li>Working as a team</li>\r\n<li>Your team player type</li>\r\n<li>Building team trust</li>\r\n<li>The stages of team development</li>\r\n<li>Team building with TORI </li>\r\n<li>Communication</li>\r\n<li>Becoming a good team player</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 3 â€“ Leadership Skills</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Managing your time and energy</li>\r\n<li>What makes a good leader?</li>\r\n<li>Communication as a leadership tool</li>\r\n<li>The commitment curve</li>\r\n<li>Employee development models</li>\r\n<li>Dealing with conflict and difficult issues</li>\r\n<li>What successful leaders do</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 4 â€“  Self -Leadership</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>What is self-leadership?</li>\r\n<li>Knowing who you are</li>\r\n<li>Change management</li>\r\n<li>Knowing what you do</li>\r\n<li>Motivation for optimists</li>\r\n<li>Using what you know</li>\r\n</ul></h6>\r\n\r\n', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Managers and team leaders with responsibility for establishing and maintaining an effective and well-motivated team.</li>\r\n<li>Practicing or potential first line managers</li>\r\n<li>Middle managers from academic and professional/support services</li>\r\n<li>Anyone in a leadership position wishing to lead</li>\r\n</ul></h6>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '210 $', '70 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CTL-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CTL-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'ctl.jpg');
INSERT INTO `org_subcategory` VALUES ('16', 'Certified Professional Supervisor', '1', '<strong>CPS-001</strong>', '1', '1', '<p> This Certified Professional Supervisor (CPS) is designed to help you overcome many of the supervisory problems you will encounter in your first few weeks as a boss, whether you are a team leader, a project manager, or a unit coordinator. Dealing with the many problems a new supervisor encounters isnâ€™t easy, but it doesnâ€™t have to lead to discouragement.</p>\r\n\r\n<p>In todayâ€™s changing workplace, many new supervisors are unsure of their roles and responsibilities. They have little experience dealing with the challenges of managing work through others. They havenâ€™t had the opportunity to develop those critical skills of planning work, leading their group, and communicating with their employees, their colleagues, and their manager. Our E-Course will give you just that opportunity.</p>\r\n\r\n<p>Effective delegation is one of the most valuable skills you can master. It reduces your workload and develops employee skills. Delegating prepares employees who work for you to be able to handle your responsibilities and simultaneously allows you to advance to other career opportunities within your organization.</p>\r\n\r\n<p>Delegation is often one of the hardest skills for a manager to master. However, the skill can be learned. The CPS Module 3 will explore many of the facets of delegation, including when to delegate and to whom to delegate. We will also go through the delegation process step by step and learn about techniques to overcome problems.</p>\r\n\r\n<p>Coach, Role Model, Counselor, Supporter, Guideâ€¦do these words ring a bell? Being a coach involves being a role model, sometimes a counselor or supporter, and always a guide. Coaching is based on a partnership that involves giving both support and challenging opportunities to employees. Knowing how and when to coach is an essential skill that can benefit both you and your organization.</p>\r\n\r\n<p>Supervisors represent an important force in the North American economy. You have the power to turn on or turn off the productivity of the people who work for you. You are the crucial interface between the employee on the shop floor or the service desk and the managers of the organization. You usually have more experience and more skill than the employees you supervise, because management tends to look for super people to fill those roles.<br>\r\n</p>', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 70% (70 out of 100 correct) to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n\r\n<h6>The total duration of the exam is 1 hour 30 minutes (90 Minutes)</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n\r\n<ol>\r\n<h6>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n</h6>\r\n<h6>\r\n<li>The exam can be taken any number of times.</li>\r\n</h6>\r\n</ol>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n\r\n<h6>The Certified Professional Supervisor (CPS) Certificate is valid for life</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Credits </strong></p>\r\n\r\n<h6>Successfully passing the CPS exam will also earn candidates a total of 70 Credits towards MBA Supervisor (Masterâ€™s Degree) offered by Charisma University. </h6>\r\n\r\n', '<h6><strong>Module 1 â€“ Foundation</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Pre-assignment review</li>\r\n<li>Making the transition</li>\r\n<li>Responsibilities of a supervisor</li>\r\n<li>Setting goals</li>\r\n<li>Planning for success</li>\r\n<li>Listening skills</li>\r\n<li>Asking questions</li>\r\n<li>Giving feedback</li>\r\n<li>Ask for what you want</li>\r\n<li>Giving instructions</li>\r\n<li>Orders, requests, and suggestions</li>\r\n<li>Managing conflict</li>\r\n<li>Dealing with difficult employees</li>\r\n<li>Dealing with others</li>\r\n<li>The reciprocal quality of relationships</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Supervisor Professional</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Adjusting to your role</li>\r\n<li>A supervisorâ€™s responsibilities</li>\r\n<li>Making plans</li>\r\n<li>Setting goals</li>\r\n<li>Leadership</li>\r\n<li>The Situational Leadership model</li>\r\n<li>Problem employees</li>\r\n<li>Synergy</li>\r\n<li>Trust</li>\r\n<li>Team development</li>\r\n<li>Communication skills</li>\r\n<li>The communication process</li>\r\n<li>Motivation</li>\r\n<li>Orientation</li>\r\n<li>Training</li>\r\n<li>Providing feedback</li>\r\n<li>Delegation</li>\r\n<li>Dealing with conflict</li>\r\n<li>Discipline</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 3 â€“ Performance Management</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>The shared management model</li>\r\n<li>Setting goals</li>\r\n<li>Phase I (Preparation)</li>\r\n<li>Phase II (Activation)</li>\r\n<li>Phase III (Ongoing and Formal Evaluation)</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 4 â€“ Delegation</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Why delegate? What is delegation?</li>\r\n<li>Pre-assignment review</li>\r\n<li>Picking the right person</li>\r\n<li>The delegation meeting</li>\r\n<li>Giving instructions</li>\r\n<li>Monitoring delegation</li>\r\n<li>Practicing delegation</li>\r\n<li>Giving feedback</li>\r\n<li>Becoming a good delegator</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 5 â€“ Coaching</strong></h6>\r\n\r\n<ul>\r\n<li>Defining coaching</li>\r\n<li>The two schools of coaches</li>\r\n<li>Five critical coaching skills</li>\r\n<li>Communications skills</li>\r\n<li>Non-verbal communication</li>\r\n<li>Johari Windows</li>\r\n<li>Learning styles and principles</li>\r\n<li>Methods of feedback</li>\r\n<li>Benefits/consequences approach</li>\r\n<li>Dealing with problem employees</li>\r\n<li>When not to coach</li>\r\n\r\n</ul>\r\n\r\n<h6><strong>Module 6 â€“ Leadership Skills for Supervisors</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Managing your time and energy</li>\r\n<li>What makes a good leader?</li>\r\n<li>Communication as a leadership tool</li>\r\n<li>The commitment curve</li>\r\n<li>Employee development models</li>\r\n<li>Dealing with conflict and difficult issues</li>\r\n<li>What successful leaders do</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 7 â€“ Conference and Event Management</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Event planning essentials</li>\r\n<li>Budgeting basics and managing contracts</li>\r\n<li>Using the committee approach</li>\r\n<li>Connecting with partners and sponsors</li>\r\n<li>Advertising and marketing</li>\r\n<li>Selecting the venue</li>\r\n<li>Feeding the masses and business etiquette</li>\r\n<li>Celebrating diversity</li>\r\n<li>Selecting speakers and a master of ceremonies</li>\r\n<li>Adding the finishing touches</li>\r\n<li>Event day roles</li>\r\n<li>Closing the event and gathering feedback</li>\r\n</ul></h6>', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>Both new and experienced supervisors in any field.</li>\r\n</ul>\r\n', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '213 $', '100 $', '170 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CPS-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSP-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cps.jpg');
INSERT INTO `org_subcategory` VALUES ('17', ' Certified Critical Thinking and Research Analyst', '1', '<strong>CCTRA-001</strong>', '1', '1', '<p> In todayâ€™s society, many people experience information overload. We are bombarded with messages to believe various ideas, purchase things, support causes, and lead our lifestyle in a particular way. How do you know what to believe? How do you separate the truth from the myths?</p>\r\n\r\n<p>The answer lies in critical thinking skills. The ability to clearly reason through problems and to present arguments in a logical, compelling way has become a key skill for survival in todayâ€™s world.</p>\r\n\r\n<p>In this age of information overload, it can be hard to know where to find good information that you can trust. If youâ€™re doing research for an important project, report, or proposal, how do you find information that you can count on?</p>\r\n\r\n<p>A research analyst is a professional who is responsible for reviewing, collecting, and reporting on a variety of data sets and information sources. Analysts are very common in the sciences, particularly in pharmaceutical research, though they exist in almost any discipline that deals with data or information assessment over time. In most cases, research analysts have at least graduate-level education, as well as a great deal of experience within their subject area. Their reports are often used to drive new innovations or direct future developments.</p>\r\n\r\n<h6 style=\"margin-bottom: 5px;\"><strong>Areas of Work</strong></h6>\r\n\r\n<p>Work for research analysts is most plentiful in disciplines that rely on data for making decisions. The financial and banking industries, as well as many business strategists, hire analysts with some regularity. There also tend to be plentiful openings in the sciences, where test results and experimental outcomes must be documented, analyzed, and often codified.</p>\r\n\r\n<h6 style=\"margin-bottom: 5px;\"><strong>Main Goals and Purposes</strong></h6>\r\n\r\n<p>Most researchers work as members of information-gathering teams. They correlate and analyze data both internally and externally, and validate information against trade publications and other leading papers in order to provide support and validity to current theories or hypotheses.</p>\r\n\r\n<p>Analysts typically compile the data they find into comprehensive reports for executives and, in some cases, corporate shareholders. Detailed data sets are usually very important when it comes to learning from the past and making reasoned predictions about the future. Executives often use the information in analystsâ€™ reports to make decisions about investments and new projects.<br>\r\n</p>\r\n\r\n', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score 70% (28 out of 40 correct) to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam</strong></span></h6>\r\n\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Closed Book</span></strong></span></h6>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><br>\r\n<strong>Retaking of exam</strong></span></h6>\r\n\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Certification Validity</strong></span></h6>\r\n\r\n<h6>The Certified Critical Thinking and Research Analyst (CCTRA) Certificate is valid for life</h6>\r\n', '<h6><strong>Module 1 â€“ Critical Thinking</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Understanding critical thinking</li>\r\n<li>Other types of thinking </li>\r\n<li>Pitfalls to reasoned decision making</li>\r\n<li>Critical thinking process</li>\r\n<li>A critical thinkerâ€™s skill set</li>\r\n<li>Creating explanations</li>\r\n<li>Dealing with assumptions</li>\r\n<li>Common sense</li>\r\n<li>Critical and creative thought systems</li>\r\n<li>Presenting powerful arguments</li>\r\n<li>Putting it into practice</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Research Skills</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Why are research skills important?</li>\r\n<li>Basic skills (reading, note-taking, and recall)</li>\r\n<li>Planning your research strategy</li>\r\n<li>Where to look and what to look for</li>\r\n<li>Finding information the old-fashioned way</li>\r\n<li>Researching with the internet</li>\r\n<li>Getting ready to write</li>\r\n<li>Putting pen to paper</li>\r\n</ul></h6>\r\n\r\n', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>This certification is applicable to leaders and managers at all levels and other people that wrestle with complex problems as part of their job.</li>\r\n<li>This certification is designed for managers who are interested in refining their research skills.</li>\r\n</ul>\r\n\r\n', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '175 $', '75 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CCTRA-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CCTRA-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cctra.jpg');
INSERT INTO `org_subcategory` VALUES ('18', 'Certified Sales and Marketing Professional ', '1', '<strong> CSMP-001</strong>', '1', '1', '<p>Certified Sales and Marketing Professional (CSMP)â„¢ Certification indicates a high level of professionalism to both coworkers and customers, increasing your value in the market place.</p>\r\n\r\n<p>Small Marketing Budget doesnâ€™t mean you canâ€™t meet your goals and business objectives â€“ you just have to be more creative in your marketing tactics. This one-day workshop will show you how to get maximum exposure at minimum cost. Learn effective, low-cost, and non-cost strategies to improve sales, develop your companyâ€™s image, and build your bottom line, the first module of the CSMP exactly deals with the same</p>\r\n\r\n<p>The CSMP deals with Body language which can make or break your efforts to establish long, trusting relationships. Your body language can help to reinforce and add credibility to what we say, or it can contradict our words. Understanding what signals you are sending, as well as being able to read the signals that your clients send, is an essential skill in sales and throughout our lives. What is your body language saying about you? Find out more as to what the CSMP has to offer for those who want to start a career or wish to have a certification on Sales and Marketing.</p>\r\n\r\n<p><strong>Leadership</strong> â€” Sales Certification and Marketing Certification signifies you are dedicated to continuous improvement of yourself and your staff.</p>\r\n\r\n<p><strong>Recognition</strong> â€” Only the top sales and marketing professionals seek sales certification and marketing certification, indicating that you are a leading sales and marketing professional.</p>\r\n\r\n<p><strong>Knowledge</strong> â€” Sales Certification and Marketing Certification improves your understanding of the most current sales and marketing processes and trends.</p>\r\n\r\n<p>Who should take the <strong>Certified Sales and Marketing Professional Exam and Why?</strong></p>\r\n\r\n<p><strong>Corporate Members (Sales Managers, Marketing Managers, Executives)</strong></p>\r\n\r\n<ul>\r\n<li>An additional credential on the resume for promotion or job transfer;</li>\r\n<li>Validation of knowledge in the areas of sales and/or marketing;</li>\r\n<li>Possible group training program for sales force or marketing staff;</li>\r\n<li>If group study is used, an additional opportunity to network with other soon-to-be certified professionals</li>\r\n</ul>\r\n\r\n<p><strong>Small Business Owners and Managers</strong></p>\r\n\r\n<ul>\r\n<li>An educational opportunity which is less expensive and tedious than a degree program;</li>\r\n<li>Validation of knowledge in the areas of sales and/or marketing;</li>\r\n<li>If group study is used, an additional opportunity to network with other soon-to-be certified professionals</li>\r\n</ul>\r\n\r\n<p><strong>Consultants</strong></p>\r\n\r\n<ul>\r\n<li>An additional credential on the bio or brochure that will help to attract business;</li>\r\n<li>Validation of knowledge in the areas of sales and/or marketing;</li>\r\n<li>An educational opportunity which is less expensive and tedious than a degree program;</li>\r\n<li>If group study is used, an additional opportunity to network with other soon-to-be certified professionals</li>\r\n</ul>\r\n\r\n<p><strong>Service Providers</strong></p>\r\n\r\n<ul>\r\n<li>If group study is used, an additional opportunity to network with other soon-to-be certified professionals;</li>\r\n<li>An additional credential on the resume for promotion or job transfer;</li>\r\n<li>Validation of knowledge in the areas of sales and/or marketing;</li>\r\n<li>An educational opportunity which is less expensive and tedious than a degree program</li>\r\n</ul>\r\n\r\n<p><strong>Sales Representatives, Account Managers, Business Development, Distributor Representatives</strong></p>\r\n\r\n<ul>\r\n<li>Validation of knowledge in the area of sales giving you possible preference over non-certified competitors</li>\r\n<li>Signifies you are a professional and adds a credential on the resume for promotion or job transfer;</li>\r\n<li>If group study is used, an additional opportunity to network with other soon-to-be certified professionals</li>\r\n</ul>\r\n\r\n<p>The Certified Sales and Marketing Professional Certification program will award the coveted â€œCSMPâ€ designation which the certified professional can place on their business cards and stationery. (Example: Mark Peter, CSMPâ„¢) This designation is a great door-opener and conversation starter during prospecting or sales calls, as the exam is designed by the real time marketing managers and sales tycoons who have earned a great fame and repute in marketing and sales segments.</p>\r\n\r\n<p>The Certified Sales and Marketing Professional (CSMP)â„¢ Certification program is designed to ensure that those completing the program have successfully demonstrated knowledge and understanding of the core competencies.</p>\r\n', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 80 Multiple Choice Questions out of which the candidate needs to score 70% (56 out of 80 correct) to pass.</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Duration of exam</strong></p>\r\n\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n\r\n<h6><span style=\"text-decoration: underline;\"><strong>Retaking of exam</strong></span></h6>\r\n\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n\r\n<h6>The Certified Sales and Marketing Professional (CSMP)â„¢ is valid for life</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Credits </strong></p>\r\n\r\n<h6>Successfully passing the CSMP exam will also earn candidates a total of 60 Credits towards MBA in Sales and Marketing (Masterâ€™s Degree) offered by Charisma University. </h6>\r\n', '<h6><strong>Module 1 â€“ Marketing and Sales</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Defining Marketing</li>\r\n<li>Recognizing Trends</li>\r\n<li>Market Research</li>\r\n<li>Strategies for Success</li>\r\n<li>Mission Statements</li>\r\n<li>Brochures</li>\r\n<li>Trade Shows</li>\r\n<li>Developing a Marketing Plan</li>\r\n<li>Increasing Business</li>\r\n<li>Saying No to New Business</li>\r\n<li>Advertising</li>\r\n<li>Networking</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Body Language</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Body language</li>\r\n<li>Give me some space!</li>\r\n<li>Whatâ€™s your face saying?</li>\r\n<li>Whatâ€™s your body saying?</li>\r\n<li>Mirroring and leading</li>\r\n<li>Monitoring your posture</li>\r\n<li>Dressing up</li>\r\n<li>Shaking hands</li>\r\n<li>Role plays and interactive activities</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 3 â€“ Dynamite Sales Presentations</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Getting down to business</li>\r\n<li>Writing your proposal</li>\r\n<li>Getting thoughts on paper</li>\r\n<li>Proposal formats</li>\r\n<li>Expert editing tips</li>\r\n<li>The handshake</li>\r\n<li>Getting ready for your presentation</li>\r\n<li>Elements of a successful presentation</li>\r\n<li>Dressing appropriately</li>\r\n<li>Presentations</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 4 â€“ Building Relationships for Success in Sales</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Focusing on your customer</li>\r\n<li>What influences people in forming relationships?</li>\r\n<li>Disclosure</li>\r\n<li>How to win friends and influence people</li>\r\n<li>Communication skills for relationship selling</li>\r\n<li>Non-verbal messages</li>\r\n<li>Managing the mingling</li>\r\n<li>The handshake</li>\r\n<li>Small talk and networking</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 5 â€“ Marketing with Social Media</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>What is social media?</li>\r\n<li>Understanding the marketing mix</li>\r\n<li>Developing a social media plan</li>\r\n<li>Building your social media team</li>\r\n<li>Using social media to build internal communities</li>\r\n<li>Analyzing your impact with metrics</li>\r\n<li>Keeping on top of the trends</li>\r\n<li>Damage control</li>\r\n<li>Using Facebook, LinkedIn, and Twitter</li>\r\n<li>Building a blog or vlog (including using YouTube)</li>\r\n<li>Using specialty sites (e.g. Pinterest and Yammer)</li>\r\n<li>Using social media management tools</li>\r\n<li>Launching your plan</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 6 â€“ Basic Internet Marketing</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Defining Internet marketing</li>\r\n<li>Creating an Internet marketing plan</li>\r\n<li>Extending your influence</li>\r\n<li>E-mail marketing</li>\r\n<li>Search engine optimization (SEO)</li>\r\n<li>Advertising online</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 7 â€“ Telemarketing</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Verbal communication</li>\r\n<li>To serve and delight</li>\r\n<li>Exceptional things about telephone sales</li>\r\n<li>Building trust</li>\r\n<li>Negotiation primer</li>\r\n<li>Communication essentials</li>\r\n<li>Developing your script</li>\r\n<li>Pre-call planning</li>\r\n<li>Phone tag and call backs</li>\r\n<li>Following up and closing the sale</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 8 â€“ Branding</strong></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>Defining branding</li>\r\n<li>Creating a mission and vision</li>\r\n<li>Positioning your brand and developing your style</li>\r\n<li>Developing a brand name and slogan</li>\r\n<li>Creating a visual identity</li>\r\n<li>Living your brand and connecting with customers</li>\r\n<li>Launching your brand</li>\r\n<li>Taking your brandâ€™s pulse</li>\r\n<li>Measuring brand health with a balanced scorecard, SWOT analysis, and Middletonâ€™s brand matrix</li>\r\n<li>Interpreting evaluation results</li>\r\n</ul></h6>\r\n', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>Corporate Members (Sales Managers, Marketing Managers, Executives)</li>\r\n<li>Small Business Owners and Managers</li>\r\n<li>Consultants</li>\r\n<li>Service Providers</li>\r\n<li>Sales Representatives, Account Managers, Business Development, Distributor Representatives</li>\r\n</ul>\r\n', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '210 $', '75 $', '170 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CSMP-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSMP-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'csmp1.jpg');
