INSERT INTO `org_subcategory` VALUES ('21', ' Certified Information Security Professional', '2', '<strong>CISP-001</strong>', '1', '1', ' <p>The Certified Information Security Professional (CISP)â„¢ on Information Systems certification program is directed towards senior level personnel in the information processing industry, If you plan to build a career in information security â€“ one of todayâ€™s most visible professions â€“ and if you have at least five full years of experience in information security, then the CISP credential should be your next career goal. Itâ€™s the credential for professionals who develop policies and procedures in information security.</p>\r\n\r\n<p>Information security, sometimes shortened to InfoSec, is the practice of defending information from unauthorized access, use, disclosure, disruption, modification, perusal, inspection, recording or destruction. It is a general term that can be used regardless of the form the data may take (electronic, physical, etcâ€¦)</p>\r\n\r\n<p>The ubiquity of computers and internet in the life of human beings has enabled chance, motive and means to do harm. With such endangers in front of us, it becomes necessary security for security professionals, to learn about how manage computer and information security aspects. Hence this course provides methods to develop new framework for information security, overview of security risk assessment and management and security planning in an organization.</p>\r\n\r\n<p>Governments, military, corporations, financial institutions, hospitals, and private businesses amass a great deal of confidential information about their employees, customers, products, research and financial status. Most of this information is now collected, processed and stored on electronic computers and transmitted across networks to other computer (source wikipedia)</p>\r\n\r\n<p>Due to the difficulty of this certification and the knowledge required to pass the exam, the CISP title carries great weight in the job market. For IT professionals looking to move up on the corporate ladder, this certification can give the extra boost that is needed to move from field work into management positions.</p>\r\n\r\n\r\n', ' <p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (70 out of 100 correct) to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n\r\n<h6>The total duration of the exam is 2 hours (120 Minutes)</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6><span style=\"text-decoration: underline;\"><strong>Certification Validity</strong></span></h6>\r\n\r\n<h6>The Certified Information Security Professional (CISP)â„¢ is valid for 5 years, the candidate needs to re-certify once in 5 years to maintain the certification credentials.</h6>\r\n\r\n', ' <h4>Introduction to Information Security</h4>\r\n\r\n<h6>\r\n<ul>\r\n<li>The Need for Security </li>\r\n<li>Legal, Ethical, and Professional Issues in Information Security </li>\r\n<li>Risk Management </li>\r\n<li>Planning for Security </li>\r\n<li>Physical Security </li>\r\n<li>Understand how security professionals protect their assets. </li>\r\n</ul></h6>\r\n\r\n<h4>Computer Network Security</h4>\r\n\r\n<h6>\r\n<ul>\r\n<li>Introduction to Computer Networks</li>\r\n<li>What is Network Security?</li>\r\n<li>LAN Security</li>\r\n<li>Wireless Network Security</li>\r\n<li>GSM Network Security</li>\r\n<li>Security Protocols</li>\r\n<li>Attack and defense in Internet</li>\r\n<li>Firewalls</li>\r\n<li>Intrusion Detection System (IDS)</li>\r\n</ul></h6>\r\n\r\n<h4>Cryptography</h4>\r\n\r\n<h6>\r\n<ul>\r\n<li>Basic Concepts of Cryptography</li>\r\n<li>Symmetrical and asymmetrical cryptosystems</li>\r\n<li>Different Types of Algorithms</li>\r\n<li>Uses of Cryptography</li>\r\n<li>Digital Signatures</li>\r\n<li>Digital Certificates</li>\r\n<li>Digital Certification</li>\r\n<li>Key Management in Cryptography</li>\r\n</ul></h6>\r\n\r\n<h4>Computer System Security</h4>\r\n\r\n<h6>\r\n<ul>\r\n<li>Principles of Computer Systems Security</li>\r\n<li>Policies and Procedures in Computer Systems Security</li>\r\n<li>Operating System Security in Windows and UNIX</li>\r\n<h6>\r\n</h6></ul>\r\n</h6>\r\n\r\n<h4>Software Development Security</h4>\r\n\r\n<h4>Systems Architecture and Design</h4>', ' <h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>IT consultants\r\n</li><li>Managers</li>\r\n<li>Security policy</li>\r\n<li>Privacy officers</li>\r\n<li>Information Security Officers</li>\r\n<li>Network Administrators</li>\r\n<li>Security Device Administrators</li>\r\n<li>Security engineers</li>\r\n</ul>\r\n', 'Exam Voucher', 'To Register for an Exam', '-', '-', '-', 'Valid for Eight (8) Months', '-', '-', '-', '-', '170 $', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', '-', '-', 'cisp.jpg');
INSERT INTO `org_subcategory` VALUES ('22', 'Certified Scrum Master', '2', '<strong>CSM-001</strong>', '1', '1', '<p><strong>What is Scrum?</strong></p>\r\n\r\n<p>Scrum is an iterative and incremental agile software development method for managing software projects and product or application development.</p>\r\n\r\n<p>Software Professionals all over the world are passionate about Scrum. However, Scrum is not hype in IT industry. Scrum is an Agile Project Management Framework to develop great products that customers love.</p>\r\n\r\n<p>Scrumâ€™s powerful and astonishing influence on people and projects take its roots from the Manifesto of Agile Software Development (Agile Manifesto) which values:</p>\r\n\r\n<p>Individuals and Interactions over processes and tools,<br>\r\nWorking Software over comprehensive documentation,<br>\r\nCustomer Collaboration over contract negotiation,<br>\r\nResponding to Change over following a planâ€¦</p>\r\n\r\n<p><strong>Who is a Certified Scrum Master (CSM)<sup>Â®</sup>?</strong></p>\r\n\r\n<p>The CSM certification is only granted to individuals who have demonstrated an acceptable level of knowledge on an assessment. As a result, all of our certification granting assessments have stringent requirements for passing before a certification is granted</p>\r\n\r\n<p><strong>Why Certified Scrum Master (CSM)<sup>Â®</sup>?</strong></p>\r\n\r\n<p>According to the latest data, the annual salary of a ScrumMaster now surpasses that of a Project Manager.<br>\r\nEven more surprising, is just how quickly the ScrumMaster salaries have increased in such a short amount of time. As you may remember, I performed similar job research in Oct 2009 when the ScrumMaster role pulled in around $88,000 a year.<br>\r\nScrumMasters now make on average $95,000 a year, which is a $7,000 increase.</p>\r\n\r\n<p><img class=\"aligncenter\" src=\"../wp-content/uploads/2012/11/graph_image.jpg\" alt=\"\" width=\"500\" height=\"290\"></p>\r\n\r\n<p>On the other hand, Project Manager Salaries seem to have become stagnant, showing no visible signs of improvement. Even the ambiguous Agile Project Manager salary seems to have hit a glass ceiling. With the Scrum Master in such high demand, can we expect these salaries to sustain this sort of growth in an economy that may be dipping into yet another recession?<br>\r\n</p>', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The Exam contains 40 Multiple Choice Questions and you must correctly answer 28 (28 out of 40 correct) to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n\r\n<h6>If a Candidate does not pass the exam in the first (1st) attempt, the candidate must wait for a period of at least seven (7) calendar days from the date of their attempt to retake the exam for second (2nd) time or any subsequent time. The exam can be taken any number of times.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n\r\n<h6>The Certified Scrum Master (CSM)<sup>Â®</sup> Certificate is valid for life</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Trademark Acknowledgement</strong></h6>\r\n\r\n<h6>Certified Scrum Master (CSM)<sup>Â®</sup> is a Registered Trademark of GAQM.</h6>', '<h4>The history of Agile</h4>\r\n\r\n<ul>\r\n<li>The new project development game, Takeuchi &amp; Nonaka (1986)</li>\r\n<li>Agile frameworks (Scrum, XP, FDD, DSDM)</li>\r\n<li>Project pains</li>\r\n<li>Description of the general project management life cycle</li>\r\n<li>Brainstorming session regarding specific project pains (the list of â€œpainsâ€ is hanged on the wall and is reviewed during the workshop while verifying that Scrum can indeed provide a solution to each item)</li>\r\n</ul>\r\n\r\n<h4>Introduction to Scrum</h4>\r\n\r\n<h4>Planning &amp; estimation</h4>\r\n\r\n<h4>Roles &amp; responsibilities</h4>\r\n\r\n<h4>Ceremonies</h4>\r\n\r\n<h4>Articrafts</h4>\r\n\r\n<h4>Assimilation of Scrum</h4>\r\n\r\n<h4>Summarizing exercise</h4>\r\n', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>Team members</li>\r\n<li>Managers</li>\r\n<li>Project managers</li>\r\n<li>Developers</li>\r\n<li>Testers</li>\r\n<li>DBAs</li>\r\n</ul>\r\n', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '150 $', '60 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CSM-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSM-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'certified-scrum-master.jpg');
INSERT INTO `org_subcategory` VALUES ('23', 'Certified Ethical Hacker', '2', '<strong>CEH-001</strong>', '1', '1', '<p>A Certified Ethical Hacker (CEH)â„¢ is usually employed by an organization who trusts him or her to attempt to penetrate networks and/or computer systems, using the same methods as a hacker, for the purpose of finding and fixing computer security vulnerabilities. Unauthorized hacking (i.e., gaining access to computer systems without prior authorization from the owner) is a crime in most countries, but penetration testing done by request of the owner of the targeted system(s) or network(s) is not. A Certified Ethical Hacker is a professional who uses the same knowledge and tools as a malicious hacker, understands and knows how to look for the weaknesses and vulnerabilities in target systems and fortify them.</p>\r\n\r\n<p>The Certified Ethical Hacker (CEH) covers credible ethical hacking and network security-training program in order to meet the standards of well skilled security professionals. A large number of SMEs and authors have highly contributed towards the content presented in the GAQM courseware. The new package includes modern tools and exploits uncovered from the underground community. Expert researchers have made dedicated efforts to research the latest trends and uncovering the covert techniques used by the underground community. </p>\r\n\r\n<p>CEH certifications addresses all issues related to securing networks and information from hackers. CEH credential validates an Information Technology security professional as an ethical hacker or penetration tester. Getting Ethical Hacking training strengthens the capabilities of a person to safeguard companies and organizations against vulnerabilities and threats in mobile devices, Operating Systems, Wi-Fi or any network as well as preventing all efforts of illegal intrusion by hackers. Participants will have to understand perimeter defenses and then be led into scanning and attacking their own networks; no real network is harmed. Participants will then learn how intruders escalate privileges and the steps that can be taken to secure a system. Paticipants will also learn about Intrusion Detection, Policy Creation, Social Engineering, DDoS Attacks, Buffer Overflows and Virus Creation.</p>\r\n\r\n', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The Exam contains 100 Multiple Choice Questions and you must correctly answer 70 questions to pass the exam.</h6>\r\n\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n\r\n<h6>The total duration of the exam is 2 hours (120 Minutes)</h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n\r\n<h6>The Certified Ethical Hacker (CEH) Certificate is valid for life</h6>\r\n', '<h6>\r\n<ul>\r\n<lifootprinting &amp;=\"\" scanning<=\"\" li=\"\">\r\n<li>Enumeration &amp; System Hacking</li>\r\n<li>Trojans and Backdoors &amp; Sniffers</li>\r\n<li>DOS &amp; Social Engineering</li>\r\n<li>Session Hijacking &amp; Web Servers</li>\r\n<li>Web Applications &amp; Passwords</li>\r\n<li>SQL injection &amp; Wireless</li>\r\n<li>Hacking Wireless Networks</li>\r\n<li>Viruses &amp; Novell</li>\r\n<li>Linux &amp; Evasion</li>\r\n<li>Buffer Overflows &amp; Cryptology</li>\r\n</lifootprinting></ul></h6>\r\n', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>Security Officers</li>\r\n<li>Auditors</li>\r\n<li>Security Professionals</li>\r\n<li>Site Administrators</li>\r\n</ul>', 'Exam Voucher', 'To Register for an Exam', '-', '-', '-', 'Valid for Eight (8) Months', '-', '-', '-', '-', '210 $', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', '-', '-', 'certified-ethical-hacker.jpg');
INSERT INTO `org_subcategory` VALUES ('24', 'Certified Professional Trainer ', '2', '<strong>CPT-001</strong>', '1', '1', '<p>Certified Professional Trainer (CPT) is an international, vendor-neutral certification that covers core instructor skills, including preparation, presentation, communication, facilitation and evaluation in both a classroom and virtual classroom environment. It is a widely accepted qualification throughout the IT sector, Management and other training fields the Certified Professional Trainer (CPT) certification provides a springboard for any technical trainer.</p>\r\n\r\n<p>If you are thinking about becoming a trainer, or have started doing some training already and want to know more about what will help you to become an excellent trainer, our CPT Certification will help. The E-Learning is designed as an exploration of the essential skills that trainers need to develop, and to get you started in the learning process in an interactive and fun environment.</p>\r\n\r\n<p>People who work as trainers are often put into difficult situations without much understanding of what training is or how to do it well. We know that being a good trainer is the result of developing skills to bring information to an audience. This information will then engage, empower, and encourage continued learning and development. Our E-Learning course will give you the skills that you need so that your students not only learn, but also enjoy the process, retain information shared, and use their new skills back in the workplace.</p>\r\n\r\n<p>Behind every spectacular training session is a lot of preparation and meticulous attention to detail. The truly skilled trainer can make a program exciting. The learners will have fun while they are learning if the facilitator is able to involve their emotions as well as their minds. You will see the involvement, and you will feel the energy. To reach this stage as an adult educator isn’t always easy, but success isn’t just for the naturally gifted. It is possible for all of us who put effort into our personal growth and development. The E-Learning will help you reach that goal.<br>\r\n</p>\r\n', '<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n\r\n<h6>The exam comprises of 80 Multiple Choice Questions out of which the candidate needs to score 80% (64 out of 80 correct) to pass the exam.</h6>\r\n\r\n<h6><span style=\"text-decoration: underline; font-size: 13px;\"><span style=\"text-decoration: underline;\"><strong>Duration of exam</strong></span></span></h6>\r\n\r\n<h6>The total duration of the exam is 1 hour 10 Minutes (70 Minutes)</h6>\r\n\r\n<h6><span style=\"text-decoration: underline; font-size: 13px;\"><strong>Closed book</strong></span></h6>\r\n\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n\r\n<h6><span style=\"text-decoration: underline; font-size: 13px;\"><strong>Retaking of exam</strong></span></h6>\r\n\r\n<h6>\r\n<ul>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ul></h6>\r\n\r\n<h6><span style=\"text-decoration: underline; font-size: 13px;\"><strong>Certification Validity</strong></span></h6>\r\n\r\n<h6>The Certified Professional Trainer (CPT) Certificate is valid for life</h6>\r\n', '<strong>Module 1 – Survival Skills for the New Trainer</strong>\r\n\r\n<h6>\r\n<ul>\r\n<li>What makes a good trainer?</li>\r\n<li>Personal best, professional best</li>\r\n<li>Being genuine</li>\r\n<li>Assertiveness skills</li>\r\n<li>Asking the right questions</li>\r\n<li>Listening skills</li>\r\n<li>Connecting with people</li>\r\n<li>Defusing difficult participants</li>\r\n<li>Essentials for success</li>\r\n<li>Do’s and don’ts for new trainers</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>Module 2 – The Practical Trainer</strong></span></p>\r\n<ul>\r\n<li>Defining a successful training program/trainer</li>\r\n<li>Adult learning and the learning process</li>\r\n<li>Principles of adult learning</li>\r\n<li>Style assessment, including introvert/extrovert analysis</li>\r\n<li>Applying the learning cycle</li>\r\n<li>The training process (planning training, choosing methods, designing learning sequences)</li>\r\n<li>Adding games</li>\r\n<li>Setting the climate</li>\r\n<li>Presentation skills</li>\r\n<li>Dealing with difficult trainees</li>\r\n<li>On-the-job training</li>\r\n<li>Evaluation techniques</li>\r\n<li>Mock training presentations for peer review</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>Module 3 – Advanced Skills for the Practical Trainer</strong></span></p>\r\n<ul>\r\n<li>Preparing to learn and understanding learning</li>\r\n<li>Competencies for adult educators</li>\r\n<li>Accommodating learning preferences</li>\r\n<li>Increasing your expertise and using existing materials</li>\r\n<li>Planning a workshop, including preparing visual aids</li>\r\n<li>Effective communication (incl. questioning)</li>\r\n<li>Kirkpatrick’s levels of evaluation</li>\r\n<li>On-the-job support</li>\r\n<li>Managing stress and dealing with difficult situations</li>\r\n<li>Training in different forums (i.e. virtual learning)</li>\r\n<li>Mock training presentations</li>\r\n</ul>\r\n<p><strong><span style=\"color: #333333;\">Module 4 – Developing a Training Program</span><br>\r\n</strong></p>\r\n<ul>\r\n<li>Program design</li>\r\n<li>Identifying needs</li>\r\n<li>Training and instructional systems design models</li>\r\n<li>The program’s basic outline</li>\r\n<li>Evaluation strategies</li>\r\n<li>Researching and developing content</li>\r\n<li>Pre-assignments in training</li>\r\n<li>Choosing openings and energizers</li>\r\n<li>Training instruments, assessments, and tools</li>\r\n<li>Creating supporting materials</li>\r\n<li>Testing the program</li>\r\n<li>Creating proposals</li>\r\n<li>Building rapport</li>\r\n</ul></h6>\r\n\r\n', '<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n\r\n<ul>\r\n<li>This certification is ideal for trainers and presenters from all industries to improve their presentation skills.</li>\r\n<li>Trainers with experience of delivering content in a live face-to-face environment.</li>\r\n<li>TTraining specialists, learning facilitators and managers, master trainers, educators and other professionals who deliver training.</li>\r\n</ul>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '255 $', '100 $', '170 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CPT-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CPT-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'download.png');
INSERT INTO `org_subcategory` VALUES ('25', ' Certified Network Engineer', '2', ' <strong>CNEF-001</strong>', '1', '1', '<p>The exponential growth in networks in recent years has totally changed the way we work and play. We now demand instant communication with anyone via voice, text and video and immediate access to all kinds of information and services. The networks that make this possible involve a wide range of engineering challenges.</p>\r\n<p>The study of networking includes the network fundamentals, network elements, applications, content etc. that make up the service-enabling technologies. The Network Engineering will give students an understanding of the full range of modern communication technologies, network protocols and middleware required for modern networks. It will equip them with the expertise to design, build, configure and test modern networks and networked services.</p>\r\n<p><strong>About Network Engineer</strong></p>\r\n<p>A Network Engineer is an individual that is responsible for the maintenance of computer hardware and software systems that make up a computer network including the maintenance and monitoring of active data network or converged infrastructure and related network equipment.</p>\r\n<p>Network Engineers are generally mid-level support staff within an organization and do not typically get involved directly with users. Network Engineers focus upon network components within a companyâ€™s LAN/WAN infrastructure ensuring integrity. Depending on the company and its size, the Network Engineer may also design and deploy networks.</p>\r\n<p>Network engineers are responsible for installing, maintaining and supporting computer communication networks within an organisation or between organisations. Their goal is to ensure the smooth operation of communication networks in order to provide maximum performance and availability for their users, such as staff, clients, customers and suppliers.</p>\r\n<p>Network engineers may work internally as part of an organisationâ€™s IT support team or externally as part of an IT networking consultancy firm working with a number of clients.</p>\r\n<p>Other job titles used to refer to this kind of work include network support, support engineer, IT support engineer, helpdesk support, network administrator, first-line support, second-line support, and security engineer and network architect.<br>\r\n</p>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 50 Multiple Choice Questions out of which the candidate needs to score 70% (35 out of 50 correct) to pass the exam.</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam<br>\r\n</strong></span></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Closed Book</span></strong></span></h6>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Retaking of exam</strong></span></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Certification Validity</strong></span></h6>\r\n<p></p>\r\n<h6>The Certified Network Engineer (CNE) â€“ Foundation Level Certificate is valid for life</h6>\r\n<p></p>\r\n<p><span style=\"color: red;\">Note: The <strong>Certified Network Engineer (CNE) â€“ Foundation Level </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span></p>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><br>\r\n<span style=\"color: #333333;\"><strong>Module 1 : Information Networks</strong></span><p></p>\r\n<h6>\r\n<ul>\r\n<li>Basic Terms</li>\r\n<li>Advanced Terms</li>\r\n<li>Networking Basics</li>\r\n<li>Basic Internet Concepts</li>\r\n<li>Internet Security</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>Module 2 : Applications</strong></span></p>\r\n<ul>\r\n<li>Computers in the Workplace</li>\r\n<li>Tele-Commuting</li>\r\n<li>The Electronic World</li>\r\n<li>Ergonomics</li>\r\n<li>Safety and the Environment</li>\r\n</ul>\r\n<p><span style=\"color: #333333;\"><strong>Module 3 : Security</strong></span></p>\r\n<ul>\r\n<li>Being Proactive</li>\r\n<li>Identifying Yourself</li>\r\n<li>Protecting your Data</li>\r\n<li>Understanding Malware</li>\r\n<li>Protecting Against Malware</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\n<li>Small-to-Medium Business Network Engineers</li>\r\n<li>Networking professionals employed at corporations and government organization</li>\r\n<li>candidates who want to seek a new career in Network Engineer.</li>\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '200 $   ', '70 $	', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CNE-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CNE-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cne.jpg');
INSERT INTO `org_subcategory` VALUES ('26', 'Certified Hardware and Technology Engineer ', '2', '<strong>CHTE-001</strong>', '1', '1', '<p> Certified Hardware and Technology Engineer (CHTE) is a vendor-neutral certification that certifies the competency of service professionals in the computer industry. It is for anyone who wants an internationally recognized credential as a competent computer service professional.</p>\r\n\r\n<p><strong>What makes Certified Hardware and Technology Engineer (CHTE) different from other credentials is the strong support it has received from the computer industry.</strong></p>\r\n\r\n<ul>\r\n<li>Certified Hardware and Technology Engineer (CHTE) Certification is recognized and backed by all the leading manufacturers, vendors, service providers and professional bodies worldwide.</li>\r\n<li>Certified Hardware and Technology Engineer (CHTE) Certification is the only generic IT support qualification in the world!</li>\r\n<li>Achievement of Certified Hardware and Technology Engineer (CHTE) Certification shows that a person has the knowledge, skill and customer service skills necessary to successfully support PC equipment and users.</li>\r\n<li>Technical support, the focus of Certified Hardware and Technology Engineer (CHTE) certification, is the busiest area of IT.</li>\r\n</ul>\r\n\r\n<p><strong>Computer users â€“ intense, enthusiasts</strong></p>\r\n\r\n<p>Are you a user or PC enthusiast that needs to have a better appreciation of how computers work? Are you someone who needs to know how to install your own software, assemble your systems or troubleshoot your faulty PCs? Some are lucky when they adopt the â€œtrial and errorâ€ method, but most get their fingers burnt. You need to be equipped with standard skills and knowledge. You need to ensure that your installation and troubleshooting is done securely, skillfully and cost-effectively.</p>\r\n\r\n<p>We will take you through the inside and outside of a computer, into the operating system, and through some basic and advanced applications.</p>\r\n\r\n<p><strong>Newcomers who want to develop a career in IT and tech support.</strong></p>\r\n\r\n<p>Certified Hardware and Technology Engineer (CHTE) certification was specially designed for the tech support field. Technical support is the best area for a beginner to gain a good working knowledge of the basics of the IT profession. Hands-on experience gained especially in the area of problem solving is invaluable for starting an IT Career. PCs can be seen in every sphere of life now. What this means is that it is easier for a newcomer in tech support to get experience and get a foot in the door, as opportunities are virtually limitless. This is quite unlike a newcomer with skills in more complex applications that are not commonplace.</p>\r\n\r\n<p><strong>Technicians / Professionals in tech support that need a recognized validation of their skills and experience.</strong></p>\r\n\r\n<p>If youâ€™ve been working in tech support for sometime and youâ€™ve donâ€™t have the respect and recognition, you feel you deserve, you need to examine Certified Hardware and Technology Engineer (CHTE) to know if it is what you need. It is an external validation and measurement of your technical support skills and experience. Not only are you saying you are capable in Tech Support, but Certified Hardware and Technology Engineer (CHTE) , the worldâ€™s largest IT trade association is confirming your level of competence.</p>\r\n\r\n<p>Also as a professional on the field you might find that your experience, that is the work you do, limits your knowledge and exposure. A relevant certification program removes this limitation, by covering all standard areas in the particular field. In this way the certification increases your knowledge, augments your level of proficiency and enhances your personal productivity. Certified Hardware and Technology Engineer (CHTE) gives you comprehensive knowledge and skills of all key areas you need to know in tech support.</p>\r\n\r\n<p><strong>IT Professionals outside tech support that need tech support skills and certification to advance their careers.</strong></p>\r\n\r\n<p>A Certified Hardware and Technology Engineer (CHTE) is usually expected to carry out the following tasks:</p>\r\n\r\n<p>Installation and setup, Upgrading, Repairs, Troubleshooting, Maintenance of desktops, laptops, printers, and all other peripherals. Plus, you need to fully understand the network configurations and operating systems your users might be utilizing. And also the setup, training of users in the use of systems, as well as Software related tasks. Installation of software packages, upgrade and update of software, troubleshoot application and system errors, advice users on software use, train users, writing of training/user manuals, overseeing PC usage and so on.</p>\r\n\r\n<p>The focus of this piece has mainly been the technical aspect of Certified Hardware and Technology Engineer (CHTE) as a certification for tech support. Technical support, like every career area of IT has its personality requirements, as well as opportunities and challenges. Are you are interested in developing your career along this line? It makes sense for you to also have an insight into the associated challenges and prospects. With this you can take meaningful career decisions within the context of your career plan.<br>\r\n</p>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 80% (80 out of 100 correct) to pass the exam.</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam</strong></span></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour 10 Minutes (70 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Closed Book</span></strong></span></h6>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Retaking of exam</strong></span></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Certification Validity</strong></span></h6>\r\n<p></p>\r\n<h6>The validity period of Certified Hardware and Technology Engineer (CHTE)â„¢ Certificate is 5 years, the candidate needs to retake the exam to renew the Certified Hardware and Technology Engineer (CHTE)â„¢ Certificate once in 5 years to maintain the credentials intact.</h6>\r\n<p></p>\r\n<p><span style=\"color: red;\">Note: The <strong>Certified Hardware and Technology Engineer (CHTE)â„¢ </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span><br>\r\n</p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h4>Module 1 â€“ Foundation Level</h4>\r\n<p>	<strong>Basic Terms</strong></p>\r\n<h6>\r\n<ul>\r\n<li>Types of Computers</li>\r\n<li>Anatomy of a PC</li>\r\n<li>How a PC Works</li>\r\n</ul></h6>\r\n\r\n<p>	<strong>Hardware Devices</strong></p>\r\n<h6>\r\n<ul>\r\n<li>CPU and Memory</li>\r\n<li>Input Devices</li>\r\n<li>Output Devices</li>\r\n<li>Secondary Storage Devices</li>\r\n</ul></h6>\r\n\r\n<p>	<strong>Software Basics</strong></p>\r\n<h6>\r\n<ul>\r\n<li>Operating Systems and Applications</li>\r\n<li>How is Software Built?</li>\r\n<li>Types of Software</li>\r\n<li>Legal Issues</li>\r\n<li>How is Software Built?</li>\r\n</ul></h6>\r\n\r\n<h4>Module 2 â€“ Advanced Level</h4>\r\n<p></p>\r\n<p><strong>Module 2.1 â€“ Advanced Computing Part I</strong></p>\r\n<h6>\r\n<ul>\r\n<li>Working With the Computer</li>\r\n<li>First Steps</li>\r\n<li>Basic Tasks</li>\r\n<li>Using the Desktop</li>\r\n<li>Customizing Your Computer</li>\r\n<li>Printing</li>\r\n</ul></h6>\r\n\r\n<p><strong>Module 2.2 â€“ Advanced Computing Part II</strong></p>\r\n<h6>\r\n<ul>\r\n<li>Working with Files and Folders</li>\r\n<li>The Basics of Files and Folders</li>\r\n<li>Managing Files and Folders, Part I</li>\r\n<li>Managing Files and Folders, Part II</li>\r\n<li>Viewing File or Folder Properties</li>\r\n<li>Working With Files and Folders</li>\r\n<li>Compressed Files</li>\r\n</ul></h6>\r\n\r\n<h4>Module 3 â€“ Expert</h4>\r\n<p></p>\r\n<h6>\r\n<ul>\r\n<li>Application Basics</li>\r\n<li>Basic Applications</li>\r\n<li>Working with a Window</li>\r\n<li>Working with WordPad</li>\r\n<li>Working With Applications</li>\r\n<li>Basics of Web Browsers</li>\r\n<li>Browsing the Web</li>\r\n<li>Working with Bookmarks</li>\r\n<li>Working With Web Pages</li>\r\n<li>Printing Web Pages</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\n<li>IT Technicians</li>\r\n<li>Hardware Engineer</li>\r\n<li>Call Center Technician</li>\r\n<li>Desktop Support Technician</li>\r\n<li>Tier 1 &amp; 2 Support</li>\r\n<li>PC Support Technician</li>\r\n<li>Field Technician</li>\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '210 $', '85 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CHTE-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CHTE-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'chte.jpg');
INSERT INTO `org_subcategory` VALUES ('27', 'Certified PHP Professional', '2', '<strong>PHP-001</strong>', '1', '1', '<p> <strong>What is PHP?</strong><br>\r\nPHP is a powerful server-side scripting language for creating dynamic and interactive websites. PHP is the widely-used, free, and efficient alternative to competitors such as Microsoftâ€™s ASP.</p>\r\n\r\n<p>PHP is perfectly suited for Web development and can be embedded directly into the HTML code.</p>\r\n\r\n<p>SQL (Structured Query Language) is an ANSI (American National Standards Institute) standard for accessing database systems. SQL statements are used to retrieve and update data in a database.</p>\r\n\r\n<p>By mastering these subjects you will be able to develop and maintain dynamic and interactive web pages and also retrieve and update data from a database over the internet.</p>\r\n\r\n<p>The PHP Developer Certificate proves fundamental knowledge of web development using PHP and SQL (MySQL).</p>\r\n\r\n<p>The CPP certification for PHP Professionals assesses the candidate for developing PHP based applications. The certification tests the candidates on various areas in developing PHP based software which includes knowledge of installation, usage, syntax and semantics of PHP programming language.<br>\r\n</p>\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 70% (70 out of 100 correct) to pass the exam.</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam<br>\r\n</strong></span></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour 30 Minutes (90 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Closed Book</span></strong></span></h6>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Retaking of exam</strong></span></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Certification Validity</strong></span></h6>\r\n<p></p>\r\n<h6>The Certified PHP Professional (CPP) Certificate is valid for five (5) years, candidate needs to do the Certification Renewal E-Course for CPP to retain the Credentials intact.</h6>\r\n<p></p>\r\n<p><span style=\"color: red;\">Note: The <strong>Certified PHP Professional (CPP) </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span><br>\r\n</p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>Module 1 â€“ PHP Basics and Advanced</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction</li>\r\n<li>Technology and Infrastructure</li>\r\n<li>Installation</li>\r\n<li>Syntax</li>\r\n<li>Output Statements</li>\r\n<li>Inputs</li>\r\n<li>Variables</li>\r\n<li>Constants</li>\r\n<li>Datatypes</li>\r\n<li>Arrays</li>\r\n<li>Library Functions</li>\r\n<li>Looping Statements</li>\r\n<li>Global Variables â€“ Super Variables</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ PHP Forms</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Forms Validation</li>\r\n<li>Header and Redirection</li>\r\n<li>File Handling</li>\r\n<li>Cookies</li>\r\n<li>Sessions</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 3 â€“ PHP &amp;MYSQL</strong></h6>\r\n<p></p>\r\n<h6><strong>Module 4 â€“ PHP and Oops</strong></h6>\r\n<ul>\r\n<li>Class and Objects</li>\r\n<li>Member Variables and Functions</li>\r\n<li>Constructors and Destructors</li>\r\n<li>Inheritance &amp; Polymorphism</li>\r\n<li>Methods (Public, Protected and Private)</li>\r\n<li>Visibility from other objects</li>\r\n\r\n</ul>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\n<li>This Course is intended for professionals and graduates wanting to excel in their chosen areas. It is also well suited for those who are already working and would like to take certification for further career progression.</li>\r\n<li>For employers, the certification provides skill verification tools that not only help assess a personâ€™s skills in PHP programming but also the ability to quickly complete on-the-job tasks across multiple programs.</li>\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '250 $', '100 $', '170 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=PHP-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CPP-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cpp.jpg');
INSERT INTO `org_subcategory` VALUES ('28', 'Certified Software Tester â€“ Foundation Level', '3', '<strong>CTFL</strong>', '1', '1', '<p>The Certified Software Tester â€“ Foundation Level Exam is a first step in your career. You are not obligated to have testing experience. What you need is to understand is the general types of applications. The main goals are to ensure a broad understanding of the key concepts in software testing and provide a foundation for a future career growth. Another goal is to understand key concepts in software testing to advance level.</p>\r\n\r\n<p>In the Certified Software Tester â€“ Foundation Level Certification E-Course, youâ€™ll learn the basic skills required of a software test professional and how testing fits into software development. Find out what it takes to be a successful software tester and how testing can add significant value to software development projects via our E-Course which is one of the best among all in Software Testing.</p>\r\n\r\n<p>If you are exploring new career opportunities or want to stay current in the Software Testing field, our certification programs can provide you a focused career training and skill development for working professionals.</p>\r\n\r\n<p>The exam for the <strong>Foundation Level</strong> has a theoretical nature and requires knowledge of software development â€“ especially in the field of software testing.</p>\r\n\r\n<p>The Foundation Level Certification is also a prerequisite for the Intermediate Level Certification exam.<br>\r\n</p>\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score 65% (26 out of 40 correct) to pass the exam.</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Closed Book</strong></h6>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n<p></p>\r\n<h6>The Certified Software Tester â€“ Foundation Level Certificate is valid for life.</h6>\r\n<p>\r\n</p><p>\r\n<span style=\"color: red;\">Note: The <strong>Certified Software Tester â€“ Foundation Level </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span></p>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>1. The fundamentals of testing:</strong> Why is testing necessary? Harm caused by defects in software; root causes; testing and quality assurance; what is testing? General testing principles; Fundamental test process and the psychology of testing.</h6>\r\n<h6><strong>2. Testing throughout the software life cycle:</strong> Software development models; test levels, objectives, objects and targets of testing; functional, non-functional, structural and change-related testing; confirmation, regression and maintenance testing.</h6>\r\n<h6><strong>3. Static techniques:</strong> Reviews and the test process; typical formal review process; different types of review: informal review, technical review, walkthrough and inspection; static analysis tools.</h6>\r\n<h6><strong>4. Test design techniques:</strong> Identifying test conditions and designing test cases; equivalence partitioning; boundary value analysis; decision tables; state transition diagrams, use case testing; statement and decision coverage; control flows using statement testing and decision testing; experience based techniques; choosing techniques.</h6>\r\n<h6><strong>5. Business Analyst Skills Introduction to Business :</strong></h6>\r\n<ul>\r\n<li>Introduction to Business Process Analysis</li>\r\n<li>Why Business Analysis</li>\r\n<li>Roles and responsibilities of a Business Analyst</li>\r\n<li>Key concept of business analysis</li>\r\n<li>What is domain knowledge?</li>\r\n<li>How to adapt with different domains</li>\r\n</ul>\r\n<h6><strong>6. Test management:</strong> Test organization, planning and estimation; â€˜Standard for Software Test Documentationâ€™ (IEEE 829); exit criteria; test progress monitoring and control; metrics and reporting; configuration management; risk and testing; incident management; incident reporting.</h6>\r\n<h6><strong>7. Tool support for testing:</strong> Types of test tool; effective use of tools; potential benefits and risks; introducing tools.</h6>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\n<li>The Certified Software Tester â€“ Foundation Level certification is aimed at anyone involved in software testing and includes people in roles such as testers, test analysts, test engineers, test consultants, test managers, user acceptance testers and software developers.</li>\r\n<li>It is also appropriate for anyone who wants a basic understanding of software testing, such as project managers, quality managers, software development managers, business analysts, IT directors and management consultants.</li>\r\n<li>Holders of the Foundation Level Certificate will be able to go on to a higher level software testing (Intermediate and Advanced) certification</li>\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '250 $', '128 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=BH0-010', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CSTFL-001', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cste.jpg');
INSERT INTO `org_subcategory` VALUES ('29', 'Certified Software Tester â€“ Intermediate Level', '3', '<strong>CTIL</strong>', '1', '1', '<p>The Certified Software Tester Intermediate Level Exam is a second step in your career, if you are seeking an advanced level of career in the field of Software Testing than this is a right exam for you.</p>\r\n\r\n<p>The Intermediate Certificate in Software Testing examination is suitable for those who are engaged in any aspect of software testing. The topics covered are those which are considered to be essential knowledge for an advanced level test professional, regardless of their specialism (i.e. Test Analysis or Test Management).</p>\r\n\r\n<p>The exam for the Intermediate level has a blend of theoretical and practical applicability; the candidate has to demonstrate a high degree of knowledge in the field of software testing to pursue this certification. The Intermediate Level is also suited for those who are seeking career advancement in software testing after foundation level.</p>\r\n\r\n<p>The Intermediate Certificate in Software Testing is aimed at those who seek a more practical approach to the core software testing material covered at Foundation level. This Intermediate level software testing course is recommended for professionals associated with software testing in any way, or for those who are looking for a more practical approach towards concepts of testing.</p>\r\n\r\n<p>Our E-Learning Course&nbsp; is broken into bite-size lessons and combines leading edge multimedia and interactive exercises for optimum enjoyment and knowledge retention. The e-learning course also comprises of unique mock exam simulator which allows you to test and re-test your understanding of the Software Testing foundations and be confident for the exams.<br>\r\n</p>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score 70% (28 out of 40 correct) to pass.</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n<p></p>\r\n<h6>The Certified Software Tester â€“ Intermediate Level Certificate is valid for life</h6>\r\n<p></p>\r\n<p><span style=\"color: red;\">Note: The <strong>Certified Software Tester â€“ Intermediate Level </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span><br>\r\n</p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>Module 1 â€“ Overview of Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Introduction of Testing</li>\r\n<li>Significance of Testing</li>\r\n<li>Seven Testing Principles</li>\r\n<li>Physiology of testing</li>\r\n<li>Who can do testing?</li>\r\n<li>Skill sets for testing professionals</li>\r\n<li>Tasks handled by test professionals</li>\r\n<li>SDLC and phases of SDLC</li>\r\n<li>Life Cycle Modules</li>\r\n<li>Definition and use of Agile and Scrum</li>\r\n<li>What is build and build process?</li>\r\n<li>STLC</li>\r\n<li>Business Requirements</li>\r\n<li>What is FRD? </li>\r\n<li>Code of Ethics </li>\r\n<li>Advantages of Manual and Automatic Testing</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Test Plan</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>What is test plan?</li>\r\n<li>Objective, scope and Strategy of test plans</li>\r\n<li>How to write test plan?</li>\r\n<li>Test Case</li>\r\n<li>Test Case Specification</li>\r\n<li>Test Procedure Specification</li>\r\n<li>Test Log</li>\r\n<li>Test Incident Report</li>\r\n<li>Test Summary Report</li>\r\n<li>Software Metrics</li>\r\n<li>Types of Metrics</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 3 â€“ Test Case and Execution</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Test Case </li>\r\n<li>How to write effective test cases?</li>\r\n<li>Test case review</li>\r\n<li>Trace-ability matrix</li>\r\n<li>Defect or bug</li>\r\n<li>Bug Lifecycle</li>\r\n<li>Priority vs severity</li>\r\n<li>Causes of software defects</li>\r\n<li>How to write test cases</li>\r\n<li>Tracking and bug reporting</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 4 â€“ Test Review</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>What is test review</li>\r\n<li>Objective of reviews (Formal, Informal, Technical and Peer)</li>\r\n<li>Value of review</li>\r\n<li>Success factor for reviews</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 5 â€“ Types of Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Types of Testing (Manual and Automation)</li>\r\n<li>Methods of Testing (Black Box, White Box and Grey Box Testing)</li>\r\n<li>Levels of Testing </li>\r\n<li>Non-functional Testing</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\n<li>Software Testers who are engaged in any aspect of software testing.</li>\r\n<li>Candidates who are seeking a new career in the field of Software Testing after Foundation Level Certification</li>\r\n<li>Everyone building a career in software testing, such as testers, test analysts, test designers and test managers, as well as anyone looking for advanced level software testing knowledge, e.g. project managers, QA managers, system managers, development managers and others, will benefit from this certification.</li>\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days	', '20 Days', 'Valid for Eight (8) Months', '-', '-', '250 $', '128 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=BH0-007', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28BH0-007%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'cstil.jpg');
INSERT INTO `org_subcategory` VALUES ('30', ' Certified Software Testing Manager', '3', '<strong>Exam Code: CSTM<sup>Â®</sup></strong>', '1', '1', '<p><strong>About CSTM<sup>Â®</sup> Certification</strong></p>\r\n\r\n<p>The Certified Software Testing Manager (CSTM)<sup>Â®</sup> certification establishes a worldwide standard for the assessment of the capabilities and competencies of software testing professionals that are working at, or soon will work at, the software testing management level.</p>\r\n\r\n<p>Acquiring the designation of CSTM<sup>Â®</sup> indicates a level of professional competence in both the principles and practices of software testing, demonstrating the skills and capabilities necessary to manage the software test function. The CSTM<sup>Â®</sup> certification provides IT upper management a necessary tool to predict the likelihood of success of individuals applying for management level positions. The CSTM<sup>Â®</sup>certification also provides the IT professional with an objective assessment of their management skills.\r\n</p>\r\n\r\n<p>\r\nThe CSTM<sup>Â®</sup> Certification was developed based on the Test Management Body of Knowledge (TMBOK) to fill the gap in the management skills required by test managers and test leads to effectively manage the test process, the test project and the test organization. Specifically, CSTM<sup>Â®</sup> aims at the following objectives:</p>\r\n\r\n<ul>\r\n<li>Help individuals develop their test management skills through formal education</li>\r\n<li>Establish a common skill set for software test managers and test leads based on a well-defined Test Management Body of Knowledge</li>\r\n<li>Create a pool of qualified software test managers</li>\r\n<li>Prepare test professionals, especially those who achieved Master Level Certification, for management and lead positions in software testing projects</li>\r\n<li>Provide professional recognition and career enhancement for those who manage test projects</li>\r\n</ul>\r\n\r\n<h6><strong>The Test Management Process Map</strong></h6>\r\n\r\n<center><img alt=\"\" src=\"wp-content/uploads/2012/12/ctsm.png\"></center>\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (70 out of 100) to pass the exam.</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour 10 minutes (70 Minutes)</h6>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<h6><span style=\"text-decoration: underline;\"><strong>Retaking of exam</strong></span></h6>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong><strong>Certification Validity</strong></strong></h6>\r\n<p></p>\r\n<h6>The validity of the CSTM<sup>Â®</sup> Certifiate is for five (5) years, the candidate needs to either retake the exam or can complete the E-Course for CSTM<sup>Â®</sup> to accrue the number of continuing education units (CEUs) to renew the Certificate. Renewing the certificate will allow the candidate to retain the professional stature and credentials intact.</h6>\r\n<h6>Certificates must be renewed on or before the expiration date (when they become inactive) to be current.</h6>\r\n<p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Trademark Acknowledgement</strong></h6>\r\n<p></p>\r\n<h6>Certified Software Testing Manager (CSTM)<sup>Â®</sup> is a Registered Trademark of GAQM.</h6>\r\n<p></p>\r\n<p><span style=\"color: #ff0000;\">Note: The <strong>Certified Software Testing Manager (CSTM)<sup>Â®</sup> </strong> Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span></p>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Module Information</strong></p>\r\n<p></p>\r\n<h6>\r\n<ul>\r\n<li>Test Organization </li>\r\n<li>Test Organization And Independence </li>\r\n<li>Tasks Of The Test Leader And Tester </li>\r\n<li>Test Planning And Estimation </li>\r\n<li>Test Planning </li>\r\n<li>Test Planning Activities </li>\r\n<li>Exit Criteria </li>\r\n<li>Test Estimation </li>\r\n<li>Test Approaches (Test Strategies) </li>\r\n<li>Test Progress Monitoring And Control </li>\r\n<li>Test Progress Monitoring </li>\r\n<li>Test Reporting </li>\r\n<li>Test Control </li>\r\n<li>Configuration Management </li>\r\n<li>Risk And Testing </li>\r\n<li>Project Risks </li>\r\n<li>Product Risks </li>\r\n<li>Incident Management </li>\r\n<li>Testing Tools </li>\r\n<li>Management Understanding</li>\r\n<li>Independent Testing</li>\r\n<li>Testing in Project Management </li>\r\n<li>People issues in Testing </li>\r\n<li>Testing Tools </li>\r\n<li>Managing Expectations </li>\r\n<li>Areas of Recommendations </li>\r\n</ul>\r\n<p></p></h6></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\n<li>Any person who has worked in software testing for at least 3 years</li>\r\n<li>People with a management or leadership role in testing</li>\r\n<li>Development managers and development leads who wish to move to a test management or lead position</li>\r\n<li>Auditors, inspectors, and others who must evaluate the work product of the testing process</li>\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Premium Package with E-Course and Two (2) Exam Vouchers', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '40 Days', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '213 $', '300 $', '70 $', '170 $', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CSTM-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSTM%29', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSTM-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', 'cstm.jpg');
INSERT INTO `org_subcategory` VALUES ('31', ' Certified Software Testing Analyst', '3', '<h6 style=\"margin-bottom: 10px;\"><strong>CSTA-001</strong></h6>', '1', '1', '<p>The CSTA Certification provides the participant with a solid understanding of, and practical experience in, Test case design. Participantsâ€™ knowledge of the quality and the objective of software testing, the system development and quality assurance lifecycles and functional testing is reinforced. </p>\r\n\r\n<p>The focus of the CSTA Certification is on Test Case design and Participants are provided with ample opportunity to gain a solid understanding of this. Participants are also provided with an opportunity to design a quality assurance. In the E-Course Participants are presented with various techniques of trawling for requirements in the absence of proper system documentation; this includes context diagrams, dataflow diagrams, workshop facilitation and interviewing subject matter experts.</p>\r\n\r\n<p>Youâ€™ll also learn how to apply testing strategy in real-world situations gaining competency in the techniques essential for test analysis and performing outcome-driven test activities.</p>\r\n\r\n<p>The  Certified Software Testing Analyst (CSTA ) qualification is aimed at people who have achieved an advanced point of their careers in software testing.</p>\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (70 out of 100 correct) to pass the exam</h6>\r\n<p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam</strong></span></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour 30 Minutes (90 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Non-Proctored</span></strong></span></h6>\r\n<p></p>\r\n<h6>The Certified Software Testing Analyst (CSTA) Exam is currently available via Online Mode, You will need to schedule testing appointment by sending an email to candidate.registrations@gaqm.org once you are done with the E-Course. You can schedule an exam appointment date before forty eight (48) hours.</h6>\r\n<h6><strong>Kindly Note: </strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>1) After you schedule your examination, if you need to reschedule or cancel your examination date, you may do so up until 48 hours before the scheduled date and time without penalty. If you cancel within 48 hours of your appointment you will forfeit your examination fee and be required to pay a new examination fee in order to reschedule, the cost would be 80$.</h6>\r\n<h6>2) To cancel or to reschedule the exam, you need to send us an email at candidate.registrations@gaqm.org</h6>\r\n<h6>3) Non-proctored exams are available to be taken online whenever the candidate wishes to take them.</h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Certification Validity</strong></span></h6>\r\n<p></p>\r\n<h6>The Certified Software Testing Analyst (CSTA) Certificate is valid for life</h6>\r\n<p></p>\r\n<p><span style=\"color: #ff0000;\">Note: The <strong>Certified Software Testing Analyst (CSTA)</strong> Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam</span>.</p>\r\n<p></p></div>\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>Module 1 â€“ Testing Fundamentals and Process</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>1.1 Quick Overview on Testing</li>\r\n<li>1.2 Testing Lifecycle Process</li>\r\n<li>1.3 Testing in the SDLC</li>\r\n<li>1.4 Test Monitoring, Planning and Control</li>\r\n<li>1.5 Test Analysis</li>\r\n<li>1.6 Test Design</li>\r\n<li>1.7 Test Implementation</li>\r\n<li>1.8 Test Execution</li>\r\n<li>1.9 Evaluating Exit Criteria and Reporting</li>\r\n<li>1.10 Test Closure Activities</li>\r\n</ul>\r\n</h6><h6><strong>Module 2 â€“ Test Management for the Test Analyst</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>2.1 Test Progress Monitoring and Control</li>\r\n<li>2.2 Distributed, Outsourced and Insourced Testing</li>\r\n<li>2.3 Test Analystâ€™s Tasks in Risk-Based Testing</li>\r\n</ul>\r\n</h6><h6><strong>Module 3 â€“ Testing Software Quality Characteristics (Part 1)</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>3.1 Test Techniques </li>\r\n<li>3.2 Specification-Based Techniques</li>\r\n<li>3.3 Defect-Based Techniques</li>\r\n<li>3.4 Experience-Based Techniques</li>\r\n<li>3.5 Cause-effects graphs</li>\r\n<li>3.6 Equivalence partitioning</li>\r\n<li>3.7 Boundary Value</li>\r\n<li>3.8 Decision Table</li>\r\n<li>3.9 State Transition</li>\r\n<li>3.10 Pair wise Testing</li>\r\n<li>3.11 Case based Testing</li>\r\n<li>3.12 Mind Mapping</li>\r\n<li>3.13 Test Matrix</li>\r\n<li>3.14 Error Guessing Technique</li>\r\n<li>3.15 Checklist-based Technique</li>\r\n<li>3.16 Exploratory Testing</li>\r\n<li>3.17 Attacks</li>\r\n</ul>\r\n</h6><h6><strong>Module 4 â€“ Testing Software Quality Characteristics (Part 2)</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>4.1 Quality Characteristics for Business Domain Service</li>\r\n<li>4.2 Testing Characteristics</li>\r\n<li>4.3 Typical Defects</li>\r\n<li>4.4 Testing in the Life Cycle</li>\r\n<li>4.5 Approaches, Usability Requirements and Userâ€™s Expectations</li>\r\n</ul>\r\n</h6><h6><strong>Module 5 â€“ Review Preparation</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>5.1 Using Checklists in Reviews </li>\r\n<li>5.2 Analyze a use case or user interface and identify problems</li>\r\n<li>5.3 Analyze a requirements specification</li>\r\n<li>5.4 Types of review</li>\r\n<li>5.5 Roles and Responsibilities in Reviews</li>\r\n<li>5.6 Informal Review</li>\r\n<li>5.7 Management Review</li>\r\n<li>5.8 Analyze Requirements Specification or User Story</li>\r\n</ul>\r\n</h6><h6><strong>Module 6 â€“ Defect Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>6.1 Detecting Defects</li>\r\n<li>6.2 Defect Report Fields</li>\r\n<li>6.3 Non-functional Defects</li>\r\n<li>6.4 Defect Classification</li>\r\n<li>6.5 Identifying, Gathering and Recording Classification</li>\r\n<li>6.6 Root Cause Analysis</li>\r\n</ul>\r\n</h6><h6><strong>Module 7 â€“ Test Tools and Automation</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>7.1 Test Tools</li>\r\n<li>7.2 Test Analystâ€™s role in Keyword Driven Automation</li>\r\n<li>7.3 Troubleshooting</li>\r\n<li>7.4 Testing Tools Approaches</li>\r\n</ul>\r\n</h6><h6><strong>Module 8 â€“ Software Inspection Process</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>8.1 Software Inspection</li>\r\n<li>8.2 Testing Methods and Strategies</li>\r\n</ul>\r\n</h6><h6><strong>Module 9 â€“ Usability Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>9.1 Attribues</li>\r\n<li>9.2 Usability Testing Process</li>\r\n<li>9.3 Client/Server Testing</li>\r\n</ul>\r\n</h6><h6><strong>Module 10 â€“ Additional Test Design Technique</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>10.1 Static Analysis</li>\r\n<li>10.2 Dynamic Analysis</li>\r\n</ul>\r\n<p></p></h6></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<h6>\r\nThe CSTA is ideal for testers and test teams who are looking to build on their existing software testing skills.</h6>\r\n<h6>\r\n<ul>\r\n<li>Experienced Testers wanting to progress their hands-on advance testing skills.</li>\r\n<li>Test Managers wanting a better understanding of advanced testing skills.</li>\r\n<li>Testers wanting to accredit their advanced level skills for recognition among employers, clients and peers.</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', '-', '-', '-', '40 Days', '20 Days', '-', '-', '-', '250 $', '107 $', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CSTA-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSTA-001%29', '-', '-', '-', 'csta.jpg');
INSERT INTO `org_subcategory` VALUES ('32', ' Certified Software Quality Analyst', '3', '<h6 style=\"margin-bottom: 10px;\"><strong>CSQA-001</strong></h6>', '1', '1', '<p><strong>Software quality assurance</strong> is a means of monitoring the software engineering processes and methods used to ensure quality. The methods by which this is accomplished are many and varied, and may include ensuring conformance to one or more standards, such as ISO 9001, or a model such as CMMI or any other international best practices.</p>\r\n\r\n<p>Acquiring the designation of Certified Software Quality Analyst (CSQA) indicates a professional level of competence in the principles and practices of quality assurance in the IT profession. CSQA’s become members of a recognized professional group and receive recognition of their competence by business and professional associates, potentially more rapid career advancement, and greater acceptance in the role as advisor to management.</p>\r\n\r\n<p><strong>Software Quality Analyst (SQA)</strong>, certification requires an understanding of bug database software and version control, as well as your familiarity with client and server architecture, to break things – break all the things – in testing, so that they aren’t broken when they make it into players’ hands. </p>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (70 out of 100 correct) to pass the exam.</h6>\r\n<p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam</strong></span></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour 30 Minutes (90 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Non-Proctored</span></strong></span></h6>\r\n<p></p>\r\n<h6>The Certified Software Quality Analyst (CSQA) Exam is currently available via Online Mode, You will need to schedule testing appointment by sending an email to candidate.registrations@gaqm.org once you are done with the E-Course. You can schedule an exam appointment date before forty eight (48) hours.</h6>\r\n<h6><strong>Kindly Note: </strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>1) After you schedule your examination, if you need to reschedule or cancel your examination date, you may do so up until 48 hours before the scheduled date and time without penalty. If you cancel within 48 hours of your appointment you will forfeit your examination fee and be required to pay a new examination fee in order to reschedule, the cost would be 80$.</h6>\r\n<h6>2) To cancel or to reschedule the exam, you need to send us an email at candidate.registrations@gaqm.org</h6>\r\n<h6>3) Non-proctored exams are available to be taken online whenever the candidate wishes to take them.</h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong><strong>Certification Validity</strong></strong></h6>\r\n<p></p>\r\n<h6>The CSQA Certificate is valid for life</h6>\r\n<p></p>\r\n<p><span style=\"color: #ff0000;\">Note: The <strong>Certified Software Quality Analyst (CSQA)<strong>™</strong> </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span></p>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>Module 1 – Introduction to Software Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>1.1 Testing Concepts</li>\r\n<li>1.2 Project vs. Product</li>\r\n<li>1.3 Objectives of Testing</li>\r\n<li>1.4 Introduction to QA and QC</li>\r\n<li>1.5 Roles and Responsibilities of a Tester</li>\r\n</ul>\r\n</h6><h6><strong>Module 2 – Software Development Life Cycle </strong></h6>\r\n<h6>\r\n<ul>\r\n<li>2.1 What is SDLC?</li>\r\n<li>2.2 Requirements Collection</li>\r\n<li>2.3 Design Phase</li>\r\n<li>2.4 Coding</li>\r\n<li>2.5 Testing (Static &amp; Dynamic)</li>\r\n<li>Delivery and Maintenance</li>\r\n</ul>\r\n</h6><h6><strong>Module 3 – SDLC Models</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>3.1 Waterfall Model</li>\r\n<li>3.2 Iterative Model</li>\r\n<li>3.3 V-Model</li>\r\n<li>3.4 Prototype Model</li>\r\n<li>3.5 Agile Model</li>\r\n</ul>\r\n</h6><h6><strong>Module 4 – Software Testing Methodologies</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>4.1 White Box Testing</li>\r\n<li>4.2 Black Box Testing</li>\r\n<li>4.3 Grey Box Testing</li>\r\n</ul>\r\n</h6><h6><strong>Module 5 – Levels of Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>5.1 Unit Testing</li>\r\n<li>5.2 Integration Testing</li>\r\n<li>5.3 System Testing</li>\r\n<li>5.4 Unit Testing</li>\r\n</ul>\r\n</h6><h6><strong>Module 6 – Types of Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>6.1 Functional Testing</li>\r\n<li>6.2 End to End Testing</li>\r\n<li>6.3 Ad-hoc Testing</li>\r\n<li>6.4 Sanity Testing</li>\r\n<li>6.5 Smoke Testing Vs Sanity Testing</li>\r\n<li>6.6 Smoke Testing</li>\r\n<li>6.7 Re-Testing</li>\r\n<li>6.8 Regression Testing</li>\r\n<li>6.9 Exploratory Testing</li>\r\n<li>6.10 Usability Testing</li>\r\n<li>6.11 Security Testing</li>\r\n<li>6.12 Compatibility Testing</li>\r\n<li>6.13 Performance Testing</li>\r\n<li>6.14 Alpha Testing</li>\r\n<li>6.15 Best Testing</li>\r\n<li>6.16 Compatibility Testing</li>\r\n</ul>\r\n</h6><h6><strong>Module 7 – Software Testing Life Cycle</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>7.1 Test Plan</li>\r\n<li>7.2 Test Analysis</li>\r\n<li>7.3 Test Case Design</li>\r\n<li>7.4 Test Case Execution</li>\r\n<li>7.5 Defect Reporting</li>\r\n<li>7.6 Test Closure</li>\r\n</ul>\r\n</h6><h6><strong>Module 8 – Test Case Design Techniques</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>8.1 Equivalence Partition Strategy</li>\r\n<li>8.2 Boundary Value Analysis</li>\r\n<li>8.3 Decision Table Testing</li>\r\n<li>8.4 State Transition Technique</li>\r\n<li>8.5 Error Guessing</li>\r\n</ul>\r\n</h6><h6><strong>Module 9 – Defect Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>9.1 Defect Life Cycle</li>\r\n<li>9.2 Types of Defects</li>\r\n<li>9.3 Priority of Defects</li>\r\n<li>9.4 Software Configuration Management</li>\r\n</ul>\r\n<p></p></h6></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\n<li>Software Testers &amp; Developers who want to move to Quality Assurance</li>\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam)', 'Standard Package (E-Course Only)', '-', '-', '-', '40 Days', '20 Days', '-', '-', '-', '255 $', '107 $', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CSQA-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSQA-001%29', '-', '-', '-', 'csqa.jpg');
INSERT INTO `org_subcategory` VALUES ('33', 'Certified Software Quality Manager', '3', '<h6 style=\"margin-bottom: 10px;\"><strong>Exam Code: CSQM-001</strong></h6>', '1', '1', '<p>Quality is the buzzword in todayâ€˜s highly competitive software market. Quality is a key measure of project success. It is what a customer remembers in the long run. High-quality products result in customer satisfactionâ€š while poor quality results in customer dissatisfaction.</p>\r\n\r\n<p>Software Quality is a very broad concept. To achieve software quality, one must focus on the quality of the software product as well as the quality of the different processes used to produce the software product.  In order to achieve this goal, a person in charge of improving quality in a software organization has certain responsibilities and objectives. The CSQM<sup>Â®</sup> Certification provides the knowledge to help a Software Quality Manager carry out these responsibilities and achieve his or her objectives.</p>\r\n\r\n<p>	1) Evaluating, developing, and monitoring<br>\r\n	2) Evaluating and selecting tools<br>\r\n	3) Management tasks pertaining to Software Quality<br>\r\n	4) Software Quality Assurance at Managerial Level<br>\r\n	5) Assessing the organizationâ€™s capability<br>\r\n	6) Facilitating process improvement issues between groups or projects<br>\r\n	7) Assessing the impact of one process improvement effort  on another process or another part of the process<br>\r\n	8) Acting as a consultant to projects having special problems or requirements\r\n</p>\r\n\r\n<p>The Certified Software Quality Manager (CSQM)<sup>Â®</sup> certification establishes a worldwide standard for the assessment of the capabilities and competencies of software quality assurance professionals that are working at, or soon will work at the software quality assurance management level.</p>\r\n\r\n<p>Acquiring the designation of Certified Software Quality Manager (CSQM)<sup>Â®</sup> indicates a level of professional competence in both the principles and practices of software quality assurance, demonstrating the skills and capabilities necessary to manage the software quality assurance function. CSQM<sup>Â®</sup> certification provides IT upper management a necessary tool to predict the likelihood of success of individuals applying for management level positions. The CSQM<sup>Â®</sup> certification provides the IT professional with an objective assessment of their management skills.<br>\r\n</p>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (70 out of 100 correct) to pass the exam</h6>\r\n<p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam</strong></span></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour 30 Minutes (90 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Non-Proctored</span></strong></span></h6>\r\n<p></p>\r\n<h6>The Certified Software Quality Manager (CSQM) Exam is currently available via Online Mode, You will need to schedule testing appointment by sending an email to candidate.registrations@gaqm.org once you are done with the E-Course. You can schedule an exam appointment date before forty eight (48) hours.</h6>\r\n<h6><strong>Kindly Note: </strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>1) After you schedule your examination, if you need to reschedule or cancel your examination date, you may do so up until 48 hours before the scheduled date and time without penalty. If you cancel within 48 hours of your appointment you will forfeit your examination fee and be required to pay a new examination fee in order to reschedule, the cost would be 80$.</h6>\r\n<h6>2) To cancel or to reschedule the exam, you need to send us an email at candidate.registrations@gaqm.org</h6>\r\n<h6>3) Non-proctored exams are available to be taken online whenever the candidate wishes to take them.</h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Certification Validity</strong></span></h6>\r\n<p></p>\r\n<h6>The Certified Software Quality Manager (CSQM) Certificate is valid for life</h6>\r\n<p></p>\r\n<p><span style=\"color: #ff0000;\">Note: The <strong>Certified Software Quality Manager (CSQM)</strong> Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam</span>.</p>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>Module 1 â€“ Managing Software Quality</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>1.1 Quick Overview on Testing</li>\r\n<li>1.1 Software Quality Definition</li>\r\n<li>1.2 SQA and Testing Defined and Distinguished</li>\r\n<li>1.3 The difference between QA and QC</li>\r\n<li>1.4 The software quality assurance</li>\r\n<li>1.5 Role of software quality manager</li>\r\n</ul>\r\n</h6><h6><strong>Module 2 â€“ Skillset of Software Quality Manager</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>2.1 Managing Software Quality</li>\r\n<li>2.2 Requirement Management and Engineering</li>\r\n<li>2.3 Change Control and Release Management</li>\r\n<li>2.4 Assuring Quality during Development</li>\r\n<li>2.5 Best Practices in Software Testing</li>\r\n</ul>\r\n</h6><h6><strong>Module 3 â€“ Best Practices</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>3.1 Best Practices in Software Inspections and Reviews</li>\r\n<li>3.2 Defect Tracking and Reporting</li>\r\n<li>3.3 Defect Prevention</li>\r\n<li>3.4 Process Improvement Models</li>\r\n<li>3.5 Lean Software Process</li>\r\n</ul>\r\n</h6><h6><strong>Module 4 â€“ Software Quality Assurance</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>4.1 Stakeholder Identification</li>\r\n<li>4.2 Developing SQA Plan</li>\r\n<li>4.3 Establishing Budget</li>\r\n<li>4.4 Establishing Mission Objectives</li>\r\n<li>4.5 Selling SQA to Management</li>\r\n<li>4.6 Demonstrating ROI for SQA efforts</li>\r\n<li>4.7 Base lining current software quality lines</li>\r\n<li>4.8 Defining Standards and Methodologies</li>\r\n<li>4.9 Instituting Metrics and Measurements</li>\r\n<li>4.10 Deploying Processes</li>\r\n<li>4.11 Evaluating Methodologies and Automated Tools</li>\r\n<li>4.12 Implementing Defect Studies</li>\r\n</ul>\r\n</h6><h6><strong>Module 5 â€“ Defect Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>5.1 Verification and Validation Method</li>\r\n<li>5.2 Activities of User Acceptance Testing</li>\r\n<li>5.3 Inspections and other forms of peer reviews</li>\r\n<li>5.4 Forms of Inspections and Reviews</li>\r\n<li>5.5 Effective and practical inspections practices</li>\r\n<li>5.6 Code Analysis</li>\r\n<li>5.7 Independent Verification and Validation</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 6 â€“ Configuration Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>6.1 Principles and activities of  software quality management</li>\r\n<li>6.2 Identifying configuration management</li>\r\n<li>6.3 Establishes baselines</li>\r\n<li>6.4 Controlling change</li>\r\n<li>6.5 Lean Software Process</li>\r\n<li>6.6 Establishing and maintaining repositories</li>\r\n<li>6.7 Assuring the integrity of software work products</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 7 â€“ Risk Analysis</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>7.1 Risk Analysis and Methodologies</li>\r\n<li>7.2 Risk Identification and Classification</li>\r\n<li>7.3 Establishes baselines</li>\r\n<li>7.4 Risk Prioritization and ranking</li>\r\n<li>7.5 Calculating costs and probability</li>\r\n<li>7.6 Risk reporting</li>\r\n<li>7.7 Monitoring and controlling risks</li>\r\n<li>7.8 Contingency planning and mitigation </li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 8 â€“ Requirement Engineering and Management</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>8.1 Defining and Validating Requirements</li>\r\n<li>8.2 Quality Vs Functional Requirements</li>\r\n<li>8.3 Different Types of Quality Requirements</li>\r\n<li>8.4 Managing and Maintaining Requirements</li>\r\n<li>8.5 Building a Requirement-Management Process</li>\r\n<li>8.6 Requirement Traceability </li>\r\n<li>8.7 Requirement Change Control</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<h6>Developers, Testers, System Analyst, Quality Assurors, EPG Members</h6>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam)', '-', '-', '-', '-', '40 Days', '-', '-', '-', '-', '255 $', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CSQM-001%29', '-', '-', '-', '-', 'csqm.jpg');
INSERT INTO `org_subcategory` VALUES ('34', 'IMTQN Certified Mobile Application Tester (CMAT) â€“ Foundation Level', '3', '<h6 style=\"margin-bottom: 10px;\"><strong>Exam Code: CMAT-001</strong></h6>', '1', '1', '<p><strong>About IMTQN</strong></p>\r\n\r\n<p>The International Mobile Testing Qualifications Network (IMTQN) is a Mobile Application Testing qualification certification organisation that operates internationally, IMTQN Certified Tester is a standardized qualification for mobile software testers and mobile testers the certification is offered by the IMTQN (International Mobile Testing Qualifications Network). The qualifications are based on a syllabus, and there is a hierarchy of qualifications and guidelines for accreditation and examination. The GAQM has been appointed by the IMTQN to deliver the IMTQN Examinations World Wide. The IMTQN certifications are highly demanded in the field of Mobile Application Testing, The IMTQN is a world wide leader in certifying candidates in Mobile Application Testing which will carter the professionals to the corporates who mainly target Mobile Application Testing. The certifications offered by IMTQNâ„¢ are vendor neutral and cross platform which provides an edge among the others in the Mobile Application Testing segment.</p>\r\n\r\n<p><strong>What is Mobile Application Testing</strong></p>\r\n\r\n<p>Mobile Application Testing is a process by which application software developed for hand held mobile devices is tested for its functionality, usability and consistency. Mobile applications either come pre-installed or can be installed from mobile software distribution platforms. Mobile devices have witnessed a phenomenal growth in the past few years. A study conducted by the Yankee Group predicts the generation of $4.2 billion in revenue by 2013 through 7 billion U.S. smartphone app downloads.</p>\r\n\r\n<p>Variety of Mobile Devices: Mobile devices differ in screen sizes, input methods (QWERTY, touch, normal) with different hardware capabilities</p>\r\n\r\n<p>Diversity in Mobile Platforms/OS: There are different Mobile Operating Systems in the market. The major ones are Android, IOS, BREW, BREWMP, Symbian, Windows 7.5 Mango, and Blackberry (RIM). Each operating system has its own limitations. Testing a single application across multiple devices running on the same platform and every platform poses a unique challenge for testers.</p>\r\n\r\n<p>The IMTQN Certified Mobile Application Tester is a one who is well versed with Mobile Application Testing.</p>\r\n\r\n<p>The field of mobile testing is popular these days. The IMTQN Certified Mobile Application Tester (CMAT) â€“ Foundation Level Certification involves both device testing as well as application and software testing to assure you a better prospects in the field of Mobile Testing.</p>\r\n\r\n<p>Many of us think about pursuing a career in this field of testing. Starting from a beginner in this domain to becoming an expert, the IMTQN Certified Mobile Application Tester (CMAT) â€“ Foundation Level Certification is interesting and helpful to know what could be the different questions that are asked to people by an employer while selecting them for various positions in the mobile testing field such as a software tester.</p>\r\n\r\n<p>This process of testing includes a set of activities from monitoring and troubleshooting the mobile application to content and services on the real handsets. Testing is nothing but the verification and validation of hardware devices and software applications.</p>\r\n\r\n<p><strong>How is mobile application testing different from mobile testing?</strong></p>\r\n\r\n<p>When you are asked to do mobile testing, you must test the mobile phone itself. It may include protocol testing, battery testing, network connectivity testing, software compatibility testing and more.</p>\r\n\r\n<p>On the other hand, mobile application testing is to test applications and software built for the mobile phones. In this case, the application needs to be tested to verify whether it meets the specified functional and non-functional requirements.<br>\r\n</p>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score 70% (28 out of 40 correct) to pass the exam.</h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n<p></p>\r\n<h6>The total duration of exam is 1 hour (60 minutes)</h6>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n<p></p>\r\n<h6>The IMTQN Certified Mobile Application Tester (CMAT) â€“ Foundation Level Certificate is valid for life</h6>\r\n<p></p>\r\n<p><span style=\"color: red;\">Note: The <strong>IMTQN Certified Mobile Application Tester (CMAT) â€“ Foundation Level </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span></p>\r\n<p></p></div>\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>What is Mobile Application Testing?</strong></h6>\r\n<h6><strong>Benefits of Mobile Application Testing </strong></h6>\r\n<h6><strong>The Mobile Boom</strong></h6>\r\n<h6><strong>The Mobile Boom: Facts and Figures</strong></h6>\r\n<h6><strong>Types of Mobile Application Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Functional Testing</li>\r\n<li>Laboratory Testing</li>\r\n<li>Memory Leakage Testing</li>\r\n<li>Interrupt Testing</li>\r\n<li>Usability testing</li>\r\n<li>Installation testing</li>\r\n<li>Certification Testing</li>\r\n<li>Load testing</li>\r\n<li>Interface Testing</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Mobile Testing Challenges for Native Applications</strong></h6>\r\n<h6><strong>Why Itâ€™s Tough: The Soaring Expectations of Users</strong></h6>\r\n<h6><strong>Why Failing Hurts</strong></h6>\r\n<h6><strong>Key Questions</strong></h6>\r\n<h6><strong>Common Functional Issues for Mobile</strong></h6>\r\n<h6><strong>From The Experts: Functional Testing Tips</strong></h6>\r\n<h6><strong>Functional Issues to Consider in the Dev Phase</strong></h6>\r\n<h6><strong>Mobile Testing Challenges for Web Applications</strong></h6>\r\n<h6><strong>Devices: The Biggest Mobile Testing Challenge</strong></h6>\r\n<h6><strong>Network: A Regional Challenge</strong></h6>\r\n<h6><strong>Network Bypass</strong></h6>\r\n<h6><strong>Real Networks</strong></h6>\r\n<h6><strong>Scripting: The Repeatability Challenge</strong></h6>\r\n<h6><strong>Recommendations</strong></h6>\r\n<h6><strong>Common Mobile Security Issues</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Confidentiality</li>\r\n<li>Integrity</li>\r\n<li>Authentication</li>\r\n<li>Authorization</li>\r\n<li>Availability</li>\r\n<li>Non-Repudiation</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Common Mobile Localization Issues</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Why is Localization So Important?</li>\r\n<li>Why is Localization So Difficult?</li>\r\n</ul></h6>\r\n\r\n<h6><strong>The Rise of Mobile Web</strong></h6>\r\n<h6><strong>Mobile Web vs. Native Apps: Differences in Testing</strong></h6>\r\n<h6><strong>The Future: Mobile Web Plus Native Apps</strong></h6>\r\n<h6><strong>The Distant Future: Hybrid Apps</strong></h6>\r\n<h6><strong>Test Sourcing Options: Lab + Wild</strong></h6>\r\n<h6><strong>Emulators &amp; Simulators</strong></h6>\r\n<h6><strong>From Surviving to Thriving: Your Strategy Moving Forward</strong></h6>\r\n<h6><strong>Performance</strong></h6>\r\n<h6><strong>Points to remember while performing mobile application testing</strong></h6>\r\n<h6><strong>The real challenges that Quality Analyst would be facing while testing Mobile Application<br>\r\n</strong></h6>\r\n<h6><strong>Introduction to Mobile Streaming</strong></h6>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\n<li>Software Test Managers</li>\r\n<li>Software Testers involved in testing Mobile Apps</li>\r\n<li>Candidates who are seeking a new career in the field of Mobile Application Testing</li>\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Premium Package with E-Course and Two (2) Exam Vouchers', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '40 Days', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '140 $', '210 $', '85 $', '128 $', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CMAT-001%29', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CMAT%29', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CMAT-001', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', 'imtqn.jpg');
INSERT INTO `org_subcategory` VALUES ('35', 'Certified Agile Tester (CAT) â€“ Foundation', '3', '<strong>CATF-001</strong>', '1', '1', '<p>Testing is a fundamental part of any successful project. Agile is flexible and adaptive with frequent feedback loops, far different from the traditional regimented methodologies.</p>\r\n\r\n<p>The Agile Testing Foundation certification extends the broad understanding of testing acquired at Foundation Level and covers those topics which are considered to be essential knowledge for a test professional working on agile projects.</p>\r\n\r\n<p>The Agile Testing Foundation Certification is suitable for those who are, or expect to be, working on agile projects and is also appropriate for anyone who wants a deeper understanding of agile development that specifically contains coverage of the options for including software testing as an integrated part of the agile development approach.  This includes Scrum Masters, project managers, release managers, quality managers, software development managers, business analysts and management consultants.<br>\r\n</p>\r\n\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 40 Multiple Choice Questions out of which the candidate needs to score 65% (26 out of 40 correct) to pass the exam.</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam</strong></span></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof</li>\r\n</h6>\r\n</ul>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<ol>\r\n<h6>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n</h6><h6>\r\n    </h6><h6>\r\n<li>The exam can be taken any number of times.</li>\r\n</h6>\r\n</ol>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n<p></p>\r\n<h6>The Certified Agile Tester Foundation (CATF) Certificate is valid for life</h6>\r\n<p></p>\r\n<p><span style=\"color: red;\">Note: The <strong>Certified Agile Tester (CAT) â€“ Foundation </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span><br>\r\n</p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>Module 1 â€“ Agile Fundamentals</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>1.1. Process Categories</li>\r\n<li>1.2. Agile history, manifesto &amp; principles</li>\r\n<li>1.3. Learn different Agile models</li>\r\n<li>1.4. Exercise / Game on Scrum/Agile</li>\r\n<li>1.5. Understand how testing would be different in an Agile model</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ Testing Fundamentals</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>2.1. Testing fundamentals</li>\r\n<li>2.2. Testing process</li>\r\n<li>2.3. Test types and levels</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 3 â€“ Practical Test Design Techniques</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>3.1. Understand Shift Left Concept and its application in Agile projects</li>\r\n<li>3.2. Practical Dynamic Test Design Technique</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 4 â€“ Basic Agile Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>4.1. Test planning and Test Reporting</li>\r\n<li>4.2. Test execution</li>\r\n<li>4.3. Test First</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ul>\r\n<li>Test Analysts</li>\r\n<li>Business Analysts</li>\r\n<li>Programmers</li>\r\n<li>System users with Testing Responsibilities and Project Managers</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '200 $', '100 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CATF-001', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CATF-001%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'catf.jpg');
INSERT INTO `org_subcategory` VALUES ('36', 'Certified Master Agile Tester (CMAT)', '3', '<h6 style=\"margin-bottom: 10px;\"><strong>CMAT-010</strong></h6>', '1', '1', '<p>The Certified Master Agile Tester (CMAT) introduces core agile philosophies such as servant leadership, adaptive planning, frequent feedback for learning, and a focus on value-driven versus plan-driven delivery. Courses compare and contrast agile management with traditional management approaches and give participants principles and tools to apply in their teams and organizations. Learning objectives focus on delivering agile projects as well as applying agile management principles beyond projects to broader organizational contexts. As agile leaders progress in organizations, they set the vision and overall goals, then empower their people to lead teams and achieve exceptional results.</p>\r\n\r\n<p>The CMAT certification training program is to accelerate your career in the Agile testing in an advanced environment.</p>\r\n\r\n<p><strong><em>Pre-requisites: Candidate must achieve the Certified Agile Tester Foundation Level Certification.</em></strong></p>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score a percentage of 70% (70 out of 100 correct) to pass the exam</h6>\r\n<p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Duration of exam</strong></span></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour 30 Minutes (90 Minutes)</h6>\r\n<h6><span style=\"color: #333333;\"><strong><span style=\"text-decoration: underline;\">Non-Proctored</span></strong></span></h6>\r\n<p></p>\r\n<h6>The Certified Master Agile Tester (CMAT) Exam is currently available via Online Mode, You will need to schedule testing appointment by sending an email to candidate.registrations@gaqm.org once you are done with the E-Course. You can schedule an exam appointment date before forty eight (48) hours.</h6>\r\n<h6><strong>Kindly Note: </strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>1) After you schedule your examination, if you need to reschedule or cancel your examination date, you may do so up until 48 hours before the scheduled date and time without penalty. If you cancel within 48 hours of your appointment you will forfeit your examination fee and be required to pay a new examination fee in order to reschedule, the cost would be 80$.</h6>\r\n<h6>2) To cancel or to reschedule the exam, you need to send us an email at candidate.registrations@gaqm.org</h6>\r\n<h6>3) Non-proctored exams are available to be taken online whenever the candidate wishes to take them.</h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><span style=\"color: #333333;\"><strong>Certification Validity</strong></span></h6>\r\n<p></p>\r\n<h6>The Certified Master Agile Tester (CMAT) Certificate is valid for life</h6>\r\n<p></p>\r\n<p><span style=\"color: red;\">Note: The <strong>Certified Master Agile Tester (CMAT)â„¢  </strong>Candidate must achieve the Certified Agile Tester Foundation Level Certification.</span></p>\r\n<p><span style=\"color: #ff0000;\">Note: The <strong>Certified Master Agile Tester (CMAT)<strong>â„¢</strong> </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam</span>.</p>\r\n<p></p></div>\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>Module 1 â€“ Agile Fundamentals</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Quick Overview on Agile â€“ Agile history, manifesto &amp; principles</li>\r\n</ul>\r\n</h6><h6><strong>Module 2 â€“ Agile Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>What is Agile Testing?</li>\r\n<li>Agile Testing mindset</li>\r\n<li>Agile Testing Principles</li>\r\n</ul>\r\n</h6><h6><strong>Module 3 â€“ User Stories and Role of Agile Testers</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Collaboration for user stories </li>\r\n<li>Agile Estimation Techniques</li>\r\n<li>Agile Testing Principles</li>\r\n</ul>\r\n</h6><h6><strong>Module 4 â€“ Agile Testing Iteration Zero</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Test Strategy and Release Planning</li>\r\n<li>of Test Preparation</li>\r\n<li>Test Environment</li>\r\n<li>Test Data</li>\r\n<li>Tools</li>\r\n<li>Regression Strategy</li>\r\n<li>User Story elaboration</li>\r\n<li>Metrics</li>\r\n<li>Test Metrics</li>\r\n</ul>\r\n</h6><h6><strong>Module 5 â€“ Optimized Test Design and Test execution</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Documentation</li>\r\n<li>Exploratory Testing</li>\r\n<li>Orthogonal array and Pair Wise Test Design Technique</li>\r\n<li>Buddy Testing / Pairing in general</li>\r\n<li>Scenario based testing</li>\r\n<li>Non-GUI based testing concepts</li>\r\n</ul>\r\n</h6><h6><strong>Module 6 â€“ Agile testing â€“ Practice Iteration 1</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Implement the tool kit for Iteration 1 </li>\r\n<li>Test Plan Creation</li>\r\n<li>Test Design and Test Scenario Creation</li>\r\n<li>Test Execution during the iteration</li>\r\n<li>Retrospective</li>\r\n</ul>\r\n</h6><h6><strong>Module 7 â€“ Test Automation and Regression Testing</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Why Automation? </li>\r\n<li>Continuous Integration</li>\r\n</ul>\r\n</h6><h6><strong>Module 8 â€“ Agile Testing â€“ Practice Iteration 2</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Test Plan Creation </li>\r\n<li>Test Design and Test Scenario Creation</li>\r\n<li>Test Execution during the iteration</li>\r\n<li>Retrospective</li>\r\n</ul>\r\n</h6><h6><strong>Module 9 â€“ Agile testing â€“ Other Facets</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Development Driven Tests </li>\r\n<li>ATDD and BDD</li>\r\n<li>Non-functional Testing</li>\r\n<li>Why AC are not same as DoD</li>\r\n<li>Managing Testing Debt</li>\r\n<li>Refactoring</li>\r\n<li>Agile for a large and distributed teams</li>\r\n<li>Agile for Independent Testing organizations</li>\r\n</ul>\r\n<p></p></h6></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ul>\r\n<li>Advanced Level Agile Testers </li>\r\n<li>Experienced Testers wanting to become valuable members of an Agile team; Test Managers, SCRUM Masters and Developers</li>\r\n<li>Moving into an Agile project performing testing activities</li>\r\n<li>Already performing testing activities in an Agile project and wish to increase their effectiveness</li>\r\n<li>Interested in the testing activities within Agile, such as Managers, SCRUM Masters and Developers</li>\r\n<li>Anyone who wants to move to Agile Testing</li>\r\n<li>Testers, Developers, Dev leads, Test Leads, Dev Managers, PMâ€™s, Test Managers, QA Leads, QA Managers, Test Programs managers, BAâ€™s, Test Automation engineers, Agile Practioners, Scrum Masters, Agile Team Members, Testing CoE  Leads and Heads, Testing and agile evangelists</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', '-', '-', '-', '40 Days', '20 Days', '-', '-', '-', '300 $', '128 $', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CMAT-010', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CMAT-010%29', '-', '-', '-', 'as.jpg');
INSERT INTO `org_subcategory` VALUES ('37', 'Certified Lean Six Sigma Yellow Belt', '4', '<strong>CLSSYB</strong>', '1', '1', '<p>Certified Lean Six Sigma Yellow Belt (CLSSYB) exam comprises of basics of the Lean Six Sigma Methodology and supports improvement projects as a part of a team. A Lean Six Sigma Yellow Belt possesses an understanding of the aspects within the phases of D-M-C. They apply this knowledge to all aspects of their primary functions.</p>\r\n\r\n<p>Six Sigma is a business strategy that focuses on product and service excellence, to create a culture that demands perfection. The DMAIC methodology is the road-map to achieving this target. This e-Learning course attempts to train novices on the principles of Six Sigma and takes them through the DMAIC process.</p>\r\n\r\n<p><strong>Objectives</strong></p>\r\n\r\n<p>â€¢  Recognize the advantages of Six Sigma<br>\r\nâ€¢  List the industries where it can be applied<br>\r\nâ€¢  Explain the use of the DMAIC methodology to achieve process excellence<br>\r\nâ€¢  Describe the use of statistics in applying the DMAIC methodology<br>\r\n</p>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 50 Multiple Choice Questions out of which the candidate needs to score 70% (35 correct out of 50) to pass the exam.</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 1 hour (60 Minutes)</h6>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Identification Proof </li>\r\n</h6>\r\n</ul>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n<p></p>\r\n<h6>The Certified Lean Six Sigma Yellow Belt (CLSSYB)â„¢ Certificate is valid for life</h6>\r\n<p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Credits </strong></p>\r\n<p></p>\r\n<h6>Successfully passing the CLSSYB exam will also earn candidates a total of 25 Credits towards MBA in Six Sigma (Masterâ€™s Degree) offered by Charisma University. </h6>\r\n<p></p>\r\n<p></p>\r\n<p><span style=\"color: red;\">Note: The <strong>Certified Lean Six Sigma Yellow Belt (CLSSYB)â„¢ </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span></p>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>Module 1 â€“ INTRODUCTION</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Six Sigma: Concept and History</li>\r\n<li>Six Sigma: A Breakthrough Improvement</li>\r\n<li>Three Sigma vs. Six Sigma</li>\r\n<li>Six Sigma â€“ Roles and Responsibilities</li>\r\n<li>How Six Sigma Works</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 2 â€“ DEFINE</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Team Charter</li>\r\n<li>Business Case</li>\r\n<li>Problem Statement</li>\r\n<li>Goal Statement</li>\r\n<li>Project Scope</li>\r\n<li>Milestone</li>\r\n<li>Resource Plan</li>\r\n<li>Team Charter Format</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 3 â€“ MEASURE</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Tools for Measure</li>\r\n<li>Process Mapping â€“ Definition</li>\r\n<li>Process Mapping â€“ Need and Benefits</li>\r\n<li>Process Map â€“ Elements</li>\r\n<li>High-level Process Map</li>\r\n<li>Process/product Drill-down Tree</li>\r\n<li>Data Collection Plan</li>\r\n<li>Process Capability Analysis</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 4 â€“ BASIC STATISTICS</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Definition â€“ Statistics</li>\r\n<li>Data Types â€“ Discrete and Continuous</li>\r\n<li>Data Types â€“ Differences</li>\r\n<li>Normal Curve</li>\r\n<li>Distribution and its Types</li>\r\n<li>Descriptive Statistics</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 5 â€“ ANALYZE</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Tools for First Stage â€“ Histogram</li>\r\n<li>Tools for First Stage â€“ Pareto Chart</li>\r\n<li>Tools for First Stage â€“ Stratification</li>\r\n<li>Tools for Second Stage â€“ Brainstorming</li>\r\n<li>Tools for Second Stage â€“ CED</li>\r\n<li>Tools for Second Stage â€“ Control Impact Matrix</li>\r\n<li>Tools for Second Stage â€“ Five Why Analysis</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 6 â€“ IMPROVE</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Identify Vital Causes â€“ Scatter Diagram</li>\r\n<li>Identify Vital Causes â€“ Correlation Coefficient</li>\r\n<li>Identify Vital Causes â€“ Regression Analysis</li>\r\n<li>Propose Solutions â€“ Pugh Matrix</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 7 â€“ CONTROL</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Control Plan</li>\r\n<li>Control Charts</li>\r\n<li>Control Charts â€“ Appropriate Selection</li>\r\n<li>Control Chart â€“ Types</li>\r\n<li>Individual and Moving Range Charts</li>\r\n<li>Attribute Control Charts</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Module 8 â€“ A Lean Glossary</strong></h6>\r\n<h6><strong>Lean Process Improvement</strong></h6>\r\n<h6>\r\n<ul>\r\n<li>Understanding Lean</li>\r\n<li>The Toyota Production System</li>\r\n<li>The Toyota Production System House</li>\r\n<li>The Five Critical Improvement Concepts</li>\r\n<li>Understanding Value with the Kano Model</li>\r\n<li>Types of Waste</li>\r\n<li>Creating a Lean Enterprise</li>\r\n<li>Understanding Lean</li>\r\n<li>The Plan, Do, Study, Act (PDSA) Cycle</li>\r\n<li>Using the R-DMAIC-S Model</li>\r\n<li>Lean Thinking Tools</li>\r\n<li>Kaizen Events</li>\r\n<li>Data Gathering and Mapping</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\n<li>Members of the service sector who need familiarity with the Lean Six Sigma process and basic process improvement tools; individuals who are on teams and in organizations that are beginning to deploy Six Sigma, one who is looking to be a member of the Six Sigma Project.</li>\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '-', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '-', '200 $', '85 $', '128 $', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CLSSYB%29', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CLSSYB', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', '-', 'yellow_belt1.jpg');
INSERT INTO `org_subcategory` VALUES ('38', ' Certified Lean Six Sigma Green Belt', '4', '<strong>CLSSGB</strong>', '1', '1', '<p>Certified Lean Six Sigma Green Belt (CLSSGB)â„¢ exam comprises of Lean Six Sigma Methodology who both leads or supports improvement projects, typically as a part-time role. A Lean Six Sigma Green Belt possesses a thorough understanding of all aspects within the phases of D-M-A-I-C. They understand how to perform and interpret Six Sigma tools and how to use standard principles of Lean.</p>\r\n\r\n<p>Lean Six Sigma Green Belts are valuable assets to any team. Our Certified Lean Six Sigma Green Belt (CLSSGB)â„¢ E-Learning will introduce you to the Lean Six Sigma philosophy and terminology and giveâ€™s you the knowledge you need to prepare for Certified Lean Six Sigma Green Belt (CLSSGB)â„¢ Exam.&nbsp; You will gain a strong foundation in Lean Six Sigma and the skills needed to lead Lean Six Sigma process improvement projects, work on teams led by Lean Six Sigma Black Belts and help your organization implement Lean Six Sigma effectively.<br>\r\n</p>\r\n\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 100 Multiple Choice Questions out of which the candidate needs to score 70% (70 out of 100 correct) to pass the exam.</h6>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Duration of exam</strong></p>\r\n<p></p>\r\n<h6>The total duration of the exam is 2 hours (120 Minutes)</h6>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<ul>\r\n<h6>\r\n<li>Scientific Calculator will be provided by Pearson Vue Test Center.</li>\r\n</h6>\r\n</ul>\r\n<p style=\"margin-bottom: 0px; text-decoration: underline; color: #303030;\"><strong>Retaking of Exam</strong></p>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>The validity period of Certified Lean Six Sigma Green Belt (CLSSGB)â„¢ Certificate is for five (5) years, the candidate needs to either retake the exam or can complete the E-Course for CLSSGB to accrue the number of continuing education units (CEUs) to renew the Certificate. Renewing the certificate will allow the candidate to retain the professional stature and credentials intact.</li>\r\n<li>Certificates must be renewed on or before the expiration date (when they become inactive) to be current.</li>\r\n</ol></h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Credits </strong></p>\r\n<p></p>\r\n<h6>Successfully passing the CLSSGB exam will also earn candidates a total of 50 Credits towards MBA in Six Sigma (Masterâ€™s Degree) offered by Charisma University. </h6>\r\n<p></p>\r\n<p></p>\r\n<p><span style=\"color: red;\">Note: The <strong>Certified Lean Six Sigma Green Belt (CLSSGB)â„¢ </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span><br>\r\n</p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>Overview: Six Sigma and the Organization</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h4>Six sigma and Organizational Goals</h4>\r\n<ul>\r\n<h6>\r\n<li>What is Six Sigma</li>\r\n<li>Value of Six Sigma</li>\r\n<li>Organizational drivers and metrics</li>\r\n<li>Organizational goals and Six Sigma projects</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Lean Principles in the organization</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<ul>\r\n<h6>\r\n<li>Lean principles in the organization</li>\r\n<li>Lean concepts and tools</li>\r\n<li>Value-added and non-value-added activities</li>\r\n<li>Theory of constraints</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Design for Six Sigma (DFSS) in the organization</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<ul>\r\n<h6>\r\n<li>Quality function deployment (QFD)</li>\r\n<li>Design and process failure mode and effects analysis (FMEA, DFMEA &amp; PFMEA)</li>\r\n<li>Road maps for DFSS</li>\r\n<li>Six Sigma â€“ Define â€“ I</li>\r\n</h6>\r\n</ul>\r\n<h6><strong>Introduction to the Define Phase</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>\r\n<ul>\r\n<li>Process elements</li>\r\n<li>Identify customers</li>\r\n<li>Collect customer data</li>\r\n<li>Analyze customer data</li>\r\n<li>Translate customer requirements</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Project Management Basics</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>\r\n<ul>\r\n<li>Project charter and problem statement</li>\r\n<li>Project scope</li>\r\n<li>Project metrics</li>\r\n<li>Project planning tools</li>\r\n<li>Project risk analysis</li>\r\n<li>Project closure</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Other Tools and Techniques</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>\r\n<ul>\r\n<li>Design of Experiments</li>\r\n<li>Building Charts</li>\r\n<li>Ten Questions Regarding Six Sigma</li>\r\n<li>Course Wrap Up</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Process Analysis and Documentation</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>\r\n<ul>\r\n<li>Process Modelling</li>\r\n<li>Process Inputs and Outputs</li>\r\n<li>Probability and Statistics</li>\r\n<li>Drawing valid statistical conclusions</li>\r\n<li>Central limit theorem and sampling distribution of the mean</li>\r\n<li>Basic probability concepts</li>\r\n</ul>\r\n</h6><h6><strong>Collecting and Summarizing Data</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>\r\n<ul>\r\n<li>Types of data and measurement scales</li>\r\n<li>Data collection method</li>\r\n<li>Techniques for assuring data accuracy and integrity</li>\r\n<li>Descriptive Statistics</li>\r\n<li>Graphical methods</li>\r\n</ul></h6>\r\n\r\n<h6><strong>Multi-vari Studies</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6><strong>Simple linear correlation and regression</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6><strong>Introduction to Improve and Control Phase</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6><strong>Design of Experiments</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6><strong>Statistical Process Control (SPC)</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6><strong>Implement and Validate Solution</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6><strong>Control Plan</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6><strong>Lean Process Improvement</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<h6>\r\n<ul>\r\n<li>Understanding Lean</li>\r\n<li>The Toyota Production System</li>\r\n<li>The Toyota Production System House</li>\r\n<li>The Five Critical Improvement Concepts</li>\r\n<li>Understanding Value with the Kano Model</li>\r\n<li>Types of Waste</li>\r\n<li>Creating a Lean Enterprise</li>\r\n<li>Understanding Lean</li>\r\n<li>The Plan, Do, Study, Act (PDSA) Cycle</li>\r\n<li>Using the R-DMAIC-S Model</li>\r\n<li>Lean Thinking Tools</li>\r\n<li>Kaizen Events</li>\r\n<li>Data Gathering and Mapping</li>\r\n</ul></h6>\r\n\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<ul>\r\nQuality professionals, engineers, production managers, and front line supervisors; process owners and champions charged with the responsibility of improving quality, Mid to upper-level managers responsible for top-line growth will gain skills to implement cost reductions and improved organizational capability and capacity and processes at the organizational or departmental level\r\n</ul>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Premium Package with E-Course and Two (2) Exam Vouchers', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '40 Days', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '213 $', '300 $', '85 $', '170 $', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CLSSGB%29', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=LSSGB', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CLSSGB', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', 'green_belt1.jpg');
INSERT INTO `org_subcategory` VALUES ('39', 'Certified Lean Six Sigma Black Belt ', '4', '<strong>CLSSBB</strong>', '1', '1', '<p>Certified Lean Six Sigma Black Belt (CLSSBB)â„¢ is well versed in the Lean Six Sigma Methodology who leads improvement projects, typically in a full-time role. A Certified Lean Six Sigma Black Belt holder possesses a thorough understanding of all aspects within the phases of D-M-A-I-C. They understand how to perform and interpret 6 Sigma black belt tools and how to use standard principles of Lean. The Certified Lean Six Sigma Black Belt is a professional who can explain Six Sigma philosophies and principles, including supporting systems and tools. A Black Belt should demonstrate team leadership, understand team dynamics and assign team member roles and responsibilities. Black Belts have a thorough understanding of all aspects of the DMAIC model in accordance with Six Sigma principles. They have basic knowledge of Lean enterprise concepts, are able to identify non-value-added elements and activities and are able to use specific tools.&nbsp;</p>\r\n\r\n<p>Black Belts operate under Master Black Belts to apply Six Sigma methodology to specific projects. They devote 100% of their valued time to Six Sigma. They primarily focus on Six Sigma project execution and special leadership with special tasks, whereas Champions and Master Black Belts focus on identifying projects/functions for Six Sigma<br>\r\n</p>\r\n\r\n', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-exam-information\" id=\"synved-tabs-1-1\" aria-labelledby=\"ui-id-2\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Exam Pattern</strong></p>\r\n<p></p>\r\n<h6>The exam comprises of 150 Multiple Choice Questions out of which the candidate needs to score 75% (112 out of 150 correct) to pass the exam.</h6>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Duration of exam</strong></h6>\r\n<p></p>\r\n<h6>The total duration of the exam is 2 hours (120 Minutes)</h6>\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Closed book</strong></p>\r\n<p></p>\r\n<h6>No external sources of information may be accessed during the exam at Pearson Vue Test Center. Further details of the materials permitted are provided:</h6>\r\n<h6>\r\n<ul>\r\n<li>Identification Proof</li>\r\n<li>Scientific Calculator will be provided by Pearson Vue Test Center.</li>\r\n</ul>\r\n</h6>\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Retaking of exam</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</li>\r\n<li>The exam can be taken any number of times.</li>\r\n</ol></h6>\r\n\r\n<h6 style=\"margin-bottom: 0px; text-decoration: underline;\"><strong>Certification Validity</strong></h6>\r\n<p></p>\r\n<h6>\r\n<ol>\r\n<li>The validity period of Certified Lean Six Sigma Black Belt (CLSSBB)â„¢ Certificate is for five (5) years, the candidate needs to either retake the exam or can complete the E-Course for CLSSBB to accrue the number of continuing education units (CEUs) to renew the Certificate. Renewing the certificate will allow the candidate to retain the professional stature and credentials intact.</li>\r\n<li>Certificates must be renewed on or before the expiration date (when they become inactive) to be current.</li>\r\n</ol></h6>\r\n\r\n<p style=\"margin-bottom: 0; text-decoration: underline; color: #303030;\"><strong>Credits </strong></p>\r\n<p></p>\r\n<h6>Successfully passing the CLSSBB exam will also earn candidates a total of 60 Credits towards MBA in Six Sigma (Masterâ€™s Degree) offered by Charisma University. </h6>\r\n<p></p>\r\n<p></p>\r\n<h6><span style=\"color: red;\">Note: The <strong>Certified Lean Six Sigma Black Belt (CLSSBB)â„¢ </strong>Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommend doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam.</span></h6>\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-course-outline\" id=\"synved-tabs-1-2\" aria-labelledby=\"ui-id-3\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6><strong>1.1 Section I â€“ Organizational Roadblocks and Lean Management</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<ul>\r\n<h6>\r\n<li>Organizational roadblocks</li>\r\n<li>Resistance Analysis</li>\r\n<li>Overview of all Continuous Improvement approaches</li>\r\n<li>Overview of Lean</li>\r\n<li>Overview of Six Sigma</li>\r\n<li>Lean Management explained â€” TAKT Time, Cycle Time, PCE, Lead Time, SWIP, Setup time, Changeover time</li>\r\n<li>Lean Tools explained â€” 5S, Kaizen, SMED, Heijunka</li>\r\n</h6></ul>\r\n\r\n<h6><strong>1.2 Section II â€“ Pre-define DMAIC and Define</strong></h6>\r\n<p><strong>1.2.1 Pre-define</strong></p>\r\n<ul>\r\n<h6>\r\n<li>DMAIC versus DFSS</li>\r\n<li>Pre-define Pre-requisites and Qualifications</li>\r\n<li>Project Prioritization Matrix</li>\r\n<li>Introduction to Enterprise Wide view versus LOB view</li>\r\n<li>NPV and IRR</li>\r\n</h6></ul>\r\n\r\n<p><strong>1.2.2 Define</strong></p>\r\n<ul>\r\n<h6>\r\n<li>Championâ€™s transfer of project</li>\r\n<li>Team dynamics and facilitation</li>\r\n<li>Project Charterâ€™s role</li>\r\n<li>SIPOC/COPIS map</li>\r\n<li>VOC/VOB/VOP</li>\r\n<li>CTQ, CTC, CTS</li>\r\n<li>VOC â€“ CTQ Tree</li>\r\n<li>Kano Model</li>\r\n<li>Quality Function Deployment</li>\r\n<li>Baseline performance of Y</li>\r\n<li>Business Metrics for Y</li>\r\n<li>Rolled Throughput Yield (RTY)</li>\r\n<li>Statistical Definition of Six Sigma</li>\r\n</h6></ul>\r\n\r\n<h6><strong>1.3 Section III â€“ Measure</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<ul>\r\n<h6>\r\n<li>Objectives of Measure Phase</li>\r\n<li>Types of Data and Data Distribution models (Normal, Binomial and Poisson Distribution discussed)</li>\r\n<li>Scales of Data</li>\r\n<li>Measures of Central Tendency</li>\r\n<li>Measures of Dispersion</li>\r\n<li>Measurement Systems Analysis</li>\r\n<li>Variables GAGE RR</li>\r\n<li>Attribute RR</li>\r\n<li>Stability Check â€” Importance of Stability</li>\r\n<li>Capability Check â€” Cp, Cpk, Cpkm explained, How to understand Attribute Capability</li>\r\n<li>Variations, Variability and Capability</li>\r\n<li>Graphical tools to understand Data distribution</li>\r\n<li>Understanding Weibull (2 Parameter, 3 Parameter and Rayleigh) Distribution</li>\r\n<li>Correlating Calculations to Business Measures</li>\r\n<li>Checking Normality of Data (Anderson Darling, Ryan Joiner and Kolmogorov Smirnov)</li>\r\n</h6></ul>\r\n\r\n<h6><strong>1.4 Section IV â€“ Analyze</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<ul>\r\n<h6>\r\n<li>Objectives of Analyze</li>\r\n<li>Simple Linear Regression</li>\r\n<li>Multiple Linear Regression</li>\r\n<li>Curvilinear Regression</li>\r\n<li>Fishbone Diagram</li>\r\n<li>Pareto Charts</li>\r\n<li>Demarcating Common Causes and Special Causes</li>\r\n<li>Hypothesis Tests (Parametric and Non-Parametric tests)</li>\r\n<li>Statistical Validation</li>\r\n</h6><h6><strong>1.5 Section V â€“ Improve</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<li>Objectives of Improve</li>\r\n<li>Cost Benefit Analysis</li>\r\n<li>Solutions Prioritization Matrix</li>\r\n<li>Pugh Matrix</li>\r\n<li>Design of Experiments</li>\r\n<li>Introduction to DOE</li>\r\n<li>Basics of DOE</li>\r\n<li>Replication, Randomization and Blocking</li>\r\n<li>Main Effects and Interaction effects</li>\r\n<li>Full factorial experiments</li>\r\n<li>Fractional factorial experiments</li>\r\n<li>Screened Designs</li>\r\n<li>Response Surface Designs</li>\r\n<li>DOE with Regression</li>\r\n<li>DOE with example</li>\r\n</ul>\r\n\r\n<h6><strong>1.6 Section VI â€“ Control</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<ul>\r\n<h6>\r\n<li>Taguchiâ€™s Loss Function\r\n</li><li>Control Charts (Variable Control Charts and Attribute Control Charts)\r\n</li><li>Measurement System Re-analysis\r\n</li><li>Control Plan and Project Storyboard Transfer\r\n</li><li>Project Closure\r\n</li><li>Introduction to Total Productive Maintenance\r\n</li></h6></ul>\r\n\r\n<h6><strong>Lean Process Improvement</strong></h6><strong>\r\n</strong><p><strong></strong></p>\r\n<ul>\r\n<h6>\r\n<li>Understanding Lean</li>\r\n<li>The Toyota Production System</li>\r\n<li>The Toyota Production System House</li>\r\n<li>The Five Critical Improvement Concepts</li>\r\n<li>Understanding Value with the Kano Model</li>\r\n<li>Types of Waste</li>\r\n<li>Creating a Lean Enterprise</li>\r\n<li>Understanding Lean</li>\r\n<li>The Plan, Do, Study, Act (PDSA) Cycle</li>\r\n<li>Using the R-DMAIC-S Model</li>\r\n<li>Lean Thinking Tools</li>\r\n<li>Kaizen Events</li>\r\n<li>Data Gathering and Mapping</li>\r\n</h6></ul>\r\n\r\n<p></p></div>', '<div class=\"tab-body ui-tabs-panel ui-widget-content ui-corner-bottom synved-tab-title-target-audience\" id=\"synved-tabs-1-3\" aria-labelledby=\"ui-id-4\" role=\"tabpanel\" aria-expanded=\"true\" aria-hidden=\"false\" style=\"display: block;\"><p></p>\r\n<h6 style=\"margin-bottom: 0; text-decoration: underline;\"><strong>Target Audience</strong></h6>\r\n<p></p>\r\n<h6>Anyone who will be leading a Lean Six Sigma process improvement project or would like to master the principles involved to further their professional skills. It applies to staff, line supervisors, managers and directors in such areas as manufacturing, operations, customer service, engineering, IT, marketing, logistics, sales, quality, purchasing, health care, education, and health and safety, The certification is important to those who are a full time Project Managers.</h6>\r\n<p></p></div>', 'Premium Package (Includes E-Course and Exam Voucher)', 'Premium Package with E-Course and Two (2) Exam Vouchers', 'Standard Package (E-Course Only)', 'Exam Voucher', 'To Register for an Exam', '40 Days', '40 Days', '20 Days', 'Valid for Eight (8) Months', '-', '280 $', '400 $', '85 $', '210 $', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CLSSBB', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CLSSBB-001%29', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=%28CLSSBB%29', 'http://gaqm.org:8080/gaqm/elearn/voucherstore', 'https://www8.pearsonvue.com/testtaker/signin/SignInPage/GAQM', 'black_belt1.jpg');
