INSERT INTO `pl_course` VALUES ('4', 'Business Process Manager  (BPM) - Premium Package', '2', 'BPM-001', 'BPM-001BPM Premium Pack.jpg', 'Premium', '40', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>7 Hours</p>\r\n\r\n\r\n\r\n', '<p>Business process management helps organizations leverage processes to achieve their goals and be successful. Once processes are implemented, they must be monitored, evaluated, and optimized to make sure they are still meeting the goals that they were designed to accomplish. A business that can successfully manage its processes is able to maintain a competitive edge, while increasing productivity and efficiency and decreasing costs. </p>\r\n\r\n<p>The E-Course from GAQMBok (Body of Knowledge) will introduce you to business process management. You’ll learn how business processes can help you improve your company’s bottom line by providing a higher level of quality and consistency for your customers.</p>\r\n', '<b>What Topics are Covered in the E-Course?</b>\r\n\r\n<p>1) The fundamentals of business process management</p>\r\n<p>2) Defining business process management</p>\r\n<p>3) Reflecting on processes</p>\r\n<p>4) The business process life cycle</p>\r\n<p>5) The vision phase</p>\r\n<p>6) The design phase (including process mapping)</p>\r\n<p>7) The modeling phase</p>\r\n<p>8) The execution phase</p>\r\n<p>9) The monitoring phase (including an introduction to the balanced scorecard and business activity monitoring)</p>\r\n<p>10) The optimizing phase(including an introduction to Lean and Six Sigma methods)</p>\r\n', '<b>What will you learn from this E-Course?</b>\r\n\r\n<p>1) Define business process management and related concepts</p>\r\n<p>2) Recognize the vital role processes play in a business</p>\r\n<p>3) Appreciate the role of technology in process management</p>\r\n<p>4) Develop a vision to guide process improvement</p>\r\n<p>5) Understand how to design or enhance an existing process using the business process life cycle </p>\r\n<p>6) Construct a process map </p>\r\n<p>7) Perform a what-if analysis to improve your processes</p>\r\n<p>8) Implement and monitor process changes</p>\r\n<p>9) Identify how Lean and Six Sigma methods can assist in managing and improving processes</p>\r\n<p>10) Use a variety of tools and techniques to eliminate waste and redundancies</p> \r\n', '<span style=\"color:red\">Note: The Business Process Manager (BPM) Certification requires a mandatory E-Course completion requirement. Once the candidate completes the E-Course, they will receive a GAQM Learner ID. This ID is required at the time of scheduling an exam at a Pearson Vue Testing Center. For more information, you can send an E-mail to support@gaqm.org</span>', '', '200', '2013-10-31 13:21:25', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('5', 'Associate in Project Management (APM) - Standard Package', '3', 'APM-001', 'APM-001APM-Std.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) Doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>', '<b>The Associate in Project Management (APM) E-Course Comprises of 3 Modules.</b>\r\n<p></p>\r\n<p>Module 1 - Project Management Fundamentals</p>\r\n\r\n<p>Module 2 - Project Management Training</p>\r\n\r\n<p>Module 3 - Intermediate Project Management</p>\r\n\r\n<p></p>', '<p style=\"font-size:13px\"> <span style=\"color:black\"><b>What will you learn from this E-Course?</b></font></p></span>\r\n\r\n<p><b>Module 1 - Project Management Fundamentals</p></b>\r\n<p></p>\r\n\r\n<p>1) Understand what is meant by a project and project management</p>\r\n<p>2) Identify benefits of projects</p>\r\n<p>3) Identify the phases of a project’s life cycle</p>\r\n<p>4) Enhance your  ability to sell ideas and make presentations</p>\r\n<p>5) Prioritize projects</p>\r\n<p>6) Begin conceptualizing your project, including goals and vision statements</p>\r\n<p>7) Use a target chart and other planning tools</p>\r\n<p>8) Complete a Statement of Work</p>\r\n\r\n\r\n<p></p>\r\n', '<p><b>Module 2 - Project Management Training</p></b>\r\n<p></p>\r\n\r\n<p>1) Understand what is meant by a project.</p>\r\n<p>2) Recognize what steps must be taken to complete projects on time and on budget.</p>\r\n<p>3) Have a better ability to sell ideas and make presentations.</p>\r\n<p>4) Know simple techniques and tools for planning and tracking your project.</p>\r\n<p>5) Have methods for keeping the team focused and motivated.</p>\r\n\r\n<p></p>', '<p><b>Module 3 - Intermediate Project Management</p></b>\r\n<p></p>\r\n<p>1) Identify your project’s tasks and resources</p>\r\n<p>2) Order tasks using the Work Breakdown Structure</p>\r\n<p>3) Schedule tasks effectively</p>\r\n<p>4) Use basic planning tools such as a Gantt chart, PERT diagram, and network diagram</p>\r\n<p>5) Prepare a project budget</p>\r\n<p>6) Modify the project budget and schedule to meet targets</p>\r\n<p>7) Identify and manage risks</p>\r\n<p>8) Develop a change control process</p>\r\n<p>9) Execute and terminate a project</p>\r\n<p></p>\r\n', '<span style=\"color:red\">Note: The Associate in Project Management (APM) Certification has no pre-requisites (Completion of an E-Course is not mandatory from GAQMBok portal), but we highly recommended doing the E-Course as maximum number of questions are drawn from the E-Course in the actual exam. </span>', '100', '2014-11-01 10:56:49', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('6', 'Certified Project Director (CPD) - Premium Package', '3', 'CPD-001', 'CPD-001CPD Premium Pack.jpg', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>', 'Whether you are managing a group of project managers, managing multiple projects or looking for a career path towards being a Project Director, you’re on the right track! With common challenges in managing scope, risk, budgets and cost, a project team can be directed to be more focused and successful. This one-day course includes many valuable project topics: align goals, projects and competencies; organizing multiple project communications; managing risk; tools to manage multiple projects; and, leadership.  At the end of the course, you will be required to  write an exam, once you qualify in the exam you will receive your official Certificate.', '<b>What Topics are Covered in the E-Course?</b>\r\n<p></p>\r\n<p>	1) Project leadership techniques</p>\r\n<p>	2) Project lifecycle in-depth focus</p>\r\n<p>	3) Utilizing matrices to support projects</p>\r\n<p>	4) Identifying gaps and utilizing strengths</p>\r\n<p>	5) Simplifying complex communications</p>\r\n<p>	6) Managing project change</p>\r\n<p>	7) Documenting Issues</p>\r\n<p>	8) Managing risk effectively</p>\r\n<p>	9) Tools for managing multiple projects </p>\r\n<p>	10) Technology needs assessment</p>\r\n\r\n', '<b>What will you learn from this E-Course?</b>\r\n<p></p>\r\n<p>1) Learn in-depth details of Life-cycle phases and process </p>\r\n<p>2) Use techniques to best align organizational goals with projects and project manager competencies</p>\r\n<p>3) Get the right information to the right people the right way</p>\r\n<p>4) Lean how to better manage project scope</p>\r\n<p>5) Establish valuable project cost management processes</p>\r\n<p>6) The Leadership way to establish personal goals</p>\r\n', '', '', '400', '2013-11-15 06:39:27', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('7', 'Business Process Manager (BPM) - Standard Package', '2', 'BPM-001 (E-Course Only)', 'BPM-001 (E-Course Only)BPM Standard Box.jpg', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>7 Hours</p>', '<p>Business process management helps organizations leverage processes to achieve their goals and be successful. Once processes are implemented, they must be monitored, evaluated, and optimized to make sure they are still meeting the goals that they were designed to accomplish. A business that can successfully manage its processes is able to maintain a competitive edge, while increasing productivity and efficiency and decreasing costs. </p>\r\n\r\n<p>The E-Course from GAQMBok (Body of Knowledge) will introduce you to business process management. You’ll learn how business processes can help you improve your company’s bottom line by providing a higher level of quality and consistency for your customers.</p>\r\n', '<b>What Topics are Covered in the E-Course?</b>\r\n\r\n<p>1) The fundamentals of business process management</p>\r\n<p>2) Defining business process management</p>\r\n<p>3) Reflecting on processes</p>\r\n<p>4) The business process life cycle</p>\r\n<p>5) The vision phase</p>\r\n<p>6) The design phase (including process mapping)</p>\r\n<p>7) The modeling phase</p>\r\n<p>8) The execution phase</p>\r\n<p>9) The monitoring phase (including an introduction to the balanced scorecard and business activity monitoring)</p>\r\n<p>10) The optimizing phase(including an introduction to Lean and Six Sigma methods)</p>\r\n', '<b>What will you learn from this E-Course?</b>\r\n\r\n<p>1) Define business process management and related concepts</p>\r\n<p>2) Recognize the vital role processes play in a business</p>\r\n<p>3) Appreciate the role of technology in process management</p>\r\n<p>4) Develop a vision to guide process improvement</p>\r\n<p>5) Understand how to design or enhance an existing process using the business process life cycle </p>\r\n<p>6) Construct a process map </p>\r\n<p>7) Perform a what-if analysis to improve your processes</p>\r\n<p>8) Implement and monitor process changes</p>\r\n<p>9) Identify how Lean and Six Sigma methods can assist in managing and improving processes</p>\r\n<p>10) Use a variety of tools and techniques to eliminate waste and redundancies</p>\r\n', '', '', '100', '2013-10-31 13:21:56', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('8', 'Certified Lean Six Sigma Yellow Belt (CLSSYB) - Standard Package', '4', 'CLSSYB', 'CLSSYBCLSSYB Standard Pack.jpg', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>', '<p>Certified Lean Six Sigma Yellow Belt (CLSSYB) exam comprises of basics of the Lean Six Sigma Methodology and supports improvement projects as a part of a team. A Lean Six Sigma Yellow Belt possesses an understanding of the aspects within the phases of D-M-C. They apply this knowledge to all aspects of their primary functions. </p>\r\n\r\n<p>Six Sigma is a business strategy that focuses on product and service excellence, to create a culture that demands perfection. The DMAIC methodology is the road-map to achieving this target. This e-Learning course attempts to train novices on the principles of Six Sigma and takes them through the DMAIC process. </p>\r\n\r\n', '<b>What are the Modules covered in this E-Course?</b>\r\n\r\n<p>1) INTRODUCTION</p>\r\n<p>2) DEFINE</p>\r\n<p>3) MEASURE</p>\r\n<p>4) BASIC STATISTICS</p>\r\n<p>5) ANALYZE</p>\r\n<p>7) IMPROVE</p>\r\n<p>8) CONTROL</p>\r\n<p>9) A Lean Glossary</p>\r\n<p>10) Lean Principles and Process Improvement</p>\r\n', '<b>What Topics are Covered in this E-Course?</b>\r\n<p></p>\r\n<p>1) Recognize the advantages of Six Sigma</p>\r\n<p>2) List the industries where it can be applied</p>\r\n<p>3) Explain the use of the DMAIC methodology to achieve process excellence</p>\r\n<p>4) Describe the use of statistics in applying the DMAIC methodology</p>\r\n<p>5) Understanding Lean </p>\r\n \r\n<p>6) The Toyota Production System </p>\r\n \r\n<p>7) The Toyota Production System House</p>\r\n \r\n<p>8) The Five Critical Improvement Concepts</p>\r\n \r\n<p>9) Understanding Value with the Kano Model</p>\r\n \r\n<p>10) Types of Waste</p>\r\n \r\n<p>11) Creating a Lean Enterprise</p>\r\n \r\n<p>12) Understanding Lean </p>\r\n \r\n<p>13) The Plan, Do, Study, Act (PDSA) Cycle</p>\r\n \r\n<p>14) Using the R-DMAIC-S Model</p>\r\n \r\n<p>15) Lean Thinking Tools</p>\r\n \r\n<p>16) Kaizen Events</p>\r\n \r\n<p>17) Data Gathering and Mapping</p>', '<b>Who should take this E-Course?</b>\r\n<p></p>\r\nMembers of the service sector who need familiarity with the Lean Six Sigma process and basic process improvement tools; individuals who are on teams and in organizations that are beginning to deploy Six Sigma, one who is looking to be a member of the Six Sigma Project.', '', '100', '2013-10-31 13:32:50', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('9', 'IMTQN Certified Mobile Application Tester (CMAT) - Standard Pack', '5', 'CMAT-001', 'CMAT-001cmatfndstd.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>7 Hours</p>\r\n', '<p>Many of us think about pursuing a career in this field of testing. Starting from a beginner in this domain to becoming an expert, the IMTQN Certified Mobile Application Tester (CMAT) – Foundation Level Certification is interesting and helpful to know what could be the different questions that are asked to people by an employer while selecting them for various positions in the mobile testing field such as a software tester. </p>', '<p>As more and more applications are getting developed for Mobile Devices including Smartphones, Mobile Application Testing is becoming very important part of Mobile Application Development Ecosystem. There is very limited margin of error and the cost of buggy application can be huge in today\'s era of social media. One mistake and your investments can all be put at risk because of negative publicity. But one fact cannot be ignored – all code is developed by humans and there is always an element of risk and unnown left with programmers who are coding the system.</p>', '<b>The reasons why mobile application testing is required :</b>\r\n \r\n<p>1. Many Types of mobile devices Hardware</p>\r\n \r\n<p>2. Different types of Mobile Platforms/Operating systems from various companies. </p>\r\n \r\n<p>3. Different Mobile Carriers</p>\r\n \r\n<p>4. Many types of Mobile screens</p>\r\n', '<b>Who should take this E-Course?</b>\r\n\r\n<p> Mobile Software Test Managers or Engineers</p>\r\n<p> Software Testers involved in testing Mobile Apps</p>\r\n<p> Candidates who are seeking a new career in the field of Mobile Application Testing</p>', '', '100', '2013-11-15 08:17:23', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('10', 'Certified Supply Chain Manager (CSCM) - Standard Package', '2', 'CSCM-001', 'CSCM-001CSCM Standard Box.jpg', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>', '<p>Supply Chain Management improves the coordination and relationship between Suppliers, Producers, and Customers. It must be kept at a high level of organization to be successful in today’s global economy. Goods and services are now pieced together from all over the world, and this process can be hectic and complicated if not managed correctly.</p>\r\n\r\n<p>With Supply Chain Management, your company and employees will be on target to lower costs, improving efficiency, and increase customer satisfaction. </p>\r\n\r\n<p>This E-course will provide your employees with the understanding of how Supply Chain Management can improve and help almost any type of business.</p>', '<b>What Topics are Covered in the E-Course?</b>\r\n<p></p>\r\n<b>Module 1 - Supply Chain Management</b>\r\n<p></p>\r\n<p>1) Take a look at inventory management</p>\r\n<p>2) Study supply chain groups</p>\r\n<p>3) Review tracking and monitoring methods</p>\r\n<p>4) Examine supply chain event management</p>\r\n<p>5) Comprehend the flows of supply chain management and data warehouses</p>\r\n<p>6) Understand the levels of supply chain management and their effects</p>\r\n<p>7) Identify how supply chain management relates to: Customer satisfaction, Improving performance, Lowering costs, and Product development</p>\r\n', '<b>Module 2 - Inventory Management</b>\r\n<p></p>\r\n<p>1) What is inventory?</p>\r\n<p>2) Types of inventory</p>\r\n<p>3) Key players</p>\r\n<p>4) Setting up the warehouse</p>\r\n<p>5) What makes a good inventory management system?</p>\r\n<p>6) The warehouse inventory cycle</p>\r\n<p>7) Identifying demand</p>\r\n<p>8) Validating inventory</p>\r\n<p>9) The put-away and receiving process</p>\r\n<p>10) Maintaining inventory accuracy</p>\r\n<p>11) The outbound process</p>\r\n<p>12) Industry trends</p>\r\n', '', '', '100', '2013-10-31 13:33:09', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('11', 'Certified Software Tester - Foundation Level - Standard Package', '5', 'CSTFL-001', 'CSTFL-001CSTFLLatStd.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>20 Hours</p>', '<p>The Certified Software Tester – Foundation Level Exam is a first step in your career. You are not obligated to have testing experience. What you need is to understand is the general types of applications. The main goals are to ensure a broad understanding of the key concepts in software testing and provide a foundation for a future career growth. Another goal is to understand key concepts in software testing to advance level.</p>\r\n\r\n<p>Those who require a basic grounding in software testing such as Project Managers, Quality Managers, Software Development Managers, Business Analysts, IT Directors and Management Consultants will also benefit from gaining the Certified Software Tester (CSTE) Credential.</p>\r\n\r\n<p>In this E-Course the participant will learn all the steps of the software test process, from test planning to test specification and running the tests.</p>\r\n\r\n<p>Our E-Learning Course is broken into bite-size lessons and combines leading edge multimedia and interactive exercises for optimum enjoyment and knowledge retention. The e-learning course also comprises of unique mock exam simulator which allows you to test and re-test your understanding of the Software Testing foundations and be confident for the exams. </p>\r\n\r\n\r\n', '<p><b>1. The fundamentals of testing:</b> Why is testing necessary? Harm caused by defects in software; root causes; testing and quality assurance; what is testing? General testing principles; Fundamental test process and the psychology of testing.\r\n\r\n<p><b>2. Testing throughout the software life cycle: </b>Software development models; test levels, objectives, objects and targets of testing; functional, non-functional, structural and change-related testing; confirmation, regression and maintenance testing.</p>\r\n\r\n<p><b>3. Static techniques: </b>Reviews and the test process; typical formal review process; different types of review: informal review, technical review, walkthrough and inspection; static analysis tools.</p>\r\n\r\n<p><b>4. Test design techniques:</b> Identifying test conditions and designing test cases; equivalence partitioning; boundary value analysis; decision tables; state transition diagrams, use case testing; statement and decision coverage; control flows using statement testing and decision testing; experience based techniques; choosing techniques.</p>\r\n\r\n<p><b>5. Business Analyst Skills Introduction to Business :</p></b>\r\n\r\n<p>Introduction to Business Process Analysis</p>\r\n<p>Why Business Analysis</p>\r\n<p>Roles and responsibilities of a Business Analyst</p>\r\n<p>Key concept of business analysis</p>\r\n<p>What is domain knowledge?</p>\r\n<p>How to adapt with different domains</p>\r\n\r\n<p><b>6. Test management: </b>Test organization, planning and estimation; ‘Standard for Software Test Documentation’ (IEEE 829); exit criteria; test progress monitoring and control; metrics and reporting; configuration management; risk and testing; incident management; incident reporting.</p>\r\n\r\n<p><b>7. Tool support for testing: </b>Types of test tool; effective use of tools; potential benefits and risks; introducing tools.</p>\r\n\r\n\r\n', '', '', '', '150', '2014-02-14 05:11:28', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('12', 'Professional in Project Management (PPM) - Premium Package', '3', 'PPM-001', 'PPM-001PPM-Premium.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>60 Hours</p>', '</>Projects and project management has become the foundation for success in the public and private sectors. Enterprises achieve their goals through projects and effective project management. Successful project management requires achieving the scope (e.g., intended result), cost and schedule. In addition, the increasing complexity of work and demands for “more with less” place special demands on the project manager.</p>\r\n\r\n<p>These programs go beyond the “What is project management and practices” to providing practical “How To” guidance, tools and techniques, and processes to implement in today’s working world.</p>', '<b>What Modules are Covered in the E-Course?</b>\r\n\r\n<p>Module 1 – Project Management Fundamentals</p>\r\n<p>Module 2 – Project Management Training</p>\r\n<p>Module 3 – Intermediate Project Management</p>\r\n<p>Module 4 – Effective Planning & Scheduling </p>\r\n<p>Module 5 – Advanced Project Management</p>\r\n<p>Module 6 – Team Building</p>\r\n<p>Module 7 – Building Better Teams</p>\r\n<p>Module 8 – Risk Management</p>\r\n<p>Module 9 – Crisis Management </p>\r\n<p>Module 10 – Time Management </p>\r\n<p>Module 11 – Leadership Skills </p>\r\n<p>Module 12 – Self-Leadership </p>\r\n<p>Module 13 – Communication Strategies </p>\r\n<p>Module 14 – Knowledge Management </p>', '<b>Who should take this Exam?</b>\r\n\r\n <p>Professionals involved directly or indirectly with projects in virtually every industry</p>\r\n\r\n <p>New managers and prospective managers, as well as newly promoted supervisors from both technical and non-technical professions including: engineering, telecommunications, computer/information technology, biological/health sciences, pharmaceuticals and biotechnology, environmental technology, hospitality/food services, professional associations and government.</p>\r\n', '<span style=\"color:red\">Note: The Professional in Project Management (PPM) Certification requires a mandatory E-Course completion requirement. Once the candidate completes the E-Course, they will receive a GAQM Learner ID. This ID is required at the time of scheduling an exam at a Pearson Vue Testing Center. For more information, you can send an E-mail to support@gaqm.org</span>', '', '400', '2014-11-01 10:53:43', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('13', 'ITIL® Foundation - Standard Package', '9', 'ITILF', 'ITILFITIL Standard Pack.jpg', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>20 Hours</p>', '<p>ITIL Foundation is suitable for individuals who require a basic understanding of the ITIL framework and how it may be used to enhance the quality of IT service management within an organization. The ITIL Foundation Certification also applies to IT professionals who work within an organization that has adopted ITIL and so need to be aware of and contribute to the overall service improvement programme.</p>\r\n\r\n\r\n<p>The Information Technology Infrastructure Library (ITIL) is a set of practices for IT service management (ITSM) that focuses on aligning IT services with the needs of business. In its current form (known as ITIL 2011 edition), ITIL is published in a series of five core publications, each of which covers an ITSM lifecycle stage. ITIL underpins ISO/IEC 20000 (previously BS15000), the International Service Management Standard for IT service management, although differences between the two frameworks do exist.</p>\r\n\r\n<b>The main benefits of ITIL include:</b>\r\n<p></p>\r\n<p>Alignment with business needs ITIL becomes an asset to the business when IT can proactively recommend solutions as a response to one or more business needs. The IT Strategy Group recommended in Service Strategy and the implementation of Service Portfolio Management gives IT the opportunity to understand the business’ current and future needs and develop service offerings that can address them.</p>\r\n\r\n<p>Negotiated achievable service levels. Business and IT become true partners when they can agree upon realistic service levels that deliver the necessary value at an acceptable cost.</p>\r\n\r\n <p>Predictable, consistent processes. Customer expectations can be set and are easier to meet with through the use of predictable processes that are consistently used. As well, good practice processes are foundational and can assist in laying the groundwork to meet regulatory compliance requirements.</p>\r\n\r\n <p>Efficiency in service delivery. Well-defined processes with clearly documented accountability for each activity as recommended through the use of a RACI matrix can significantly increase the efficiency of processes. In conjunction with the evaluation of efficiency metrics that indicate the time required to perform each activity, service delivery tasks can be optimized.</p>\r\n\r\n<p>Measurable, improvable services and processes. The adage that you can’t manage what you cannot measure rings true here. Consistent, repeatable processes can be measured and therefore can be better tuned for accurate delivery and overall effectiveness. Additionally, under ITIL guidelines, services are designed to be measurable.  With the proper metrics and monitoring in place, IT organizations can monitor SLAs and make improvements as necessary.</p>\r\n', '<b>Learning Objectives</b>\r\n\r\n<p>Candidates can expect to gain knowledge and understanding in the following upon successful completion of the education and examination components related to the ITIL 2011 Foundation certification.</p>\r\n\r\n <p>Service Management as a practice (Comprehension)</p>\r\n <p>Service Lifecycle (Comprehension)</p>\r\n <p> Key Principles and Models (Comprehension)</p>\r\n <p>Generic Concepts (Awareness)</p>\r\n <p>Selected Processes (Awareness)</p>\r\n <p> Selected Roles (Awareness)</p>\r\n <p> Selected Functions (Awareness)</p>\r\n <p>Technology and Architecture (Awareness)</p>\r\n <p>ITIL Qualification scheme (Awareness)</p>\r\n', '<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n', '', '', '100', '2014-02-05 04:20:02', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('14', 'Certified Lean Six Sigma Green Belt (CLSSGB) - Standard Package', '4', 'CLSSGB', 'CLSSGBCLSSGB STANDARD BOX.jpg', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) E-Courseware is written by Six Sigma Champion\'s</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>Lean Six Sigma Green Belts are valuable assets to any team. Our Certified Lean Six Sigma Green Belt (CLSSGB)™ E-Learning will introduce you to the Lean Six Sigma philosophy and terminology and give’s you the knowledge you need to prepare for Certified Lean Six Sigma Green Belt (CLSSGB)™ Exam.  </p>\r\n\r\n<p>With this E-Course-ware you will gain a strong foundation in Lean Six Sigma and the skills needed to lead Lean Six Sigma process improvement projects, work on teams led by Lean Six Sigma Black Belts and help your organization implement Lean Six Sigma effectively.</p>', '<p>This E-Course will also give you the foundation to begin implementing Lean process improvement tools in your workplace. It  will explore the foundations of Lean through the Toyota precepts and the five critical improvement concepts (value, waste, variation, complexity, and continuous improvement). The second day will give participants tools to perform continuous improvement in their organization, including 5S, 5W-2H, PDSA, DMAIC, Kaizen, Genchi Genbutsu, and various Lean data mapping methods.</p>', '<b>What Topics are Covered in this E-Course?</b>\r\n \r\n<p>1) Overview: Six Sigma and the Organization</p>\r\n\r\n<p>2) Six sigma and Organizational Goals</p>\r\n\r\n<p>3) Lean Principles in the organization</p>\r\n\r\n<p>4) Design for Six Sigma (DFSS) in the organization</p>\r\n\r\n<p>5) Introduction to the Define Phase</p>\r\n\r\n<p>6) Project Management Basics</p>\r\n\r\n<p>7) Other Tools and Techniques</p>\r\n\r\n<p>8) Process Analysis and Documentation</p>\r\n\r\n<p>9) Collecting and Summarizing Data</p>\r\n\r\n<p>10) Multi-vari Studies </p>\r\n\r\n<p>11) Simple linear correlation and regression</p>\r\n\r\n<p>12) Introduction to Improve and Control Phase</p>\r\n\r\n<p>13) Design of Experiments</p>\r\n\r\n<p>14) Statistical Process Control (SPC)</p>\r\n\r\n<p>15) Implement and Validate Solution</p>\r\n\r\n<p>16) Control Plan</p>\r\n\r\n<p>17) Understanding Lean </p>\r\n \r\n<p>18) The Toyota Production System </p>\r\n \r\n<p>19) The Toyota Production System House</p>\r\n \r\n<p>20) The Five Critical Improvement Concepts</p>\r\n \r\n<p>21) Understanding Value with the Kano Model</p>\r\n \r\n<p>22) Types of Waste</p>\r\n \r\n<p>23) Creating a Lean Enterprise</p>\r\n \r\n<p>24) Understanding Lean </p>\r\n \r\n<p>25) The Plan, Do, Study, Act (PDSA) Cycle</p>\r\n \r\n<p>26) Using the R-DMAIC-S Model</p>\r\n \r\n<p>27) Lean Thinking Tools</p>\r\n \r\n<p>28) Kaizen Events</p>\r\n \r\n<p>29) Data Gathering and Mapping</p>\r\n \r\n\r\n', '', '', '100', '2013-10-31 13:31:03', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('15', 'Certified Lean Six Sigma Green Belt (CLSSGB) - Premium Package', '4', '(CLSSGB)', '(CLSSGB)CLSSGB Premium Box.jpg', 'Premium', '40', '<b>Highlights of the Package</b>\r\n\r\n<p>1) E-Courseware is written by Six Sigma Champion\'s</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>\r\n', '<p>Lean Six Sigma Green Belts are valuable assets to any team. Our Certified Lean Six Sigma Green Belt (CLSSGB)™ E-Learning will introduce you to the Lean Six Sigma philosophy and terminology and give’s you the knowledge you need to prepare for Certified Lean Six Sigma Green Belt (CLSSGB)™ Exam.  </p>\r\n\r\n<p>With this E-Course-ware you will gain a strong foundation in Lean Six Sigma and the skills needed to lead Lean Six Sigma process improvement projects, work on teams led by Lean Six Sigma Black Belts and help your organization implement Lean Six Sigma effectively.</p>\r\n', '<p>This E-Course will also give you the foundation to begin implementing Lean process improvement tools in your workplace. The first day will explore the foundations of Lean through the Toyota precepts and the five critical improvement concepts (value, waste, variation, complexity, and continuous improvement). The second day will give participants tools to perform continuous improvement in their organization, including 5S, 5W-2H, PDSA, DMAIC, Kaizen, Genchi Genbutsu, and various Lean data mapping methods.</p>', '<b>What Topics are Covered in this E-Course?</b>\r\n \r\n<p>1) Overview: Six Sigma and the Organization</p>\r\n\r\n<p>2) Six sigma and Organizational Goals</p>\r\n\r\n<p>3) Lean Principles in the organization</p>\r\n\r\n<p>4) Design for Six Sigma (DFSS) in the organization</p>\r\n\r\n<p>5) Introduction to the Define Phase</p>\r\n\r\n<p>6) Project Management Basics</p>\r\n\r\n<p>7) Other Tools and Techniques</p>\r\n\r\n<p>8) Process Analysis and Documentation</p>\r\n\r\n<p>9) Collecting and Summarizing Data</p>\r\n\r\n<p>10) Multi-vari Studies </p>\r\n\r\n<p>11) Simple linear correlation and regression</p>\r\n\r\n<p>12) Introduction to Improve and Control Phase</p>\r\n\r\n<p>13) Design of Experiments</p>\r\n\r\n<p>14) Statistical Process Control (SPC)</p>\r\n\r\n<p>15) Implement and Validate Solution</p>\r\n\r\n<p>16) Control Plan</p>\r\n\r\n<p>17) Understanding Lean </p>\r\n \r\n<p>18) The Toyota Production System </p>\r\n \r\n<p>19) The Toyota Production System House</p>\r\n \r\n<p>20) The Five Critical Improvement Concepts</p>\r\n \r\n<p>21) Understanding Value with the Kano Model</p>\r\n \r\n<p>22) Types of Waste</p>\r\n \r\n<p>23) Creating a Lean Enterprise</p>\r\n \r\n<p>24) Understanding Lean </p>\r\n \r\n<p>25) The Plan, Do, Study, Act (PDSA) Cycle</p>\r\n \r\n<p>26) Using the R-DMAIC-S Model</p>\r\n \r\n<p>27) Lean Thinking Tools</p>\r\n \r\n<p>28) Kaizen Events</p>\r\n \r\n<p>29) Data Gathering and Mapping</p>', '', '', '250', '2013-10-31 13:31:11', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('16', 'Certified Lean Six Sigma Black Belt (CLSSBB) - Premium Package', '4', 'CLSSBB', 'CLSSBBCLSSBB Premium Box copy.jpg', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>40 Hours</p>\r\n', '<p>Certified Lean Six Sigma Black Belt (CLSSBB)™ is well versed in the Lean Six Sigma Methodology who leads improvement projects, typically in a full-time role. A Certified Lean Six Sigma Black Belt holder possesses a thorough understanding of all aspects within the phases of D-M-A-I-C. They understand how to perform and interpret 6 Sigma black belt tools and how to use standard principles of Lean.</p>\r\n\r\n<p>Black Belts operate under Master Black Belts to apply Six Sigma methodology to specific projects. They devote 100% of their valued time to Six Sigma. They primarily focus on Six Sigma project execution and special leadership with special tasks, whereas Champions and Master Black Belts focus on identifying projects/functions for Six Sigma.</p>', '<b>What Topics are Covered in this E-Course?</b>\r\n\r\n<b><p>Organizational Roadblocks and Lean Management</b></p>\r\n<p>Pre-define DMAIC and Define</p>\r\n<p>Organizational roadblocks</p>\r\n<p>Resistance Analysis</p>\r\n<p>Overview of all Continuous Improvement approaches</p>\r\n<b><p>Overview of Lean</b></p>\r\n<b><p>Overview of Six Sigma</b></p>\r\n<p>Lean Management explained — TAKT Time, Cycle Time, PCE, Lead Time, SWIP, Setup time, Changeover time</p>\r\n<p>Lean Tools explained — 5S, Kaizen, SMED, Heijunka</p>\r\n<b><p>1.2 Section II – </b></p>\r\n<b><p>1.2.1 Pre-define</b></p>\r\n<p>DMAIC versus DFSS</p>\r\n<p>Pre-define Pre-requisites and Qualifications</p>\r\n<p>Project Prioritization Matrix</p>\r\n<p>Introduction to Enterprise Wide view versus LOB view</p>\r\n<p>NPV and IRR</p>\r\n<b><p>1.2.2 Define</p></b>\r\n<p>Champion’s transfer of project</p>\r\n<p>Team dynamics and facilitation</p>\r\n<p>Project Charter’s role</p>\r\n<p>SIPOC/COPIS map</p>\r\n<p>VOC/VOB/VOP</p>\r\n<p>CTQ, CTC, CTS</p>\r\n<p>VOC – CTQ Tree</p>\r\n<p>Kano Model</p>\r\n<p>Quality Function Deployment</p>\r\n<p>Baseline performance of Y</p>\r\n<p>Business Metrics for Y</p>\r\n<p>Rolled Throughput Yield (RTY)</p>\r\n<p>Statistical Definition of Six Sigma</p>\r\n<b><p>1.3 Section III – Measure</b></p>\r\n<p>Objectives of Measure Phase</p>\r\n<p>Types of Data and Data Distribution models (Normal, Binomial and Poisson Distribution discussed)</p>\r\n<p>Scales of Data</p>\r\n<p>Measures of Central Tendency</p>\r\n<p>Measures of Dispersion</p>\r\n<p>Measurement Systems Analysis</p>\r\n<p>Variables GAGE RR</p>\r\n<p>Attribute RR</p>\r\n<p>Stability Check — Importance of Stability</p>\r\n<p>Capability Check — Cp, Cpk, Cpkm explained, How to understand Attribute Capability</p>\r\n<p>Variations, Variability and Capability</p>\r\n<p>Graphical tools to understand Data distribution</p>\r\n<p>Understanding Weibull (2 Parameter, 3 Parameter and Rayleigh) Distribution</p>\r\n<p>Correlating Calculations to Business Measures</p>\r\n<p>Checking Normality of Data (Anderson Darling, Ryan Joiner and Kolmogorov Smirnov)</p>\r\n<b><p>1.4 Section IV – Analyze</b></p>\r\n<p>Objectives of Analyze</p>\r\n<p>Simple Linear Regression</p>\r\n<p>Multiple Linear Regression</p>\r\n<p>Curvilinear Regression</p>\r\n<p>Fishbone Diagram</p>\r\n<p>Pareto Charts</p>\r\n<p>Demarcating Common Causes and Special Causes</p>\r\n<p>Hypothesis Tests (Parametric and Non-Parametric tests)</p>\r\n<p>Statistical Validation</p>\r\n<b><p>1.5 Section V – Improve</p></b>\r\n<p>Objectives of Improve</p>\r\n<p>Cost Benefit Analysis</p>\r\n<p>Solutions Prioritization Matrix</p>\r\n<p>Pugh Matrix</p>\r\n<p>Design of Experiments</p>\r\n<p>Introduction to DOE</p>\r\n<p>Basics of DOE</p>\r\n<p>Replication, Randomization and Blocking</p>\r\n<p>Main Effects and Interaction effects</p>\r\n<p>Full factorial experiments</p>\r\n<p>Fractional factorial experiments</p>\r\n<p>Screened Designs</p>\r\n<p>Response Surface Designs</p>\r\n<p>DOE with Regression</p>\r\n<p>DOE with example</p>\r\n<b><p>1.6 Section VI – Control</b></p>\r\n<p>Taguchi’s Loss Function</p>\r\n<p>Control Charts (Variable Control Charts and Attribute Control Charts)</p>\r\n<p>Measurement System Re-analysis</p>\r\n<p>Control Plan and Project Storyboard Transfer</p>\r\n<p>Project Closure</p>\r\n<p>Introduction to Total Productive Maintenance</p>\r\n<b><p>Lean Process Improvement</b></p>\r\n<p>Understanding Lean</p>\r\n<p>The Toyota Production System</p>\r\n<p>The Toyota Production System House</p>\r\n<p>The Five Critical Improvement Concepts</p>\r\n<p>Understanding Value with the Kano Model</p>\r\n<p>Types of Waste</p>\r\n<p>Creating a Lean Enterprise</p>\r\n<p>Understanding Lean</p>\r\n<p>The Plan, Do, Study, Act (PDSA) Cycle</p>\r\n<p>Using the R-DMAIC-S Model</p>\r\n<p>Lean Thinking Tools</p>\r\n<p>Kaizen Events</p>\r\n<p>Data Gathering and Mapping</p>\r\n', '', '', '', '400', '2013-11-15 08:30:26', '1', '1', '30');
