ng</p>\r\n<p>Main Effects and Interaction effects</p>\r\n<p>Full factorial experiments</p>\r\n<p>Fractional factorial experiments</p>\r\n<p>Screened Designs</p>\r\n<p>Response Surface Designs</p>\r\n<p>DOE with Regression</p>\r\n<p>DOE with example</p>\r\n<b><p>1.6 Section VI – Control</b></p>\r\n<p>Taguchi’s Loss Function</p>\r\n<p>Control Charts (Variable Control Charts and Attribute Control Charts)</p>\r\n<p>Measurement System Re-analysis</p>\r\n<p>Control Plan and Project Storyboard Transfer</p>\r\n<p>Project Closure</p>\r\n<p>Introduction to Total Productive Maintenance</p>\r\n<b><p>Lean Process Improvement</b></p>\r\n<p>Understanding Lean</p>\r\n<p>The Toyota Production System</p>\r\n<p>The Toyota Production System House</p>\r\n<p>The Five Critical Improvement Concepts</p>\r\n<p>Understanding Value with the Kano Model</p>\r\n<p>Types of Waste</p>\r\n<p>Creating a Lean Enterprise</p>\r\n<p>Understanding Lean</p>\r\n<p>The Plan, Do, Study, Act (PDSA) Cycle</p>\r\n<p>Using the R-DMAIC-S Model</p>\r\n<p>Lean Thinking Tools</p>\r\n<p>Kaizen Events</p>\r\n<p>Data Gathering and Mapping</p>\r\n', '', '', '', '100', '2013-11-15 08:31:04', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('18', 'IMTQN Certified Mobile Application Tester (CMAT) - Premium Pack', '5', '(CMAT-001)', '(CMAT-001)cmatfnd.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>7 Hours</p>', '<p>Many of us think about pursuing a career in this field of testing. Starting from a beginner in this domain to becoming an expert, the IMTQN Certified Mobile Application Tester (CMAT) – Foundation Level Certification is interesting and helpful to know what could be the different questions that are asked to people by an employer while selecting them for various positions in the mobile testing field such as a software tester. </p>', '<p>As more and more applications are getting developed for Mobile Devices including Smartphones, Mobile Application Testing is becoming very important part of Mobile Application Development Ecosystem. There is very limited margin of error and the cost of buggy application can be huge in today\'s era of social media. One mistake and your investments can all be put at risk because of negative publicity. But one fact cannot be ignored – all code is developed by humans and there is always an element of risk and unknown left with programmers who are coding the system.</p>', '<b>The reasons why mobile application testing is required :</b>\r\n \r\n<p>1. Many Types of mobile devices Hardware</p>\r\n \r\n<p>2. Different types of Mobile Platforms/Operating systems from various companies. </p>\r\n \r\n<p>3. Different Mobile Carriers</p>\r\n \r\n<p>4. Many types of Mobile screens</p>\r\n\r\n', '<b>Who should take this E-Course?</b>\r\n\r\n<p> Mobile Software Test Managers or Engineers</p>\r\n<p> Software Testers involved in testing Mobile Apps</p>\r\n<p> Candidates who are seeking a new career in the field of Mobile Application Testing</p>\r\n', '', '200', '2013-11-15 08:18:31', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('19', 'Professional in Project Management (PPM) - Standard Package', '3', '(PPM-001)', '(PPM-001)PPM-Std.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>60 Hours</p>', '</>Projects and project management has become the foundation for success in the public and private sectors. Enterprises achieve their goals through projects and effective project management. Successful project management requires achieving the scope (e.g., intended result), cost and schedule. In addition, the increasing complexity of work and demands for “more with less” place special demands on the project manager.</p>\r\n\r\n<p>These programs go beyond the “What is project management and practices” to providing practical “How To” guidance, tools and techniques, and processes to implement in today’s working world.</p>\r\n', '<b>What Modules are Covered in the E-Course?</b>\r\n\r\n<p>Module 1 – Project Management Fundamentals</p>\r\n<p>Module 2 – Project Management Training</p>\r\n<p>Module 3 – Intermediate Project Management</p>\r\n<p>Module 4 – Effective Planning & Scheduling </p>\r\n<p>Module 5 – Advanced Project Management</p>\r\n<p>Module 6 – Team Building</p>\r\n<p>Module 7 – Building Better Teams</p>\r\n<p>Module 8 – Risk Management</p>\r\n<p>Module 9 – Crisis Management </p>\r\n<p>Module 10 – Time Management </p>\r\n<p>Module 11 – Leadership Skills </p>\r\n<p>Module 12 – Self-Leadership </p>\r\n<p>Module 13 – Communication Strategies </p>\r\n<p>Module 14 – Knowledge Management </p>', '<b>Who should take this E-Course?</b>\r\n\r\n <p>Professionals involved directly or indirectly with projects in virtually every industry</p>\r\n\r\n <p>New managers and prospective managers, as well as newly promoted supervisors from both technical and non-technical professions including: engineering, telecommunications, computer/information technology, biological/health sciences, pharmaceuticals and biotechnology, environmental technology, hospitality/food services, professional associations and government.</p>\r\n', '<span style=\"color:red\">Note: The Professional in Project Management (PPM) Certification requires a mandatory E-Course completion requirement. Once the candidate completes the E-Course, they will receive a GAQM Learner ID. This ID is required at the time of scheduling an exam at a Pearson Vue Testing Center. For more information, you can send an E-mail to support@gaqm.org</span>', '', '100', '2014-11-01 10:55:34', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('20', 'Certified Finance Manager (CFM) - Standard Package', '2', '(CFM-001)', '(CFM-001)CFM-Std..png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>11 Hours</p>\r\n\r\n', '<p>Many of us flinch when we hear terms like depreciation, cash flow, balance sheet, and (worst of all!) budgets. However, these are all important concepts to understand if you’re going to succeed in today’s business world, particularly as a supervisor. Even better, financial terms are not as scary as they seem!</p>', '<p>For managers in today’s business world, it’s essential to have a working knowledge of finance. We all play a role in our organization’s financial health, whether we realize it or not. If you don’t have training or a background in finance, you may be at a disadvantage as you sit around the management table. Understanding the cycle of finance will help you figure out where you fit into your company’s financial structure, and how to keep your department out of the red. This E-Course workshop will help you prepare budgets and make decisions with confidence.</p>', '<b>How You Will Benefit with this E-Course</b>\r\n\r\n<p>1) Describe the art of finance and key financial terms</p>\r\n<p>2) Determine your role in company finances</p>\r\n<p>3) Find the rules and regulations for your area and industry</p>\r\n<p>4) Discuss various types of financial reports, including income statements, balance sheets, cash flow statements, and statements of retained earnings</p>\r\n<p>5) Explain how a chart of accounts is created</p>\r\n<p>6) Tell the difference between cash and accrual accounting</p>\r\n<p>7) Explain single-entry and double-entry bookkeeping</p>\r\n<p>8) Differentiate between debits and credits</p>\r\n<p>9) Identify and analyze important financial data and make financial decisions</p>\r\n<p>10) Read annual reports</p>\r\n<p>11) Determine whether a company is financially high or low risk</p>\r\n<p>12) Recognize different types of organizational financial plans</p>\r\n<p>13) Explain what budgets are and how to prepare them</p>\r\n<p>14) Recognize what computer skills you need to make you a financial whiz</p>\r\n<p>15) Deal with financial situations that impact the people that work for you</p>\r\n<p>16) Define basic financial terminology</p>\r\n<p>17) Prepare a budget of any type or size</p>\r\n<p>18) Get your budget approved</p>\r\n<p>19) Perform basic ratio analysis</p>\r\n<p>20) Make better financial decisions</p>\r\n', '<b>What Topics are Covered in Module 1? </b>\r\n<p>1) Getting the facts straight</p>\r\n<p>2) The accounting cycle</p>\r\n<p>3) The key reports</p>\r\n<p>4) Keeping score</p>\r\n<p>5) A review of financial terms</p>\r\n<p>6) Understanding debits and credits</p>\r\n<p>7) Your financial analysis toolbox</p>\r\n<p>8) Identifying high and low risk companies</p>\r\n<p>9) The basics of budgeting</p>\r\n<p>10) Working smarter</p>\r\n<p>11) People and numbers</p>\r\n', '<b>What Topics are covered in Module 2? </b>\r\n<p>1) The fundamentals of finance</p>\r\n<p>2) The basics of budgeting</p>\r\n<p>3) Parts of a budget</p>\r\n<p>4) The budgeting process</p>\r\n<p>5) Budgeting tips and tricks</p>\r\n<p>6) Monitoring and managing budgets</p>\r\n<p>7) Crunching the numbers</p>\r\n<p>8) Getting your budget approved</p>\r\n<p>9) Comparing investment opportunities</p>\r\n<p>10) ISO 9001:2008</p>\r\n<p>11) Directing the Peerless Data Corporation (intensive case study) </p>\r\n', '100', '2013-11-15 07:18:28', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('21', 'Certified Team Leader (CTL) - Standard Package', '2', '(CTL-001)', '(CTL-001)CTL.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>16 Hours</p>\r\n', '<p>Your success as a manager can often depend on how well your team operates.  How are their problem-solving skills? Are they enthusiastic and motivated to do their best?  Do they work well together? There have been hundreds of studies demonstrating that human beings function better and learn better in groups. If you want to develop your team leadership skills and unleash the talent of your individual team members, this E-Course is a practical look at current leadership practices that work. </p>', '<p>Teams are an important building block of successful organizations. Whether the focus is on service, quality, cost, value, speed, efficiency, performance, or other similar goals, teams are the basic unit that supports most organizations. With teams at the core of corporate strategy, your success as an organization can often depend on how well you and other team members operate together. How are your problem-solving skills? Is the team enthusiastic and motivated to do its best? Do you work well together? This E-Course can help you get there! </p>\r\n\r\n<p>Leaders represent an important force in the North American economy. You have the power to turn on or turn off the productivity of the people who work for you. You are the crucial interface between the employee on the shop floor or the service desk and the managers of the organization. You usually have more experience and more skill than the employees you supervise, because management tends to look for super people to fill those roles.</p>', '<p>This E-Course also covers Self-leadership which puts together taking responsibility for our outcomes, setting direction for our lives, and having tools to manage priorities. Self-leaders work at all levels of an organization. They are front-line workers in every possible role, middle managers, and CEOs. Self-leaders like Walt Disney and Wayne Gretzky worked hard to achieve their dreams without using the term self-leadership. However, they have clearly demonstrated that being in control of their behavior and results, focus, practice, and learning were necessary to achieve their goals. </p>\r\n\r\n<p>Self-leadership requires a commitment from individuals to decide what they want from life and to do what’s necessary to get the results they want. This one-day workshop will help participants internalize the four pillars of self-leadership and to make meaningful, empowered choices while taking action to get where they want to go.</p>\r\n', '<b>What Topics are Covered?</b>\r\n\r\n<p>1) Types of teams</p>\r\n<p>2) The TORI model</p>\r\n<p>3) The Team Player Survey</p>\r\n<p>4) Organizations Today</p>\r\n<p>5) The Stages of Team Development</p>\r\n<p>6) Communication Skills</p>\r\n<p>7) Shared Leadership </p>\r\n<p>8) DeBono’s Thinking Hats</p>\r\n<p>9) Managing Team Conflict</p>\r\n<p>10) The Trust/Relationship Model</p>\r\n<p>11) Obtaining Consensus</p>\r\n<p>12) Team-Shaping Factors</p>\r\n<p>13) Team Problem-Solving</p>\r\n<p>14) SWOT Analysis</p>\r\n<p>15) Managing your time and energy</p>\r\n<p>16) What makes a good leader?</p>\r\n<p>17) Communication as a leadership tool</p>\r\n<p>18) The commitment curve</p>\r\n<p>19) Employee development models</p>\r\n<p>20) Dealing with conflict and difficult issues</p>\r\n<p>21) Defining teams</p>\r\n<p>22) Establishing team norms</p>\r\n<p>23) Working as a team</p>\r\n<p>24) Your team player type</p>\r\n<p>25) Building team trust</p>\r\n<p>26) The stages of team development</p>\r\n<p>27) Team building with TORI </p>\r\n<p>28) Communication</p>\r\n<p>29) Becoming a good team player</p>\r\n<p>30) Managing your time and energy</p>\r\n<p>31) What makes a good leader?</p>\r\n<p>32) Communication as a leadership tool</p>\r\n<p>33) The commitment curve</p>\r\n<p>34) Employee development models</p>\r\n<p>35) Dealing with conflict and difficult issues</p>\r\n<p>36) What successful leaders do</p>\r\n<p>37) What is self-leadership?</p>\r\n<p>38) Knowing who you are</p>\r\n<p>39) Change management</p>\r\n<p>40) Knowing what you do</p>\r\n<p>41) Motivation for optimists</p>\r\n', '', '100', '2014-12-29 08:28:42', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('22', 'Certified Sales and Marketing Professional (CSMP) - Standard Pack', '2', '(CSMP-001)', '(CSMP-001)CSMP Standard Box.jpg', 'Standard', '20', '<p><b>Highlights of the Package</b></p>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>40 Hours</p>', '<p>Small Marketing Budget doesn’t mean you can’t meet your goals and business objectives – you just have to be more creative in your marketing tactics. This one-day workshop will show you how to get maximum exposure at minimum cost. Learn effective, low-cost, and non-cost strategies to improve sales, develop your company’s image, and build your bottom line, the first module of the CSMP exactly deals with the same</p>\r\n\r\n<p>The second module of CSMP deals with Body language which can make or break your efforts to establish long, trusting relationships. Your body language can help to reinforce and add credibility to what we say, or it can contradict our words. Understanding what signals you are sending, as well as being able to read the signals that your clients send, is an essential skill in sales and throughout our lives. What is your body language saying about you? Find out in our second module</p>', '<p>The third module of CSMP covers sales presentation, a great sales presentation does not demand that you have all the bells and whistles to impress the client with your technical skills. Rather, try impressing your clients with your knowledge of the products and services you sell and your understanding of their problems and the solutions they need. The third module will show you how to create a winning proposal and how to turn it into a dynamite sales presentation.</p>\r\n', '<p>The fourth module of CSMP deals with Building Relationship for success in sales, no one questions that making friends is a good thing. In this module, you are going to discover that the business of business is making friends, and the business of all sales professionals is making friends and building relationships. Strategic friendships will make or break any business, no matter how big and no matter what kind of market.</p>\r\n\r\n<p>The fifth module covers Social media which remains an evolving aspect of our daily lives in addition to being a part of our businesses. This module course is designed for people who have some familiarity with social media already. Participants will learn to develop a social media marketing plan as a part of their overall marketing strategy, determine who should be on their team, and choose how they will measure what is taking place. In addition, we will explore some of the major social media sites and look at how specialty sites and social media management tools can take their social media marketing to the next level. </p>\r\n', '<p>This sixth module is an ideal start for business owners and people new to marketing to learn the basics of Internet marketing. We’ve included information on how to market online, and even more importantly, how to determine what results you are getting. Then, you can figure out whether you are reaching your target market, where your qualified prospects are, and how they are engaged as a result of your efforts. This module includes sessions on search engine optimization, e-mail campaigns, pay per click advertising, and more.</p>\r\n\r\n<p>The seventh module covers Telemarketing, virtually everybody in sales today sells over the phone at least part of the time. Perhaps it is time for you to evaluate how you use the telephone and where it fits into your sales and marketing mix. This module will show you how the telephone can supplement, enhance, and sometimes replace other means of marketing and selling, and how this personal approach can dramatically increase your sales success. We will also talk about how to hone your communication skills, your ability to persuade, and techniques to personalize each sales call.</p>\r\n', '<p>Your brand is the vehicle that propels your product or service into your customer’s lives, and into their hearts. A good brand is much more than an attractive image combined with some witty type. Your brand must reflect the heart and soul of your product, and offer a promise that you can live up to. The eighth module will get you started on the road to creating a perfect brand. </p>\r\n', '75', '2013-10-31 13:30:09', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('23', 'Certified Risk and Crisis Manager (CRCM) - Standard Package', '2', '(CRCM-001)', '(CRCM-001)CRCM-Standard.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>\r\n', '<b>About Risk Management</b>\r\n\r\n<p>Risk management has long been a key part of project management, but in recent years, it has become an increasingly important part of organizational best practices. Corporations have realized that effective risk management can not only reduce the negative impact of crises; it can provide real benefits and cost savings.</p>\r\n\r\n<p>The risk management framework provided in this E-Course is flexible enough for any organization. You can apply it to a single project, a department, or use it as a basis for an enterprise-wide risk management program.</p>\r\n', '<b>How will you benefit with this E-Course</b>\r\n\r\n<p>1) Define risk and risk management</b>\r\n<p>2) Describe the COSO ERM cube and ISO 31000</b>\r\n<p>3) Establish a risk management context</b>\r\n<p>4) Describe the 7 R’s and 4 T’s that form the framework of risk management activities</b>\r\n<p>5) Design and complete a basic risk assessment</b>\r\n<p>6) Determine the appropriate response to risks and create a plan for those responses</b>\r\n<p>7) Describe the key components of reporting, monitoring, and evaluation of a risk management program</b>\r\n\r\n<p><b>What Topics are Covered in Risk Management?</b></p>\r\n\r\n 	<p>1) Understanding risk</p>\r\n 	<p>2) Risk management activities</p>\r\n 	<p>3) Assessing risk</p>\r\n 	<p>4) Responding to risks</p>\r\n 	<p>5) Resourcing controls</p>\r\n 	<p>6) Reaction planning</p>\r\n 	<p>7) Reporting and monitoring</p>\r\n 	<p>8) Reviewing and evaluating the framework</p>\r\n', '<p><b>About Crisis Management</b></p>\r\n\r\n<p>Viable organizations need to be ready for emergencies because they are a fact of doing business. The worst plan is not to have any kind of plan at all, and the best plans are tested and adjusted so that they work over time. Fortunately, you do not need separate plans for fire, weather disasters, and all the different kinds of crises that can occur. One solid plan will help you to prevent, respond, and recover from all crises. This E-course will help you ensure your organization is ready to manage any kind of crisis. </p>\r\n', '<p><b>What Topics are Covered in Crisis Management?</b></p>\r\n\r\n<p>1) What is crisis management?</p>\r\n<p>2) Training leaders and staff</p>\r\n<p>3) Conducting the crisis audit</p>\r\n<p>4) Performing a risk level analysis</p>\r\n<p>5) Developing a response process</p>\r\n<p>6) Consulting with the experts</p>\r\n<p>7) Incident management techniques </p>\r\n<p>8) Working through the issues</p>\r\n<p>9) Establishing an emergency operations center</p>\r\n<p>10) Building business continuity and recovery</p>\r\n<p>11) Recovering and moving on</p>\r\n<p>12) Plenty of case studies and practice opportunities</p>\r\n\r\n<p><b>How will you benefit with this E-Course</b></p>\r\n<p>1) Assign people to an appropriate crisis team role</p>\r\n<p>2) Conduct a crisis audit</p>\r\n<p>3) Establish the means for business continuity</p>\r\n<p>4) Determine how to manage incidents</p>\r\n<p>5) Help your team recover from a crisis</p>\r\n<p>6) How to apply the process </p>\r\n\r\n', '', '50', '2013-10-31 13:25:04', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('24', 'Business Management Professional (BMP) - Standard Package', '2', '(BMP-001)', '(BMP-001)BMP---Standard-Pack.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>Owning a business requires a vision balanced with attention to detail. You need to be a generalist who understands the multiple aspects of running a business, as well as the ability to step back and see the big picture and to reach into the future. The business environment is a complex place to be. Whether you wish to work as a consultant or freelancer, establish a corporation, or set up an operation that meets a need for very particular type of customer, there is a tremendous amount of information that you need to know and to apply. This E-Course course provides essential learning for new business owners, whether the business is just in the idea stage or you have already begun and need to fill in the gaps</p>\r\n\r\n<p> <b>The Business Management Professional (BMP) comprises of 6 Modules</p></b>\r\n<p>Module 1 – Business Management Fundamentals</p>\r\n<p>Module 2 – Business Leadership </p>\r\n<p>Module 3 – Core Negotiation Skills </p>\r\n<p>Module 4 – Business Succession Planning </p>\r\n<p>Module 5 – Conflict Resolution</p>\r\n<p>Module 6 – Dealing With Difficult People</p>', '<p><b>What will you learn from this E-Course</p></b>\r\n\r\n<p>1) How to apply the best methods for creating, leading, and managing their own business</p>\r\n<p>2) Ways to establish an organizational framework through operations, finance, and leadership</p>\r\n<p>3) Techniques for setting up an effective and efficient system for hiring, retaining, and succession planning</p>\r\n<p>4) How to start researching and designing a strategic plan</p>\r\n<p>5) How to describe the essential elements of marketing, sales, and their company brand</p>\r\n<p>6) How to apply financial and accounting terms correctly</p>\r\n<p>7) Demonstrate an understanding of the value of succession planning for successful businesses.</p>\r\n<p>8) Demonstrate expertise with the key elements of a succession plan.</p>\r\n<p>9) Create and discuss aspects of a succession plan.</p>\r\n<p>10) Discuss the elements of a succession plan in terms of roles, responsibility, function, scope, and evaluation.</p>\r\n<p>11) Understand the basic principles of negotiation</p>\r\n<p>12) Prepare for negotiation</p>\r\n<p>13) Respond to challenges</p>\r\n<p>14) Create win-win situations</p>\r\n<p>15) Develop sustainable agreements</p>\r\n<p>16) Define your role as a manager and identify how that role differs from other roles you have had.</p>\r\n<p>17) Understand the management challenge and the new functions of management..</p>\r\n<p>18) Discover how you can prepare for and embrace the forces of change... </p>\r\n<p>19) Identify ways to get you and your workspace organized and get a jump on the next crisis.</p>\r\n<p>20) Identify your leadership profile and explore ways to use this knowledge to improve your success as a manager..</p>\r\n<p>21) Enhance your ability to communicate with others in meetings and through presentations. </p>\r\n<p>22) Create an action plan for managing your career success. </p>\r\n<p>23) Understand conflict</p>\r\n<p>24) Be able to identify the stages of conflict</p>\r\n<p>25) Use LECSR to resolve conflict</p>\r\n<p>26) Identify other ways to resolve conflict</p>\r\n<p>27) Develop personal skills necessary to resolve conflict</p>\r\n<p>28) Recognize how your own attitudes and actions impact others.</p>\r\n<p>29) Find new and effective techniques for dealing with difficult people.</p>\r\n<p>30) Learn some techniques for managing and dealing with anger.</p>\r\n<p>31) Develop coping strategies for dealing with difficult people and difficult situations.</p>\r\n', '', '', '', '100', '2013-10-31 13:25:15', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('25', 'Certified Scrum Master (CSM) - Standard Package', '6', '(CSM-001)', '(CSM-001)CSM Standard Pack.jpg', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>8 Hours</p>', '<b><p>What is Scrum?<p></b>\r\n<p>Scrum is an iterative and incremental agile software development method for managing software projects and product or application development. </p>\r\n\r\n<p>Software Professionals all over the world are passionate about Scrum. However, Scrum is not hype in IT industry. Scrum is an Agile Project Management Framework to develop great products that customers love.</p>\r\n\r\n<p>Scrum’s powerful and astonishing influence on people and projects take its roots from the Manifesto of Agile Software Development (Agile Manifesto) which values:</p>\r\n<p>Scrum is the most used Agile methodology and is suitable for all IT Professionals looking to keep their knowledge up to date with the latest developments in the field of IT</p>\r\n', '<b><p>Who is a Certified Scrum Master (CSM)™?</p></b>\r\n<p>Scrum is facilitated by a Scrum Master, sometimes written as ScrumMaster, who is accountable for removing impediments to the ability of the team to deliver the sprint goal/deliverables. The Scrum Master is not the team leader, but acts as a buffer between the team and any distracting influences. The Scrum Master ensures that the Scrum process is used as intended. The Scrum Master is the enforcer of rules. A key part of the Scrum Master’s role is to protect the Development Team and keep it focused on the tasks at hand. The role has also been referred to as a servant-leader to reinforce these dual perspectives</p>', '<p>This online scrum training course offers you all the benefits of in-person training but with the convenience of watching whenever and wherever you want<p>', '', '', '60', '2013-11-15 07:27:02', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('26', 'Certified Sales and Marketing Professional (CSMP) - Premium Pack', '2', 'CSMP-001', 'CSMP-001CSMP-.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>40 Hours</p>', '<p>Small Marketing Budget doesn’t mean you can’t meet your goals and business objectives – you just have to be more creative in your marketing tactics. This one-day workshop will show you how to get maximum exposure at minimum cost. Learn effective, low-cost, and non-cost strategies to improve sales, develop your company’s image, and build your bottom line, the first module of the CSMP exactly deals with the same</p>\r\n\r\n<p>The second module of CSMP deals with Body language which can make or break your efforts to establish long, trusting relationships. Your body language can help to reinforce and add credibility to what we say, or it can contradict our words. Understanding what signals you are sending, as well as being able to read the signals that your clients send, is an essential skill in sales and throughout our lives. What is your body language saying about you? Find out in our second module</p>', '<p>The third module of CSMP covers sales presentation, a great sales presentation does not demand that you have all the bells and whistles to impress the client with your technical skills. Rather, try impressing your clients with your knowledge of the products and services you sell and your understanding of their problems and the solutions they need. The third module will show you how to create a winning proposal and how to turn it into a dynamite sales presentation.</p>\r\n\r\n<p>The fourth module of CSMP deals with Building Relationship for success in sales, no one questions that making friends is a good thing. In this module, you are going to discover that the business of business is making friends, and the business of all sales professionals is making friends and building relationships. Strategic friendships will make or break any business, no matter how big and no matter what kind of market.</p>', '<p>The fifth module covers Social media which remains an evolving aspect of our daily lives in addition to being a part of our businesses. This module course is designed for people who have some familiarity with social media already. Participants will learn to develop a social media marketing plan as a part of their overall marketing strategy, determine who should be on their team, and choose how they will measure what is taking place. In addition, we will explore some of the major social media sites and look at how specialty sites and social media management tools can take their social media marketing to the next level. </p>', '<p>This sixth module is an ideal start for business owners and people new to marketing to learn the basics of Internet marketing. We’ve included information on how to market online, and even more importantly, how to determine what results you are getting. Then, you can figure out whether you are reaching your target market, where your qualified prospects are, and how they are engaged as a result of your efforts. This module includes sessions on search engine optimization, e-mail campaigns, pay per click advertising, and more.</p>', '<p>The seventh module covers Telemarketing, virtually everybody in sales today sells over the phone at least part of the time. Perhaps it is time for you to evaluate how you use the telephone and where it fits into your sales and marketing mix. This module will show you how the telephone can supplement, enhance, and sometimes replace other means of marketing and selling, and how this personal approach can dramatically increase your sales success. We will also talk about how to hone your communication skills, your ability to persuade, and techniques to personalize each sales call.</p>\r\n\r\n<p>Your brand is the vehicle that propels your product or service into your customer’s lives, and into their hearts. A good brand is much more than an attractive image combined with some witty type. Your brand must reflect the heart and soul of your product, and offer a promise that you can live up to. The eighth module will get you started on the road to creating a perfect brand. </p>', '300', '2013-10-31 13:40:30', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('27', 'Lean Principles and Process Improvement', '4', 'None', 'NoneLPPI.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>4 Hours</p>', '<p>This E-Course will give you the foundation to begin implementing Lean process improvement tools in your workplace. The first day will explore the foundations of Lean through the Toyota precepts and the five critical improvement concepts (value, waste, variation, complexity, and continuous improvement). The second day will give participants tools to perform continuous improvement in their organization, including 5S, 5W-2H, PDSA, DMAIC, Kaizen, Genchi Genbutsu, and various Lean data mapping methods.<p>', '<p><b>How You Will Benefit:</p></b>\r\n<p>1. Define Lean, its key terms, and the five critical improvement concepts</p>\r\n<p>2. Describe the Toyota Production System and the TPS house</p>\r\n<p>3. Use the Kano model to understand, describe, analyze, and improve value</p>\r\n<p>4. Identify and reduce various types of waste</p>\r\n<p>5. Create a plan for a more environmentally Lean organization</p>\r\n<p>6. Use the PDSA and R-DMAIC-S models to plan, execute, and evaluate Lean changes</p>\r\n<p>7. Use Lean thinking frameworks, including 5W-2H, Genchi Genbutsu and Gemba</p>\r\n<p>8. Prepare for and complete a basic 5-S</p>\r\n<p>9. Describe the key elements of Kaizen events, particularly a Kaizen blitz</p>\r\n<p>10. Gather, analyze, and interpret data using flow charts, Ishikawa and SIPOC diagrams, and value stream maps</p>\r\n<p>11. Go back to your organization with a plan to begin incorporating Lean into your corporate culture</p>\r\n', '<p><b>What this E-Course will cover</p></b>\r\n \r\n<p>1. Understanding Lean </p>\r\n \r\n<p>2. The Toyota Production System </p>\r\n \r\n<p>3. The Toyota Production System House</p>\r\n \r\n<p>4. The Five Critical Improvement Concepts</p>\r\n \r\n<p>5. Understanding Value with the Kano Model</p>\r\n \r\n<p>6. Types of Waste</p>\r\n \r\n<p>7. Creating a Lean Enterprise</p>\r\n \r\n<p>8. Understanding Lean </p>\r\n \r\n<p>9. The Plan, Do, Study, Act (PDSA) Cycle</p>\r\n \r\n<p>10. Using the R-DMAIC-S Model</p>\r\n \r\n<p>11. Lean Thinking Tools</p>\r\n \r\n<p>12. Kaizen Events</p>\r\n \r\n<p>13. Data Gathering and Mapping</p>\r\n \r\n', '', '', '25', '2013-10-31 13:25:40', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('28', 'Knowledge Management', '2', 'Course Only', 'Course Onlyknowledge-management.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>8 Hours</p>', '<p>Understanding how to manage the knowledge within your organization is the key to business success. Mismanagement of organizational knowledge comes with a price: frustrated employees, angry customers, and decreased productivity. All of these things can affect a business’ bottom line. The purpose behind knowledge management is to help us bridge organizational gaps and to use our greatest asset (our knowledge) to take our business performance to the next level. The theory of knowledge management has emerged to help us harness and enhance both the individual and collective brain power of our businesses. This E-Course will introduce you to knowledge management tips, techniques, and proven processes.</p>\r\n', '<b><p>What Will You Learn from this E-Course</p></b>\r\n\r\n<p>1. Define knowledge and knowledge management. </p>\r\n<p>2. Explain the difference between explicit and tacit knowledge.</p>\r\n<p>3. Identify various knowledge management theoretical models.</p>\r\n<p>4. Explain how a properly implemented knowledge management program can improve efficiency.</p>\r\n<p>5. Describe the steps for employing a new knowledge management program in an organization.</p>\r\n<p>6. Identify the required components for implementing a knowledge management framework within an organization.</p>\r\n', '<b><p>What Topics are Covered in this E-Course? </p>  </b>\r\n<p>1. Definitions of knowledge management, tacit knowledge, explicit knowledge, and KMBOK</p>\r\n<p>2. The business case for knowledge management</p>\r\n<p>3. The knowledge management mix</p>\r\n<p>4. The knowledge management framework</p>\r\n<p>5. Knowledge management models</p>\r\n<p>6. The knowledge management toolkit</p>\r\n<p>7. Implementing knowledge management initiatives</p>\r\n<p>8. Designing a chief knowledge officer position</p>\r\n<p>9. Case studies and success stories</p>', '', '', '30', '2013-10-31 13:25:27', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('29', 'Certified Professional Trainer (CPT) - Standard Package', '7', '(CPT-001)', '(CPT-001)CPT---Standard-Pack.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>12 Hours</p>', '<p> If you are thinking about becoming a trainer, or have started doing some training already and want to know more about what will help you to become an excellent trainer, this workshop will help. This E-Course is designed as an exploration of the essential skills that trainers need to develop, and to get you started in the learning process in an interactive and fun environment. </p>\r\n', '<p>People who work as trainers are often put into difficult situations without much understanding of what training is or how to do it well. We know that being a good trainer is the result of developing skills to bring information to an audience. This information will then engage, empower, and encourage continued learning and development. This course will give you the skills that you need so that your students not only learn, but also enjoy the process, retain information shared, and use their new skills back in the workplace. </p>', '<p>Behind every spectacular training session is a lot of preparation and meticulous attention to detail. The truly skilled trainer can make a program exciting. The learners will have fun while they are learning if the facilitator is able to involve their emotions as well as their minds. You will see the involvement, and you will feel the energy. To reach this stage as an adult educator isn’t always easy, but success isn’t just for the naturally gifted. It is possible for all of us who put effort into our personal growth and development. We want the enormous satisfaction that comes from working with others to help them reach their potential as human beings. The third module of this E-Course will help you reach that goal.</p>\r\n\r\n<p>Training is also an essential element of development in any organization. Being knowledgeable and continuing to learn throughout your career can make you a very valuable asset. We also know that training and orientation (or ‘onboarding’) for newly hired employees is a key factor in retention. The Module 4 workshop is designed for a trainer who wants to develop training programs that are meaningful, practical, and will benefit both trainees and the organizations they work for.</p>', '<p><b>What Will you Learn from this E-Course?</p></b>\r\n\r\n<p>1) Understand the essential background for trainers to have </p>\r\n<p>2) Explore how being genuine enhances training</p>\r\n<p>3) Identify the elements of good questions</p>\r\n<p>4) Understand how to apply listening skills</p>\r\n<p>5) Develop rapport building strategies </p>\r\n<p>6) Recognize key skills in a trainer’s toolbox and identify skill areas for development</p>\r\n<p>7) Recognize the importance of considering the participants and their training needs, including the different learning styles and adult learning principles.</p>\r\n<p>8) Know how to write objectives and evaluate whether these objectives have been met at the end of a training session.</p>\r\n<p>9) Develop an effective training style, using appropriate training aids and techniques.</p>\r\n<p>10) Conduct a short group training session that incorporates these training concepts. </p>\r\n<p>11) Demonstrate your understanding of learning styles and how to accommodate all four learning styles in the classroom</p>\r\n<p>12) Apply the key principles of effective communication in a workshop setting</p>\r\n<p>13) Use a variety of training techniques to stimulate participation</p>\r\n<p>14) Develop a plan and prepare for an effective training session</p>\r\n<p>15) Explain the different levels of evaluation and when to use each</p>\r\n<p>16) Identify advanced interventions for difficult situations</p>\r\n<p>17) Put your skills to work for a team presentation</p>\r\n<p>18) Describe the essential elements of a training program </p>\r\n<p>19) Apply different methodologies to program design</p>\r\n<p>20) Demonstrate skills in preparation, research, and delivery of strong content</p>\r\n<p>21) Explain an instructional model </p>\r\n<p>22) Be prepared to create a training program proposal </p>\r\n\r\n', '<p><b>What Topics are Covered in this E-Course?</p></b>\r\n\r\n<p>1) What makes a good trainer?</p>\r\n<p>2) Personal best, professional best</p>\r\n<p>3) Being genuine</p>\r\n<p>4) Assertiveness skills</p>\r\n<p>5) Asking the right questions </p>\r\n<p>6) Listening skills</p>\r\n<p>7) Connecting with people</p>\r\n<p>8) Defusing difficult participants</p>\r\n<p>9) Essentials for success</p>\r\n<p>10) Do’s and don’ts for new trainers </p>\r\n<p>11) Defining a successful training program/trainer</p>\r\n<p>12) Adult learning and the learning process</p>\r\n<p>13) Principles of adult learning</p>\r\n<p>14) Style assessment, including introvert/extrovert analysis</p>\r\n<p>15) Applying the learning cycle</p>\r\n<p>16) The training process (planning training, choosing methods, designing learning sequences)</p>\r\n<p>17) Adding games</p>\r\n<p>18) Setting the climate</p>\r\n<p>19) Presentation skills</p>\r\n<p>20) Dealing with difficult trainees</p>\r\n<p>21) On-the-job training </p>\r\n<p>22) Evaluation techniques</p>\r\n<p>23) Mock training presentations for peer review</p>\r\n<p>24) Preparing to learn and understanding learning</p>\r\n<p>25) Competencies for adult educators</p>\r\n<p>26) Accommodating learning preferences</p>\r\n<p>27) Increasing your expertise and using existing materials</p>\r\n<p>28) Planning a workshop, including preparing visual aids</p>\r\n<p>29) Effective communication (incl. questioning)</p>\r\n<p>30) Kirkpatrick’s levels of evaluation</p>\r\n<p>31) On-the-job support</p>\r\n<p>32) Managing stress and dealing with difficult situations</p>\r\n<p>33) Training in different forums (i.e. virtual learning)</p>\r\n<p>34) Mock training presentations</p>', '100', '2013-10-31 13:25:52', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('30', 'Associate in Project Management (APM) - Premium Pack', '3', '(APM-001)', '(APM-001)APM-Prem.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>', '<b>The Associate in Project Management (APM) E-Course Comprises of 3 Modules.</b>\r\n<p></p>\r\n<p>Module 1 - Project Management Fundamentals</p>\r\n\r\n<p>Module 2 - Project Management Training</p>\r\n\r\n<p>Module 3 - Intermediate Project Management</p>\r\n\r\n<p></p>\r\n\r\n', '<p style=\"font-size:13px\"> <span style=\"color:black\"><b>What will you learn from this E-Course?</b></font></p></span>\r\n\r\n<p><b>Module 1 - Project Management Fundamentals</p></b>\r\n<p></p>\r\n\r\n<p>1) Understand what is meant by a project and project management</p>\r\n<p>2) Identify benefits of projects</p>\r\n<p>3) Identify the phases of a project’s life cycle</p>\r\n<p>4) Enhance your  ability to sell ideas and make presentations</p>\r\n<p>5) Prioritize projects</p>\r\n<p>6) Begin conceptualizing your project, including goals and vision statements</p>\r\n<p>7) Use a target chart and other planning tools</p>\r\n<p>8) Complete a Statement of Work</p>\r\n\r\n', '<p></p>\r\n\r\n<p><b>Module 2 - Project Management Training</p></b>\r\n<p></p>\r\n\r\n<p>1) Understand what is meant by a project.</p>\r\n<p>2) Recognize what steps must be taken to complete projects on time and on budget.</p>\r\n<p>3) Have a better ability to sell ideas and make presentations.</p>\r\n<p>4) Know simple techniques and tools for planning and tracking your project.</p>\r\n<p>5) Have methods for keeping the team focused and motivated.</p>\r\n\r\n', '<p></p>\r\n\r\n<p><b>Module 3 - Intermediate Project Management</p></b>\r\n<p></p>\r\n<p>1) Identify your project’s tasks and resources</p>\r\n<p>2) Order tasks using the Work Breakdown Structure</p>\r\n<p>3) Schedule tasks effectively</p>\r\n<p>4) Use basic planning tools such as a Gantt chart, PERT diagram, and network diagram</p>\r\n<p>5) Prepare a project budget</p>\r\n<p>6) Modify the project budget and schedule to meet targets</p>\r\n<p>7) Identify and manage risks</p>\r\n<p>8) Develop a change control process</p>\r\n<p>9) Execute and terminate a project</p>\r\n<p></p>', '', '175', '2014-11-01 10:57:40', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('31', 'Certified Lean Six Sigma Yellow Belt (CLSSYB) - Premium Package', '4', '(CLSSYB)', '(CLSSYB)CLSSYB Premium Box.jpg', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>', '<p>Certified Lean Six Sigma Yellow Belt (CLSSYB) exam comprises of basics of the Lean Six Sigma Methodology and supports improvement projects as a part of a team. A Lean Six Sigma Yellow Belt possesses an understanding of the aspects within the phases of D-M-C. They apply this knowledge to all aspects of their primary functions. </p>\r\n\r\n<p>Six Sigma is a business strategy that focuses on product and service excellence, to create a culture that demands perfection. The DMAIC methodology is the road-map to achieving this target. This e-Learning course attempts to train novices on the principles of Six Sigma and takes them through the DMAIC process. </p>', '<b>What are the Modules covered in this E-Course?</b>\r\n\r\n<p>1) INTRODUCTION</p>\r\n<p>2) DEFINE</p>\r\n<p>3) MEASURE</p>\r\n<p>4) BASIC STATISTICS</p>\r\n<p>5) ANALYZE</p>\r\n<p>7) IMPROVE</p>\r\n<p>8) CONTROL</p>\r\n<p>9) A Lean Glossary</p>\r\n<p>10) Lean Principles and Process Improvement</p>\r\n', '<b>What Topics are Covered in this E-Course?</b>\r\n<p></p>\r\n<p>1) Recognize the advantages of Six Sigma</p>\r\n<p>2) List the industries where it can be applied</p>\r\n<p>3) Explain the use of the DMAIC methodology to achieve process excellence</p>\r\n<p>4) Describe the use of statistics in applying the DMAIC methodology</p>\r\n<p>5) Understanding Lean </p>\r\n \r\n<p>6) The Toyota Production System </p>\r\n \r\n<p>7) The Toyota Production System House</p>\r\n \r\n<p>8) The Five Critical Improvement Concepts</p>\r\n \r\n<p>9) Understanding Value with the Kano Model</p>\r\n \r\n<p>10) Types of Waste</p>\r\n \r\n<p>11) Creating a Lean Enterprise</p>\r\n \r\n<p>12) Understanding Lean </p>\r\n \r\n<p>13) The Plan, Do, Study, Act (PDSA) Cycle</p>\r\n \r\n<p>14) Using the R-DMAIC-S Model</p>\r\n \r\n<p>15) Lean Thinking Tools</p>\r\n \r\n<p>16) Kaizen Events</p>\r\n \r\n<p>17) Data Gathering and Mapping</p>\r\n', '<b>Who should take this E-Course?</b>\r\n<p></p>\r\nMembers of the service sector who need familiarity with the Lean Six Sigma process and basic process improvement tools; individuals who are on teams and in organizations that are beginning to deploy Six Sigma, one who is looking to be a member of the Six Sigma Project.', '', '200', '2013-10-31 13:31:54', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('32', 'Certified Scrum Master (CSM) - Premium Package', '6', 'CSM-001', 'CSM-001CSM Premium Pack.jpg', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>8 Hours</p>', '<b><p>What is Scrum?<p></b>\r\n<p>Scrum is an iterative and incremental agile software development method for managing software projects and product or application development. </p>\r\n\r\n<p>Software Professionals all over the world are passionate about Scrum. However, Scrum is not hype in IT industry. Scrum is an Agile Project Management Framework to develop great products that customers love.</p>\r\n', '<p>Scrum’s powerful and astonishing influence on people and projects take its roots from the Manifesto of Agile Software Development (Agile Manifesto) which values:</p>\r\n<p>Scrum is the most used Agile methodology and is suitable for all IT Professionals looking to keep their knowledge up to date with the latest developments in the field of IT</p>\r\n', '<b><p>Who is a Certified Scrum Master (CSM)™?</p></b>\r\n<p>Scrum is facilitated by a Scrum Master, sometimes written as ScrumMaster, who is accountable for removing impediments to the ability of the team to deliver the sprint goal/deliverables. The Scrum Master is not the team leader, but acts as a buffer between the team and any distracting influences. The Scrum Master ensures that the Scrum process is used as intended. The Scrum Master is the enforcer of rules. A key part of the Scrum Master’s role is to protect the Development Team and keep it focused on the tasks at hand. The role has also been referred to as a servant-leader to reinforce these dual perspectives</p>\r\n', '<p>This online scrum training course offers you all the benefits of in-person training but with the convenience of watching whenever and wherever you want<p>', '', '150', '2013-10-31 13:28:29', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('33', 'Certified Supply Chain Manager (CSCM) - Premium Package', '2', '(CSCM-001)', '(CSCM-001)CSCM Premium Box.jpg', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>', '<p>Supply Chain Management improves the coordination and relationship between Suppliers, Producers, and Customers. It must be kept at a high level of organization to be successful in today’s global economy. Goods and services are now pieced together from all over the world, and this process can be hectic and complicated if not managed correctly.</p>\r\n\r\n<p>With Supply Chain Management, your company and employees will be on target to lower costs, improving efficiency, and increase customer satisfaction. </p>\r\n\r\n<p>This E-course will provide your employees with the understanding of how Supply Chain Management can improve and help almost any type of business.</p>', '<b>What Topics are Covered in the E-Course?</b>\r\n<p></p>\r\n<b>Module 1 - Supply Chain Management</b>\r\n<p></p>\r\n<p>1) Take a look at inventory management</p>\r\n<p>2) Study supply chain groups</p>\r\n<p>3) Review tracking and monitoring methods</p>\r\n<p>4) Examine supply chain event management</p>\r\n<p>5) Comprehend the flows of supply chain management and data warehouses</p>\r\n<p>6) Understand the levels of supply chain management and their effects</p>\r\n<p>7) Identify how supply chain management relates to: Customer satisfaction, Improving performance, Lowering costs, and Product development</p>\r\n', '<b>Module 2 - Inventory Management</b>\r\n<p></p>\r\n<p>1) What is inventory?</p>\r\n<p>2) Types of inventory</p>\r\n<p>3) Key players</p>\r\n<p>4) Setting up the warehouse</p>\r\n<p>5) What makes a good inventory management system?</p>\r\n<p>6) The warehouse inventory cycle</p>\r\n<p>7) Identifying demand</p>\r\n<p>8) Validating inventory</p>\r\n<p>9) The put-away and receiving process</p>\r\n<p>10) Maintaining inventory accuracy</p>\r\n<p>11) The outbound process</p>\r\n<p>12) Industry trends</p>', '', '', '200', '2013-10-31 13:42:13', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('34', 'Certified Problem and Change Manager (CPCM) - Standard Package', '2', '(CPCM-001)', '(CPCM-001)CPCM-STANDARD.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>15 Hours</p>', '<p>We make decisions and solve problems continually. We start making decisions before we even get out of bed (shall I get up now or not?). Sometimes, we will have made as many as 50 decisions by the time we leave for work. Despite all the natural decision making that goes on and the problem solving we do, some people are very uncomfortable with having to make decisions. You may know someone who has a hard time making decisions about what to eat, never mind the internal wrestling they go through in order to take on major decisions at work. Likewise, we’ve probably all looked at a solution to something and said, “I could have thought of that.” The key to finding creative solutions is not just creativity, although that will certainly help. The answer rests in our ability to identify options, research them, and then put things together in a way that works. Having a process to work through can take the anxiety out of problem solving and make decisions easier. That’s what this E-Course is all about.</p>\r\n\r\n\r\n<p>Change is something that excites people who love opportunities for growth, to see and learn about new things, or who like to shift the status quo. Some changes, however, are harder to adjust to and lead to expressions of resistance and anger. We can take concrete steps to make change more palatable by understanding people’s hesitation, enlisting the help of others, setting up plans, and managing stressors. These steps can also ensure that desired changes are implemented successfully.  </p>\r\n\r\n<p>In this E-Course, you will learn how to manage and cope with change and how to help those around you too. </p>\r\n\r\n', '<p><b>What Will you learn from this E-Course?</b></p>\r\n\r\n<p>1) How to apply problem solving steps and tools</p>\r\n<p>2) How to analyze information to clearly describe problems</p>\r\n<p>3) How to identify appropriate solutions</p>\r\n<p>4) Ways to think creatively and be a contributing member of a problem solving team</p>\r\n<p>5) How to select the best approach for making decisions</p>\r\n<p>6) How to create a plan for implementing, evaluating, and following up on decisions</p>\r\n<p>7) Ways to avoid common decision-making mistakes</p>\r\n<p>8) Accept there are no normal or abnormal ways of reacting to change, but that we must start from where we are. </p>\r\n<p>9) See change not as something to be feared and resisted but as an essential element of the world to be accepted.</p>\r\n<p>10) Understand that adapting to change is not technical but attitudinal. Change is not an intellectual issue but one that strikes at who you are.</p>\r\n<p>11) Recognize that before we can embrace the way things will be, we may go through a process of grieving, and of letting go of the way things used to be.</p>\r\n<p>12) See change as an opportunity for self-motivation and innovation.\r\nIdentify strategies for helping change be accepted and implemented in the workplace. </p>\r\n<p>13) Find different ways of looking at change</p>\r\n<p>14) Create a change implementation strategy</p>\r\n<p>15) Make change easier for yourself and others</p>\r\n<p>16) Develop techniques to cope with change, including resiliency and stress management\r\n<p>17) Know how to maintain a sense of control during a change</p>\r\n', '', '', '', '75', '2013-11-14 12:22:36', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('35', 'Certified Human Resources Manager (CHRM) - Standard Package', '2', '(CHRM-001)', '(CHRM-001)CHRM---Standard.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>The human resource issues facing today\'s business owners and managers. You do not always have the expertise to deal with the many employee relationship issues you face, and yet you will be expected to make decisions that are both effective and legal. This Certified Human Resources Manager (CHRM)™ Certification will walk you through the hiring process, from performing a skills inventory to conducting the interview; discuss orientation; and cover some issues that arise after the hiring process (such as diversity issues, compensation, and discipline).</p>', '<b>The CHRM E-Course compries of 6 Modules</b>\r\n<p>Module 1 – HR Training for the Non HR Managers</p>\r\n<p>Module 2 – Employee Dispute Resolution</p>\r\n<p>Module 3 – Talent Management</p>\r\n<p>Module 4 – Conducting Effective Performance Reviews</p>\r\n<p>Module 5 – Conflict Resolution</p>\r\n<p>Module 6 – Anger Management</p>', '<b>What will you learn from this E-Course</b>\r\n<p>1) The latest trends in the human resource field and the changing role of the human resource professional.</p>\r\n<p>2) How to write job specifications and identify core competencies.</p>\r\n<p>3) Methods of finding, selecting, and keeping the best people using behavioral description interviewing techniques.</p>\r\n<p>4) How to get employees off to a good start.</p>\r\n<p>5) How to deal with compensation and benefits.</p>\r\n<p>6) How to maintain healthy employee relations.</p>\r\n<p>7) How to make performance appraisals a cooperative process. </p>\r\n<p>8) What the peer review process is</p>\r\n<p>9) A process for employees to file grievances and for management to respond</p>\r\n<p>10) How to choose a facilitator and panel</p>\r\n<p>11) What is involved in the hearing process, from preliminary meetings to the hearing, and the decision process</p>\r\n<p>12) What responsibilities and powers a panel should have</p>\r\n<p>13) How to apply professional questioning and probing techniques </p>\r\n<p>14) Why peer review panels fail and how to avoid those pitfalls</p>\r\n<p>15) Apply the multifaceted aspects of talent management in their own organization</p>\r\n<p>16) Describe the skills required to manage high potential candidates</p>\r\n<p>17) Recognize and foster talent within an organization</p>\r\n<p>18) Explain the principles of competency-based management</p>\r\n<p>19) Use the language for talent management </p>\r\n<p>20) The importance of having a performance review process for employees.</p>\r\n<p>21) How to work with employees to set performance standards and goals.</p>\r\n<p>22) Skills in observing, giving feedback, listening, and asking questions.</p>\r\n<p>23) An effective interview process and have the opportunity to practice the process in a supportive atmosphere.</p>\r\n<p>24) How to make the performance review legally defensible. </p>\r\n<p>25) What conflict is and how it can escalate.</p>\r\n<p>26) The types of conflict and the stages of conflict.</p>\r\n<p>27) The five most common conflict resolution styles and when to use them.</p>\r\n<p>28) How to increase positive information flow through non-verbal and verbal communication skills.</p>\r\n<p>29) Effective techniques for intervention strategies.</p>\r\n<p>30) Ways to manage conflicts to enhance productivity and performance.</p>\r\n<p>31) Recognize how anger affects your body, your mind, and your behavior.</p>\r\n<p>32) Use the five-step method to break old patterns and replace them with a model for assertive anger.</p>\r\n<p>33) Use an anger log to identify your hot buttons and triggers.</p>\r\n<p>34) Control your own emotions when faced with other peoples’ anger.</p>\r\n<p>35) Identify ways to help other people safely manage some of their repressed or expressed anger. </p>\r\n<p>36) Communicate with others in a constructive, assertive manner.</p>', '', '', '100', '2013-10-31 13:43:35', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('36', 'Certified Professional Supervisor (CPS) - Standard Package', '2', '(CSP-001)', '(CSP-001)CPS-Standard.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>This Certified Professional Supervisor (CPS) is designed to help you overcome many of the supervisory problems you will encounter in your first few weeks as a boss, whether you are a team leader, a project manager, or a unit coordinator. Dealing with the many problems a new supervisor encounters isn’t easy, but it doesn’t have to lead to discouragement.</p>\r\n\r\n<p>In today’s changing workplace, many new supervisors are unsure of their roles and responsibilities. They have little experience dealing with the challenges of managing work through others. They haven’t had the opportunity to develop those critical skills of planning work, leading their group, and communicating with their employees, their colleagues, and their manager. Our E-Course will give you just that opportunity.</p>\r\n', '<b><p>What will you learn from this E-Course:</p></b>\r\n\r\n<p>1) Clarify roles and responsibilities of the new job.</p>\r\n<p>2) Adjust to the new role with confidence and an assurance you can handle the position.</p>\r\n<p>3) Develop your skills in listening, asking questions, resolving conflict, and giving feedback to employees.</p>\r\n<p>4) Develop a technique for making sure you give employees instructions that are clear and understood.</p>\r\n<p>5) Identify some techniques to deal with employee challenges, such as hostility, complaints, and laziness.</p>\r\n<p>6) Understand the importance of developing good relationships with employees and peers, so you are seen as fair and consistent.</p>\r\n<p>7) You will understand the scope and nature of the supervisory position.</p>\r\n<p>8) You will learn some ways to deal with the challenges of the role.</p>\r\n<p>9) You will recognize the responsibilities you have as a supervisor, to yourself, to your team, and to your organization.</p>\r\n<p>10) You will identify key techniques to help you plan and prioritize effectively</p>\r\n<p>11) You will acquire a basic understanding of and develop strategies for leadership, team building, communication, and motivation and what part they play in effective supervision. </p>\r\n<p>12) The role of goal setting in performance management.</p>\r\n<p>13) Tools to help your employees set and achieve goals.</p>\r\n<p>14) A three-phase model that will help you prepare employees for peak performance, activate their inner motivation, and evaluate their skills.</p>\r\n<p>15) Motivational tools and techniques</p>\r\n<p>16) How delegation fits into their job and how it can make them more successful</p>\r\n<p>17) Different ways of delegating tasks</p>\r\n<p>18) How to use an eight-step process for effective delegation</p>\r\n<p>19) How to give better instructions for better delegation results</p>\r\n<p>20) Common delegation pitfalls and how to avoid them</p>\r\n<p>21) Ways to monitor delegation results</p>\r\n<p>22) Techniques for giving effective feedback</p>\r\n<p>23) Understand how coaching can be used to develop your team.</p>\r\n<p>24) Develop the coaching skills that help improve individual performance.</p>\r\n<p>25) Demonstrate the behaviors and practices of an effective coach.</p>\r\n<p>26) Recognize employees’ strengths and give them the feedback they need to succeed.</p>\r\n<p>27) Identify employee problems and ways you can help to correct them.</p>\r\n<p>28) Learn ways to prioritize, plan, and manage your time.</p>\r\n<p>29) Identify your primary leadership style and techniques for maximizing that style.</p>\r\n<p>30) Develop more flexibility to use other leadership styles.</p>\r\n<p>31) Search for ways to overcome communication barriers.</p>\r\n<p>32) Determine ways you can meet the needs of employees and co-workers through communication and coaching.</p>\r\n<p>33) Explore ways to engage in productive rather than toxic debate, and to make conflict a powerful force for creative, well-rounded solutions to problems. </p>\r\n', '<b><p>What topics are covered in this E-Course:</p></b>\r\n\r\n<p>1) Pre-assignment review</p>\r\n<p>2) Making the transition</p>\r\n<p>3) Responsibilities of a supervisor</p>\r\n<p>4) Setting goals</p>\r\n<p>5) Planning for success</p>\r\n<p>6) Listening skills</p>\r\n<p>7) Asking questions</p>\r\n<p>8) Giving feedback</p>\r\n<p>9) Ask for what you want</p>\r\n<p>10) Giving instructions</p>\r\n<p>11) Orders, requests, and suggestions</p>\r\n<p>12) Managing conflict</p>\r\n<p>13) Dealing with difficult employees</p>\r\n<p>14) Dealing with others</p>\r\n<p>15) The reciprocal quality of relationships</p>\r\n<p>16) Adjusting to your role</p>\r\n<p>17) A supervisor’s responsibilities</p>\r\n<p>18) Making plans</p>\r\n<p>19) Setting goals</p>\r\n<p>20) Leadership</p>\r\n<p>21) The Situational Leadership model</p>\r\n<p>22) Problem employees</p>\r\n<p>23) Synergy</p>\r\n<p>24) Trust</p>\r\n<p>25) Team development</p>\r\n<p>26) Communication skills</p>\r\n<p>27) The communication process</p>\r\n<p>28) Motivation</p>\r\n<p>29) Orientation</p>\r\n<p>30) Training</p>\r\n<p>31) Providing feedback</p>\r\n<p>32) Delegation</p>\r\n<p>33) Dealing with conflict</p>\r\n<p>34) Discipline</p>\r\n<p>35) The shared management model </p>\r\n<p>36) Setting goals </p>\r\n<p>37) Phase I (Preparation)</p>\r\n<p>38) Phase II (Activation)</p>\r\n<p>39) Phase III (Ongoing and Formal Evaluation)</p>\r\n<p>40) Why delegate? What is delegation?</p>\r\n<p>41) Pre-assignment review</p>\r\n<p>42) Picking the right person</p>\r\n<p>43) The delegation meeting</p>\r\n<p>44) Giving instructions</p>\r\n<p>45) Monitoring delegation</p>\r\n<p>46) Practicing delegation</p>\r\n<p>47) Giving feedback</p>\r\n<p>48) Becoming a good delegator</p>\r\n<p>49) Defining coaching</p>\r\n<p>50) The two schools of coaches</p>\r\n<p>51) Five critical coaching skills</p>\r\n<p>52) Communications skills</p>\r\n<p>53) Non-verbal communication</p>\r\n<p>54) Johari Windows</p>\r\n<p>55) Learning styles and principles</p>\r\n<p>56) Methods of feedback</p>\r\n<p>57) Benefits/consequences approach</p>\r\n<p>58) Dealing with problem employees</p>\r\n<p>59) When not to coach</p>\r\n<p>60) Managing your time and energy</p>\r\n<p>61) What makes a good leader?</p>\r\n<p>62) Communication as a leadership tool</p>\r\n<p>63) The commitment curve</p>\r\n<p>64) Employee development models</p>\r\n<p>65) Dealing with conflict and difficult issues</p>\r\n<p>66) What successful leaders do</p>\r\n', '', '', '100', '2013-10-31 13:41:57', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('37', 'Business Management Professional (BMP) -  Premium Package', '2', 'BMP-001', 'BMP-001BPM-----Premium.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>Owning a business requires a vision balanced with attention to detail. You need to be a generalist who understands the multiple aspects of running a business, as well as the ability to step back and see the big picture and to reach into the future. The business environment is a complex place to be. Whether you wish to work as a consultant or freelancer, establish a corporation, or set up an operation that meets a need for very particular type of customer, there is a tremendous amount of information that you need to know and to apply. This E-Course course provides essential learning for new business owners, whether the business is just in the idea stage or you have already begun and need to fill in the gaps</p>\r\n\r\n<p> <b>The Business Management Professional (BMP) comprises of 6 Modules</p></b>\r\n<p>Module 1 – Business Management Fundamentals</p>\r\n<p>Module 2 – Business Leadership </p>\r\n<p>Module 3 – Core Negotiation Skills </p>\r\n<p>Module 4 – Business Succession Planning </p>\r\n<p>Module 5 – Conflict Resolution</p>\r\n<p>Module 6 – Dealing With Difficult People</p>', '<p><b>What will you learn from this E-Course</p></b>\r\n\r\n<p>1) How to apply the best methods for creating, leading, and managing their own business</p>\r\n<p>2) Ways to establish an organizational framework through operations, finance, and leadership</p>\r\n<p>3) Techniques for setting up an effective and efficient system for hiring, retaining, and succession planning</p>\r\n<p>4) How to start researching and designing a strategic plan</p>\r\n<p>5) How to describe the essential elements of marketing, sales, and their company brand</p>\r\n<p>6) How to apply financial and accounting terms correctly</p>\r\n<p>7) Demonstrate an understanding of the value of succession planning for successful businesses.</p>\r\n<p>8) Demonstrate expertise with the key elements of a succession plan.</p>\r\n<p>9) Create and discuss aspects of a succession plan.</p>\r\n<p>10) Discuss the elements of a succession plan in terms of roles, responsibility, function, scope, and evaluation.</p>\r\n<p>11) Understand the basic principles of negotiation</p>\r\n<p>12) Prepare for negotiation</p>\r\n<p>13) Respond to challenges</p>\r\n<p>14) Create win-win situations</p>\r\n<p>15) Develop sustainable agreements</p>\r\n<p>16) Define your role as a manager and identify how that role differs from other roles you have had.</p>\r\n<p>17) Understand the management challenge and the new functions of management..</p>\r\n<p>18) Discover how you can prepare for and embrace the forces of change... </p>\r\n<p>19) Identify ways to get you and your workspace organized and get a jump on the next crisis.</p>\r\n<p>20) Identify your leadership profile and explore ways to use this knowledge to improve your success as a manager..</p>\r\n<p>21) Enhance your ability to communicate with others in meetings and through presentations. </p>\r\n<p>22) Create an action plan for managing your career success. </p>\r\n<p>23) Understand conflict</p>\r\n<p>24) Be able to identify the stages of conflict</p>\r\n<p>25) Use LECSR to resolve conflict</p>\r\n<p>26) Identify other ways to resolve conflict</p>\r\n<p>27) Develop personal skills necessary to resolve conflict</p>\r\n<p>28) Recognize how your own attitudes and actions impact others.</p>\r\n<p>29) Find new and effective techniques for dealing with difficult people.</p>\r\n<p>30) Learn some techniques for managing and dealing with anger.</p>\r\n<p>31) Develop coping strategies for dealing with difficult people and difficult situations.</p>', '', '', '', '300', '2013-10-31 13:41:36', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('38', 'Certified Human Resources Manager (CHRM) - Premium Package', '2', 'CHRM-001', 'CHRM-001CHRM-Premium-Pack.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>The human resource issues facing today\'s business owners and managers. You do not always have the expertise to deal with the many employee relationship issues you face, and yet you will be expected to make decisions that are both effective and legal. This Certified Human Resources Manager (CHRM)™ Certification will walk you through the hiring process, from performing a skills inventory to conducting the interview; discuss orientation; and cover some issues that arise after the hiring process (such as diversity issues, compensation, and discipline).</p>', '<b>The CHRM E-Course compries of 6 Modules</b>\r\n<p>Module 1 – HR Training for the Non HR Managers</p>\r\n<p>Module 2 – Employee Dispute Resolution</p>\r\n<p>Module 3 – Talent Management</p>\r\n<p>Module 4 – Conducting Effective Performance Reviews</p>\r\n<p>Module 5 – Conflict Resolution</p>\r\n<p>Module 6 – Anger Management</p>\r\n', '<b>What will you learn from this E-Course</b>\r\n<p>1) The latest trends in the human resource field and the changing role of the human resource professional.</p>\r\n<p>2) How to write job specifications and identify core competencies.</p>\r\n<p>3) Methods of finding, selecting, and keeping the best people using behavioral description interviewing techniques.</p>\r\n<p>4) How to get employees off to a good start.</p>\r\n<p>5) How to deal with compensation and benefits.</p>\r\n<p>6) How to maintain healthy employee relations.</p>\r\n<p>7) How to make performance appraisals a cooperative process. </p>\r\n<p>8) What the peer review process is</p>\r\n<p>9) A process for employees to file grievances and for management to respond</p>\r\n<p>10) How to choose a facilitator and panel</p>\r\n<p>11) What is involved in the hearing process, from preliminary meetings to the hearing, and the decision process</p>\r\n<p>12) What responsibilities and powers a panel should have</p>\r\n<p>13) How to apply professional questioning and probing techniques </p>\r\n<p>14) Why peer review panels fail and how to avoid those pitfalls</p>\r\n<p>15) Apply the multifaceted aspects of talent management in their own organization</p>\r\n<p>16) Describe the skills required to manage high potential candidates</p>\r\n<p>17) Recognize and foster talent within an organization</p>\r\n<p>18) Explain the principles of competency-based management</p>\r\n<p>19) Use the language for talent management </p>\r\n<p>20) The importance of having a performance review process for employees.</p>\r\n<p>21) How to work with employees to set performance standards and goals.</p>\r\n<p>22) Skills in observing, giving feedback, listening, and asking questions.</p>\r\n<p>23) An effective interview process and have the opportunity to practice the process in a supportive atmosphere.</p>\r\n<p>24) How to make the performance review legally defensible. </p>\r\n<p>25) What conflict is and how it can escalate.</p>\r\n<p>26) The types of conflict and the stages of conflict.</p>\r\n<p>27) The five most common conflict resolution styles and when to use them.</p>\r\n<p>28) How to increase positive information flow through non-verbal and verbal communication skills.</p>\r\n<p>29) Effective techniques for intervention strategies.</p>\r\n<p>30) Ways to manage conflicts to enhance productivity and performance.</p>\r\n<p>31) Recognize how anger affects your body, your mind, and your behavior.</p>\r\n<p>32) Use the five-step method to break old patterns and replace them with a model for assertive anger.</p>\r\n<p>33) Use an anger log to identify your hot buttons and triggers.</p>\r\n<p>34) Control your own emotions when faced with other peoples’ anger.</p>\r\n<p>35) Identify ways to help other people safely manage some of their repressed or expressed anger. </p>\r\n<p>36) Communicate with others in a constructive, assertive manner.</p>', '', '', '300', '2013-10-31 13:43:56', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('39', 'Certified Professional Trainer (CPT) - Premium Package', '7', 'CPT-001', 'CPT-001CPT---Premium.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>12 Hours</p>', '<p> If you are thinking about becoming a trainer, or have started doing some training already and want to know more about what will help you to become an excellent trainer, this workshop will help. This E-Course is designed as an exploration of the essential skills that trainers need to develop, and to get you started in the learning process in an interactive and fun environment. </p>\r\n\r\n<p>People who work as trainers are often put into difficult situations without much understanding of what training is or how to do it well. We know that being a good trainer is the result of developing skills to bring information to an audience. This information will then engage, empower, and encourage continued learning and development. This course will give you the skills that you need so that your students not only learn, but also enjoy the process, retain information shared, and use their new skills back in the workplace. </p>\r\n', '<p>Behind every spectacular training session is a lot of preparation and meticulous attention to detail. The truly skilled trainer can make a program exciting. The learners will have fun while they are learning if the facilitator is able to involve their emotions as well as their minds. You will see the involvement, and you will feel the energy. To reach this stage as an adult educator isn’t always easy, but success isn’t just for the naturally gifted. It is possible for all of us who put effort into our personal growth and development. We want the enormous satisfaction that comes from working with others to help them reach their potential as human beings. The third module of this E-Course will help you reach that goal.</p>\r\n\r\n<p>Training is also an essential element of development in any organization. Being knowledgeable and continuing to learn throughout your career can make you a very valuable asset. We also know that training and orientation (or ‘onboarding’) for newly hired employees is a key factor in retention. The Module 4 workshop is designed for a trainer who wants to develop training programs that are meaningful, practical, and will benefit both trainees and the organizations they work for.</p>\r\n', '<p><b>What Will you Learn from this E-Course?</p></b>\r\n\r\n<p>1) Understand the essential background for trainers to have </p>\r\n<p>2) Explore how being genuine enhances training</p>\r\n<p>3) Identify the elements of good questions</p>\r\n<p>4) Understand how to apply listening skills</p>\r\n<p>5) Develop rapport building strategies </p>\r\n<p>6) Recognize key skills in a trainer’s toolbox and identify skill areas for development</p>\r\n<p>7) Recognize the importance of considering the participants and their training needs, including the different learning styles and adult learning principles.</p>\r\n<p>8) Know how to write objectives and evaluate whether these objectives have been met at the end of a training session.</p>\r\n<p>9) Develop an effective training style, using appropriate training aids and techniques.</p>\r\n<p>10) Conduct a short group training session that incorporates these training concepts. </p>\r\n<p>11) Demonstrate your understanding of learning styles and how to accommodate all four learning styles in the classroom</p>\r\n<p>12) Apply the key principles of effective communication in a workshop setting</p>\r\n<p>13) Use a variety of training techniques to stimulate participation</p>\r\n<p>14) Develop a plan and prepare for an effective training session</p>\r\n<p>15) Explain the different levels of evaluation and when to use each</p>\r\n<p>16) Identify advanced interventions for difficult situations</p>\r\n<p>17) Put your skills to work for a team presentation</p>\r\n<p>18) Describe the essential elements of a training program </p>\r\n<p>19) Apply different methodologies to program design</p>\r\n<p>20) Demonstrate skills in preparation, research, and delivery of strong content</p>\r\n<p>21) Explain an instructional model </p>\r\n<p>22) Be prepared to create a training program proposal </p>\r\n\r\n\r\n', '<p><b>What Topics are Covered in this E-Course?</p></b>\r\n\r\n<p>1) What makes a good trainer?</p>\r\n<p>2) Personal best, professional best</p>\r\n<p>3) Being genuine</p>\r\n<p>4) Assertiveness skills</p>\r\n<p>5) Asking the right questions </p>\r\n<p>6) Listening skills</p>\r\n<p>7) Connecting with people</p>\r\n<p>8) Defusing difficult participants</p>\r\n<p>9) Essentials for success</p>\r\n<p>10) Do’s and don’ts for new trainers </p>\r\n<p>11) Defining a successful training program/trainer</p>\r\n<p>12) Adult learning and the learning process</p>\r\n<p>13) Principles of adult learning</p>\r\n<p>14) Style assessment, including introvert/extrovert analysis</p>\r\n<p>15) Applying the learning cycle</p>\r\n<p>16) The training process (planning training, choosing methods, designing learning sequences)</p>\r\n<p>17) Adding games</p>\r\n<p>18) Setting the climate</p>\r\n<p>19) Presentation skills</p>\r\n<p>20) Dealing with difficult trainees</p>\r\n<p>21) On-the-job training </p>\r\n<p>22) Evaluation techniques</p>\r\n<p>23) Mock training presentations for peer review</p>\r\n<p>24) Preparing to learn and understanding learning</p>\r\n<p>25) Competencies for adult educators</p>\r\n<p>26) Accommodating learning preferences</p>\r\n<p>27) Increasing your expertise and using existing materials</p>\r\n<p>28) Planning a workshop, including preparing visual aids</p>\r\n<p>29) Effective communication (incl. questioning)</p>\r\n<p>30) Kirkpatrick’s levels of evaluation</p>\r\n<p>31) On-the-job support</p>\r\n<p>32) Managing stress and dealing with difficult situations</p>\r\n<p>33) Training in different forums (i.e. virtual learning)</p>\r\n<p>34) Mock training presentations</p>', '', '300', '2013-10-31 13:41:15', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('40', 'Certified Finance Manager (CFM) - Premium Package', '2', 'CFM-001', 'CFM-001CFMPrem.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>11 Hours</p>', '<p>Many of us flinch when we hear terms like depreciation, cash flow, balance sheet, and (worst of all!) budgets. However, these are all important concepts to understand if you’re going to succeed in today’s business world, particularly as a supervisor. Even better, financial terms are not as scary as they seem!</p>\r\n\r\n<p>For managers in today’s business world, it’s essential to have a working knowledge of finance. We all play a role in our organization’s financial health, whether we realize it or not. If you don’t have training or a background in finance, you may be at a disadvantage as you sit around the management table. Understanding the cycle of finance will help you figure out where you fit into your company’s financial structure, and how to keep your department out of the red. This E-Course workshop will help you prepare budgets and make decisions with confidence.</p>', '<b>How You Will Benefit with this E-Course</b>\r\n\r\n<p>1) Describe the art of finance and key financial terms</p>\r\n<p>2) Determine your role in company finances</p>\r\n<p>3) Find the rules and regulations for your area and industry</p>\r\n<p>4) Discuss various types of financial reports, including income statements, balance sheets, cash flow statements, and statements of retained earnings</p>\r\n<p>5) Explain how a chart of accounts is created</p>\r\n<p>6) Tell the difference between cash and accrual accounting</p>\r\n<p>7) Explain single-entry and double-entry bookkeeping</p>\r\n<p>8) Differentiate between debits and credits</p>\r\n<p>9) Identify and analyze important financial data and make financial decisions</p>\r\n<p>10) Read annual reports</p>\r\n<p>11) Determine whether a company is financially high or low risk</p>\r\n<p>12) Recognize different types of organizational financial plans</p>\r\n<p>13) Explain what budgets are and how to prepare them</p>\r\n<p>14) Recognize what computer skills you need to make you a financial whiz</p>\r\n<p>15) Deal with financial situations that impact the people that work for you</p>\r\n<p>16) Define basic financial terminology</p>\r\n<p>17) Prepare a budget of any type or size</p>\r\n<p>18) Get your budget approved</p>\r\n<p>19) Perform basic ratio analysis</p>\r\n<p>20) Make better financial decisions</p>\r\n\r\n<b>What Topics are Covered in Module 1? </b>\r\n<p></p>\r\n<p>1) Getting the facts straight</p>\r\n<p>2) The accounting cycle</p>\r\n<p>3) The key reports</p>\r\n<p>4) Keeping score</p>\r\n<p>5) A review of financial terms</p>\r\n<p>6) Understanding debits and credits</p>\r\n<p>7) Your financial analysis toolbox</p>\r\n<p>8) Identifying high and low risk companies</p>\r\n<p>9) The basics of budgeting</p>\r\n<p>10) Working smarter</p>\r\n<p>11) People and numbers</p>\r\n\r\n', '<b>What Topics are covered in Module 2? </b>\r\n<p>1) The fundamentals of finance</p>\r\n<p>2) The basics of budgeting</p>\r\n<p>3) Parts of a budget</p>\r\n<p>4) The budgeting process</p>\r\n<p>5) Budgeting tips and tricks</p>\r\n<p>6) Monitoring and managing budgets</p>\r\n<p>7) Crunching the numbers</p>\r\n<p>8) Getting your budget approved</p>\r\n<p>9) Comparing investment opportunities</p>\r\n<p>10) ISO 9001:2008</p>\r\n<p>11) Directing the Peerless Data Corporation (intensive case study) </p>', '', '', '250', '2013-11-15 07:19:04', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('41', 'Certified Team Leader (CTL) - Premium Package ', '2', 'CTL-001', 'CTL-001CTL-Premium.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>16 Hours</p', '<p>Your success as a manager can often depend on how well your team operates.  How are their problem-solving skills? Are they enthusiastic and motivated to do their best?  Do they work well together? There have been hundreds of studies demonstrating that human beings function better and learn better in groups. If you want to develop your team leadership skills and unleash the talent of your individual team members, this E-Course is a practical look at current leadership practices that work. </p>\r\n\r\n<p>Teams are an important building block of successful organizations. Whether the focus is on service, quality, cost, value, speed, efficiency, performance, or other similar goals, teams are the basic unit that supports most organizations. With teams at the core of corporate strategy, your success as an organization can often depend on how well you and other team members operate together. How are your problem-solving skills? Is the team enthusiastic and motivated to do its best? Do you work well together? This E-Course can help you get there! </p>\r\n\r\n', '<p>Leaders represent an important force in the North American economy. You have the power to turn on or turn off the productivity of the people who work for you. You are the crucial interface between the employee on the shop floor or the service desk and the managers of the organization. You usually have more experience and more skill than the employees you supervise, because management tends to look for super people to fill those roles.</p>\r\n\r\n<p>This E-Course also covers Self-leadership which puts together taking responsibility for our outcomes, setting direction for our lives, and having tools to manage priorities. Self-leaders work at all levels of an organization. They are front-line workers in every possible role, middle managers, and CEOs. Self-leaders like Walt Disney and Wayne Gretzky worked hard to achieve their dreams without using the term self-leadership. However, they have clearly demonstrated that being in control of their behavior and results, focus, practice, and learning were necessary to achieve their goals. </p>\r\n', '<p>Self-leadership requires a commitment from individuals to decide what they want from life and to do what’s necessary to get the results they want. This one-day workshop will help participants internalize the four pillars of self-leadership and to make meaningful, empowered choices while taking action to get where they want to go.</p>\r\n', '<b>What Topics are Covered?</b>\r\n\r\n<p>1) Types of teams</p>\r\n<p>2) The TORI model</p>\r\n<p>3) The Team Player Survey</p>\r\n<p>4) Organizations Today</p>\r\n<p>5) The Stages of Team Development</p>\r\n<p>6) Communication Skills</p>\r\n<p>7) Shared Leadership </p>\r\n<p>8) DeBono’s Thinking Hats</p>\r\n<p>9) Managing Team Conflict</p>\r\n<p>10) The Trust/Relationship Model</p>\r\n<p>11) Obtaining Consensus</p>\r\n<p>12) Team-Shaping Factors</p>\r\n<p>13) Team Problem-Solving</p>\r\n<p>14) SWOT Analysis</p>\r\n<p>15) Managing your time and energy</p>\r\n<p>16) What makes a good leader?</p>\r\n<p>17) Communication as a leadership tool</p>\r\n<p>18) The commitment curve</p>\r\n<p>19) Employee development models</p>\r\n<p>20) Dealing with conflict and difficult issues</p>\r\n<p>21) Defining teams</p>\r\n<p>22) Establishing team norms</p>\r\n<p>23) Working as a team</p>\r\n<p>24) Your team player type</p>\r\n<p>25) Building team trust</p>\r\n<p>26) The stages of team development</p>\r\n<p>27) Team building with TORI </p>\r\n<p>28) Communication</p>\r\n<p>29) Becoming a good team player</p>\r\n<p>30) Managing your time and energy</p>\r\n<p>31) What makes a good leader?</p>\r\n<p>32) Communication as a leadership tool</p>\r\n<p>33) The commitment curve</p>\r\n<p>34) Employee development models</p>\r\n<p>35) Dealing with conflict and difficult issues</p>\r\n<p>36) What successful leaders do</p>\r\n<p>37) What is self-leadership?</p>\r\n<p>38) Knowing who you are</p>\r\n<p>39) Change management</p>\r\n<p>40) Knowing what you do</p>\r\n<p>41) Motivation for optimists</p>', '', '300', '2014-12-29 08:31:01', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('42', 'Certified Problem and Change Manager (CPCM) - Premium Package', '2', 'CPCM-001', 'CPCM-001CPCM-Premium.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>15 Hours</p>', '<p>We make decisions and solve problems continually. We start making decisions before we even get out of bed (shall I get up now or not?). Sometimes, we will have made as many as 50 decisions by the time we leave for work. Despite all the natural decision making that goes on and the problem solving we do, some people are very uncomfortable with having to make decisions. You may know someone who has a hard time making decisions about what to eat, never mind the internal wrestling they go through in order to take on major decisions at work. Likewise, we’ve probably all looked at a solution to something and said, “I could have thought of that.” The key to finding creative solutions is not just creativity, although that will certainly help. The answer rests in our ability to identify options, research them, and then put things together in a way that works. Having a process to work through can take the anxiety out of problem solving and make decisions easier. That’s what this E-Course is all about.</p>\r\n', '<p>Change is something that excites people who love opportunities for growth, to see and learn about new things, or who like to shift the status quo. Some changes, however, are harder to adjust to and lead to expressions of resistance and anger. We can take concrete steps to make change more palatable by understanding people’s hesitation, enlisting the help of others, setting up plans, and managing stressors. These steps can also ensure that desired changes are implemented successfully.  </p>\r\n', '<p>In this E-Course, you will learn how to manage and cope with change and how to help those around you too. </p>\r\n\r\n<p><b>What Will you learn from this E-Course?</b></p>\r\n\r\n<p>1) How to apply problem solving steps and tools</p>\r\n<p>2) How to analyze information to clearly describe problems</p>\r\n<p>3) How to identify appropriate solutions</p>\r\n<p>4) Ways to think creatively and be a contributing member of a problem solving team</p>\r\n<p>5) How to select the best approach for making decisions</p>\r\n<p>6) How to create a plan for implementing, evaluating, and following up on decisions</p>\r\n<p>7) Ways to avoid common decision-making mistakes</p>\r\n<p>8) Accept there are no normal or abnormal ways of reacting to change, but that we must start from where we are. </p>\r\n<p>9) See change not as something to be feared and resisted but as an essential element of the world to be accepted.</p>\r\n<p>10) Understand that adapting to change is not technical but attitudinal. Change is not an intellectual issue but one that strikes at who you are.</p>\r\n<p>11) Recognize that before we can embrace the way things will be, we may go through a process of grieving, and of letting go of the way things used to be.</p>\r\n<p>12) See change as an opportunity for self-motivation and innovation.\r\nIdentify strategies for helping change be accepted and implemented in the workplace. </p>\r\n<p>13) Find different ways of looking at change</p>\r\n<p>14) Create a change implementation strategy</p>\r\n<p>15) Make change easier for yourself and others</p>\r\n<p>16) Develop techniques to cope with change, including resiliency and stress management\r\n<p>17) Know how to maintain a sense of control during a change</p>', '', '', '250', '2013-10-31 13:43:15', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('43', 'Certified Call Center Associate (CCCA) - Standard Package ', '2', '(CCCA-001)', '(CCCA-001)CCCA---Standard.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>8 Hours</p>', '<p>Whether we choose to embrace them or cannot stand being interrupted by their calls, call centers are a business element that is here to stay. This E-Course will help call center agents learn to make the most of their telephone-based work, including understanding the best ways to listen and be heard. Each phone interaction has elements of sales and customer service skills, which we will explore in detail throughout this energizing and practical via our E-Course</p> \r\n', '</p>While many companies promise to deliver an incredible customer experience, some are better at delivering than others. The E-Course is also designed around six critical elements of customer service that, when the company lives them, bring customers back to experience service that outdoes the competition.</p>', '<b><p>What Topics are Covered in this E-Course?</p></b>\r\n\r\n<p>1) Verbal communication techniques</p>\r\n<p>2) Who are your customers?</p>\r\n<p>3) Listening skills</p>\r\n<p>4) Asking the right questions and saying no</p>\r\n<p>5) Taking messages and using voice mail effectively</p>\r\n<p>6) Vocal exercises</p>\r\n<p>7) Cold and warm calls, including developing a script</p>\r\n<p>8) Going above and beyond and high impact moments</p>\r\n<p>9) Handling objections and closing the sale</p>\r\n<p>10) Negotiation techniques </p>\r\n<p>11) Tips for challenging callers</p>\r\n<p>12) Phone tag and getting the call back</p>\r\n<p>13) Stress busting</p>\r\n<p>14) Call center trends</p>\r\n<p>15) What is customer service? Who are your customers? </p>\r\n<p>16) Meeting expectations</p>\r\n<p>17) Setting goals</p>\r\n<p>18) Communication skills and telephone techniques</p>\r\n<p>19) Dealing with difficult customers and people</p>\r\n<p>20) Dealing with challenges assertively</p>\r\n<p>21) Dealing with stress </p>\r\n<p>22) The first critical element: A customer service focus </p>\r\n<p>23) The second critical element: Defined in your organization</p>\r\n<p>24) The third critical element: Given life by employees</p>\r\n<p>25) The fourth critical element: Be a problem solver</p>\r\n<p>26) The fifth critical element: Measure it</p>\r\n<p>27) The sixth critical element: Reinforce it</p>', '<b><p>What Will you learn from this E-Course?</p></b>\r\n\r\n<p>1) The nuances of body language and verbal skills.</p>\r\n<p>2) Aspects of verbal communication such as tone, cadence, and pitch.</p>\r\n<p>3) Questioning and listening skills.</p>\r\n<p>4) Ways of delivering bad news and saying no.</p>\r\n<p>5) Effective ways to negotiate.</p>\r\n<p>6) The importance of creating and delivering meaningful messages.</p>\r\n<p>7) Tools to facilitate communication.</p>\r\n<p>8) The value of personalizing interactions and developing relationships.</p>\r\n<p>9) Vocal techniques that enhance speech and communication ability.</p>\r\n<p>10) Techniques for managing stress.</p>\r\n', '', '100', '2013-10-31 13:27:43', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('44', 'Certified Call Center Associate (CCCA) - Premium Package', '2', 'CCCA-001', 'CCCA-001CCCA----Premium-Package.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>8 Hours</p>', '<p>Whether we choose to embrace them or cannot stand being interrupted by their calls, call centers are a business element that is here to stay. This E-Course will help call center agents learn to make the most of their telephone-based work, including understanding the best ways to listen and be heard. Each phone interaction has elements of sales and customer service skills, which we will explore in detail throughout this energizing and practical via our E-Course</p> ', '</p>While many companies promise to deliver an incredible customer experience, some are better at delivering than others. The E-Course is also designed around six critical elements of customer service that, when the company lives them, bring customers back to experience service that outdoes the competition.</p>\r\n', '<b><p>What Topics are Covered in this E-Course?</p></b>\r\n\r\n<p>1) Verbal communication techniques</p>\r\n<p>2) Who are your customers?</p>\r\n<p>3) Listening skills</p>\r\n<p>4) Asking the right questions and saying no</p>\r\n<p>5) Taking messages and using voice mail effectively</p>\r\n<p>6) Vocal exercises</p>\r\n<p>7) Cold and warm calls, including developing a script</p>\r\n<p>8) Going above and beyond and high impact moments</p>\r\n<p>9) Handling objections and closing the sale</p>\r\n<p>10) Negotiation techniques </p>\r\n<p>11) Tips for challenging callers</p>\r\n<p>12) Phone tag and getting the call back</p>\r\n<p>13) Stress busting</p>\r\n<p>14) Call center trends</p>\r\n<p>15) What is customer service? Who are your customers? </p>\r\n<p>16) Meeting expectations</p>\r\n<p>17) Setting goals</p>\r\n<p>18) Communication skills and telephone techniques</p>\r\n<p>19) Dealing with difficult customers and people</p>\r\n<p>20) Dealing with challenges assertively</p>\r\n<p>21) Dealing with stress </p>\r\n<p>22) The first critical element: A customer service focus </p>\r\n<p>23) The second critical element: Defined in your organization</p>\r\n<p>24) The third critical element: Given life by employees</p>\r\n<p>25) The fourth critical element: Be a problem solver</p>\r\n<p>26) The fifth critical element: Measure it</p>\r\n<p>27) The sixth critical element: Reinforce it</p>', '<b><p>What Will you learn from this E-Course?</p></b>\r\n\r\n<p>1) The nuances of body language and verbal skills.</p>\r\n<p>2) Aspects of verbal communication such as tone, cadence, and pitch.</p>\r\n<p>3) Questioning and listening skills.</p>\r\n<p>4) Ways of delivering bad news and saying no.</p>\r\n<p>5) Effective ways to negotiate.</p>\r\n<p>6) The importance of creating and delivering meaningful messages.</p>\r\n<p>7) Tools to facilitate communication.</p>\r\n<p>8) The value of personalizing interactions and developing relationships.</p>\r\n<p>9) Vocal techniques that enhance speech and communication ability.</p>\r\n<p>10) Techniques for managing stress.</p>', '', '175', '2013-10-31 13:26:58', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('45', 'Certified Professional Supervisor (CPS) - Premium Package', '2', 'CPS-001', 'CPS-001CPS-Premium-Pack.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>This Certified Professional Supervisor (CPS) is designed to help you overcome many of the supervisory problems you will encounter in your first few weeks as a boss, whether you are a team leader, a project manager, or a unit coordinator. Dealing with the many problems a new supervisor encounters isn’t easy, but it doesn’t have to lead to discouragement.</p>\r\n\r\n<p>In today’s changing workplace, many new supervisors are unsure of their roles and responsibilities. They have little experience dealing with the challenges of managing work through others. They haven’t had the opportunity to develop those critical skills of planning work, leading their group, and communicating with their employees, their colleagues, and their manager. Our E-Course will give you just that opportunity.</p>', '<b><p>What will you learn from this E-Course:</p></b>\r\n\r\n<p>1) Clarify roles and responsibilities of the new job.</p>\r\n<p>2) Adjust to the new role with confidence and an assurance you can handle the position.</p>\r\n<p>3) Develop your skills in listening, asking questions, resolving conflict, and giving feedback to employees.</p>\r\n<p>4) Develop a technique for making sure you give employees instructions that are clear and understood.</p>\r\n<p>5) Identify some techniques to deal with employee challenges, such as hostility, complaints, and laziness.</p>\r\n<p>6) Understand the importance of developing good relationships with employees and peers, so you are seen as fair and consistent.</p>\r\n<p>7) You will understand the scope and nature of the supervisory position.</p>\r\n<p>8) You will learn some ways to deal with the challenges of the role.</p>\r\n<p>9) You will recognize the responsibilities you have as a supervisor, to yourself, to your team, and to your organization.</p>\r\n<p>10) You will identify key techniques to help you plan and prioritize effectively</p>\r\n<p>11) You will acquire a basic understanding of and develop strategies for leadership, team building, communication, and motivation and what part they play in effective supervision. </p>\r\n<p>12) The role of goal setting in performance management.</p>\r\n<p>13) Tools to help your employees set and achieve goals.</p>\r\n<p>14) A three-phase model that will help you prepare employees for peak performance, activate their inner motivation, and evaluate their skills.</p>\r\n<p>15) Motivational tools and techniques</p>\r\n<p>16) How delegation fits into their job and how it can make them more successful</p>\r\n<p>17) Different ways of delegating tasks</p>\r\n<p>18) How to use an eight-step process for effective delegation</p>\r\n<p>19) How to give better instructions for better delegation results</p>\r\n<p>20) Common delegation pitfalls and how to avoid them</p>\r\n<p>21) Ways to monitor delegation results</p>\r\n<p>22) Techniques for giving effective feedback</p>\r\n<p>23) Understand how coaching can be used to develop your team.</p>\r\n<p>24) Develop the coaching skills that help improve individual performance.</p>\r\n<p>25) Demonstrate the behaviors and practices of an effective coach.</p>\r\n<p>26) Recognize employees’ strengths and give them the feedback they need to succeed.</p>\r\n<p>27) Identify employee problems and ways you can help to correct them.</p>\r\n<p>28) Learn ways to prioritize, plan, and manage your time.</p>\r\n<p>29) Identify your primary leadership style and techniques for maximizing that style.</p>\r\n<p>30) Develop more flexibility to use other leadership styles.</p>\r\n<p>31) Search for ways to overcome communication barriers.</p>\r\n<p>32) Determine ways you can meet the needs of employees and co-workers through communication and coaching.</p>\r\n<p>33) Explore ways to engage in productive rather than toxic debate, and to make conflict a powerful force for creative, well-rounded solutions to problems. </p>\r\n', '<b><p>What topics are covered in this E-Course:</p></b>\r\n\r\n<p>1) Pre-assignment review</p>\r\n<p>2) Making the transition</p>\r\n<p>3) Responsibilities of a supervisor</p>\r\n<p>4) Setting goals</p>\r\n<p>5) Planning for success</p>\r\n<p>6) Listening skills</p>\r\n<p>7) Asking questions</p>\r\n<p>8) Giving feedback</p>\r\n<p>9) Ask for what you want</p>\r\n<p>10) Giving instructions</p>\r\n<p>11) Orders, requests, and suggestions</p>\r\n<p>12) Managing conflict</p>\r\n<p>13) Dealing with difficult employees</p>\r\n<p>14) Dealing with others</p>\r\n<p>15) The reciprocal quality of relationships</p>\r\n<p>16) Adjusting to your role</p>\r\n<p>17) A supervisor’s responsibilities</p>\r\n<p>18) Making plans</p>\r\n<p>19) Setting goals</p>\r\n<p>20) Leadership</p>\r\n<p>21) The Situational Leadership model</p>\r\n<p>22) Problem employees</p>\r\n<p>23) Synergy</p>\r\n<p>24) Trust</p>\r\n<p>25) Team development</p>\r\n<p>26) Communication skills</p>\r\n<p>27) The communication process</p>\r\n<p>28) Motivation</p>\r\n<p>29) Orientation</p>\r\n<p>30) Training</p>\r\n<p>31) Providing feedback</p>\r\n<p>32) Delegation</p>\r\n<p>33) Dealing with conflict</p>\r\n<p>34) Discipline</p>\r\n<p>35) The shared management model </p>\r\n<p>36) Setting goals </p>\r\n<p>37) Phase I (Preparation)</p>\r\n<p>38) Phase II (Activation)</p>\r\n<p>39) Phase III (Ongoing and Formal Evaluation)</p>\r\n<p>40) Why delegate? What is delegation?</p>\r\n<p>41) Pre-assignment review</p>\r\n<p>42) Picking the right person</p>\r\n<p>43) The delegation meeting</p>\r\n<p>44) Giving instructions</p>\r\n<p>45) Monitoring delegation</p>\r\n<p>46) Practicing delegation</p>\r\n<p>47) Giving feedback</p>\r\n<p>48) Becoming a good delegator</p>\r\n<p>49) Defining coaching</p>\r\n<p>50) The two schools of coaches</p>\r\n<p>51) Five critical coaching skills</p>\r\n<p>52) Communications skills</p>\r\n<p>53) Non-verbal communication</p>\r\n<p>54) Johari Windows</p>\r\n<p>55) Learning styles and principles</p>\r\n<p>56) Methods of feedback</p>\r\n<p>57) Benefits/consequences approach</p>\r\n<p>58) Dealing with problem employees</p>\r\n<p>59) When not to coach</p>\r\n<p>60) Managing your time and energy</p>\r\n<p>61) What makes a good leader?</p>\r\n<p>62) Communication as a leadership tool</p>\r\n<p>63) The commitment curve</p>\r\n<p>64) Employee development models</p>\r\n<p>65) Dealing with conflict and difficult issues</p>\r\n<p>66) What successful leaders do</p>\r\n', '', '', '250', '2013-10-31 13:29:09', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('46', 'Certified Software Tester - Intermediate Level - Standard Pack', '5', '(BH0-007)', '(BH0-007)CSTIL---Standard.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>12 Hours</p>', '<p>The Certified Software Tester Intermediate Level Exam is a second step in your career, if you are seeking an advanced level of career in the field of Software Testing than this is a right exam for you.</p>\r\n\r\n<p>The Intermediate Certificate in Software Testing examination is suitable for those who are engaged in any aspect of software testing. The topics covered are those which are considered to be essential knowledge for an advanced level test professional, regardless of their specialism (i.e. Test Analysis or Test Management).</p>', '<p>Our E-Learning Course  is broken into bite-size lessons and combines leading edge multimedia and interactive exercises for optimum enjoyment and knowledge retention. The e-learning course also comprises of unique mock exam simulator which allows you to test and re-test your understanding of the Software Testing foundations and be confident for the exams. </p>', '</p><b>What are the Modules Covered in CSTIL?</p></b>\r\n<p>Module 1 - Overview of Testing </p>\r\n<p>Module 2 - Test Plan</p>\r\n<p>Module 3 - Test Case and Execution </p>\r\n<p>Module 4 - Test Review </p>\r\n<p>Module 5 - Types of Testing </p>', '', '', '150', '2013-11-15 06:58:27', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('47', 'Certified Hardware and Technology Engineer (CHTE) - Standard Pack', '8', '(CHTE-001)', '(CHTE-001)CHTE-Standard.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<b>Course Duration</b>\r\n18 Hours', '<p>The focus of this piece has mainly been the technical aspect of Certified Hardware and Technology Engineer (CHTE) as a certification for tech support. Technical support, like every career area of IT has its personality requirements, as well as opportunities and challenges. Are you are interested in developing your career along this line? It makes sense for you to also have an insight into the associated challenges and prospects. With this you can take meaningful career decisions within the context of your career plan.<p>', '<p><b>Module 1 - Foundation</b></p>\r\n\r\n<b>  <p>Module 1.1 - Basic Terms</p></b>\r\n  <p>1) Types of Computers</p>\r\n   <p>2) Anatomy of a PC</p>\r\n   <p>3) How a PC Works</p>\r\n  <b><p>Module 1.2 Hardware Devices</p></b>\r\n  <p>1) CPU and Memory</p>\r\n   <p>2) Input Devices</p>\r\n   <p>3) Output Devices</p>\r\n    <p>4) Secondary Storage Devices</p>\r\n <b>  <p>Module 1.3 Software Basics</p></b>\r\n <p>1) Operating Systems and Applications</p>\r\n   <p>2) How is Software Built?</p>\r\n  <p>3) Types of Software</p>\r\n  <p>4) Legal Issues</p>\r\n   <p>5) How is Software Built?</p>\r\n', '<p><b>Module 2 - Advanced Level</b></p>\r\n <b>  <p>Module 2.1 Advanced Level Part I</p></b>\r\n    <p>1) Working With the Computer</p>\r\n    <p>2) First Steps</p>\r\n    <p>3) Basic Tasks</p>\r\n    <p>4) Using the Desktop</p>\r\n   <p>5) Customizing Your Computer</p>\r\n   <p>6) Printing</p>\r\n <b>  <p>Module 2.2 Advanced Level Part I</p></b>\r\n    <p>1) Working with Files and Folders</p>\r\n  <p>2) The Basics of Files and Folders</p>\r\n   <p>3) Managing Files and Folders, Part I</p>\r\n   <p>4) Managing Files and Folders, Part II</p>\r\n    <p>5) Viewing File or Folder Properties</p>\r\n    <p>6) Working With Files and Folders</p>\r\n    <p>7) Compressed Files</p>\r\n', '<p><b>Module 3 - Expert</b></p>\r\n\r\n     <p>1) Application Basics</p>\r\n     <p>2) Basic Applications</p>\r\n     <p>3) Working with a Window</p>\r\n     <p>4) Working with WordPad</p>\r\n     <p>5) Working With Applications</p>\r\n     <p>6) Basics of Web Browsers</p>\r\n     <p>7) Browsing the Web</p>\r\n     <p>8) Working with Bookmarks</p>\r\n     <p>9) Working With Web Pages</p>\r\n    <p>10) Printing Web Pages</p>\r\n', '', '100', '2013-11-15 07:34:01', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('48', 'Certified Network Engineer (CNE) Foundation - Standard Package', '8', '(CNE-001)', '(CNE-001)CNE-Standard.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>Course Duration</b></p>\r\n12 Hours', '<p>The exponential growth in networks in recent years has totally changed the way we work and play. We now demand instant communication with anyone via voice, text and video, and immediate access to all kinds of information and services. The networks that make this possible involve a wide range of engineering challenges.</p>\r\n\r\n<p>The study of networking includes the network fundamentals, network elements, applications, content etc. that make up the service-enabling technologies. The Network Engineering will give students an understanding of the full range of modern communication technologies, network protocols and middle-ware required for modern networks. It will equip them with the expertise to design, build, configure and test modern networks and networked services.</p>\r\n', '<p><b>Network Engineer</b></p>\r\n<p>A Network Engineer is an individual that is responsible for the maintenance of computer hardware and software systems that make up a computer network including the maintenance and monitoring of active data network or converged infrastructure and related network equipment.</p>\r\n\r\n<p>Network Engineers are generally mid-level support staff within an organization and do not typically get involved directly with users. Network Engineers focus upon network components within a company\'s LAN/WAN infrastructure ensuring integrity. Depending on the company and its size, the Network Engineer may also design and deploy networks. </p>\r\n', '<p><b>Module 1 : Information Networks</b></p>\r\n<p>Basic Terms</p>\r\n<p>Advanced Terms</p>\r\n<p>Networking Basics</p>\r\n<p>Basic Internet Concepts</p>\r\n<p>Internet Security</p>\r\n<p><b>Module 2 : Applications</b></p>\r\n<p>Computers in the Workplace</p>\r\n<p>Tele-Commuting</p>\r\n<p>The Electronic World</p>\r\n<p>Ergonomics</p>\r\n<p>Safety and the Environment</p>\r\n<p><b>Module 3 : Security</b></p>\r\n<p>Being Proactive</p>\r\n<p>Identifying Yourself</p>\r\n<p>Protecting your Data</p>\r\n<p>Understanding Malware</p>\r\n<p>Protecting Against Malware</p>\r\n', '', '', '100', '2014-02-12 06:56:22', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('49', 'Certified Project Director (CPD) - Standard Package', '3', '(CPD-001)', '(CPD-001)CPD-Standard-Pack.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>', 'Whether you are managing a group of project managers, managing multiple projects or looking for a career path towards being a Project Director, you’re on the right track! With common challenges in managing scope, risk, budgets and cost, a project team can be directed to be more focused and successful. This one-day course includes many valuable project topics: align goals, projects and competencies; organizing multiple project communications; managing risk; tools to manage multiple projects; and, leadership.  At the end of the course, you will be required to  write an exam, once you qualify in the exam you will receive your official Certificate.\r\n', '<b>What Topics are Covered in the E-Course?</b>\r\n<p></p>\r\n<p>	1) Project leadership techniques</p>\r\n<p>	2) Project lifecycle in-depth focus</p>\r\n<p>	3) Utilizing matrices to support projects</p>\r\n<p>	4) Identifying gaps and utilizing strengths</p>\r\n<p>	5) Simplifying complex communications</p>\r\n<p>	6) Managing project change</p>\r\n<p>	7) Documenting Issues</p>\r\n<p>	8) Managing risk effectively</p>\r\n<p>	9) Tools for managing multiple projects </p>\r\n<p>	10) Technology needs assessment</p>\r\n', '<b>What will you learn from this E-Course?</b>\r\n<p></p>\r\n<p>1) Learn in-depth details of Life-cycle phases and process </p>\r\n<p>2) Use techniques to best align organizational goals with projects and project manager competencies</p>\r\n<p>3) Get the right information to the right people the right way</p>\r\n<p>4) Lean how to better manage project scope</p>\r\n<p>5) Establish valuable project cost management processes</p>\r\n<p>6) The Leadership way to establish personal goals</p>', '', '', '100', '2013-11-15 06:46:05', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('50', 'Certified Hardware and Technology Engineer (CHTE) - Premium Pack', '8', 'CHTE-001', 'CHTE-001CHTE-Premium-Pack.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>Course Duration</b></p>\r\n18 Hours', '<p>The focus of this piece has mainly been the technical aspect of Certified Hardware and Technology Engineer (CHTE) as a certification for tech support. Technical support, like every career area of IT has its personality requirements, as well as opportunities and challenges. Are you are interested in developing your career along this line? It makes sense for you to also have an insight into the associated challenges and prospects. With this you can take meaningful career decisions within the context of your career plan.<p>', '<p><b>Module 1 - Foundation</b></p>\r\n\r\n<b>  <p>Module 1.1 - Basic Terms</p></b>\r\n  <p>1) Types of Computers</p>\r\n   <p>2) Anatomy of a PC</p>\r\n   <p>3) How a PC Works</p>\r\n  <b><p>Module 1.2 Hardware Devices</p></b>\r\n  <p>1) CPU and Memory</p>\r\n   <p>2) Input Devices</p>\r\n   <p>3) Output Devices</p>\r\n    <p>4) Secondary Storage Devices</p>\r\n <b>  <p>Module 1.3 Software Basics</p></b>\r\n <p>1) Operating Systems and Applications</p>\r\n   <p>2) How is Software Built?</p>\r\n  <p>3) Types of Software</p>\r\n  <p>4) Legal Issues</p>\r\n   <p>5) How is Software Built?</p>\r\n', '<p><b>Module 2 - Advanced Level</b></p>\r\n <b>  <p>Module 2.1 Advanced Level Part I</p></b>\r\n    <p>1) Working With the Computer</p>\r\n    <p>2) First Steps</p>\r\n    <p>3) Basic Tasks</p>\r\n    <p>4) Using the Desktop</p>\r\n   <p>5) Customizing Your Computer</p>\r\n   <p>6) Printing</p>\r\n <b>  <p>Module 2.2 Advanced Level Part I</p></b>\r\n    <p>1) Working with Files and Folders</p>\r\n  <p>2) The Basics of Files and Folders</p>\r\n   <p>3) Managing Files and Folders, Part I</p>\r\n   <p>4) Managing Files and Folders, Part II</p>\r\n    <p>5) Viewing File or Folder Properties</p>\r\n    <p>6) Working With Files and Folders</p>\r\n    <p>7) Compressed Files</p>\r\n', '<p><b>Module 3 - Expert</b></p>\r\n\r\n     <p>1) Application Basics</p>\r\n     <p>2) Basic Applications</p>\r\n     <p>3) Working with a Window</p>\r\n     <p>4) Working with WordPad</p>\r\n     <p>5) Working With Applications</p>\r\n     <p>6) Basics of Web Browsers</p>\r\n     <p>7) Browsing the Web</p>\r\n     <p>8) Working with Bookmarks</p>\r\n     <p>9) Working With Web Pages</p>\r\n    <p>10) Printing Web Pages</p>', '', '300', '2013-11-15 07:41:46', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('51', 'Certified Software Tester - Foundation Level - Premium Package', '5', 'BH0-010', 'BH0-010CSTFLLatPrem.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>20 Hours</p>', '<p>The Certified Software Tester – Foundation Level Exam is a first step in your career. You are not obligated to have testing experience. What you need is to understand is the general types of applications. The main goals are to ensure a broad understanding of the key concepts in software testing and provide a foundation for a future career growth. Another goal is to understand key concepts in software testing to advance level.</p>\r\n\r\n<p>Those who require a basic grounding in software testing such as Project Managers, Quality Managers, Software Development Managers, Business Analysts, IT Directors and Management Consultants will also benefit from gaining the Certified Software Tester (CSTE) Credential.</p>\r\n', '<p>In this E-Course the participant will learn all the steps of the software test process, from test planning to test specification and running the tests.</p>\r\n\r\n<p>Our E-Learning Course is broken into bite-size lessons and combines leading edge multimedia and interactive exercises for optimum enjoyment and knowledge retention. The e-learning course also comprises of unique mock exam simulator which allows you to test and re-test your understanding of the Software Testing foundations and be confident for the exams. </p>\r\n', '<p><b>1. The fundamentals of testing:</b> Why is testing necessary? Harm caused by defects in software; root causes; testing and quality assurance; what is testing? General testing principles; Fundamental test process and the psychology of testing.\r\n\r\n<p><b>2. Testing throughout the software life cycle: </b>Software development models; test levels, objectives, objects and targets of testing; functional, non-functional, structural and change-related testing; confirmation, regression and maintenance testing.</p>\r\n\r\n<p><b>3. Static techniques: </b>Reviews and the test process; typical formal review process; different types of review: informal review, technical review, walkthrough and inspection; static analysis tools.</p>\r\n\r\n<p><b>4. Test design techniques:</b> Identifying test conditions and designing test cases; equivalence partitioning; boundary value analysis; decision tables; state transition diagrams, use case testing; statement and decision coverage; control flows using statement testing and decision testing; experience based techniques; choosing techniques.</p>\r\n\r\n<p><b>5. Business Analyst Skills Introduction to Business :</p></b>\r\n\r\n<p>Introduction to Business Process Analysis</p>\r\n<p>Why Business Analysis</p>\r\n<p>Roles and responsibilities of a Business Analyst</p>\r\n<p>Key concept of business analysis</p>\r\n<p>What is domain knowledge?</p>\r\n<p>How to adapt with different domains</p>\r\n\r\n\r\n<p><b>6. Test management: </b>Test organization, planning and estimation; ‘Standard for Software Test Documentation’ (IEEE 829); exit criteria; test progress monitoring and control; metrics and reporting; configuration management; risk and testing; incident management; incident reporting.</p>\r\n\r\n<p><b>7. Tool support for testing: </b>Types of test tool; effective use of tools; potential benefits and risks; introducing tools.</p>', '', '', '250', '2014-02-14 05:13:55', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('52', 'Certified Software Tester - Intermediate Level - Premium Package', '5', 'BH0-007', 'BH0-007CSTIL---Premium-Package.png', 'Premium', '40', '<b>Highlights of the Package</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>12 Hours</p>', '<p>The Certified Software Tester Intermediate Level Exam is a second step in your career, if you are seeking an advanced level of career in the field of Software Testing than this is a right exam for you.</p>\r\n\r\n<p>The Intermediate Certificate in Software Testing examination is suitable for those who are engaged in any aspect of software testing. The topics covered are those which are considered to be essential knowledge for an advanced level test professional, regardless of their specialism (i.e. Test Analysis or Test Management).</p>\r\n', '<p>Our E-Learning Course  is broken into bite-size lessons and combines leading edge multimedia and interactive exercises for optimum enjoyment and knowledge retention. The e-learning course also comprises of unique mock exam simulator which allows you to test and re-test your understanding of the Software Testing foundations and be confident for the exams. </p>', '</p><b>What are the Modules Covered in CSTIL?</p></b>\r\n<p>Module 1 - Overview of Testing </p>\r\n<p>Module 2 - Test Plan</p>\r\n<p>Module 3 - Test Case and Execution </p>\r\n<p>Module 4 - Test Review </p>\r\n<p>Module 5 - Types of Testing </p>', '', '', '250', '2013-11-18 07:56:33', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('53', 'Cross Cultural Management', '2', 'N/A', 'N/ACrossCultural.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>8 Hours</p>', '<p>The E-course is designed to introduce issues of cross-cultural communication to those who work with international students and staff.</p>\r\n<p>This course is designed to convey the major principles relating to management across cultural and national boundaries. It focuses on interpersonal approaches between people of different cultures in work settings as opposed to a country specific approach. That is, the approach is used to understand the effect of culture in a way that can then be applied to a wide variety of cross-cultural interactions in a number of organisational context. Participants will interact, examine concepts, cases to increase awareness, and understanding concerning the influence of culture on management and management practices. </p>', '<p>Skills in cross-cultural communication are essential in order to minimise problems and misunderstandings that arise from cultural difference.</p>\r\n\r\n<p>The course will also highlight ways to improve cross-cultural communication and needs of international businesses in mind, offering expatriates, managers, HR personnel, international teams and global business travellers with access to a range of online tools and resources, helping raise intercultural awareness.</p>', '<p>This course provides necessary skills to engage and communicate more effectively and confidently with international students and staff.</p>', '<b><p>Modules covered in Cross Cultural Management E-Course</p></b>\r\n<p>Module 1 - Manifestation of Culture</p>\r\n<p>Module 2 - Cultural Competencies</p>\r\n<p>Module 3 - Cross Culture Communication</p>\r\n<p>Module 4 - Cross Culture Negotiation Strategies</p>\r\n<p>Module 5 - Culture Adjustments</p>', '', '60', '2013-11-18 13:13:29', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('54', 'Linux Certified Professional (LCP) - Standard Package', '8', '(LCP-001)', '(LCP-001)LPILCP.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>6 Hours</p>', '<p>With the ever increasing ubiquity of Linux in both the server and embedded markets, The Linux course provide both companies and individuals with a variety of training options to increase their knowledge and use of Linux. Our Linux Certified Professional (LCP) is a vendor-neutral and as the company that employs Linux founder Linus Torvalds, our training has been created with the actual leaders of the Linux Administrators Community. </p>\r\n\r\n<p>Whether time-to-market or the high performance of Linux are critical to your business, The Linux Certified Professional (LCP) Certification E-Course provide a unique return on investment opportunity that will pay for itself many times over. For individuals, the demand for Linux talent is at an all time high. The Linux Certified Professional (LCP) E-Course provides Linux developers and Linux system administrators with the opportunity to to capitalize on the talent gap.</p>', '<p><b>Module 1</b></p>\r\n<p>1) Overview of Operating System </p>\r\n<p>2) Why Unix in Testing is required</p>\r\n<p>3) Unix File System Architecture (Boot Block, Super Block, Inode Block and Data Block)</p>\r\n<p>4) Installation', '<p><b>Module 2</b></p>\r\n<p>1) The Directory Structure</p>\r\n<p>2) Listing files and directories</p>\r\n<p>3) File compression</p>\r\n<p>4) Different Unix commands</p>\r\n<p>5) Communication commands</p>\r\n<p>6) Networking commands</p>', '<p><b>Module 3</b></p>\r\n<p>1) Backup and disk utilities</p>\r\n<p>2) Pipes and filters</p>\r\n<p>3) Grep</p>\r\n<p>4) Process and job control</p>\r\n<p>5) Editing files</p>\r\n<p>6) Vi editor</p>', '', '70', '2013-12-23 12:34:35', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('55', 'Certified Cloud Computing Professional (CCCP) - Standard Package', '8', '(CCCP)', '(CCCP)CCCP-Standard.png', 'Standard', '20', '<p><b>Powered by EXIN</p></b>\r\n\r\n<p><b>Highlights of the Package.</b></b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>\r\n\r\n', '<p>Cloud computing has emerged as one of the most significant information technology developments over the past decade. </p>\r\n\r\n<p>Cloud computing has a lot in store in terms of future job creation. It is anticipated that cloud computing will lead to a generation of an estimated 14 million novel job opportunities across the world in the span of the coming three years. Surprising enough, the scope of the fresh jobs may extend beyond the IT sector. The estimates are an outcome of research carried out by IDC funded by the Microsoft Corporation. Fourteen million expected jobs sure is a promising number in itself, but when stacked against the current volume of the available global workforce (a little greater than 3 billion to be exact) it equals a shy half a percent – a mere droplet compared against the pail. So take your exam today and Get Certified for your future.</p>', '<p><b>What Topics are Covered in this E-Course?</p></b>\r\n\r\n<p><b>Module 1 – Introduction to Cloud Computing</p></b><p><b>Module 2 – Evolution towards Cloud</p></b>\r\n<p><b>Module 3 – History of Cloud</p></b>\r\n<p><b>Module 4 – Implementing and Managing Cloud Computing</p></b>\r\n<p><b>Module 5 – Using the Cloud</p></b>\r\n<p><b>Module 6 – Security and Compliance</p></b>\r\n', '', '', '', '100', '2013-12-23 12:36:43', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('56', 'Certified Cloud Computing Professional (CCCP) - Premium Package ', '8', 'CCCP-001', 'CCCP-001CCCP---Premium-Pack.png', 'Premium', '40', '<b><p>Powered by Exin</b></p>\r\n<b><p>Highlights of the Package.</b></p>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>10 Hours</p>', '<p>Cloud computing has emerged as one of the most significant information technology developments over the past decade. </p>\r\n\r\n<p>Cloud computing has a lot in store in terms of future job creation. It is anticipated that cloud computing will lead to a generation of an estimated 14 million novel job opportunities across the world in the span of the coming three years. Surprising enough, the scope of the fresh jobs may extend beyond the IT sector. The estimates are an outcome of research carried out by IDC funded by the Microsoft Corporation. Fourteen million expected jobs sure is a promising number in itself, but when stacked against the current volume of the available global workforce (a little greater than 3 billion to be exact) it equals a shy half a percent – a mere droplet compared against the pail. So take your exam today and Get Certified for your future.</p>\r\n', '<p><b>What Topics are Covered in this E-Course?</p></b>\r\n\r\n<p><b>Module 1 – Introduction to Cloud Computing</p></b><p><b>Module 2 – Evolution towards Cloud</p></b>\r\n<p><b>Module 3 – History of Cloud</p></b>\r\n<p><b>Module 4 – Implementing and Managing Cloud Computing</p></b>\r\n<p><b>Module 5 – Using the Cloud</p></b>\r\n<p><b>Module 6 – Security and Compliance</p></b>', '', '', '', '175', '2013-12-23 12:14:13', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('57', 'Certified Risk and Crisis Manager (CRCM) - Premium Package', '2', 'CRCM-001', 'CRCM-001CRCM-Premium.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>Course Duration</p></b>\r\n<p>6 Hours</p>\r\n', '<b>About Risk Management</b>\r\n\r\n<p>Risk management has long been a key part of project management, but in recent years, it has become an increasingly important part of organizational best practices. Corporations have realized that effective risk management can not only reduce the negative impact of crises; it can provide real benefits and cost savings.</p>\r\n\r\n<p>The risk management framework provided in this E-Course is flexible enough for any organization. You can apply it to a single project, a department, or use it as a basis for an enterprise-wide risk management program.</p>\r\n\r\n<p><b>How will you benefit with this E-Course</b></p>\r\n\r\n<p>1) Define risk and risk management</b>\r\n<p>2) Describe the COSO ERM cube and ISO 31000</b>\r\n<p>3) Establish a risk management context</b>\r\n<p>4) Describe the 7 R’s and 4 T’s that form the framework of risk management activities</b>\r\n<p>5) Design and complete a basic risk assessment</b>\r\n<p>6) Determine the appropriate response to risks and create a plan for those responses</b>\r\n<p>7) Describe the key components of reporting, monitoring, and evaluation of a risk management program</b>\r\n\r\n<p><b>What Topics are Covered in Risk Management?</b></p>\r\n\r\n 	<p>1) Understanding risk</p>\r\n 	<p>2) Risk management activities</p>\r\n 	<p>3) Assessing risk</p>\r\n 	<p>4) Responding to risks</p>\r\n 	<p>5) Resourcing controls</p>\r\n 	<p>6) Reaction planning</p>\r\n 	<p>7) Reporting and monitoring</p>\r\n 	<p>8) Reviewing and evaluating the framework</p>\r\n\r\n<p><b>About Crisis Management</b></p>\r\n\r\n<p>Viable organizations need to be ready for emergencies because they are a fact of doing business. The worst plan is not to have any kind of plan at all, and the best plans are tested and adjusted so that they work over time. Fortunately, you do not need separate plans for fire, weather disasters, and all the different kinds of crises that can occur. One solid plan will help you to prevent, respond, and recover from all crises. This E-course will help you ensure your organization is ready to manage any kind of crisis. </p>\r\n\r\n', '<p><b>What Topics are Covered in Crisis Management?</b></p>\r\n\r\n<p>1) What is crisis management?</p>\r\n<p>2) Training leaders and staff</p>\r\n<p>3) Conducting the crisis audit</p>\r\n<p>4) Performing a risk level analysis</p>\r\n<p>5) Developing a response process</p>\r\n<p>6) Consulting with the experts</p>\r\n<p>7) Incident management techniques </p>\r\n<p>8) Working through the issues</p>\r\n<p>9) Establishing an emergency operations center</p>\r\n<p>10) Building business continuity and recovery</p>\r\n<p>11) Recovering and moving on</p>\r\n<p>12) Plenty of case studies and practice opportunities</p>\r\n\r\n<p><b>How will you benefit with this E-Course</b></p>\r\n<p>1) Assign people to an appropriate crisis team role</p>\r\n<p>2) Conduct a crisis audit</p>\r\n<p>3) Establish the means for business continuity</p>\r\n<p>4) Determine how to manage incidents</p>\r\n<p>5) Help your team recover from a crisis</p>\r\n<p>6) How to apply the process </p>\r\n', '', '', '', '150', '2013-12-23 12:36:17', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('58', 'Linux Certified Professional (LCP) - Premium Package', '8', 'LCP-001', 'LCP-001LPILCPPremium.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>6 Hours</p>', '<p>With the ever increasing ubiquity of Linux in both the server and embedded markets, The Linux course provide both companies and individuals with a variety of training options to increase their knowledge and use of Linux. Our Linux Certified Professional (LCP) is a vendor-neutral and as the company that employs Linux founder Linus Torvalds, our training has been created with the actual leaders of the Linux Administrators Community. </p>\r\n\r\n<p>Whether time-to-market or the high performance of Linux are critical to your business, The Linux Certified Professional (LCP) Certification E-Course provide a unique return on investment opportunity that will pay for itself many times over. For individuals, the demand for Linux talent is at an all time high. The Linux Certified Professional (LCP) E-Course provides Linux developers and Linux system administrators with the opportunity to to capitalize on the talent gap.</p>', '<p><b>Module 1</b></p>\r\n<p>1) Overview of Operating System </p>\r\n<p>2) Why Unix in Testing is required</p>\r\n<p>3) Unix File System Architecture (Boot Block, Super Block, Inode Block and Data Block)</p>\r\n<p>4) Installation</p>\r\n', '<p><b>Module 2</b></p>\r\n<p>1) The Directory Structure</p>\r\n<p>2) Listing files and directories</p>\r\n<p>3) File compression</p>\r\n<p>4) Different Unix commands</p>\r\n<p>5) Communication commands</p>\r\n<p>6) Networking commands</p>\r\n', '<p><b>Module 3</b></p>\r\n<p>1) Backup and disk utilities</p>\r\n<p>2) Pipes and filters</p>\r\n<p>3) Grep</p>\r\n<p>4) Process and job control</p>\r\n<p>5) Editing files</p>\r\n<p>6) Vi editor</p>', '', '150', '2013-12-23 12:34:06', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('59', 'Certified Business Analyst (CBA) - Foundation - Standard Package', '2', '(CBAF-001)', '(CBAF-001)CBA---Standard.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>8 Hours</p>\r\n', '<p>A Business Analyst is someone who analyses change requirements and produces a justifiable set of analysis deliverables that are used to design and implement the solution. A Business Analyst is (or should!) be measured on delivery of the benefits specified in the project objectives. </p>\r\n<p>Job rankings reports over the past few years (including ones by CNN Money and job search engine Indeed.com) rank Business Analyst as a ‘hot job’ for the future and survey data spanning from 2008 to 2010 from Blueprint Systems reports that 37% of BAs now use some kind of purpose-built requirements software tool in their role. </p>\r\n', '<b> <p>About Business Analysis</p></b>\r\n<p>Business Analysis is a straight forward process of analyzing business change requirements. Why, then, are there so many methods, approaches, techniques and tools for doing what is – essentially – the same job? In order to understand this, we need to rewind a bit in time to look at where Business Analysis came from, where it currently is and projections for where it will go.</p>\r\n', '<p><b>What Modules are covered in this E-Course?</p></b>\r\n\r\n<p> Module 1 - Introduction to Business Process Analysis</p>\r\n<p> Module 2 - Business Process Analysis Planning and Stakeholder Management</p>\r\n<p> Module 3 - Business Requirements Management</p>\r\n<p> Module 4 - Organizational Analysis</p>\r\n<p> Module 5 - Business Solutions Evaluation and Implementation</p>\r\n<p> Module 6 - Business Analyst Competencies</p>\r\n', '', '', '100', '2014-06-02 08:37:52', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('60', 'Certified Business Analyst (CBA) - Foundation - Premium Package', '2', 'CBAF-001', 'CBAF-001CBA-Premium.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>8 Hours</p>', '<p>A Business Analyst is someone who analyses change requirements and produces a justifiable set of analysis deliverables that are used to design and implement the solution. A Business Analyst is (or should!) be measured on delivery of the benefits specified in the project objectives. </p>\r\n<p>Job rankings reports over the past few years (including ones by CNN Money and job search engine Indeed.com) rank Business Analyst as a ‘hot job’ for the future and survey data spanning from 2008 to 2010 from Blueprint Systems reports that 37% of BAs now use some kind of purpose-built requirements software tool in their role. </p>\r\n', '<b> <p>About Business Analysis</p></b>\r\n<p>Business Analysis is a straight forward process of analyzing business change requirements. Why, then, are there so many methods, approaches, techniques and tools for doing what is – essentially – the same job? In order to understand this, we need to rewind a bit in time to look at where Business Analysis came from, where it currently is and projections for where it will go.</p>\r\n', '<p><b>What Modules are covered in this E-Course?</p></b>\r\n\r\n<p> Module 1 - Introduction to Business Process Analysis</p>\r\n<p> Module 2 - Business Process Analysis Planning and Stakeholder Management</p>\r\n<p> Module 3 - Business Requirements Management</p>\r\n<p> Module 4 - Organizational Analysis</p>\r\n<p> Module 5 - Business Solutions Evaluation and Implementation</p>\r\n<p> Module 6 - Business Analyst Competencies</p>\r\n\r\n', '', '', '175', '2014-06-02 08:38:18', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('61', 'Prince2® Foundation and Practitioner', '10', 'Prince2FndPrac', 'Prince2FndPracPrince2Latest.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) HD Quality\r\n<p>4) Access to all the modules\r\n\r\n<p><b>Course Duration:</p></b>\r\n<p>24 Hours</p>\r\n', '<p>PRINCE2<sup>®</sup> project management is used in approximately 70 countries worldwide and is by far the most popular project management methodology used in the UK in the private and public sectors.</p>\r\n<p>Gaining a PRINCE2<sup>®</sup> Certification is highly recommended if you are considering project management as a career or are already working in a project environment as being PRINCE2<sup>®</sup> certified is a prerequisite for many Project Manager positions. .</p>\r\n<p>The accredited PRINCE2<sup>®</sup> Foundation and Practitioner e-learning training course covers all aspects of the PRINCE2<sup>®</sup> Project Management method. The main body of the course consists of five lessons which cover an introduction to the method and basic concepts and Principles, through to the Themes and Processes which make up the PRINCE2<sup>®</sup> methodology. </p>\r\n', '<b><p> Why study your PRINCE<sup>®</sup> Foundation online? </p></b>\r\n<p>Technological improvements and advances in educational design mean that e-learning is no longer just a low cost alternative to traditional training methods. In many respects our courseware offers training which is superior to the majority of available “classroom” options. Not only is the effectiveness of the training process enhanced, but also the convenience and overall cost efficiency of e-learning makes it a compelling option for training. You can learn at your own pace and can repeat each section as many times as required unlike in a classroom environment.</p>\r\n<b><p>Accreditation and Credentials <p></b>\r\n<p>The E-Course is Accredited by Peoplecert and GAQM is an Authorised Training and Exam Organisation for Prince2<sup>®</sup> </p>\r\n<p><b>Certificate</p></b>\r\n<p>After you have completed the PRINCE2<sup>®</sup> Foundation and PRINCE2<sup>®</sup> Practitioner E-Course, you will receive an official course completion certificate and credits as per Prince2<sup>®</sup>. </p>\r\n', '<b><p>What does this PRINCE2<sup>®</sup> Foundation and Practitioner course contain? </p></b>\r\n<p>Module 1 - Prince2 Foundation Introduction</P>\r\n<p>Module 2 - Prince2 Foundation Overview</P>\r\n<p>Module 3 - Organization Theme</P>\r\n<p>Module 4 - Starting up a Project Process</P>\r\n<p>Module 5 - Business Case Theme</P>\r\n<p>Module 6 - Directing a Project</P>\r\n<p>Module 7 - Initiating a Project Process</P>\r\n<p><p>Module 8 - Plans Theme</P>\r\n<p>Module 9 - Products based Planning</P>\r\n<p>Module 10 - Risk Theme</P>\r\n<p>Module 11 - Progress Theme</P>\r\n<p>Module 12 - Change Theme</P>\r\n<p>Module 13 - Controlling a Stage Process</P>\r\n<p>Module 14 - Managing Product Delivery Process</P>\r\n<p>Module 15 - Managing Stage Boundaries Process</P>\r\n<p>Module 16 - Quality Theme</P>\r\n<p>Module 17 -  Closing a Project Process</P>\r\n<p>Module 18 - Tailoring Prince2</P>\r\n\r\n', '<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n', '', '125', '2014-03-11 10:45:39', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('62', 'Certified Critical Thinking and Research Analyst (CCTRA) Standard', '2', '(CCTRA-001)', '(CCTRA-001)CCTRA-Std..png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>Course Duration</p></b>\r\n<p>8 Hours</p>', '<p>In today’s society, many people experience information overload. We are bombarded with messages to believe various ideas, purchase things, support causes, and lead our lifestyle in a particular way. How do you know what to believe? How do you separate the truth from the myths?</p>\r\n\r\n<p>The answer lies in critical thinking skills. The ability to clearly reason through problems and to present arguments in a logical, compelling way has become a key skill for survival in today’s world.</p>\r\n\r\n<p>In this age of information overload, it can be hard to know where to find good information that you can trust. If you’re doing research for an important project, report, or proposal, how do you find information that you can count on?</p>\r\n<p>A research analyst is a professional who is responsible for reviewing, collecting, and reporting on a variety of data sets and information sources. Analysts are very common in the sciences, particularly in pharmaceutical research, though they exist in almost any discipline that deals with data or information assessment over time. In most cases, research analysts have at least graduate-level education, as well as a great deal of experience within their subject area. Their reports are often used to drive new innovations or direct future developments.</p>\r\n\r\n', '<p><b>What Modules are covered in this E-Course?</p></b>\r\n<p>Module 1 - Critical Thinking</p>\r\n<p>Module 2 - Research Skills</p>\r\n', '', '', '', '75', '2014-02-04 07:06:11', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('63', 'Certified Critical Thinking and Research Analyst (CCTRA) Premium ', '2', 'CCTRA-001', 'CCTRA-001CCTRA-Prem.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n\r\n\r\n<p><b>Course Duration</p></b>\r\n<p>8 Hours</p>\r\n', '<p>In today’s society, many people experience information overload. We are bombarded with messages to believe various ideas, purchase things, support causes, and lead our lifestyle in a particular way. How do you know what to believe? How do you separate the truth from the myths?</p>\r\n\r\n<p>The answer lies in critical thinking skills. The ability to clearly reason through problems and to present arguments in a logical, compelling way has become a key skill for survival in today’s world.</p>\r\n\r\n<p>In this age of information overload, it can be hard to know where to find good information that you can trust. If you’re doing research for an important project, report, or proposal, how do you find information that you can count on?</p>\r\n<p>A research analyst is a professional who is responsible for reviewing, collecting, and reporting on a variety of data sets and information sources. Analysts are very common in the sciences, particularly in pharmaceutical research, though they exist in almost any discipline that deals with data or information assessment over time. In most cases, research analysts have at least graduate-level education, as well as a great deal of experience within their subject area. Their reports are often used to drive new innovations or direct future developments.</p>\r\n', '<p><b>What Modules are covered in this E-Course?</p></b>\r\n<p>Module 1 - Critical Thinking</p>\r\n<p>Module 2 - Research Skills</p>\r\n', '', '', '', '175', '2014-02-04 08:00:05', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('64', 'ITIL®  Service Transition', '9', '(ITILST)', '(ITILST)Service-Transition-Std.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) HD Quality</p>\r\n<p>4) Access to all the modules</p>\r\n<p>5) You will receive an e-certificate after successfully completing the E-Course</p>\r\n<p><b>Course Duration:</p></b>\r\n<p>21 Hours</p>\r\n', '<p><b>Prerequisites: Must be ITIL<sup>®</sup> Foundation Certified</p></b>\r\n\r\n<p>The ITIL<sup>®</sup> Intermediate Qualification: Service Transition Certificate is a free-standing qualification, but is also part of the ITIL<sup>®</sup> Intermediate Lifecycle stream, and one of the modules that leads to the ITIL<sup>®</sup> Expert in IT Service Management Certificate. The purpose of this training module and the associated exam and certificate is, respectively, to impart, test, and validate the knowledge on industry practices in service Management as documented in the ITIL<sup>®</sup> Service Transition publication.</p>\r\n', '<p>This Peoplecert accredited training program is for individuals seeking specialist certification in ITIL\'s Service Transition practice area. Candidates for this program include executives, managers, supervisory staff, team leaders, architects and planners who hold a Foundation certificate. Candidates will gain competencies in the following areas upon successful completion of the reading (Service Transition Book), training and examination components related to this certification: </p>', '<p><b>Organisational Benefits</p></b>\r\n<p>Through understanding Service Transition, the IT teams can more successfully handle higher volumes of change. From the customer’s point of view, that results in a greater percentage of IT changes delivering the desired improvements without unnecessary disruption. From the IT team’s viewpoint, it means an increased level of trust from the customers and users.</p>\r\n\r\n<p><b>Individual Benefits</p></b>\r\n<p>You will gain an understanding on how to control changes to the IT services with the appropriate level of flexibility. This will lead to great confidence in your own abilities and hence better job satisfaction. You may gain other benefits such as increased promotion within your own organisation along with a potential to increase your salary!</p>\r\n\r\n<p><b>The Service Transition Course provides information to enable delegates to gain competencies in:</p></b>\r\n<p>1) Introduction to Service Transition </p>\r\n<p>2) Service Transition Principles </p>\r\n<p>3) Transition Planning and Support </p>\r\n<p>4) Change Management </p>\r\n<p>5) Service Asset and Configuration Management </p>\r\n<p>6) Release and Deployment Management </p>\r\n<p>7) Service Validation and Testing </p>\r\n<p>8) Evaluation Knowledge Management </p>\r\n<p>9) Managing Communications and Commitment </p>\r\n<p>10) Managing Organisational and Stakeholder Change </p>\r\n<p>11) Stakeholder Management </p>\r\n<p>12) Organising for Service Transition </p>\r\n<p>13) Consideration of Technology </p>\r\n<p>14) Implementation and improvement of Service Transition </p>\r\n\r\n', '<p><b>Modules covered in this E-Course</p></b>\r\n\r\n<p>ST01: Introduction to Service Transition</p>\r\n<p>ST02: Service Transition Principles</p>\r\n<p>ST03: Service Transition Processes</p>\r\n<p>ST04: Service Transition related activities</p>\r\n<p>ST05: Organizing for Service Transition</p>\r\n<p>ST06: Consideration of Technology</p>\r\n<p>ST07: Implementation and improvement of Service Transition</p>\r\n<p>ST08: Challenges, CSF’s and Risks</p>\r\n', '<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n', '100', '2014-07-01 04:59:30', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('65', 'ITIL® Operational Support and Analysis', '9', '(ITILOSA)', '(ITILOSA)OSA-Std.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) HD Quality</p>\r\n<p>4) Access to all the modules</p>\r\n<p>5) You will receive a e-certificate after successfully completing the E-Course</p>\r\n<p><b>Course Duration:</p></b>\r\n<p>24 Hours</p>\r\n', '<p><b>Prerequisites: Must be ITIL<sup>®</sup> Foundation Certified</p></b>\r\n\r\n<p>The ITIL<sup>®</sup> Intermediate Qualification: Operational Support and Analysis Certificate is a free-standing qualification, but is also part of the ITIL<sup>®</sup> Intermediate Service Capability stream, and one of the modules that leads to the ITIL<sup>®</sup> Expert in IT Service Management Certificate. The purpose of this training module and the associated exam and certificate is, respectively, to impart, test, and validate the knowledge on industry practices in service Management as documented in the ITIL<sup>®</sup> Operational Support and Analysis publication.</p>\r\n\r\n<p>Our ITIL<sup>®</sup> OSA module from the Capability Stream will successfully prepare you for certification and teach you the technical knowledge and skills you need to better understand ITIL<sup>®</sup> processes and roles.</p>', '<p><b>Organisational Benefits</p></b>\r\n<p>By understanding and using ITIL<sup>®</sup> your IT organisation can move towards a Service Management culture where your IT team can be (and is recognised as) a key player in the success of your customers and users. </p>\r\n\r\n<p>ITIL<sup>®</sup> helps you to attain that key status by understanding the link between IT services and customer/user outcomes. ITIL<sup>®</sup> then helps to understand the best ways to manage those services, making your IT organisation indispensable to your customers.</p>\r\n\r\n<p><b>Individual Benefits</p></b>\r\n<p>By having a better understanding of the best-practice framework, it will enable you to identify areas for improvement back at the workplace, to develop your current role further, to do your job better.The reward being advancement within your company and a potential to increase your salary!</p>\r\n\r\n\r\n<p><b>What will you learn from this E-Course</p></b>\r\n<p>How does each operational process create value for your company?</p>\r\n<p>What principles are required to design a meaningful Event Management process?</p>\r\n<p>How do you best manage, control and utilize the Known Error Database?</p>\r\n<p>What staffing capabilities are required for an efficient Service Desk?</p>\r\n<p>How do you define and handle Events, Incidents, Problems and Requests?</p>\r\n\r\n\r\n\r\n<p><b>Modules covered in this E-Course</p></b>\r\n\r\n<p>OSA01: Introduction to OSA</p>\r\n<p>OSA02: Event Management</p>\r\n<p>OSA03: Incident Management</p>\r\n<p>OSA04: Request Fulfillment</p>\r\n<p>OSA05: Problem Management</p>\r\n<p>OSA06: Access Management</p>\r\n<p>OSA07: The Service Desk</p>\r\n<p>OSA08: Common OSA Functions and Roles</p>\r\n<p>OSA09: Technology Consideration</p>\r\n\r\n', '<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n', '', '', '100', '2014-07-01 05:10:24', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('66', 'Certified PHP Professional (CPP) - Standard Package', '8', '(CPP-001)', '(CPP-001)CPP-Std.png', 'Standard', '20', '<p><b>Highlights of the Package.</b></p>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>Course Duration</p></b>\r\n<p>20 Hours</p>', '<p>PHP is a powerful server-side scripting language for creating dynamic and interactive websites. PHP is the widely-used, free, and efficient alternative to competitors such as Microsoft\'s ASP.</p>\r\n\r\n<p>PHP is perfectly suited for Web development and can be embedded directly into the HTML code.</p>\r\n\r\n<p>SQL (Structured Query Language) is an ANSI (American National Standards Institute) standard for accessing database systems. SQL statements are used to retrieve and update data in a database.</p>\r\n\r\n<p>PHP is an open source, server-side web-scripting language that is compatible with all the major web servers (most notably Apache) and databases.By the help of PHP code you can create dynamic website content. Dynamic Web sites are flexible applications than merely sites.\r\nIf you know HTML, but you have no experience in the field of programming, you can easily learn PHP and MySQL with the help of this course. This course starts from the most simple, explaining the operations of the PHP language, and then move on to detail how to create PHP programs, how to load the PHP scripts, and to the final approach more complex items, such as SQL commands, working with MySQL database, using classes and OOP (Object Oriented Programming) in PHP. The tutorials covered in this course approach in an easy and intuitive manner with numerous examples that make it easier and more understanding to learn PHP. </p>', '<p><b>What are the Modules covered in this E-Course</p></b>\r\n<p>Module 1 - PHP Basics and Advanced </p>\r\n<p>Module 2 – PHP Forms  </p>\r\n<p>Module 3 – PHP &MYSQL</p>\r\n<p>Module 4 – PHP and Oops</p>\r\n\r\n<br>\r\n<br>\r\n<p></b>Total Number of Sessions: 21</p></b>', '', '', '', '100', '2014-02-06 10:55:34', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('67', 'ITIL® Service Operation', '9', '(ITILSO)', '(ITILSO)Service-Operations-StD.png', 'Standard', '20', '<b>Highlights of the Package</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) HD Quality</p>\r\n<p>4) Access to all the modules</p>\r\n<p>5) You will receive an e-certificate after successfully completing the E-Course</p>\r\n<p><b>Course Duration:</p></b>\r\n<p>21 Hours</p>\r\n', '<p><b>Prerequisites: Must be ITIL<sup>®</sup> Foundation Certified</p></b>\r\n\r\n<p>The ITIL<sup>®</sup> Intermediate Qualification: Service Operation Certificate is a free-standing qualification, but is also part of the ITIL<sup>®</sup> Intermediate Lifecycle stream, and one of the modules that leads to the ITIL<sup>®</sup> Expert in IT Service Management Certificate. The purpose of this training module and the associated exam and certificate is, respectively, to impart, test, and validate the knowledge on industry practices in service Management as documented in the ITIL<sup>®</sup> Service Operation publication.</p>\r\n\r\n<p>The ITIL<sup>®</sup> Service Operation course focuses on how to deliver value to customers and users by managing the operation of services. This E-Course course will help you to understand the processes and functions needed to keep IT services up and running in the most efficient manner, including Incident, Problem and Event Management. The E-Course also explains how operations staff should be involved in processes which have their home in other parts of the Service Management Lifecycle, such as Service Level Management.</p>\r\n', '<p><b>Organisational Benefits</b></p>\r\n<p>Through understanding Service Operation, the IT teams can deliver a consistently high standard in the running of IT Services. From the customer’s point of view, that means they are able to completely rely on the IT services to help them achieve their desired results. From the IT team’s perspective, consistently good service delivery means less fire-fighting leading to the ability to take a more proactive approach to service delivery and Compliance via evaluating service quality and robustness</p>\r\n\r\n<p><b>Individual Benefits</b></p>\r\n<p>You will gain an understanding of how to be a more effective – and therefore more valued - team member through the use and understanding of Service Operation processes. Medium to long term you may gain other benefits such as a promotion within your own organisation or other opportunities to advance your career!</p>\r\n\r\n<p><b>Modules covered in this E-Course</p></b>\r\n<p>SO01: Introduction</p>\r\n<p>SO02: Service Operation Introduction</p>\r\n<p>SO03: Service Operation Principles</p>\r\n<p>SO04: Service Operation Processes</p>\r\n<p>SO05: Common Service Operations Activities</p>\r\n<p>SO06: Organizing Service Operations</p>\r\n<p>SO07: Technology Considerations</p>\r\n<p>SO08: Implementation Considerations</p>\r\n<p>SO09: Challenges, CSF\'s and Risks</p>\r\n', '<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n', '', '', '100', '2014-07-15 07:46:41', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('68', 'ITIL® Release, Control and Validation', '9', 'ITILRCV', 'ITILRCVRcv-Std.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) HD Quality</p>\r\n<p>4) Access to all the modules</p>\r\n<p>You will receive an e-certificate after successfully completing the E-Course</p>\r\n<p><b>Course Duration:</p></b>\r\n<p>24 Hours</p>\r\n\r\n', '<p><b>Prerequisites: Must be ITIL<sup>®</sup>  Foundation Certified</p></b>\r\n\r\n<p>The ITIL<sup>®</sup> Intermediate Qualification: Release, Control and Validation Certificate is a free-standing qualification, but is also part of the ITIL<sup>®</sup>  Intermediate Capability stream, and one of the modules that leads to the ITIL<sup>®</sup>  Expert in IT Service Management Certificate. The purpose of this training module and the associated exam and certificate is, respectively, to impart, test, and validate the knowledge on industry practices in service Management as documented in the ITIL<sup>®</sup>  Release, Control and Validation publication.</p>', '<p>Release, Control and Validation specifically addresses the need to ensure that services are planned, built, tested, evaluated and deployed in a controlled manner, ensuring that they meet the organisations requirements, and ensuring that on deployment there is no or minimal disruption to our existing Infrastructure and services, and that the required organisational needs are met, and value realised.</p>', '<p><b>Individual Benefits</p></b>\r\n<p>You will gain an understanding on how Release, control and validation forms the core of the Service Transition stage of the ITIL<sup>®</sup>  Lifecycle, and works to try and ensure only beneficial changes are introduced into the production environment, in a controlled fashion.</p>\r\n<p>It will also become apparent from the training that service transition needs to ensure that all requirements for the service are considered during the build/test/deployment phase, including people, (both the business and IT), processes, measurements and metrics, knowledge, tools etc. If we are to create the expected and required organisational value.</p>\r\n\r\n', '<p><b>Modules covered in this E-Course</p></b>\r\n<p>RCV01: Introduction to RCV</p>\r\n<p>RCV02: Change Management Process</p>\r\n<p>RCV03: Service Asset and Configuration Management</p>\r\n<p>RCV04: Service Validation and Testing</p>\r\n<p>RCV05: Release and Deployment Management</p>\r\n<p>RCV06: Change Evaluation</p>\r\n<p> RCV07: Knowledge Management</p>\r\n<p> RCV08: Roles and Responsibilities</p>\r\n<p> RCV09: Technology and Implementation Considerations </p>\r\n', '<br>\r\n<br>\r\n\r\n<br>\r\n\r\n<br>\r\n\r\n<br>\r\n\r\n<br>\r\n\r\n<br>\r\n\r\n\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n\r\n\r\n', '100', '2014-07-01 05:11:08', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('69', 'ITIL® Service Design', '9', 'ITILSD', 'ITILSDService-Design-Std.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) HD Quality</p>\r\n<p>4) Access to all the modules</p>\r\n<p>You will receive an e-certificate after successfully completing the E-Course</p>\r\n<p><b>Course Duration:</p></b>\r\n<p>21Hours</p>\r\n', '<p><b>Prerequisites: Must be ITIL<sup>®</sup>  Foundation Certified</p></b>\r\n<p>The ITIL<sup>®</sup> Intermediate Qualification: Release, Control and Validation Certificate is a free-standing qualification, but is also part of the ITIL<sup>®</sup>  Intermediate Lifecycle stream, and one of the modules that leads to the ITIL<sup>®</sup>  Expert in IT Service Management Certificate. The purpose of this training module and the associated exam and certificate is, respectively, to impart, test, and validate the knowledge on industry practices in service Management as documented in the ITIL<sup>®</sup>  Service Design  publication.</p>\r\n\r\n<p>The ITIL Service Design certificate is the second phase in the IT Service Management lifecycle, which focuses on the design of the IT services, including all of the relevant aspects - architectures, processes and policies, and documentation. These will all need to be aligned to meet the needs of the business, both at this point in time, and in the future.</p>\r\n', '<p>The Service Design qualification would suit candidates in the following IT professions or areas: </p>\r\n<p>Capacity Manager</p>\r\n<p>Availability Manager</p>\r\n<p>Service Level Manager</p>\r\n<p>Compliance Managers</p>\r\n<p>Business Continuity Manager</p>\r\n<p>Service Portfolio Manager</p>\r\n\r\n<p><b>Organisational Benefits</p></b>\r\n<p>By ensuring that the business and IT work together as a team, this will ensure that the design and delivery of a new or changed service meets the customer requirements that will deliver the performance improvements or increased profitability (depending on what the service change was aimed to address).</p>\r\n<p>IT staff will be more aligned with the aims of the business as a whole, rather than just the technical aspects. </p>\r\n<p><b>Individual Benefits</p></b>\r\n<p>You will gain an understanding on how to ensure that the service is designed in the appropriate manner to meet all of the requirements (both business and IT), thereby improving the quality of the deliverables. </p>\r\n<p>By enabling IT to be able to respond quickly and effectively to the needs of the business, will generate increased team functionality – increased enjoyment of delivering what was required, on time. By having a better understanding of the best-practice framework, it will enable you to identify areas for improvement back at the workplace, and allow you to develop your current role further, and help you do your job better.The reward being advancement within your company and a potential to increase your salary! </p>\r\n', '<p><b>Modules covered in this E-Course</p></b>\r\n<p>SD01: Introduction</p>\r\n<p>SD02: Service Design Principles</p>\r\n<p>SD03: Defining services and market spaces</p>\r\n<p>SD04: Conducting Strategic Assessments </p>\r\n<p>SD05: Financial Management</p>\r\n<p>SD06: Service Portfolio Management</p>\r\n<p> SD07: Managing demand</p>\r\n<p> SD08: Driving strategy through the Service Lifecycle</p>\r\n<p> SD09: Understanding Critical Success Factors and risks</p>\r\n\r\n<br>\r\n<br>\r\n\r\n<br>\r\n\r\n<br>\r\n\r\n<br>\r\n\r\n<br>\r\n\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n\r\n\r\n\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n\r\n\r\n', '', '', '100', '2014-07-15 07:40:31', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('70', 'Certified Netork Engineer (CNE) Foundation - Premium Package', '8', 'CNE-001', 'CNE-001CNE-Premium.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n\r\n<p><b>Course Duration</b></p>\r\n12 Hours\r\n', '<p>The exponential growth in networks in recent years has totally changed the way we work and play. We now demand instant communication with anyone via voice, text and video, and immediate access to all kinds of information and services. The networks that make this possible involve a wide range of engineering challenges.</p>\r\n\r\n<p>The study of networking includes the network fundamentals, network elements, applications, content etc. that make up the service-enabling technologies. The Network Engineering will give students an understanding of the full range of modern communication technologies, network protocols and middle-ware required for modern networks. It will equip them with the expertise to design, build, configure and test modern networks and networked services.</p>\r\n', '<p><b>Network Engineer</b></p>\r\n<p>A Network Engineer is an individual that is responsible for the maintenance of computer hardware and software systems that make up a computer network including the maintenance and monitoring of active data network or converged infrastructure and related network equipment.</p>\r\n\r\n<p>Network Engineers are generally mid-level support staff within an organization and do not typically get involved directly with users. Network Engineers focus upon network components within a company\'s LAN/WAN infrastructure ensuring integrity. Depending on the company and its size, the Network Engineer may also design and deploy networks. </p>\r\n', '<p><b>Module 1 : Information Networks</b></p>\r\n<p>Basic Terms</p>\r\n<p>Advanced Terms</p>\r\n<p>Networking Basics</p>\r\n<p>Basic Internet Concepts</p>\r\n<p>Internet Security</p>\r\n<p><b>Module 2 : Applications</b></p>\r\n<p>Computers in the Workplace</p>\r\n<p>Tele-Commuting</p>\r\n<p>The Electronic World</p>\r\n<p>Ergonomics</p>\r\n<p>Safety and the Environment</p>\r\n<p><b>Module 3 : Security</b></p>\r\n<p>Being Proactive</p>\r\n<p>Identifying Yourself</p>\r\n<p>Protecting your Data</p>\r\n<p>Understanding Malware</p>\r\n<p>Protecting Against Malware</p>\r\n', '', '', '200', '2014-03-01 07:59:02', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('71', 'Certified PHP Professional (CPP) - Premium Package', '8', 'PHP-001', 'PHP-001CPP-Premium.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>Course Duration</p></b>\r\n<p>20 Hours</p>\r\n', '<p>PHP is a powerful server-side scripting language for creating dynamic and interactive websites. PHP is the widely-used, free, and efficient alternative to competitors such as Microsoft\'s ASP.</p>\r\n\r\n<p>PHP is perfectly suited for Web development and can be embedded directly into the HTML code.</p>\r\n\r\n<p>SQL (Structured Query Language) is an ANSI (American National Standards Institute) standard for accessing database systems. SQL statements are used to retrieve and update data in a database.</p>\r\n', '<p>PHP is an open source, server-side web-scripting language that is compatible with all the major web servers (most notably Apache) and databases.By the help of PHP code you can create dynamic website content. Dynamic Web sites are flexible applications than merely sites. </p>\r\n<p>If you know HTML, but you have no experience in the field of programming, you can easily learn PHP and MySQL with the help of this course. This course starts from the most simple, explaining the operations of the PHP language, and then move on to detail how to create PHP programs, how to load the PHP scripts, and to the final approach more complex items, such as SQL commands, working with MySQL database, using classes and OOP (Object Oriented Programming) in PHP. The tutorials covered in this course approach in an easy and intuitive manner with numerous examples that make it easier and more understanding to learn PHP. </p>\r\n', '<p><b>What are the Modules covered in this E-Course</p></b>\r\n<p>Module 1 - PHP Basics and Advanced </p>\r\n<p>Module 2 – PHP Forms  </p>\r\n<p>Module 3 – PHP &MYSQL</p>\r\n<p>Module 4 – PHP and Oops</p>\r\n\r\n<br>\r\n<br>\r\n<p></b>Total Number of Sessions: 21</p></b>\r\n', '', '', '250', '2014-03-01 08:13:30', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('72', 'ITIL® Service Strategy', '9', 'ITILSS', 'ITILSSSS-Std.png', 'Standard', '20', '<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) HD Quality</p>\r\n<p>4) Access to all the modules</p>\r\n<p>You will receive an e-certificate after successfully completing the E-Course</p>\r\n<p><b>Course Duration:</p></b>\r\n<p>21 Hours</p>\r\n\r\n', '<p><b>Prerequisites: Must be ITIL Foundation Certified</p></b>\r\n<p>The ITIL Intermediate Qualification: Service Strategy Certificate is a free-standing qualification, but is also part of the ITIL Intermediate Lifecycle stream, and one of the modules that leads to the ITIL Expert in IT Service Management Certificate. The purpose of this training module and the associated exam and certificate is, respectively, to impart, test, and validate the knowledge on industry practices in service Management as documented in the ITIL Service Strategy publication.</p>', '<p>The ITIL Service Strategy intermediate certificate is one of the five lifecycle phase courses that builds on the knowledge gained from the ITIL<sup>®</sup> Foundation certificate.This lifecycle phase is for you if you wish to seek, or currently hold, a management or team leader role within your organisation. The primary focus for this ITIL<sup>®</sup> Service Strategy certification is the management of teams responsible for the strategic assessment and planning for new or changing IT services, which will enable your organisation to achieve its strategic goals.</p>', '<b><p>Organisational Benefits</b></p>\r\n<p>By ensuring that the business and IT work together as a team, this will ensure that the design and delivery of a new or changed service meets the customer requirements. By adopting service strategy principles, it will allow the technical teams to develop the service quicker as there will be less opportunity for any misunderstanding, through regular and accurate liaison and communication.</p>\r\n\r\n<p>IT staff will be more aligned with the aims of the business as a whole, rather than just the technical aspects. Service strategy is a key area for those professionals working in roles associated with the strategic planning, execution and control within a service-based business model, including those seeking an understanding of the concepts, processes, functions and activities involved. </p>\r\n\r\n\r\n<b><p>Individual Benefits</b></p>\r\n<p>You will gain an understanding on how to identify and meet the required outcomes for the business, plus what level of service is required, and how this can be achieved. By enabling IT to be able to respond quickly and effectively to the needs of the business, will generate increased team functionality – increased enjoyment of delivering what was required, on time. By having a better understanding of the best-practice framework, it will enable you to identify areas for improvement back at the workplace, and allow you to develop your current role further, and help you do your job better.The reward being advancement within your company and a potential to increase your salary!</p>\r\n', '<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n', '', '100', '2014-07-01 05:01:02', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('73', 'Advanced Diploma in Human Resource Management (ADHRM)', '11', 'GAQM-ASIQUAL-ADHRM-001', 'GAQM-ASIQUAL-ADHRM-001ADHRM.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address by ASIQUAL if you achieve the qualifying score in the exam.\r\n', 'The human resource issues facing today’s business owners and managers. You do not always have the expertise to deal with the many employee relationship issues you face, and yet you will be expected to make decisions that are both effective and legal. This Advanced Diploma in Human Resource Management will walk you through the hiring process, from performing a skills inventory to conducting the interview; discuss orientation; and cover some issues that arise after the hiring process (such as diversity issues, compensation, and discipline).', '<p>The course also introduce issues of cross-cultural communication to those who work with international students and staff.</p>\r\n\r\n<p>This course is designed to convey the major principles relating to management across cultural and national boundaries. It focuses on interpersonal approaches between people of different cultures in work settings as opposed to a country specific approach. That is, the approach is used to understand the effect of culture in a way that can then be applied to a wide variety of cross-cultural interactions in a number of organisational context. Participants will interact, examine concepts, cases to increase awareness, and understanding concerning the influence of culture on management and management practices.</p>\r\n\r\n</p>Skills in cross-cultural communication are essential in order to minimize problems and misunderstandings that arise from cultural difference.</p>\r\n\r\n<p>The course will also highlight ways to improve cross-cultural communication and needs of international businesses in mind, offering expatriates, managers, HR personnel, international teams and global business travellers with access to a range of online tools and resources, helping raise intercultural awareness.</p>\r\n\r\n<p>This course provides necessary skills to engage and communicate more effectively and confidently with international students and staff.</p>', '<p><b>What Topics are Covered in the E-Course?</b></p>\r\n\r\n<p>Module 1  –  HR Training for the Non HR Managers (12 Credits)</p>\r\n<p>Module 2  –  Employee Dispute Resolution (8 Credits)</p>\r\n<p>Module 3  –  Talent Management (11 Credits)</p>\r\n<p>Module 4  –  Conducting Effective Performance Reviews (7 Credits)</p>\r\n<p>Module 5  –  Conflict Resolution (8 Credits)</p>\r\n<p>Module 6  –  Anger Management (9 Credits)</p>\r\n<p>Module 7 – Manifestation of Culture (4 Credits)</p>\r\n<p>Module 8 – Cultural Competencies (4 Credits)</p>\r\n<p>Module 9 – Cross Culture Communication (4 Credits)</p>\r\n<p>Module 10 – Cross Culture Negotiation Strategies (4 Credits)</p>\r\n<p>Module 11 - Culture Adjustments (4 Credits)</p>\r\n\r\n<b><p>Total Credits: 75</b></p>\r\n<b><p>Level: 7</b></p>  \r\n\r\n', '', '', '500', '2015-01-28 06:27:54', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('75', 'Diploma in Business Process and Management (DPBM)', '11', 'GAQM-ASIQUAL-DBPM-001(2)', 'GAQM-ASIQUAL-DBPM-001(2)DBPM.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes two E-Vouchers for Certification Exam</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address by ASIQUAL (UK) if you achieve the qualifying score in the exams.</p>\r\n\r\n', '<p>Owning a business requires a vision balanced with attention to detail. You need to be a generalist who understands the multiple aspects of running a business, as well as the ability to step back and see the big picture and to reach into the future. The business environment is a complex place to be. Whether you wish to work as a consultant or freelancer, establish a corporation, or set up an operation that meets a need for very particular type of customer, there is a tremendous amount of information that you need to know and to apply. This E-Course course provides essential learning for new business owners, whether the business is just in the idea stage or you have already begun and need to fill in the gaps</p>\r\n\r\n<p>Business process management helps organizations leverage processes to achieve their goals and be successful. Once processes are implemented, they must be monitored, evaluated, and optimized to make sure they are still meeting the goals that they were designed to accomplish. A business that can successfully manage its processes is able to maintain a competitive edge, while increasing productivity and efficiency and decreasing costs</p>\r\n', '<b><p>Diploma in Business Process and Management (DBPM) comprises of 7 Modules</b></p>\r\n\r\n\r\n\r\n<p>Module 1 - Business Management Fundamentals (14 Credits)</p>\r\n\r\n<p>Module 2 - Business Leadership (12 Credits)</p>\r\n\r\n<p>Module 3 - Core Negotiation Skills (9 Credits)</p>\r\n\r\n<p>Module 4 - Business Succession Planning (8 Credits)</p>\r\n\r\n<p>Module 5 - Conflict Resolution (9 Credits)</p>\r\n\r\n<p>Module 6 - Dealing With Difficult People (8 Credits)</p>\r\n\r\n<p>Module 7 - Business Process Management (15 Credits)</p>\r\n\r\n<b><p>Total Credits: 75</b></p>\r\n<b><p>Level: 4</b></p>  ', '', '', '', '500', '2014-06-04 09:53:04', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('76', 'Post Graduate Diploma in Software and Mobile Testing (PGDSMT)', '11', 'GAQM-ASIQUAL-ADSMT-001(2)(3)', 'GAQM-ASIQUAL-ADSMT-001(2)(3)PGDSMT.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes three E-Vouchers for Certification Exams</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate of Diploma will be shipped to your mailing address by ASIQUAL (UK) if you achieve the qualifying score in the exams.</p>\r\n', '<p>If you are exploring new career opportunities or want to stay current in the Software Testing field, our Advanced Diploma in Software and Mobile Testing can provide you a focused career training and skill development for working professionals.</p>\r\n\r\n<p>With Advanced Diploma in Software and Mobile Testing E-Course, you’ll learn the basic skills required of a software test professional and how testing fits into software development. Find out what it takes to be a successful software tester and how testing can add significant value to software development projects via our E-Course which is one of the best among all in Software Testing.</p>\r\n\r\n<p>The Software Testing is aimed at those who seek a more practical approach to the core software testing material covered at Foundation level. This Intermediate level software testing course is recommended for professionals associated with software testing in any way, or for those who are looking for a more practical approach towards concepts of testing. </p>', '<p>Mobile Application Testing is a process by which application software developed for hand held mobile devices is tested for its functionality, usability and consistency. Mobile applications either come pre-installed or can be installed from mobile software distribution platforms. Mobile devices have witnessed a phenomenal growth in the past few years. A study conducted by the Yankee Group predicts the generation of $4.2 billion in revenue by 2013 through 7 billion U.S. smartphone app downloads.</p>\r\n\r\n<p>PGDMST also involves both device testing as well as application and software testing to assure you a better prospects in the field of Mobile Testing.</p>', '<b><p>What Modules are covered in this Diploma?</p></b>\r\n\r\n<p>Module 1 -  Foundation in Testing (10 Credits)</p>\r\n<p>Module 2 -  Testing Through Life-cycle (10 Credits)</p>\r\n<p>Module 3 -  Static techniques (8 Credits)</p>\r\n<p>Module 4 -  Test design techniques (8 Credits)</p>\r\n<p>Module 5 -  Business Analyst Skills (8 Credits)</p>\r\n<p>Module 6 -  Test management (10 Credits)</p>\r\n<p>Module 7 -  Tool support for testing (8 Credits)</p>\r\n<p>Module 8 -  Overview of Testing (10 Credits)</p>\r\n<p>Module 9 -  Test Plan (6 Credits)</p>\r\n<p>Module 10 - Test Case and Execution (6 Credits)</p>\r\n<p>Module 11 - Test Review (8 Credits)</p>\r\n<p>Module 12 - Types of Testing (8 Credits)</p>\r\n<p>Module 13 - Mobile Testing (10 Credits)</p>\r\n\r\n<b><p>Total Credits: 110</b></p>\r\n<b><p>Level: 7</b></p>  ', '', '', '600', '2014-06-04 09:51:24', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('77', 'Diploma in Hardware and Networking (DHN)', '11', 'GAQM-ASIQUAL-DHN-001(2)', 'GAQM-ASIQUAL-DHN-001(2)ADHN.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes two E-Vouchers for Certification Exams</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address by ASIQUAL (UK) if you achieve the qualifying score in the exams.<p>\r\n', '<p>Diploma in Hardware and Networking is a vendor-neutral certification that certifies the competency of service professionals in the computer industry. It is for anyone who wants an internationally recognized credential as a competent computer service professional.</p>\r\n<p>If you’ve been working in tech support for some time and you’ve don’t have the respect and recognition, you feel you deserve, you need to take up Diploma in Hardware and Networking (DHN) to know if it is what you need. It is an external validation and measurement of your technical support skills and experience. </p>\r\n<p>The exponential growth in networks in recent years has totally changed the way we work and play. We now demand instant communication with anyone via voice, text and video and immediate access to all kinds of information and services. The networks that make this possible involve a wide range of engineering challenges.</p>\r\n', '<p><b>What Modules are covered in this Diploma?</p></b>\r\n\r\n<p>Module 1 - Foundation Level (Credits 10)</p>\r\n<p>Module 2 - Advanced Level (Credits 15)</p>\r\n<p>Module 3 - Expert Level (Credits 15)</p>\r\n<p>Module 4 - Networking (Credits 10)</p>\r\n\r\n<b><p>Total Credits: 50</b></p>\r\n<b><p>Level: 5</b></p>\r\n', '', '', '', '400', '2014-06-04 09:49:55', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('78', 'Diploma in Business and Research Analysis (DBRA)', '12', 'GAQM-ASIQUAL-DBRA 1(2)', 'GAQM-ASIQUAL-DBRA 1(2)DBRA.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes two (2) E-Vouchers for Certification Exams</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address by GAQM-ASIC if you achieve the qualifying score in the exams.</p>\r\n', '<p>Diploma in Business and Research Analysis the overall business and IT needs of an organization in order to develop appropriate solution strategies. As the key liaison between business and information technology departments, the business analyst is responsible for gathering and documenting business requirements and translating them into functional system design specifications that can be successfully executed by IT development teams.</p>\r\n<p>A Business Analyst is someone who analyses change requirements and produces a justifiable set of analysis deliverables that are used to design and implement the solution. A Business Analyst is (or should!) be measured on delivery of the benefits specified in the project objectives.</p>\r\n\r\n\r\n<p>In today’s society, many people experience information overload. We are bombarded with messages to believe various ideas, purchase things, support causes, and lead our lifestyle in a particular way. How do you know what to believe? How do you separate the truth from the myths?</p>\r\n<p>In this age of information overload, it can be hard to know where to find good information that you can trust. If you’re doing research for an important project, report, or proposal, how do you find information that you can count on?</p>\r\n\r\n<p>In this diploma you will learn how to research any topic using a number of different tools. We will start with basic techniques, such as reading, memory recall, note-taking, and planning. We will also talk about creating different kinds of outlines for different stages of your project, and how to move from the outline to actual writing, editing, and polishing. Most importantly, we will talk about how to use all kinds of sources, including a library’s Dewey Decimal System, journals, and the Internet. After you complete this course, you’ll be ready to find reliable information on any topic, and turn that information into a compelling, accurate piece of writing.</p>\r\n', '<p><b> What Modules are covered in this Diploma?</p></b>\r\n<p>Module 1 - Introduction to Business Process Analysis (10 Credits)</p>\r\n<p>Module 2 - Business Process Analysis Planning & Stake Holder Management (10 Credits)</p>\r\n<p>Module 3 - Business Requirements Management (10 Credits)</p>\r\n<p>Module 4 - Organizational Analysis (6 Credits)</p>\r\n<p>Module 5 - Business Solutions Evaluation and Implementation (8 Credits)</p>\r\n<p>Module 6 - Business Analyst Competencies (6 Credits)</p>\r\n<p>Module 7 - Critical Thinking (10 Credits)</p>\r\n<p>Module 8 - Research Analysis (10 Credits)</p>\r\n\r\n<p><b>Total Credits: 70</p></b> \r\n<p><b>Level: 6</p></b>', '', '', '', '400', '2014-06-14 08:39:09', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('79', 'Postgraduate Diploma in Web Designing and Development (PGDWDD)', '12', 'GAQM-ASIC-DEV-DES', 'GAQM-ASIC-DEV-DESPGDWDD.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes two (2) E-Vouchers for Certification Exams</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address by GAQM-ASIC if you achieve the qualifying score in the exams.</p>', '<p>In this Diploma, you will get the design skills needed to build and manage highly engaging, user-friendly websites. You will also develop the know how to work as an indie developer or as part of a development team.</p>\r\n\r\n<p>Employing best practice web development techniques, the latest hardware and industry leading training, our Diploma will set you apart from the IT crowd.</p>\r\n\r\n<p>Web Development is the process of creating websites for the internet. This involves the design of both the back-end and the front-end of a website. Front-end includes designing a webpage, adding user interactivity with scripting languages like javascript. Back-end includes the server-side scripting for database availability, creation of various web services, etc.</p>\r\n\r\n<p>Web Development training gives you and all-round training in both the design and the development part of web in detail. We train in all the latest technologies that are yet to get supported by all the browsers like HTML & CSS. It also includes installing helpful tools, learning how to use frameworks, debugging, etc.</p>\r\n\r\n<p>The Diploma also comprises of MySQL, MYSQL is a Relational Database Management System, which stores content in tabular format, and provides access to the saved content to multiple users.</p>', '<p><b>What Modules are covered in this E-Course?</p></b>\r\n\r\n<p>Module 1 - HTML (Credits 20)</p>\r\n\r\n<p>Module 2 - CSS (Credits 20)</p>\r\n\r\n<p>Module 3 - JavaScript (Credits 15)</p>\r\n\r\n<p>Module 4 -  MYSQL (Credits 20)</p>\r\n\r\n<p>Module 5 - PHP (Credits 40)</p>\r\n\r\n\r\n', '<p><b>Total Credits: 115</p></b> \r\n<p><b>Level: 7</p></b>', '', '', '600', '2014-06-14 09:04:53', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('80', 'Certified Web Developer (CWD) - Premium Package', '8', 'CWD-001', 'CWD-001CWD.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>25 Hours</p>\r\n', '<p>In this E-Course, you will get the design skills needed to build and manage highly engaging, user-friendly websites. You will also develop the know how to work as an indie developer or as part of a development team.</p>\r\n\r\n<p>Employing best practice web development techniques, the latest hardware and industry leading training, our Diploma will set you apart from the IT crowd.</p>\r\n\r\n<p>Module 1 comprises of HTML, HTML (Hypertext Markup Language) lays the groundwork for every kind of website, whether it is a single homegrown webpage or a multi-hundred-page corporate site. Employers worldwide rely upon the HTML skills of web developers to edit content, add new pages, and enhance website navigability. This instructor-led introduction HTML training gives you the tools to write code, engineer web pages, and craft a web presence of your very own. Using a hands-on approach to learning, this introductory HTML training course helps you master a multitude of techniques.</p>\r\n\r\n<p>Module 2 comprises of CSS, CSS (Cascading Style Sheets) enables you to control the look and layout of a web page much more precisely than you could with HTML alone, but it can be time-consuming to learn. In this innovative workshop, expert developer Candyce Mairs makes it quick and easy, walking you through the process of adding content to a web page and using CSS to position that content. You will learn CSS positioning concepts like the CSS “box model,” “floats,” and “clears,” and gain a deeper understanding of how HTML and CSS work together to create the look of your web page. By speaking the same language as the browser, you will learn to work with the browser to place content accurately and easily. </p>\r\n\r\n<p>Module 3 – comprises of JavaScript, JavaScript is the lingua franca of the web, but before you can start using it to create dynamic websites, you need to understand how it works. In this workshop trainer and developer Joe Chellman explores the syntax behind the JavaScript language. You’ll learn to “speak” JavaScript by gaining an understanding of variables, types, objects, arrays, operators, control structures, loops, and functions. You’ll also work through a series of hands-on examples that put these ideas into action. After completing this course, you will understand the core syntax of JavaScript and how this scripting language works to build powerful and complex functionality on the web.</p>\r\n\r\n<p>Module 4 – comprises of MySQL is a Relational Database Management System, which stores content in tabular format, and provides access to the saved content to multiple users.</p>\r\n', '', '', '', '', '100', '2014-06-16 11:31:56', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('81', 'Certified Software Testing Manager (CSTM) - Standard Package', '5', '(CSTM-001)', '(CSTM-001)CSTM-Standard.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>\r\n', '<p>The Certified Software Testing Manager (CSTM)<sup>®</sup> certification establishes a worldwide standard for the assessment of the capabilities and competencies of software testing professionals that are working at, or soon will work at, the software testing management level.</p>\r\n\r\n<p>Acquiring the designation of CSTM<sup>®</sup> indicates a level of professional competence in both the principles and practices of software testing, demonstrating the skills and capabilities necessary to manage the software test function. The CSTM<sup>®</sup> certification provides IT upper management a necessary tool to predict the likelihood of success of individuals applying for management level positions. The CSTM<sup>®</sup>certification also provides the IT professional with an objective assessment of their management skills.<p>\r\n<p>The CSTM<sup>®</sup> Certification was developed based on the Test Management Body of Knowledge (TMBOK) to fill the gap in the management skills required by test managers and test leads to effectively manage the test process, the test project and the test organization. </p>', '<p><b>What Modules are covered in this E-Course?</p></b>\r\n<p> Test Organization</p>\r\n<p> Test Organization And Independence</p>\r\n <p>Tasks Of The Test Leader And Tester</p>\r\n<p> Test Planning And Estimation</p>\r\n<p> Test Planning</p>\r\n<p> Test Planning Activities</p>\r\n<p> Exit Criteria</p>\r\n<p> Test Estimation</p>\r\n<p> Test Approaches (Test Strategies)</p>\r\n<p> Test Progress Monitoring And Control</p>\r\n<p> Test Progress Monitoring</p>\r\n<p> Test Reporting</p>\r\n<p> Test Control</p>\r\n<p>  Configuration Management</p>\r\n<p>  Risk And Testing</p>\r\n<p>  Project Risks</p>\r\n<p>  Product Risks</p>\r\n<p>  Incident Management</p>\r\n<p>  Testing Tools</p>\r\n<p>  Management Understanding</p>\r\n<p>  Independent Testing</p>\r\n<p>  Testing in Project Management</p>\r\n<p>  People issues in Testing</p>\r\n<p>  Testing Tools</p>\r\n<p>  Managing Expectations</p>\r\n<p>  Areas of Recommendations</p>\r\n', '', '', '', '100', '2014-06-24 07:50:33', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('82', 'Certified Software Testing Manager (CSTM) - Premium Package', '5', 'CSTM-001', 'CSTM-001CSTM-Premium.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>The Certified Software Testing Manager (CSTM)<sup>®</sup> certification establishes a worldwide standard for the assessment of the capabilities and competencies of software testing professionals that are working at, or soon will work at, the software testing management level.</p>\r\n\r\n<p>Acquiring the designation of CSTM<sup>®</sup> indicates a level of professional competence in both the principles and practices of software testing, demonstrating the skills and capabilities necessary to manage the software test function. The CSTM<sup>®</sup> certification provides IT upper management a necessary tool to predict the likelihood of success of individuals applying for management level positions. The CSTM<sup>®</sup>certification also provides the IT professional with an objective assessment of their management skills.<p>\r\n<p>The CSTM<sup>®</sup> Certification was developed based on the Test Management Body of Knowledge (TMBOK) to fill the gap in the management skills required by test managers and test leads to effectively manage the test process, the test project and the test organization. </p>\r\n\r\n', '<p><b>What Modules are covered in this E-Course?</p></b>\r\n<p> Test Organization</p>\r\n<p> Test Organization And Independence</p>\r\n <p>Tasks Of The Test Leader And Tester</p>\r\n<p> Test Planning And Estimation</p>\r\n<p> Test Planning</p>\r\n<p> Test Planning Activities</p>\r\n<p> Exit Criteria</p>\r\n<p> Test Estimation</p>\r\n<p> Test Approaches (Test Strategies)</p>\r\n<p> Test Progress Monitoring And Control</p>\r\n<p> Test Progress Monitoring</p>\r\n<p> Test Reporting</p>\r\n<p> Test Control</p>\r\n<p> Configuration Management</p>\r\n<p> Risk And Testing</p>\r\n<p> Project Risks</p>\r\n<p> Product Risks</p>\r\n<p> Incident Management</p>\r\n<p> Testing Tools</p>\r\n<p> Management Understanding</p>\r\n<p> Independent Testing</p>\r\n<p> Testing in Project Management</p>\r\n<p> People issues in Testing</p>\r\n<p> Testing Tools</p>\r\n<p> Managing Expectations</p>\r\n<p> Areas of Recommendations</p>', '', '', '', '250', '2014-12-12 05:47:27', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('83', 'ITIL® Service Offerings and Agreements', '9', 'SOA', 'SOASOA-Std.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) HD Quality</p>\r\n<p>4) Access to all the modules</p>\r\n<p>You will receive an e-certificate after successfully completing the E-Course</p>\r\n<p><b>Course Duration:</p></b>\r\n<p>25 Hours</p>', '<p><b>Prerequisites: Must be ITIL Foundation Certified</p></b>\r\n<p>The ITIL Intermediate Qualification: Service Offerings and Agreements Certificate is a free-standing qualification, but is also part of the ITIL Intermediate Capability stream, and one of the modules that leads to the ITIL Expert in IT Service Management Certificate. The purpose of this training module and the associated exam and certificate is, respectively, to impart, test, and validate the knowledge on industry practices in service Management as documented in the ITIL Service Offerings and Agreements publication.</p>', '<p>The ITIL Service Offerings and Agreements course is one of the four phases of the ITIL Capability cycle of courses. Where the ITIL Lifecycle courses concentrate on the processes themselves, these courses also concentrate on the Management angle of the ITIL Lifecycle. Service Offerings and Agreements looks at how the associated processes support the service lifecycle, and more specifically, how the five phases of the ITIL lifecycle (service strategy, service design, service transition, service operation and continual service improvement) create organisational value.</p>', '<p>The ITIL® Service Offerings & Agreements (SOA) intermediate certificate is one of the four capability phases that build on the knowledge gained from the ITIL® Foundation certificate. This capability phase is for those who wish to gain a deeper level of understanding of the ITIL® processes and roles, how they are implemented and interact.</p>\r\n\r\n<p>The primary focus for this ITIL® Service Offerings & Agreements is to effectively translate the requirements of the business through discussions and negotiation, through:</p>\r\n\r\n<p>  Understanding the demands of the business and agreeing service levels to suite.</p>\r\n<p>    Through Demand Management, understand the peaks and troughs in demand on services (identifying Patterns of Business Activity).</p>\r\n<p>    Management of internal and external service providers to ensure business needs are met.</p>\r\n<p>    The criticality of ensuring Service Portfolio Management documents all aspects of current, future and retired services.</p>\r\n<p>Compliance Management by ensuring Security, Service Continuity, Risk Management and Service Level Agreements </p>\r\n<p><b>Modules covered in this E-Course</p></b>\r\n\r\n<p>SOA01: Introduction</p>\r\n<p>SOA02: Introduction to SOA</p>\r\n<p>SOA03: Service Portfolio Management</p>\r\n<p>SOA04: Service Catalogue Management</p>\r\n<p>SOA05: Service Level Management</p>\r\n<p>SOA06: Demand Management<p>\r\n<p>SOA07: Supplier Management</p>\r\n<p>SOA08: Financial Management</p>\r\n<p>SOA09: Business Relationship Management</p>\r\n<p>SOA10: Roles and Responsibilities</p>\r\n<p>SOA11: Technology Consideration</p>', '<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n', '', '100', '2014-07-15 07:44:49', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('84', 'ITIL® Planning, Protection & Optimisation', '9', 'PPO', 'PPOPPO-Std.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) HD Quality\r\n<p>4) Access to all the modules\r\n<p><b>Course Duration:</p></b>\r\n<p>25 Hours</p>', '<p><b>Prerequisites: Must be ITIL Foundation Certified</p></b>\r\n<p>The ITIL Intermediate Qualification: Planning, Protection & Optimisation Certificate is a free-standing qualification, but is also part of the ITIL Intermediate Capability stream, and one of the modules that leads to the ITIL Expert in IT Service Management Certificate. The purpose of this training module and the associated exam and certificate is, respectively, to impart, test, and validate the knowledge on industry practices in service Management as documented in the ITIL Planning, Protection & Optimisation publication.</p>', '<p>The ITIL Planning, protection and optimisation course is one of the four phases of the ITIL Capability cycle of courses. Where the ITIL Lifecycle courses concentrate on the processes themselves, these courses also concentrate on the Management angle of the ITIL Lifecycle.</p>\r\n\r\n<p>Planning, protection and optimisation covers the purpose, objectives, value to the business, service design basics, scope and service design’s role within the ITIL Lifecycle and the role of design coordination to ensure that what we deliver to our organisations meets their requirements and supports the outcomes they need to achieve to be successful.</p>', '<p><b>Individual Benefits</p></b>\r\n\r\n<p>You will gain an understanding on how Planning, protection and optimisation forms the core of the Service Design stage of the ITIL Lifecycle and works to try and ensure that designs meet organisational requirements (both now and in the future) and support the outcomes the organisation needs to achieve to be considered successful, PPO is also an important course for Compliance Managers to ensure security policies are aligned with business requirements and security continuity plans are aligned with business continuity plans</p>\r\n\r\n<p>It will also become apparent from the training that any flaws in the service design activities will inevitably lead to a service that fails to meet the organisational needs and requirements, resulting in the need for remedial work being undertaken within the production environment, leading to dissatisfaction from the organisation, and additional workload for IT in trying to correct the design faults that exist.</p>\r\n\r\n<p>By having a better understanding of the best-practice framework, and in this particular course, Planning, protection and optimisation, it will enable you to identify areas for improvement back at the workplace, and allow you to develop your current role further, and help you do your job better.The reward being advancement within your company and a potential to increase your salary!</p>\r\n', '<p><b>Modules covered in this E-Course</p></b>\r\n\r\n<p>PPO01: Introduction</p>\r\n<p>PPO02: Introduction to PPO</p>\r\n<p>PPO03: Capacity Management</p>\r\n<p>PPO04: Availability Management</p>\r\n<p>PPO05: IT Service Continuity Management</p>\r\n<p>PPO06: Information Security Management<p>\r\n<p>PPO07: Demand Management</p>\r\n<p>PPO08: Roles and Responsibilities</p>\r\n<p>PPO09: Technology Consideration</p>', '<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<p>ITIL<sup>®</sup> is a registered trade mark of AXELOS Limited. </p>\r\n<p>IT Infrastructure Library<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>PRINCE2<sup>®</sup> is a registered trade mark of AXELOS Limited.</p>\r\n<p>The Swirl logo™ is a trademark of AXELOS Limited. </p>\r\n<p>Axelos<sup>®</sup> is a registered trade mark of AXELOS Limited</p>\r\n', '100', '2014-07-15 07:53:01', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('85', 'Certified Data Centre Professional (CDCP) - Standard Package ', '2', '(CDCP-001)', '(CDCP-001)CDCP-STD.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This Package doesn\'t includes E-Voucher for Certification Exam</p>\r\n<b><p>E-Course Duration</p></b>\r\n<p>15 Hours</p>\r\n\r\n', '<p>The Certified Data Centre Professional (CDCP)™ exam certification indicates a foundational knowledge of critical physical infrastructure in the Data Center. The Certified Data Centre Professional’s have to demonstrate a base level proficiency in the elements of: cooling, power, racks, cabling, fire protection, management and physical security.</p>', '<p>The candidate’s who are appearing for the CDCP exam must have sufficient knowledge in data center design, build and operations.</p>', '<p><b>What Modules are covered in this E-Course?</b></p>\r\n\r\n<p>Module 1 - Fundamentals of Availability</p>\r\n<p>Module 2 - Examining Fire protection methods in the Data Center </p>\r\n<p>Module 3 - Fundamentals of Cabling strategies for Data Centers</p>\r\n<p>Module 4 - Fundamentals of Cooling I</p>\r\n<p>Module 5 - Fundamentals of cooling II : Humidilty in the Data Center</p>\r\n', '', '', '80', '2015-01-19 09:59:41', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('86', 'Certified Data Centre Professional (CDCP) - Premium Package', '2', 'CDCP-001', 'CDCP-001CDCP-Prem.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes One (1) E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>15 Hours</p>\r\n', '<p>The Certified Data Centre Professional (CDCP)™ exam certification indicates a foundational knowledge of critical physical infrastructure in the Data Center. The Certified Data Centre Professional’s have to demonstrate a base level proficiency in the elements of: cooling, fire safety and protection, racks, cabling, management and physical security.</p>', '<p>The candidate’s who are appearing for the CDCP exam must have sufficient knowledge in data center design and cabling strategies.</p>', '<p><b>What Modules are covered in this E-Course?</b></p>\r\n\r\n<p>Module 1 - Fundamentals of Availability</p>\r\n<p>Module 2 - Examining Fire protection methods in the Data Center </p>\r\n<p>Module 3 - Fundamentals of Cabling strategies for Data Centers</p>\r\n<p>Module 4 - Fundamentals of Cooling I</p>\r\n<p>Module 5 - Fundamentals of cooling II : Humidilty in the Data Center</p>\r\n', '', '', '250', '2015-01-19 10:02:12', '1', '1', '30');
INSERT INTO `pl_course` VALUES ('88', 'MBA in Project Management', '13', 'MBAPM', 'MBAPMMBA-in-PM.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes Two (2) E-Vouchers for Exams</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>Project managers supervise staff and allocate resources to ensure the correct and timely completion of work. Unlike departmental managers who oversee the same employees working on essentially the same tasks every day, project managers typically take charge of a diverse group for the duration of a particular project. Afterwards they move on to another project that will probably involve a different staff and different tasks, at least in part.</p>\r\n\r\n<p>Projects and project management has become the foundation for success in the public and private sectors. Enterprises achieve their goals through projects and effective project management. Successful project management requires achieving the scope (e.g., intended result), cost and schedule. In addition, the increasing complexity of work and demands for “more with less” place special demands on the project manager.</p>\r\n\r\n<p>The MBA in Project Management programs go beyond the “What is project management and practices” to providing practical “How To” guidance, tools and techniques, and processes to implement in today’s working world. The programme help candidates to have pledged time, energy and effort to the project management profession. This overt evidence of a commitment to the profession can lead to opportunities in the corporate domain, increased responsibilities and a growth in earnings.</p>\r\n\r\n<p>The MBA in Project Management program also comprises of directing projects allowing experienced senior managers and executives to acquire new skills and advanced techniques in managing and controlling today’s complex project and management issues – from managing risks and quality to managing scope and budgets.</p>', '', '', '', '', '1900', '2014-11-07 15:35:38', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('89', 'MBA in Six Sigma', '13', 'MBASS', 'MBASSMBA-in-SS.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes Three (3) E-Voucher(s) for Exams</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>Six Sigma is one of the most widely used quality management approaches in the business world, utilized to gain production and operational efficiencies, as well as customer service improvements, across multiple industries. Business, engineering, and technical professionals can prepare for Six Sigma certification and earn a respected MBA in as few as 12 months. </p>\r\n\r\n<p>MBA in Six Sigma courses are taught trainer with extensive experience in Six Sigma applications or via E-Learning Mode. Through business case-study analysis and computer technology, students will learn quality management approaches, how to use statistical tools, and effective quality improvement techniques. As part of the MBA in Six Sigma Quality studies, students gain a thorough understanding of define, measure, analyze, improve, control (DMAIC)—the statistical and analytical method used to reduce defects by finding the root causes of defects, eliminating them, and sustaining that improvement level. </p>', '<p>Six Sigma approach is being widely used all over the world for reduction in process variation and waste elimination. A large number of organizations are using Six Sigma approach many areas. </p>', '', '', '', '2100', '2014-11-07 15:36:06', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('90', 'MBA in Human Resource Management', '13', 'MBAHRM', 'MBAHRMMBA-in-HRM.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes Two (2) E-Vouchers for Exams</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>The human resource issues facing today’s business owners and managers. You do not always have the expertise to deal with the many employee relationship issues you face, and yet you will be expected to make decisions that are both effective and legal. The MBA in Human Resource Management will walk you through the hiring process, from performing a skills inventory to conducting the interview; discuss orientation; and cover some issues that arise after the hiring process (such as diversity issues, compensation, and discipline).</p>\r\n\r\n<p>Organizations recognize that they do better business when their people are engaged, motivated, and yes, talented. Having the right people in place at the right time is a key aspect to continued growth, success, or even just stability. The MBA in Human Resource Management will provide you with just what it takes to have the right people ready. It will help you create a program to measure the talents of your people and how to help them grow in preparation for the future. It will also help you support and grow your organization by teaching you how to apply the most current research and adapt your organization to the ever-changing marketplaces.</p>\r\n\r\n<p>The MBA in Human Resource Management will develop the business expertise through a deeper understanding of managing people and organisations, decision making and problem-solving, international business environment, strategies to manage globalisation, strategic marketing and operations management. It focuses on Strategic Human Resource Management.</p>\r\n\r\n<p>The course also provides Candidates with strategic functional aspects of key management issues with emphasis on global, local and virtual aspects of modern business practice. </p>', '', '', '', '', '1900', '2014-11-07 15:36:43', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('91', 'MBA in Business Management', '13', 'MBABM', 'MBABMMBA-in-BM.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes Three (3) E-Voucher(s) for Exams</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p> Business administration deals with the performance or management of business operations and therefore is all about making or implementing major decisions. It is mostly about organizing people and resources efficiently so as to channel activities toward common goals. A degree in Business Administration can help you obtain those particular abilities and master the latest methods to manage a group or business. Problem-solving, theorizing and analytical thinking skills are much needed and favoured. In addition, this major will encourage you to think about issues such as diversity, ethics, politics and other dynamics that play a role in every work environment. </p>\r\n\r\n<p>MBA in Business Management program is geared towards persons interested in pursuing a career in management or improving their managerial skills. The certificate demonstrates the essential information and skills required by professionals who have to make decisions that are important to the direction and performance of an organization or business. It also demonstrates that a candidate has the required practical approach to manage business in any environment.</p>\r\n\r\n<p>Change is a hallmark of today’s business world. In particular, our workforce is constantly changing – people come and go, and move into new roles within the company. Succession planning can help you make the most of that change by ensuring that when someone leaves, there is someone new to take their place.</p>\r\n\r\n<p>MBA in Business Management also covers Business process management which helps organizations leverage processes to achieve their goals and be successful. Once processes are implemented, they must be monitored, evaluated, and optimized to make sure they are still meeting the goals that they were designed to accomplish. A business that can successfully manage its processes is able to maintain a competitive edge, while increasing productivity and efficiency and decreasing costs. </p>', '', '', '', '', '2400', '2014-11-07 15:35:08', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('92', 'MBA in Sales and Marketing', '13', 'MBASM', 'MBASMMBA-in-Sales.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes Two (2) E-Vouchers for Exams</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>The MBA in Sales Marketing is ideal for those with relevant work experience who would like to receive more focused marketing management education. The Marketing MBA will provide the education and credentials needed to qualify for advancement to most management positions.</p>\r\n\r\n<p>Though MBA programs differ by school, you can generally expect to receive in-depth instruction on key points in international marketing as well as integrated marketing communication strategies like advertising, promotions, and public relations. Students may also receive an understanding of Social Media Marketing, Customer Relationship Management (CRM), Telemarketing, Branding and overall marketing strategy.</p>\r\n\r\n<p>Virtually everybody in sales today sells over the phone at least part of the time. Perhaps it is time for you to evaluate how you use the telephone and where it fits into your sales and marketing mix. This MBA program will show you how the telephone can supplement, enhance, and sometimes replace other means of marketing and selling, and how this personal approach can dramatically increase your sales success. We will also talk about how to hone your communication skills, your ability to persuade, and techniques to personalize each sales call.</p>\r\n\r\n<p>The course is an ideal start for business owners and people new to marketing to learn the basics of Internet marketing. We’ve included information on how to market online, and even more importantly, how to determine what results you are getting. Then, you can figure out whether you are reaching your target market, where your qualified prospects are, and how they are engaged as a result of your efforts. This one-day course includes sessions on search engine optimization, e-mail campaigns, pay per click advertising, and more.</p>\r\n\r\n<p>While many companies promise to deliver an incredible customer experience, some are better at delivering than others. This MBA is also designed around six critical elements of customer service that, when the company lives them, bring customers back to experience service that outdoes the competition.</p>', '', '', '', '', '1800', '2014-11-07 15:34:39', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('93', 'MBA Supervisor', '13', 'MBASV', 'MBASVMBA-Super.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes One (1) E-Voucher for Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>The MBA Supervisor is designed to help you overcome many of the supervisory problems you will encounter in your first few weeks as a boss, whether you are a team leader, a project manager, or a unit coordinator. Dealing with the many problems a new supervisor encounters isn’t easy, but it doesn’t have to lead to discouragement.</p>\r\n\r\n<p>In today’s changing workplace, many new supervisors are unsure of their roles and responsibilities. They have little experience dealing with the challenges of managing work through others. They haven’t had the opportunity to develop those critical skills of planning work, leading their group, and communicating with their employees, their colleagues, and their manager. Our MBA Supervisor will give you just that opportunity.</p>\r\n\r\n<p>Effective delegation is one of the most valuable skills you can master. It reduces your workload and develops employee skills. Delegating prepares employees who work for you to be able to handle your responsibilities and simultaneously allows you to advance to other career opportunities within your organization.</p>\r\n\r\n<p>Delegation is often one of the hardest skills for a manager to master. However, the skill can be learned. The MBA Supervisor will explore many of the facets of delegation, including when to delegate and to whom to delegate. We will also go through the delegation process step by step and learn about techniques to overcome problems.</p>\r\n\r\n<p>Supervisors represent an important force in the North American economy. You have the power to turn on or turn off the productivity of the people who work for you. You are the crucial interface between the employee on the shop floor or the service desk and the managers of the organization. You usually have more experience and more skill than the employees you supervise, because management tends to look for super people to fill those roles.</p>', '', '', '', '', '1700', '2014-11-07 15:54:18', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('96', 'MBA in Sports Management', '13', 'CSM-002', 'CSM-002MBA-in-Sports-Management.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes One (1) E-Voucher for Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>Sport and its associated industries of recreation and fitness have entered a period of rapid growth. The recent Skills Audit conducted by the Tourism, Hospitality and Sport Sector Education and Training Authority in 2007, highlights the need for capacity building in sport to promote competence in managing sport organisations, tournaments and events, sport teams and sport facilities. </p>\r\n\r\n<p>The bridging of the current skills gap will have a positive impact on the management of sport organisations and sport teams as well as the growth of sport at all levels across the globe.</p>\r\n<p>In addition, the sport marketing industry represents a multi-million rand industry and the current ten TV channels dedicated to sport are evident of its reach and public demand in terms of access.</p>\r\n\r\n<p>Managerial competencies are acquired in a variety of contexts, ranging from private fitness facilities and sport clubs to local government initiatives in sport and recreation and on to the marketing and promotional world of sport sponsorships, media, athlete representation as well as sport tourism. </p>\r\n<p>Increased pressure to deliver efficient and effective management of sport entities, athletes, facilities and events comes from participants, federations, spectators and the media as well as athletes with special needs. </p>\r\n\r\n<p>The industry specific technical skills required within the operational sport and related environments require specific contextualisation within the operational environment in particular for the areas for which specialization streams were designed within the qualification. </p>\r\n\r\n\r\n<p> The MBA in Sports Management is aimed at developing specific competencies in a range of self-organisational and life-long learning skills with an in depth knowledge of sport requirements and technical know-how applicable to a sport specific context. </p>\r\n\r\n<p>The MBA in Sports Management will enable the assuming of job responsibilities as a sport manager in schools, clubs and private institutions in a range of areas, which includes, but is not limited to sport team management, federation management or facility management. </p>\r\n\r\n<p>Candidates will be exposed to establishing of commitment, policy and planning to achieve racial, disability and gender equity through sport programmes whilst maintaining a safe environment for sport activities, events and tournaments within the selected operational environment and community. </p>\r\n\r\n<p>Candidates meeting the requirements of this qualification will be positioned to further their learning, practice, experience and career within the sport or fitness industries, either at further levels or in other areas of practice. </p>\r\n<p>This MBA will serve as a stepping-stone to equip the learner to specialise in one of the various disciplines of choice in order to take up a leadership role and expand training and development into the area of management. </p>\r\n\r\n\r\n', '', '', '', '', '1800', '2014-11-07 15:53:55', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('97', 'MBA in Real Estate Management', '13', 'CREM-001', 'CREM-001MBA-CREM.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes One (1) E-Voucher for Exam</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>The Real Estate industry is a multi-million rand sector which requires professionals who are well-trained and knowledgeable to meet the housing needs of private citizens and the business community by providing office space and business premises. A wide range of legislation applies to this sector and employees/agents need to understand the relevant legislation and be able to apply it in their execution of their work. This MBA strives to equip the learners to be able to operate effectively and efficiently in the Real Estate sector. </p>\r\n\r\n<p>The MBA in Real Estate Management is designed to provide those learners who are already involved in the field of Property and Real Estate. It is also for learners who wish to seek a career in this industry. The Property and Real Estate Industry is a well-established industry and thus has many learners that would benefit from qualifications aligned to career paths. This means there is a need to develop career paths in this sub-field, an industry constantly in need of skilled people. </p>\r\n\r\n<p>The scope of Real Estate is changing and evolving all the time, with opportunities for learners in this arena to get involved in a wide variety of Real Estate opportunities such as real estate sales, brokerage and leasing, property management, institutional real estate investment, real estate consulting, real estate development. </p>\r\n\r\n<p>The MBA in Real Estate Management is for any individual who is, or wishes to be involved in the property and real estate industry. It serves to support and advance the functioning of individuals in this industry. The attainment of the Qualification represents the prerequisite for admission to the professional examination for estate agents, to be conducted by the Estate Agency Affairs Board, the successful completion of which will entitle the candidate to be registered as a non-principal estate agent by the Estate Agency Affairs Board. </p>\r\n\r\n<p>A learner will be able to complete the MBA with a specialisation in Real Estate or Valuation. The core unit standards are relevant to each area of specialisation.  Learners working towards this MBA will find that the acquisition of competence in the Unit Standards that make up the MBA will add value to their understanding of the sector and functioning in the workplace. This MBA is intended to enhance the provision of entry-level service within the Property and Real Estate sector. It will provide the broad knowledge, skills and values needed in the Property and Real Estate sector. </p>\r\n\r\n<p> The MBA in Real Estate Management consists of building blocks that can be developed further and will lead to a more specialised learning path in Property and Real Estate. It focuses on the skills, knowledge, values and attitudes required to progress further. The intention is: </p>\r\n<p>1) To promote the development of knowledge, skills and values that are required in Property and Real Estate. </p>\r\n<p>2) To help learners realise their potential in the field. </p>\r\n<p>3) To provide opportunities for people to progress to levels of authority and responsibility in the Real Estate sector</p>\r\n\r\n<p>A real estate agent with a Professional MBA in Business will offer added insight and resources to clients when seeking property financing advice and direction.</p>\r\n<p>Real estate brokerages negotiate commission percentages based upon successful sales, and expertise in the field. This degree will put the real estate professional at a distinct advantage when discussing moneymaking potential with an employer.</p>\r\n', '', '', '', '', '2100', '2014-11-08 09:09:05', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('98', 'MBA in General Management', '13', 'CGM-001', 'CGM-001MBA-GM.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes One (1) E-Voucher for Exam</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>General Management studies help in understanding the managerial, functional and operational demands of commercial organizations to trigger production effectively and efficiently. This subject extensively covers several topics on marketing, investment, functional administration, human resource, sales, advertising etc. Imbibing the core tenets of this module will enable transformation into an effective business manager to understand the nuances of optimizing capital growth.</p>\r\n<p>General Management and further develops the key concepts, principles and practices of management that will enable learners to lead, manage, organise and control first line managers and team leaders. </p>\r\n<p>The learners will typically be managers who have other junior managers or team leaders reporting to them. In smaller organisations or entities, the managers could primarily be responsible for managing the supervisors and staff within their section, division or business unit. </p>\r\n\r\n<p>The scope of generic management covers five domains: leadership, managing the environment, managing relations, managing knowledge and the practice of management. This qualification addresses each of these domains with generic competencies, so that it allows learning programmes to be contextualised for specific sectors and industries. </p>\r\n<p>MBA in General Management provides opportunities for learners to transfer between various specialisations within management. This leads to the strengthening of management competencies and will enable managers at this level to manage successfully systems, processes, resources, managers and teams in their various occupations and contexts. </p>\r\n\r\n<p>This qualification is further intended to empower learners to acquire the knowledge, skills, attitudes and values required to operate confidently as individuals in South African communities and to respond to the challenging economic environment and constantly changing world of work. </p>\r\n<p>Ultimately, this qualification is aimed at improving the effectiveness and leadership abilities of middle managers in various occupations globally, in private and public business entities as well as non-governmental organisations. For this reason, the word \'entity\' includes a company, business unit, public institution, small business or non-profit organisation. </p>\r\n', '', '', '', '', '2000', '2014-11-08 10:43:59', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('99', 'MBA in Wholesale and Retail Operations', '13', 'CWRM-001', 'CWRM-001MBA-Whole.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes One (1) E-Voucher for Exam</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>The MBA in Wholesale and Retail Operations qualification consists of at least 120 credits. This programme is going to be an exciting experience for you since it looks at the world of Wholesale and Retail Operations from a practical viewpoint.\r\n<p>The Student Guidelines and the rest of this book are structured as follows; Each chapter represents a Unit Standard and therefore each has a title that corresponds with a specific Unit Standard, a set of objectives (which corresponds with the Specific Outcomes and Assessment Criteria of that Unit Standard) and a list of the Resource Material that would be of assistance to you to achieve competency. </p>\r\n<p>These guidelines and information will therefore not only assist you to start your own business but will be the guiding principles by which you could attain the MBA in Wholesale and Retail Operations. </p>\r\n<p>It makes absolute sense to obtain the qualification since it will also help you should you ever need to find a job again. Businessmen are known to have to find employment during times of hardship but even subsequent to that, most still return to their own enterprises after a while. It will serve as the second in the Wholesale and Retail Operations learning pathway and provide a basis for further learning. While the qualifying learners will experience personal growth and development, workplace succession planning will be more readily achieved.\r\n\r\n<p>The operational process includes; ordering stock, receiving, dispatching, stock control, cash control, sales and marketing and displaying, responsible credit promotion, perishable foods preparation, sales and display and the running of an informal small business. This qualification will serve to provide the Wholesale and Retail sector with personnel that can perform the operation functions to industry standards, optimise productivity and improve service levels. The qualifying learner will undergo personal development that will contribute to social and economic development. </p>\r\n\r\n<p>The learner assessed as competent against this qualification will be able to: </p>\r\n<p>1) Ensure a positive customer experience in a W and R business unit.\r\n<p>2) Explain how employees can influence the objectives of a W and R business unit. </p>', '', '', '', '', '1800', '2014-11-08 11:56:11', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('100', 'MBA in International Travel', '13', 'PGDIT-001', 'PGDIT-001PGDIT.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes One (1) E-Voucher for Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>The tourist industry provides government with hundreds of million of dollars in tax revenues each year through accommodation and restaurant taxes, airport users fees, sales taxes, park entrance fees and employee income tax. Clearly, this industry offers plenty of opportunities for operating or working in a successful travel consultancy. </p>\r\n\r\n<p>The MBA in International Tourism has been designed to develop a broad range of skills appropriate to a person who is undergoing training or operating as a front line worker in the international tourism industry with some supervisory responsibilities. It brings together the theoretical and practical elements of international tourism operations and will help to professionalise the travel and tourism industry.</p>\r\n\r\n<p>It makes absolute sense to obtain the MBA in International Tourism since it will also help you should you ever need to find a job again. Businessmen are known to have to find employment during times of hardship but even subsequent to that, most still return to their own enterprises after a while.</p>\r\n\r\n<p>Travel is the physical transportation of a person from one point to another, is one sector of tourism industry. It is however, a very important sector, for without it the other sectors would most likely not exit .For this reason, it is give its rightful place in the term “Travel and Tourism industry”. Tourism is the activity of people travelling to, visiting and/or staying in places outside their usual environments, for leisure, business or other purposes.</p>\r\n\r\n<p>The Travel and Tourism industry employs over 200 million people worldwide. Many tourism jobs are in small or medium –sized, family-owned enterprises. Research shows that job creation in tourism is growing one-and-a-half times faster than in any other industrial sector. Travel agents or consultants no longer work only in a travel agency. Companies, organizations, associations, educational institutions and societies all need the knowledge and skills of professional travel experts.</p>', '', '', '', '', '1800', '2014-11-10 09:22:34', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('101', 'MBA in  Property and Facilities Management', '13', 'CPFM-001', 'CPFM-001MBAPFM.jpg', 'Charisma', '365', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for one year (12 months)</p>\r\n<p>3) The Package also includes One (1) E-Voucher for Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Includes University Fee </p>\r\n', '<p>Commercial Property Management is a multi-million dollar sector which requires professionals who are well-trained and knowledgeable to meet the commercial property needs of the business community through the provision of office space and business premises. </p>\r\n\r\n<p>A wide range of legislation applies to this sector and employees/agents need to understand the relevant legislation and be able to apply it in the execution of their work. This qualification strives to equip the learners with the knowledge and skills necessary to be able to operate effectively and efficiently in the Commercial Property Management sector.</p>\r\n\r\n<p>The knowledge and skills required by practitioners, managers, brokers and facility managers in the Commercial Property Management sector are specialised. </p>\r\n<p>A practitioner in the field of Commercial Property Management needs to have a broad knowledge of the concepts, principles and theory underpinning the skills and specialized knowledge required to practice within this field. </p>\r\n\r\n<p>The course brings together a range of built environment disciplines from sustainable construction to property management to provide a broad perspective on issues of relevant international significance, while case studies provide opportunity for critical reflection and analysis.</p>\r\n', '', '', '', '', '2100', '2014-11-10 15:14:23', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('102', 'Certified Lean Six Sigma Black Belt (CLSSBB) - Premium Package', '4', '(CLSSBB-001)', '(CLSSBB-001)CLSSBB Premium Box copy.jpg', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes two E-Voucher(s) for Certification Exam</p>\r\n<p>4) The Exam Vouchers can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n', '\r\n<p>Certified Lean Six Sigma Black Belt (CLSSBB)™ is well versed in the Lean Six Sigma Methodology who leads improvement projects, typically in a full-time role. A Certified Lean Six Sigma Black Belt holder possesses a thorough understanding of all aspects within the phases of D-M-A-I-C. They understand how to perform and interpret 6 Sigma black belt tools and how to use standard principles of Lean.</p>\r\n\r\n<p>Black Belts operate under Master Black Belts to apply Six Sigma methodology to specific projects. They devote 100% of their valued time to Six Sigma. They primarily focus on Six Sigma project execution and special leadership with special tasks, whereas Champions and Master Black Belts focus on identifying projects/functions for Six Sigma.</p>\r\n', '<b>What Topics are Covered in this E-Course?</b>\r\n\r\n<b><p>Organizational Roadblocks and Lean Management</b></p>\r\n<p>Pre-define DMAIC and Define</p>\r\n<p>Organizational roadblocks</p>\r\n<p>Resistance Analysis</p>\r\n<p>Overview of all Continuous Improvement approaches</p>\r\n<b><p>Overview of Lean</b></p>\r\n<b><p>Overview of Six Sigma</b></p>\r\n<p>Lean Management explained — TAKT Time, Cycle Time, PCE, Lead Time, SWIP, Setup time, Changeover time</p>\r\n<p>Lean Tools explained — 5S, Kaizen, SMED, Heijunka</p>\r\n<b><p>1.2 Section II – </b></p>\r\n<b><p>1.2.1 Pre-define</b></p>\r\n<p>DMAIC versus DFSS</p>\r\n<p>Pre-define Pre-requisites and Qualifications</p>\r\n<p>Project Prioritization Matrix</p>\r\n<p>Introduction to Enterprise Wide view versus LOB view</p>\r\n<p>NPV and IRR</p>\r\n<b><p>1.2.2 Define</p></b>\r\n<p>Champion’s transfer of project</p>\r\n<p>Team dynamics and facilitation</p>\r\n<p>Project Charter’s role</p>\r\n<p>SIPOC/COPIS map</p>\r\n<p>VOC/VOB/VOP</p>\r\n<p>CTQ, CTC, CTS</p>\r\n<p>VOC – CTQ Tree</p>\r\n<p>Kano Model</p>\r\n<p>Quality Function Deployment</p>\r\n<p>Baseline performance of Y</p>\r\n<p>Business Metrics for Y</p>\r\n<p>Rolled Throughput Yield (RTY)</p>\r\n<p>Statistical Definition of Six Sigma</p>\r\n<b><p>1.3 Section III – Measure</b></p>\r\n<p>Objectives of Measure Phase</p>\r\n<p>Types of Data and Data Distribution models (Normal, Binomial and Poisson Distribution discussed)</p>\r\n<p>Scales of Data</p>\r\n<p>Measures of Central Tendency</p>\r\n<p>Measures of Dispersion</p>\r\n<p>Measurement Systems Analysis</p>\r\n<p>Variables GAGE RR</p>\r\n<p>Attribute RR</p>\r\n<p>Stability Check — Importance of Stability</p>\r\n<p>Capability Check — Cp, Cpk, Cpkm explained, How to understand Attribute Capability</p>\r\n<p>Variations, Variability and Capability</p>\r\n<p>Graphical tools to understand Data distribution</p>\r\n<p>Understanding Weibull (2 Parameter, 3 Parameter and Rayleigh) Distribution</p>\r\n<p>Correlating Calculations to Business Measures</p>\r\n<p>Checking Normality of Data (Anderson Darling, Ryan Joiner and Kolmogorov Smirnov)</p>\r\n<b><p>1.4 Section IV – Analyze</b></p>\r\n<p>Objectives of Analyze</p>\r\n<p>Simple Linear Regression</p>\r\n<p>Multiple Linear Regression</p>\r\n<p>Curvilinear Regression</p>\r\n<p>Fishbone Diagram</p>\r\n<p>Pareto Charts</p>\r\n<p>Demarcating Common Causes and Special Causes</p>\r\n<p>Hypothesis Tests (Parametric and Non-Parametric tests)</p>\r\n<p>Statistical Validation</p>\r\n<b><p>1.5 Section V – Improve</p></b>\r\n<p>Objectives of Improve</p>\r\n<p>Cost Benefit Analysis</p>\r\n<p>Solutions Prioritization Matrix</p>\r\n<p>Pugh Matrix</p>\r\n<p>Design of Experiments</p>\r\n<p>Introduction to DOE</p>\r\n<p>Basics of DOE</p>\r\n<p>Replication, Randomization and Blocking</p>\r\n<p>Main Effects and Interaction effects</p>\r\n<p>Full factorial experiments</p>\r\n<p>Fractional factorial experiments</p>\r\n<p>Screened Designs</p>\r\n<p>Response Surface Designs</p>\r\n<p>DOE with Regression</p>\r\n<p>DOE with example</p>\r\n<b><p>1.6 Section VI – Control</b></p>\r\n<p>Taguchi’s Loss Function</p>\r\n<p>Control Charts (Variable Control Charts and Attribute Control Charts)</p>\r\n<p>Measurement System Re-analysis</p>\r\n<p>Control Plan and Project Storyboard Transfer</p>\r\n<p>Project Closure</p>\r\n<p>Introduction to Total Productive Maintenance</p>\r\n<b><p>Lean Process Improvement</b></p>\r\n<p>Understanding Lean</p>\r\n<p>The Toyota Production System</p>\r\n<p>The Toyota Production System House</p>\r\n<p>The Five Critical Improvement Concepts</p>\r\n<p>Understanding Value with the Kano Model</p>\r\n<p>Types of Waste</p>\r\n<p>Creating a Lean Enterprise</p>\r\n<p>Understanding Lean</p>\r\n<p>The Plan, Do, Study, Act (PDSA) Cycle</p>\r\n<p>Using the R-DMAIC-S Model</p>\r\n<p>Lean Thinking Tools</p>\r\n<p>Kaizen Events</p>\r\n<p>Data Gathering and Mapping</p>', '', '', '', '400', '2014-12-12 05:22:09', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('103', 'IMTQN Certified Mobile Application Tester (CMAT) - Premium Pack', '5', '(CMAT)', '(CMAT)cmatfnd.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes two E-Voucher(s) for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>7 Hours</p>\r\n', '<p>Many of us think about pursuing a career in this field of testing. Starting from a beginner in this domain to becoming an expert, the IMTQN Certified Mobile Application Tester (CMAT) – Foundation Level Certification is interesting and helpful to know what could be the different questions that are asked to people by an employer while selecting them for various positions in the mobile testing field such as a software tester. </p>\r\n<p>As more and more applications are getting developed for Mobile Devices including Smartphones, Mobile Application Testing is becoming very important part of Mobile Application Development Ecosystem. There is very limited margin of error and the cost of buggy application can be huge in today\'s era of social media. One mistake and your investments can all be put at risk because of negative publicity. But one fact cannot be ignored – all code is developed by humans and there is always an element of risk and unknown left with programmers who are coding the system.</p>\r\n', '<b>The reasons why mobile application testing is required :</b>\r\n \r\n<p>1. Many Types of mobile devices Hardware</p>\r\n \r\n<p>2. Different types of Mobile Platforms/Operating systems from various companies. </p>\r\n \r\n<p>3. Different Mobile Carriers</p>\r\n \r\n<p>4. Many types of Mobile screens</p>\r\n\r\n\r\n', '<b>Who should take this E-Course?</b>\r\n\r\n<p> Mobile Software Test Managers or Engineers</p>\r\n<p> Software Testers involved in testing Mobile Apps</p>\r\n<p> Candidates who are seeking a new career in the field of Mobile Application Testing</p>', '', '', '210', '2014-12-12 05:34:15', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('104', 'Certified Software Testing Manager (CSTM) - Premium Package', '5', '(CSTM)', '(CSTM)CSTM-Premium.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes two E-Voucher(s) for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>\r\n', '<p>The Certified Software Testing Manager (CSTM)<sup>®</sup> certification establishes a worldwide standard for the assessment of the capabilities and competencies of software testing professionals that are working at, or soon will work at, the software testing management level.</p>\r\n\r\n<p>Acquiring the designation of CSTM<sup>®</sup> indicates a level of professional competence in both the principles and practices of software testing, demonstrating the skills and capabilities necessary to manage the software test function. The CSTM<sup>®</sup> certification provides IT upper management a necessary tool to predict the likelihood of success of individuals applying for management level positions. The CSTM<sup>®</sup>certification also provides the IT professional with an objective assessment of their management skills.<p>\r\n<p>The CSTM<sup>®</sup> Certification was developed based on the Test Management Body of Knowledge (TMBOK) to fill the gap in the management skills required by test managers and test leads to effectively manage the test process, the test project and the test organization. </p>\r\n', '<p><b>What Modules are covered in this E-Course?</p></b>\r\n<p> Test Organization</p>\r\n<p> Test Organization And Independence</p>\r\n <p>Tasks Of The Test Leader And Tester</p>\r\n<p> Test Planning And Estimation</p>\r\n<p> Test Planning</p>\r\n<p> Test Planning Activities</p>\r\n<p> Exit Criteria</p>\r\n<p> Test Estimation</p>\r\n<p> Test Approaches (Test Strategies)</p>\r\n<p> Test Progress Monitoring And Control</p>\r\n<p> Test Progress Monitoring</p>\r\n<p> Test Reporting</p>\r\n<p> Test Control</p>\r\n<p> Configuration Management</p>\r\n<p> Risk And Testing</p>\r\n<p> Project Risks</p>\r\n<p> Product Risks</p>\r\n<p> Incident Management</p>\r\n<p> Testing Tools</p>\r\n<p> Management Understanding</p>\r\n<p> Independent Testing</p>\r\n<p> Testing in Project Management</p>\r\n<p> People issues in Testing</p>\r\n<p> Testing Tools</p>\r\n<p> Managing Expectations</p>\r\n<p> Areas of Recommendations</p>\r\n', '', '', '', '300', '2014-12-12 05:49:06', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('105', 'Business Process Manager (BPM) - Premium Package', '2', '(BPM)', '(BPM)BPM Premium Pack.jpg', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes two E-Voucher(s) for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>15 Hours</p>\r\n', '<p>Business process management helps organizations leverage processes to achieve their goals and be successful. Once processes are implemented, they must be monitored, evaluated, and optimized to make sure they are still meeting the goals that they were designed to accomplish. A business that can successfully manage its processes is able to maintain a competitive edge, while increasing productivity and efficiency and decreasing costs. </p>\r\n\r\n<p>The E-Course from GAQMBok (Body of Knowledge) will introduce you to business process management. You’ll learn how business processes can help you improve your company’s bottom line by providing a higher level of quality and consistency for your customers.</p>\r\n', '<b>What Topics are Covered in the E-Course?</b>\r\n\r\n<p>1) The fundamentals of business process management</p>\r\n<p>2) Defining business process management</p>\r\n<p>3) Reflecting on processes</p>\r\n<p>4) The business process life cycle</p>\r\n<p>5) The vision phase</p>\r\n<p>6) The design phase (including process mapping)</p>\r\n<p>7) The modeling phase</p>\r\n<p>8) The execution phase</p>\r\n<p>9) The monitoring phase (including an introduction to the balanced scorecard and business activity monitoring)</p>\r\n<p>10) The optimizing phase(including an introduction to Lean and Six Sigma methods)</p>\r\n', '<b>What will you learn from this E-Course?</b>\r\n\r\n<p>1) Define business process management and related concepts</p>\r\n<p>2) Recognize the vital role processes play in a business</p>\r\n<p>3) Appreciate the role of technology in process management</p>\r\n<p>4) Develop a vision to guide process improvement</p>\r\n<p>5) Understand how to design or enhance an existing process using the business process life cycle </p>\r\n<p>6) Construct a process map </p>\r\n<p>7) Perform a what-if analysis to improve your processes</p>\r\n<p>8) Implement and monitor process changes</p>\r\n<p>9) Identify how Lean and Six Sigma methods can assist in managing and improving processes</p>\r\n<p>10) Use a variety of tools and techniques to eliminate waste and redundancies</p>\r\n', '<span style=\"color:red\">Note: The Business Process Manager (BPM) Certification requires a mandatory E-Course completion requirement. Once the candidate completes the E-Course, they will receive a GAQM Learner ID. This ID is required at the time of scheduling an exam at a Pearson Vue Testing Center. For more information, you can send an E-mail to support@gaqm.org</span>', '', '210', '2014-12-12 06:00:07', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('106', 'Certified Lean Six Sigma Green Belt (CLSSGB) - Premium Package', '4', 'LSSGB', 'LSSGBCLSSGB Premium Box.jpg', 'Premium', '40', '<b>Highlights of the Package</b>\r\n\r\n<p>1) E-Courseware is written by Six Sigma Champion\'s</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes Two (2) E-Vouchers for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>\r\n', '<p>Lean Six Sigma Green Belts are valuable assets to any team. Our Certified Lean Six Sigma Green Belt (CLSSGB)™ E-Learning will introduce you to the Lean Six Sigma philosophy and terminology and give’s you the knowledge you need to prepare for Certified Lean Six Sigma Green Belt (CLSSGB)™ Exam.  </p>\r\n\r\n<p>With this E-Course-ware you will gain a strong foundation in Lean Six Sigma and the skills needed to lead Lean Six Sigma process improvement projects, work on teams led by Lean Six Sigma Black Belts and help your organization implement Lean Six Sigma effectively.</p>\r\n\r\n<p>This E-Course will also give you the foundation to begin implementing Lean process improvement tools in your workplace. The first day will explore the foundations of Lean through the Toyota precepts and the five critical improvement concepts (value, waste, variation, complexity, and continuous improvement). The second day will give participants tools to perform continuous improvement in their organization, including 5S, 5W-2H, PDSA, DMAIC, Kaizen, Genchi Genbutsu, and various Lean data mapping methods.</p>\r\n', '<b>What Topics are Covered in this E-Course?</b>\r\n \r\n<p>1) Overview: Six Sigma and the Organization</p>\r\n\r\n<p>2) Six sigma and Organizational Goals</p>\r\n\r\n<p>3) Lean Principles in the organization</p>\r\n\r\n<p>4) Design for Six Sigma (DFSS) in the organization</p>\r\n\r\n<p>5) Introduction to the Define Phase</p>\r\n\r\n<p>6) Project Management Basics</p>\r\n\r\n<p>7) Other Tools and Techniques</p>\r\n\r\n<p>8) Process Analysis and Documentation</p>\r\n\r\n<p>9) Collecting and Summarizing Data</p>\r\n\r\n<p>10) Multi-vari Studies </p>\r\n\r\n<p>11) Simple linear correlation and regression</p>\r\n\r\n<p>12) Introduction to Improve and Control Phase</p>\r\n\r\n<p>13) Design of Experiments</p>\r\n\r\n<p>14) Statistical Process Control (SPC)</p>\r\n\r\n<p>15) Implement and Validate Solution</p>\r\n\r\n<p>16) Control Plan</p>\r\n\r\n<p>17) Understanding Lean </p>\r\n \r\n<p>18) The Toyota Production System </p>\r\n \r\n<p>19) The Toyota Production System House</p>\r\n \r\n<p>20) The Five Critical Improvement Concepts</p>\r\n \r\n<p>21) Understanding Value with the Kano Model</p>\r\n \r\n<p>22) Types of Waste</p>\r\n \r\n<p>23) Creating a Lean Enterprise</p>\r\n \r\n<p>24) Understanding Lean </p>\r\n \r\n<p>25) The Plan, Do, Study, Act (PDSA) Cycle</p>\r\n \r\n<p>26) Using the R-DMAIC-S Model</p>\r\n \r\n<p>27) Lean Thinking Tools</p>\r\n \r\n<p>28) Kaizen Events</p>\r\n \r\n<p>29) Data Gathering and Mapping</p>\r\n', '', '', '', '300', '2014-12-12 07:40:00', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('107', 'Certified Agile Tester (CAT) – Foundation - Standard Package', '6', '(CATF-001)', '(CATF-001)CATF-Std.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) Doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course Duration</p></b>\r\n<p>20 Hours</p>\r\n\r\n', '<p>Testing is a fundamental part of any successful project. Agile is flexible and adaptive with frequent feedback loops, far different from the traditional regimented methodologies.</p>\r\n\r\n<p>The Agile Testing Foundation certification extends the broad understanding of testing acquired at Foundation Level and covers those topics which are considered to be essential knowledge for a test professional working on agile projects.</p>\r\n\r\n<p>The Agile Testing Foundation Certification is suitable for those who are, or expect to be, working on agile projects and is also appropriate for anyone who wants a deeper understanding of agile development that specifically contains coverage of the options for including software testing as an integrated part of the agile development approach. This includes Scrum Masters, project managers, release managers, quality managers, software development managers, business analysts and management consultants.</p>', '<p><b>What is covered in the E-Course?</p></b>\r\n<p><b>Module 1 – Agile Fundamentals</p></b>\r\n\r\n    <p>1.1. Process Categories\r\n    <p>1.2. Agile history, manifesto & principles</p>\r\n    <p>1.3. Learn different Agile models</p>\r\n    <p>1.4. Exercise / Game on Scrum/Agile</p>\r\n    <p>1.5. Understand how testing would be different in an Agile model</p>\r\n\r\n<p><b>Module 2 – Testing Fundamentals</p></b>\r\n\r\n    <p>2.1. Testing fundamentals</p>\r\n    <p>2.2. Testing process</p>\r\n    <p>2.3. Test types and levels</p>\r\n\r\n<p><b>Module 3 – Practical Test Design Techniques</p></b>\r\n\r\n    <p>3.1. Understand Shift Left Concept and its application in Agile projects</p>\r\n    <p>3.2. Practical Dynamic Test Design Technique</p>\r\n\r\n<p><b>Module 4 – Basic Agile Testing</p></b>\r\n\r\n    <p>4.1. Test planning and Test Reporting</p>\r\n    <p>4.2. Test execution</p>\r\n    <p>4.3. Test First</p>\r\n', '', '', '', '100', '2015-01-02 09:48:55', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('108', 'Certified Agile Tester (CAT) – Foundation - Premium Package', '6', 'CATF-001', 'CATF-001CATF-Prem.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes an Online Certification Exam</p>\r\n<p>4) The exam can be taken anywhere (Non-Proctored)</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>20 Hours</p>\r\n', '<p>Testing is a fundamental part of any successful project. Agile is flexible and adaptive with frequent feedback loops, far different from the traditional regimented methodologies.</p>\r\n\r\n<p>The Agile Testing Foundation certification extends the broad understanding of testing acquired at Foundation Level and covers those topics which are considered to be essential knowledge for a test professional working on agile projects.</p>\r\n\r\n<p>The Agile Testing Foundation Certification is suitable for those who are, or expect to be, working on agile projects and is also appropriate for anyone who wants a deeper understanding of agile development that specifically contains coverage of the options for including software testing as an integrated part of the agile development approach. This includes Scrum Masters, project managers, release managers, quality managers, software development managers, business analysts and management consultants.</p>\r\n', '<p><b>What is covered in the E-Course?</p></b>\r\n<p><b>Module 1 – Agile Fundamentals</p></b>\r\n\r\n    <p>1.1. Process Categories\r\n    <p>1.2. Agile history, manifesto & principles</p>\r\n    <p>1.3. Learn different Agile models</p>\r\n    <p>1.4. Exercise / Game on Scrum/Agile</p>\r\n    <p>1.5. Understand how testing would be different in an Agile model</p>\r\n\r\n<p><b>Module 2 – Testing Fundamentals</p></b>\r\n\r\n    <p>2.1. Testing fundamentals</p>\r\n    <p>2.2. Testing process</p>\r\n    <p>2.3. Test types and levels</p>\r\n\r\n<p><b>Module 3 – Practical Test Design Techniques</p></b>\r\n\r\n    <p>3.1. Understand Shift Left Concept and its application in Agile projects</p>\r\n    <p>3.2. Practical Dynamic Test Design Technique</p>\r\n\r\n<p><b>Module 4 – Basic Agile Testing</p></b>\r\n\r\n    <p>4.1. Test planning and Test Reporting</p>\r\n    <p>4.2. Test execution</p>\r\n    <p>4.3. Test First</p>\r\n', '', '', '', '200', '2015-01-02 09:39:24', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('109', 'Certified Sports Manager (CSM) - Standard Package', '2', '(CSM-002)', '(CSM-002)CSM-002-Std.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) E-Course-ware (Flip Book)</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) Doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course-ware Duration</b></p>\r\n<p>45 Hours</p>\r\n', '<p>Sport and its associated industries of recreation and fitness have entered a period of rapid growth. The recent Skills Audit conducted by the Tourism, Hospitality and Sport Sector Education and Training Authority in 2007, highlights the need for capacity building in sport to promote competence in managing sport organisations, tournaments and events, sport teams and sport facilities. The bridging of the current skills gap will have a positive impact on the management of sport organisations and sport teams as well as the growth of sport at all levels across the globe. </p> \r\n\r\n<p>In addition, the sport marketing industry represents a multi-million dollar industry and the current ten TV channels dedicated to sport are evident of its reach and public demand in terms of access. Managerial competencies are acquired in a variety of contexts, ranging from private fitness facilities and sport clubs to local government initiatives in sport and recreation and on to the marketing and promotional world of sport sponsorships, media, athlete representation as well as sport tourism. </p>\r\n<p>Increased pressure to deliver efficient and effective management of sport entities, athletes, facilities and events comes from participants, federations, spectators and the media as well as athletes with special needs. </p>\r\n<p>The industry specific technical skills required within the operational sport and related environments require specific contextualisation within the operational environment in particular for the areas for which specialization streams were designed within the qualification. </p>\r\n<p>The Certified Sports Manager (CSM)® is aimed at developing specific competencies in a range of self-organisational and life-long learning skills with an in depth knowledge of sport requirements and technical know-how applicable to a sport specific context. </p>\r\n<p>The Certified Sports Manager (CSM)® will enable the assuming of job responsibilities as a sport manager in schools, clubs and private institutions in a range of areas, which includes, but is not limited to sport team management, federation management or facility management. </p>\r\n', '<p><b>What Modules are covered in this E-Course-Ware?</p></b>\r\n<p>Module 1 - Sports Business Administration</p>\r\n<p>Module 2 - Communication, Customer Care and Self-development </p>\r\n<p>Module 3 - Fitness Participation and Disabilities</p>\r\n<p>Module 4 - Marketing, volunteer management and tournament planning</p>\r\n<p>Module 5 - Governance, Structures and Ethical Behavior in Sport </p>\r\n', '', '', '', '100', '2015-01-05 09:18:33', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('110', 'Certified Sports Manager (CSM) - Premium Package', '2', 'CSM002', 'CSM002CSM-002-Prem.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) E-Course-ware (Flip Book)</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes One (1) E-Voucher for Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.\r\n\r\n<p><b>E-Course-ware Duration</b></p>\r\n<p>45 Hours</p>\r\n', '<p>Sport and its associated industries of recreation and fitness have entered a period of rapid growth. The recent Skills Audit conducted by the Tourism, Hospitality and Sport Sector Education and Training Authority in 2007, highlights the need for capacity building in sport to promote competence in managing sport organisations, tournaments and events, sport teams and sport facilities. The bridging of the current skills gap will have a positive impact on the management of sport organisations and sport teams as well as the growth of sport at all levels across the globe. </p> \r\n\r\n<p>In addition, the sport marketing industry represents a multi-million dollar industry and the current ten TV channels dedicated to sport are evident of its reach and public demand in terms of access. Managerial competencies are acquired in a variety of contexts, ranging from private fitness facilities and sport clubs to local government initiatives in sport and recreation and on to the marketing and promotional world of sport sponsorships, media, athlete representation as well as sport tourism. </p>\r\n<p>Increased pressure to deliver efficient and effective management of sport entities, athletes, facilities and events comes from participants, federations, spectators and the media as well as athletes with special needs. </p>\r\n<p>The industry specific technical skills required within the operational sport and related environments require specific contextualisation within the operational environment in particular for the areas for which specialization streams were designed within the qualification. </p>\r\n<p>The Certified Sports Manager (CSM)® is aimed at developing specific competencies in a range of self-organisational and life-long learning skills with an in depth knowledge of sport requirements and technical know-how applicable to a sport specific context. </p>\r\n<p>The Certified Sports Manager (CSM)® will enable the assuming of job responsibilities as a sport manager in schools, clubs and private institutions in a range of areas, which includes, but is not limited to sport team management, federation management or facility management. </p>\r\n', '<p><b>What Modules are covered in this E-Course-Ware?</p></b>\r\n<p>Module 1 - Sports Business Administration</p>\r\n<p>Module 2 - Communication, Customer Care and Self-development </p>\r\n<p>Module 3 - Fitness Participation and Disabilities</p>\r\n<p>Module 4 - Marketing, volunteer management and tournament planning</p>\r\n<p>Module 5 - Governance, Structures and Ethical Behavior in Sport </p>\r\n', '', '', '', '220', '2015-01-05 09:18:56', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('111', 'Certified General Manager (CGM) - Standard Package', '2', '(CGM-001)', '(CGM-001)CGM-Std-Pack.png', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) E-Course-ware (Flip Book) </p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) Doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course-ware Duration</b></p>\r\n<p>50 Hours</p>\r\n\r\n', '<p>General Management studies help in understanding the managerial, functional and operational demands of commercial organizations to trigger production effectively and efficiently. This subject extensively covers several topics on marketing, investment, functional administration, human resource, sales, advertising etc. Imbibing the core tenets of this module will enable transformation into an effective business manager to understand the nuances of optimizing capital growth.</p>\r\n\r\n<p>General Management and further develops the key concepts, principles and practices of management that will enable learners to lead, manage, organise and control first line managers and team leaders. </p>\r\n\r\n<p>The learners will typically be managers who have other junior managers or team leaders reporting to them. In smaller organisations or entities, the managers could primarily be responsible for managing the supervisors and staff within their section, division or business unit. </p>\r\n\r\n<p>The scope of generic management covers five domains: leadership, managing the environment, managing relations, managing knowledge and the practice of management. This Certification addresses each of these domains with generic competencies, so that it allows learning programmes to be contextualised for specific sectors and industries. </p>\r\n\r\n<p>Certified General Manager (CGM) Certification provides opportunities for learners to transfer between various specialisations within management. This leads to the strengthening of management competencies and will enable managers at this level to manage successfully systems, processes, resources, managers and teams in their various occupations and contexts. </p>\r\n\r\n<p>This qualification is further intended to empower learners to acquire the knowledge, skills, attitudes and values required to operate confidently as individuals in international communities and to respond to the challenging economic environment and constantly changing world of work. </p>\r\n\r\n<p>Ultimately, this qualification is aimed at improving the effectiveness and leadership abilities of middle managers in various occupations globally, in private and public business entities as well as non-governmental organisations. For this reason, the word \'entity\' includes a company, business unit, public institution, small business or non-profit organisation. </p>\r\n', '<p><b>What Modules are covered in this E-Course-Ware?</p></b>\r\n<p>Module 1 - People Management </p>\r\n<p>Module 2 - Workplace Management</p>\r\n<p>Module 3 - Decision Making</p>\r\n<p>Module 4 - Unit Management </p>\r\n<p>Module 5 - Strategic Management</p>', '', '', '', '100', '2015-01-05 09:03:46', '1', '1', '0');
