rtunities for learners to transfer between various specialisations within management. This leads to the strengthening of management competencies and will enable managers at this level to manage successfully systems, processes, resources, managers and teams in their various occupations and contexts. </p>\r\n\r\n<p>This qualification is further intended to empower learners to acquire the knowledge, skills, attitudes and values required to operate confidently as individuals in international communities and to respond to the challenging economic environment and constantly changing world of work. </p>\r\n\r\n<p>Ultimately, this qualification is aimed at improving the effectiveness and leadership abilities of middle managers in various occupations globally, in private and public business entities as well as non-governmental organisations. For this reason, the word \'entity\' includes a company, business unit, public institution, small business or non-profit organisation. </p>\r\n', '<p><b>What Modules are covered in this E-Course-Ware?</p></b>\r\n<p>Module 1 - People Management </p>\r\n<p>Module 2 - Workplace Management</p>\r\n<p>Module 3 - Decision Making</p>\r\n<p>Module 4 - Unit Management </p>\r\n<p>Module 5 - Strategic Management</p>\r\n', '', '', '', '220', '2015-01-05 09:19:25', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('113', 'Certified Data Centre Specialist (CDCS) - Standard Package', '2', '(CDCS-001)', '(CDCS-001)CDCS---Standard.png', 'Standard', '20', '<p><b>Highlights of the Package.</b></p>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) This package doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>15 Hours</p>\r\n', '<p>The Certified Data Centre Specialist (CDCS)™ exam is the next step after the Certified Data Centre Professional exam.</p>\r\n\r\n<p>Frequent or rapid changes in business dynamics require enterprises to be increasingly agile. The Certified Data Specialist (CDCS) Certification enables candidates to coupe enterprise need scalable space, power, network capabilities and reliable security to efficiently manage growth and control expenses. </p>\r\n\r\n<p>The participant needs to be aware of Advanced Data Center topics such as Selecting the Power, Space and Network Connectivity Right for the organization, DC power and redundant cooling systems, Concurrently maintaining power and cooling systems (N+1 AC power, N+1 cooling), Site Monitoring, Biometric Authentication, Key Cards, On-site guards, Enhanced Security, enterprise-ready high-density cabinets apart from this the candidate has to be proficient in Data Centre Networking like Reducing Latency, Backbone Technologies, Global cloud and virtualization services, IT convergence etc.</p>\r\n\r\n<p>CDCS will further increase attendees to a level being a compatible sparring partner with suppliers and they will be able to verify offers provided by vendors for correctness, effectiveness and efficiency.</p>\r\n', '<p><b>What Modules are covered in this E-course?<p></b>\r\n<p>Module 1 – Fundamentals of Security</p>\r\n<p>Module 2 – Fundamentals of Power</p>\r\n<p>Module 3 – Generator Management</p>\r\n<p>Module 4 – Cooling Layouts for Data Center</p>\r\n', '', '', '', '100', '2015-01-20 09:31:44', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('114', 'Certified Data Centre Specialist (CDCS) - Premium Package', '2', 'CDCS-001', 'CDCS-001CDCS---Prem.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes an Online Certification Exam</p>\r\n<p>4) The exam can be taken anywhere (Non-Proctored)</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>15 Hours</p>\r\n', '<p>The Certified Data Centre Specialist (CDCS)™ exam is the next step after the Certified Data Centre Professional exam.</p>\r\n\r\n<p>Frequent or rapid changes in business dynamics require enterprises to be increasingly agile. The Certified Data Specialist (CDCS) Certification enables candidates to coupe enterprise needs scalable space, power, network capabilities and reliable security to efficiently manage growth and control expenses. </p>\r\n\r\n<p>The participant needs to be aware of Advanced Data Center topics such as Selecting the Power, Space and Network Connectivity Right for the organization, DC power and redundant cooling systems, Concurrently maintaining power and cooling systems (N+1 AC power, N+1 cooling), Site Monitoring, Biometric Authentication, Key Cards, On-site guards, Enhanced Security, enterprise-ready high-density cabinets apart from this the candidate has to be proficient in Data Centre Networking like Reducing Latency, Backbone Technologies, Global cloud and virtualization services, IT convergence etc.</p>\r\n\r\n<p>CDCS will further increase attendees to a level being a compatible sparring partner with suppliers and they will be able to verify offers provided by vendors for correctness, effectiveness and efficiency.</p>\r\n', '<p><b>What Modules are covered in this E-Course</p></b>\r\n<p>Module 1 – Fundamentals of Security</p>\r\n<p>Module 2 – Fundamentals of Power</p>\r\n<p>Module 3 – Generator Management</p>\r\n<p>Module 4 – Cooling Layouts for Data Center</p>', '', '', '', '200', '2015-01-21 10:03:28', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('115', 'Certified Data Centre Expert (CDCE) - Standard Package', '2', 'CDCE-001', 'CDCE-001CDCE---Std.png', 'Standard', '20', '<p><b>Highlights of the Package.</b></p>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) Doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>20 Hours</p>', '<p>With few exceptions, enterprises today rely on IT for the delivery of business or mission critical services – often directly to the end consumer. It is vitally important therefore, that a mission critical Data Centre be designed, maintained, and operated with guaranteed high-availability and efficiency in mind. Fact is however, that most Data Centre do not meet the full availability, capacity, safety or efficiency requirements demanded by the enterprise.</p>\r\n\r\n<p>The candidates who are appearing for this exam should be a Data Centre Owner/Investor, Data Centre Facilities and/or Operations Manager, IT professional working in and around the Data Centre, having oversight accountability or responsibility for achieving and improving high availability and manageability of the Data Centre and will be involved in the design/build, renovation or relocation of a mission critical Data Centre.</p>', '<p><b>Module 1 - Power Redundancy in a Data Center</p></b>\r\n<p>1.1 Introduction</p>\r\n<p>1.2 UPS</p>\r\n<p>1.3 Types of UPS</p>\r\n<p>1.4 Standby UPS</p>\r\n<p>1.5 Line Interactive UPS</p>\r\n<p>1.6 Standby-Ferro UPS</p>\r\n<p>1.7 Double Conversion On-Line UPS</p>\r\n<p>1.8 Delta Conversion On-Line</p>\r\n<p>1.9 UPS System Design Configuration</p>\r\n<p>1.10 The Concept of \"N\"</p>\r\n<p>1.11 Types of Redundancies</p>\r\n<p>1.12 UPS Rightsizing</p>\r\n<p>1.13 Power Environments</p>\r\n<p>1.14 Standby Generators</p>\r\n\r\n<p><b>Module 2 - Power Distribution 1</p></b>\r\n<p>2.1 Introduction</p>\r\n<p>2.2 Power Transmission Overview</p>\r\n<p>2.3 Nominal Vs Normal Voltage</p>\r\n<p>2.4 Transformers</p>\r\n<p>2.5 Type of Transformers</p>\r\n<p>2.6 Service Entrance</p>\r\n<p>2.7 Main Electrical Service Panel</p>\r\n<p>2.8 Facility Transformers</p>\r\n<p>2.9 Sub-Panels</p>\r\n<p>2.10 Feeders</p>\r\n<p>2.11 Branch Circuits</p>\r\n<p>2.12 Receptacles</p>\r\n\r\n<p><b>Module 3 - Physical Infrastructure Management</p></b>\r\n<p>3.1 What is Management?</p>\r\n<p>3.2 Physical Infrastructure Management Challenges</p>\r\n<p>3.3 Incident Management</p>\r\n<p>3.4 Availability Management</p>\r\n<p>3.5 Capacity Management</p>\r\n<p>3.6 Physical Infrastructure Management Strategy</p>\r\n<p>3.7 Management Focus</p>\r\n<p>3.8 Physical Infrastructure Management Standards</p>\r\n<p>3.9 Management Approaches</p>\r\n<p>3.10 Element Managers</p>\r\n<p>3.11 Enterprise Management System</p>\r\n<p>3.12 Building Management System</p>\r\n<p>3.13 Integrating Physical Infrastructure Management</p>\r\n<p>3.14 Physical Infrastructure Element Manager</p>\r\n\r\n<p><b>Module 4 - Rack Fundamentals</p></b>\r\n<p>4.1 Introduction</p>\r\n<p>4.2 The 19 Inch Standard</p>\r\n<p>4.3 Earthquake Standards</p>\r\n<p>4.4 Open Frame Rack</p>\r\n<p>4.5 Advantages and Disadvantages of Open Frames</p>\r\n<p>4.6 Server Enclosure</p>\r\n<p>4.7 Networking Enclosure</p>\r\n<p>4.8 Seismic Enclosure</p>\r\n<p>4.9 Wall Mount Enclosure</p>\r\n<p>4.10 Industry Survey Results</p>\r\n<p>4.11 Life-cycle Costs</p>\r\n<p>4.12 Availability</p>\r\n<p>4.13 Improving Airflow: Door Ventilation</p>\r\n<p>4.14 Improving Airflow: Blanking Panels</p>\r\n<p>4.15 Improving Airflow: ADU</p>\r\n<p>4.16 Improving Airflow: SADU</p>\r\n<p>4.17 Improving Airflow: ARU</p>\r\n<p>4.18 Maintenance and Serviceability</p>\r\n<p>4.19 Adaptability and Scalability</p>\r\n<P>4.20 Manageability</p>\r\n<p>4.21 Floor Plan</p>\r\n<p><b>Module 5 - Cooling System</p></b>\r\n<p>5.1 Introduction<p>\r\n<p>5.2 Rack based Cooling</p>\r\n<p>5.3 Room based Cooling </p>\r\n<p>5.4 Row based Cooling</p>\r\n<p>5.5 Hybrid Cooling</p>\r\n\r\n\r\n\r\n\r\n', '', '', '', '85', '2015-03-03 05:53:08', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('116', 'Certified Master Agile Tester (CMAT) - Standard Package', '6', '(CMAT-010)', '(CMAT-010)CMAT---Std.png', 'Standard', '20', '<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) Doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>The Certified Agile Master introduces core agile philosophies such as servant leadership, adaptive planning, frequent feedback for learning, and a focus on value-driven versus plan-driven delivery. Courses compare and contrast agile management with traditional management approaches and give participants principles and tools to apply in their teams and organizations. Learning objectives focus on delivering agile projects as well as applying agile management principles beyond projects to broader organizational contexts. As agile leaders progress in organizations, they set the vision and overall goals, then empower their people to lead teams and achieve exceptional results.</p>\r\n\r\n<p>The CMAT certification training program is to accelerate your career in the Agile testing in an advanced environment. Designed as a very interactive course, delegates have the opportunity to discuss and share their experiences with others and to extend their knowledge of testing in agile projects. Practical exercises based on a complete agile life cycle are used to help delegates to put learning and their knowledge in to practice throughout the course.</p>', '<p> <b>What Modules are covered in this E-Course? </p> </b>\r\n<p>Module 1 – Agile Fundamentals</p>\r\n<p>Module 2 – Agile Testing</p>\r\n<p>Module 3 – User Stories and Role of Agile Testers</p>\r\n<p>Module 4 – Agile Testing Iteration Zero</p>\r\n<p>Module 5 – Optimized Test Design and Test execution</p>\r\n<p>Module 6 – Agile testing – Practice Iteration 1</p>\r\n<p>Module 7 – Test Automation and Regression Testing</p>\r\n<p>Module 8 – Agile Testing – Practice Iteration 2</p>\r\n<p>Module 9 – Agile testing – Other Facets</p>\r\n<p>Sample Exam</p>\r\n', '', '', '', '150', '2015-03-26 12:02:19', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('117', 'Certified Master Agile Tester (CMAT) - Premium Package', '6', 'CMAT-010', 'CMAT-010CMAT-Prem.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes one (1) E-Voucher for Certification Exam</p>\r\n<p>4) The Exam Voucher can be used at any Pearson VUE test center worldwide.</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>\r\n', '<p>The Certified Agile Master introduces core agile philosophies such as servant leadership, adaptive planning, frequent feedback for learning, and a focus on value-driven versus plan-driven delivery. Courses compare and contrast agile management with traditional management approaches and give participants principles and tools to apply in their teams and organizations. Learning objectives focus on delivering agile projects as well as applying agile management principles beyond projects to broader organizational contexts. As agile leaders progress in organizations, they set the vision and overall goals, then empower their people to lead teams and achieve exceptional results.</p>\r\n\r\n<p>The CMAT certification training program is to accelerate your career in the Agile testing in an advanced environment. Designed as a very interactive course, delegates have the opportunity to discuss and share their experiences with others and to extend their knowledge of testing in agile projects. Practical exercises based on a complete agile life cycle are used to help delegates to put learning and their knowledge in to practice throughout the course.</p>\r\n', '<p> <b>What Modules are covered in this E-Course? </p> </b>\r\n<p>Module 1 – Agile Fundamentals</p>\r\n<p>Module 2 – Agile Testing</p>\r\n<p>Module 3 – User Stories and Role of Agile Testers</p>\r\n<p>Module 4 – Agile Testing Iteration Zero</p>\r\n<p>Module 5 – Optimized Test Design and Test execution</p>\r\n<p>Module 6 – Agile testing – Practice Iteration 1</p>\r\n<p>Module 7 – Test Automation and Regression Testing</p>\r\n<p>Module 9 – Agile Testing – Practice Iteration 2</p>\r\n<p>Sample Exam</p>\r\n', '', '', '', '300', '2015-03-26 12:02:38', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('118', 'Certified Data Centre Expert (CDCE) - Premium Package', '2', '(CDCE-001)', '(CDCE-001)CDCE-Prem.png', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes an Online Certification Exam</p>\r\n<p>4) The exam can be taken anywhere (Non-Proctored)</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>20 Hours</p>\r\n', '<p>With few exceptions, enterprises today rely on IT for the delivery of business or mission critical services – often directly to the end consumer. It is vitally important therefore, that a mission critical Data Centre be designed, maintained, and operated with guaranteed high-availability and efficiency in mind. Fact is however, that most Data Centre do not meet the full availability, capacity, safety or efficiency requirements demanded by the enterprise.</p>\r\n\r\n<p>The candidates who are appearing for this exam should be a Data Centre Owner/Investor, Data Centre Facilities and/or Operations Manager, IT professional working in and around the Data Centre, having oversight accountability or responsibility for achieving and improving high availability and manageability of the Data Centre and will be involved in the design/build, renovation or relocation of a mission critical Data Centre.</p>', '<p><b>Module 1 - Power Redundancy in a Data Center</p></b>\r\n<p>1.1 Introduction</p>\r\n<p>1.2 UPS</p>\r\n<p>1.3 Types of UPS</p>\r\n<p>1.4 Standby UPS</p>\r\n<p>1.5 Line Interactive UPS</p>\r\n<p>1.6 Standby-Ferro UPS</p>\r\n<p>1.7 Double Conversion On-Line UPS</p>\r\n<p>1.8 Delta Conversion On-Line</p>\r\n<p>1.9 UPS System Design Configuration</p>\r\n<p>1.10 The Concept of \"N\"</p>\r\n<p>1.11 Types of Redundancies</p>\r\n<p>1.12 UPS Rightsizing</p>\r\n<p>1.13 Power Environments</p>\r\n<p>1.14 Standby Generators</p>\r\n\r\n<p><b>Module 2 - Power Distribution 1</p></b>\r\n<p>2.1 Introduction</p>\r\n<p>2.2 Power Transmission Overview</p>\r\n<p>2.3 Nominal Vs Normal Voltage</p>\r\n<p>2.4 Transformers</p>\r\n<p>2.5 Type of Transformers</p>\r\n<p>2.6 Service Entrance</p>\r\n<p>2.7 Main Electrical Service Panel</p>\r\n<p>2.8 Facility Transformers</p>\r\n<p>2.9 Sub-Panels</p>\r\n<p>2.10 Feeders</p>\r\n<p>2.11 Branch Circuits</p>\r\n<p>2.12 Receptacles</p>\r\n\r\n<p><b>Module 3 - Physical Infrastructure Management</p></b>\r\n<p>3.1 What is Management?</p>\r\n<p>3.2 Physical Infrastructure Management Challenges</p>\r\n<p>3.3 Incident Management</p>\r\n<p>3.4 Availability Management</p>\r\n<p>3.5 Capacity Management</p>\r\n<p>3.6 Physical Infrastructure Management Strategy</p>\r\n<p>3.7 Management Focus</p>\r\n<p>3.8 Physical Infrastructure Management Standards</p>\r\n<p>3.9 Management Approaches</p>\r\n<p>3.10 Element Managers</p>\r\n<p>3.11 Enterprise Management System</p>\r\n<p>3.12 Building Management System</p>\r\n<p>3.13 Integrating Physical Infrastructure Management</p>\r\n<p>3.14 Physical Infrastructure Element Manager</p>\r\n\r\n<p><b>Module 4 - Rack Fundamentals</p></b>\r\n<p>4.1 Introduction</p>\r\n<p>4.2 The 19 Inch Standard</p>\r\n<p>4.3 Earthquake Standards</p>\r\n<p>4.4 Open Frame Rack</p>\r\n<p>4.5 Advantages and Disadvantages of Open Frames</p>\r\n<p>4.6 Server Enclosure</p>\r\n<p>4.7 Networking Enclosure</p>\r\n<p>4.8 Seismic Enclosure</p>\r\n<p>4.9 Wall Mount Enclosure</p>\r\n<p>4.10 Industry Survey Results</p>\r\n<p>4.11 Life-cycle Costs</p>\r\n<p>4.12 Availability</p>\r\n<p>4.13 Improving Airflow: Door Ventilation</p>\r\n<p>4.14 Improving Airflow: Blanking Panels</p>\r\n<p>4.15 Improving Airflow: ADU</p>\r\n<p>4.16 Improving Airflow: SADU</p>\r\n<p>4.17 Improving Airflow: ARU</p>\r\n<p>4.18 Maintenance and Serviceability</p>\r\n<p>4.19 Adaptability and Scalability</p>\r\n<P>4.20 Manageability</p>\r\n<p>4.21 Floor Plan</p>\r\n<p><b>Module 5 - Cooling System</p></b>\r\n<p>5.1 Introduction<p>\r\n<p>5.2 Rack based Cooling</p>\r\n<p>5.3 Room based Cooling </p>\r\n<p>5.4 Row based Cooling</p>\r\n<p>5.5 Hybrid Cooling</p>\r\n\r\n\r\n', '', '', '', '220', '2015-03-03 05:56:48', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('119', 'Certified Software Testing Analyst (CSTA) - Standard Package', '5', '(CSTA-001)', '(CSTA-001)CSTA-Std.jpg', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) Doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>\r\n', '<p>The CSTA Certification provides the participant with a solid understanding of, and practical experience in, Test case design. Participants’ knowledge of the quality and the objective of software testing, the system development and quality assurance lifecycles and functional testing is reinforced. </p>\r\n<p>The focus of the CSTA Certification is on Test Case design and Participants are provided with ample opportunity to gain a solid understanding of this. Participants are also provided with an opportunity to design a quality assurance. In the E-Course Participants are presented with various techniques of trawling for requirements in the absence of proper system documentation; this includes context diagrams, dataflow diagrams, workshop facilitation and interviewing subject matter experts.</p>\r\n<p>You’ll also learn how to apply testing strategy in real-world situations gaining competency in the techniques essential for test analysis and performing outcome-driven test activities.</p>\r\n<p>The Certified Software Testing Analyst (CSTA ) qualification is aimed at people who have achieved an advanced point of their careers in software testing.</p>\r\n', '<p> <b>What Modules are covered in this E-Course? </p> </b>\r\n<p>Module 1 - Testing Fundamentals and Process</p> \r\n<p>Module 2 - Test Management for the Test Analyst</p> \r\n<p>Module 3 - Testing Software Quality Characteristics (Part 1)</p> \r\n<p>Module 4 - Testing Software Quality Characteristics (Part 2)</p> \r\n<p>Module 5 - Review Preparation</p> \r\n<p>Module 6 - Defect Management</p> \r\n<p>Module 7 - Test Tools and Automation</p> \r\n<p>Module 8 - Software Inspection Process</p>\r\n<p>Module 9 - Usability Testing </p>\r\n<p>Module 10 - Additional Test Design Techniques</p>\r\n<p>Sample Exam</p> \r\n\r\n', '', '', '', '125', '2015-04-18 12:39:30', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('120', 'Certified Software Testing Analyst (CSTA) - Premium Package', '5', 'CSTA-001', 'CSTA-001CSTA-Prem.jpg', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) Doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>', '<p>The CSTA Certification provides the participant with a solid understanding of, and practical experience in, Test case design. Participants’ knowledge of the quality and the objective of software testing, the system development and quality assurance lifecycles and functional testing is reinforced. </p>\r\n<p>The focus of the CSTA Certification is on Test Case design and Participants are provided with ample opportunity to gain a solid understanding of this. Participants are also provided with an opportunity to design a quality assurance. In the E-Course Participants are presented with various techniques of trawling for requirements in the absence of proper system documentation; this includes context diagrams, dataflow diagrams, workshop facilitation and interviewing subject matter experts.</p>\r\n<p>You’ll also learn how to apply testing strategy in real-world situations gaining competency in the techniques essential for test analysis and performing outcome-driven test activities.</p>\r\n<p>The Certified Software Testing Analyst (CSTA ) qualification is aimed at people who have achieved an advanced point of their careers in software testing.</p>\r\n\r\n\r\n', '<p> <b>What Modules are covered in this E-Course? </p> </b>\r\n<p>Module 1 - Testing Fundamentals and Process</p> \r\n<p>Module 2 - Test Management for the Test Analyst</p> \r\n<p>Module 3 - Testing Software Quality Characteristics (Part 1)</p> \r\n<p>Module 4 - Testing Software Quality Characteristics (Part 2)</p> \r\n<p>Module 5 - Review Preparation</p> \r\n<p>Module 6 - Defect Management</p> \r\n<p>Module 7 - Test Tools and Automation</p> \r\n<p>Module 8 - Software Inspection Process</p>\r\n<p>Module 9 - Usability Testing </p>\r\n<p>Module 10 - Additional Test Design Techniques</p>\r\n<p>Sample Exam</p> \r\n', '', '', '', '250', '2015-04-18 12:39:45', '1', '1', '0');
INSERT INTO `pl_course` VALUES ('121', 'Certified Software Quality Analyst (CSQA) - Standard Package', '5', '(CSQA-001)', '(CSQA-001)CSQA-Std.jpg', 'Standard', '20', '<b>Highlights of the Package.</b>\r\n\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 20 days</p>\r\n<p>3) Doesn\'t includes E-Voucher for Certification Exam</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>\r\n', '<p>Software Quality Analyst (SQA), certification requires an understanding of bug database software and version control, as well as your familiarity with client and server architecture, to break things – break all the things – in testing, so that they aren’t broken when they make it into players’ hands.</p> \r\n\r\n<p>Software quality assurance is a means of monitoring the software engineering processes and methods used to ensure quality. The methods by which this is accomplished are many and varied, and may include ensuring conformance to one or more standards, such as ISO 9001, or a model such as CMMI or any other international best practices.</p>\r\n\r\n<p>Acquiring the designation of Certified Software Quality Analyst (CSQA) indicates a professional level of competence in the principles and practices of quality assurance in the IT profession. CSQA’s become members of a recognized professional group and receive recognition of their competence by business and professional associates, potentially more rapid career advancement, and greater acceptance in the role as advisor to management.</p>', '<b><p>What Modules are covered in this E-Course?</p></b>\r\n<p>Module 1 - Introduction to Software Testing</p>\r\n<p>Module 2 - Software Development Life Cycle </p>\r\n<p>Module 3 - SDLC Models</p>\r\n<p>Module 4 - Software Testing Methodologies</p>\r\n<p>Module 5 - Levels of Testing</p>\r\n<p>Module 6 - Types of Testing</p>\r\n<p>Module 7 - Software Testing Life Cycle</p>\r\n<p>Module 8 - Test Case Design Techniques</p>\r\n<p>Module 9 - Defect Management</p>\r\n<p>Module 10 - Sample Exam</p>\r\n', '', '', '', '125', '2015-05-08 12:24:21', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('122', 'Certified Software Quality Analyst (CSQA) - Premium Package', '5', 'CSQA-001', 'CSQA-001CSQQ-Prem.jpg', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes an Online Certification Exam</p>\r\n<p>4) The exam can be taken anywhere (Non-Proctored)</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>\r\n', '<p>Software Quality Analyst (SQA), certification requires an understanding of bug database software and version control, as well as your familiarity with client and server architecture, to break things – break all the things – in testing, so that they aren’t broken when they make it into players’ hands.</p> \r\n\r\n<p>Software quality assurance is a means of monitoring the software engineering processes and methods used to ensure quality. The methods by which this is accomplished are many and varied, and may include ensuring conformance to one or more standards, such as ISO 9001, or a model such as CMMI or any other international best practices.</p>\r\n\r\n<p>Acquiring the designation of Certified Software Quality Analyst (CSQA) indicates a professional level of competence in the principles and practices of quality assurance in the IT profession. CSQA’s become members of a recognized professional group and receive recognition of their competence by business and professional associates, potentially more rapid career advancement, and greater acceptance in the role as advisor to management.</p>\r\n', '<b><p>What Modules are covered in this E-Course?</p></b>\r\n<p>Module 1 - Introduction to Software Testing</p>\r\n<p>Module 2 - Software Development Life Cycle </p>\r\n<p>Module 3 - SDLC Models</p>\r\n<p>Module 4 - Software Testing Methodologies</p>\r\n<p>Module 5 - Levels of Testing</p>\r\n<p>Module 6 - Types of Testing</p>\r\n<p>Module 7 - Software Testing Life Cycle</p>\r\n<p>Module 8 - Test Case Design Techniques</p>\r\n<p>Module 9 - Defect Management</p>\r\n<p>Module 10 - Sample Exam</p>\r\n', '', '', '', '300', '2015-05-08 12:29:55', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('123', 'Certified Data Centre Facilities Operations Manager (CDCFOM)', '2', 'CDCFOM', 'CDCFOMCDFOM.jpg', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes examination fee</p>\r\n<p>4) The exam can be taken anywhere (Non-Proctored)</p>\r\n', '<p>The candidates who are appearing for this exam should have gained in-depth knowledge in managing data center operation which includes the following key subject matters such as; Capacity planning, latest Green initiatives, how to properly commission and de-commission equipment, Compliance to Safety Standards, Statutory Compliance and International Standards, Managing People, Vendor Management, handling Incident/Crisis Management as well the how to keep operations really simple, manageable, effective and efficient and much more.</p>\r\n<p>With few exceptions, enterprises today rely on IT for the delivery of business or mission critical services – often directly to the end consumer. It is vitally important therefore, that a mission critical Data Centre be designed, maintained, and operated with guaranteed high-availability and efficiency in mind. Fact is however, that most Data Centre do not meet the full availability, capacity, safety or efficiency requirements demanded by the enterprise.</p>\r\n\r\n<p>The candidates who are appearing for this exam should be a Data Centre Owner/Investor, Data Centre Facilities and/or Operations Manager, IT professional working in and around the Data Centre, having oversight accountability or responsibility for achieving and improving high availability and manageability of the Data Centre and will be involved in the design/build, renovation or relocation of a mission critical Data Centre.</p>\r\n', '<p><b>What Modules are covered in this E-Course?</p></b>\r\n<p>The Certified Data Centre Facilities Operations Manager (CDCFOM) includes all the modules from CDCP-001, CDCS-001 and CDCE-001 Certifications</p>', '', '', '', '400', '2015-05-13 15:16:18', '1', '1', '15');
INSERT INTO `pl_course` VALUES ('124', 'Certified Software Quality Manager (CSQM) - Premium Package', '5', '(CSQM-001)', '(CSQM-001)CSQM-Prem.jpg', 'Premium', '40', '<b>Highlights of the Package.</b>\r\n<p>1) Trainer\'s Voice Included</p>\r\n<p>2) Valid for 40 days</p>\r\n<p>3) The Package also includes an Online Certification Exam</p>\r\n<p>4) The exam can be taken anywhere (Non-Proctored)</p>\r\n<p>5) Hard Copy Certificate will be shipped to your mailing address if you achieve the qualifying score in the exam.</p>\r\n<p><b>E-Course Duration</b></p>\r\n<p>30 Hours</p>\r\n', '<p>The Certified Software Quality Manager (CSQM)® certification establishes a worldwide standard for the assessment of the capabilities and competencies of software quality assurance professionals that are working at, or soon will work at the software quality assurance management level.</p>\r\n\r\n<p>Acquiring the designation of Certified Software Quality Manager (CSQM)® indicates a level of professional competence in both the principles and practices of software quality assurance, demonstrating the skills and capabilities necessary to manage the software quality assurance function. CSQM® certification provides IT upper management a necessary tool to predict the likelihood of success of individuals applying for management level positions. The CSQM® certification provides the IT professional with an objective assessment of their management skills.</p>', '<b>What Modules are Covered in the E-Course?</b>\r\n<p>Module 1 - Managing Software Quality</p>\r\n<p>Module 2 - Skillset of Software Quality Manager</p>\r\n<p>Module 3 - Best Practices</p>\r\n<p>Module 4 - Software Quality Assurance</p>\r\n<p>Module 5 - Defect Management</p>\r\n<p>Module 6 - Configuration Management</p>\r\n<p>Module 7 - Risk Analysis</p>\r\n<p>Module 8 - Requirement Engineering and Management</p>\r\n<p>CSQM Sample Exam</p>', '', '', '', '300', '2015-06-16 13:03:09', '1', '1', '15');
