INSERT INTO `pl_coursecontent` VALUES ('2', 'MBA in Project Management', '<u><p><b>Overview of Master of Business Administration in Project Management </p></b></u>\r\n<p></p>\r\n<p></p>\r\n<p>Project managers supervise staff and allocate resources to ensure the correct and timely completion of work. Unlike departmental managers who oversee the same employees working on essentially the same tasks every day, project managers typically take charge of a diverse group for the duration of a particular project. Afterwards they move on to another project that will probably involve a different staff and different tasks, at least in part. </p>\r\n\r\n<p>Projects and project management has become the foundation for success in the public and private sectors. Enterprises achieve their goals through projects and effective project management. Successful project management requires achieving the scope (e.g., intended result), cost and schedule. In addition, the increasing complexity of work and demands for “more with less” place special demands on the project manager.</p>\r\n\r\n<p>The MBA in Project Management programs go beyond the “What is project management and practices” to providing practical “How To” guidance, tools and techniques, and processes to implement in today’s working world. The programme  help candidates to have pledged time, energy and effort to the project management profession. This overt evidence of a commitment to the profession can lead to opportunities in the corporate domain, increased responsibilities and a growth in earnings.</p>\r\n\r\n<p>The MBA in Project Management  programme also comprises of directing projects allowing experienced senior managers and executives to acquire new skills and advanced techniques in managing and controlling today’s complex project and management issues – from managing risks and quality to managing scope and budgets.</p>\r\n<p></p>\r\n<p></p>\r\n<u><b><p>MBA Degree Requirement </p></b></u>\r\n<p></p>\r\n<p> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<p></p>\r\n<u><b><p>Delivery Mode </u></b></p>\r\n<p>Self E-Learning </p>\r\n', '<u><p><b>What is the Learning Outcome of the MBA in Project Management E-Course?</b></p></u>\r\n<p></p>\r\n<p></p>\r\n<p>1) Understand what is meant by a project</p>\r\n<p>2) Identify benefits of projects</p>\r\n<p>3) Identify the phases of a project’s life cycle</p>\r\n<p> 4) Enhance your ability to sell ideas and make presentations</p>\r\n<p> 5) Prioritize projects</p>\r\n<p> 6) Begin conceptualizing your project, including goals and vision statements</p>\r\n<p> 7) Use a target chart and other planning tools</p>\r\n<p> 8) Complete a Statement of Work</p>\r\n<p> 9) Understand what is meant by a project.</p>\r\n<p> 10) Recognize what steps must be taken to complete projects on time and on budget.</p>\r\n<p> 11) Have a better ability to sell ideas and make presentations.</p>\r\n<p> 12) Know simple techniques and tools for planning and tracking your project.</p>\r\n<p> 13) Have methods for keeping the team focused and motivated.</p>\r\n<p> 14) Identify your project’s tasks and resources</p>\r\n<p> 15) Order tasks using the Work Breakdown Structure</p>\r\n<p> 16) Schedule tasks effectively</p>\r\n<p> 17) Use basic planning tools such as a Gantt chart, PERT diagram, and network</p>\r\n<p> 18) Prepare a project budget</p>\r\n<p> 19) Modify the project budget and schedule to meet targets</p>\r\n<p> 20) Identify and manage risks</p>\r\n<p> 21) Develop a change control process</p>\r\n<p> 22) Execute and terminate a project</p>\r\n<p> 23) Think critically when choosing a project team</p>\r\n<p> 24) Make the best of an assigned project team</p>\r\n<p> 25) Help teams move through various stages to become a high-functioning machine</p>\r\n<p> 26) Maximize productivity at team meetings</p>\r\n<p> 27) Reward and motivate your team</p>\r\n<p> 28) Develop and execute a communication plan</p>\r\n<p> 29) Communicate with sponsors and executives more effectively</p>\r\n<p> 30) Identify problem team members and strategies for working with them</p>\r\n<p> 31) Identify different types of teams.</p>\r\n<p> 32) Build teamwork by recognizing and tapping into the twelve characteristics of an effective team.</p>\r\n<p> 33) Promote trust and rapport by exploring your team player style and how it impacts on group dynamics.</p>\r\n<p> 34) Recognize the key elements that move a team from involvement to empowerment and how to give these elements to your team.</p>\r\n<p> 35) Develop strategies for dealing with team conflict and common situations.</p>\r\n<p> 36) Understand how action planning and analysis tools can help your team perform better.</p>\r\n<p> 37) The value of working as a team</p>\r\n<p> 38) How to develop team norms, ground rules, and team contracts</p>\r\n<p> 39) Their team player style and how it can be used effectively </p>\r\n<p> 40) Ways to build team trust</p>\r\n<p> 41) The stages of team development and how to help a team move through them</p>\r\n<p> 42) The critical role communication skills will play in building and maintaining a team atmosphere</p>\r\n<p> 43) Ways that team members can be involved and grow in a team setting</p>\r\n<p> 44) Define risk and risk management</p>\r\n<p> 45) Describe the COSO ERM cube and ISO 31000</p>\r\n<p> 46) Establish a risk management context</p>\r\n<p> 47) Describe the 7 R’s and 4 T’s that form the framework of risk management activities</p>\r\n<p> 48) Design and complete a basic risk assessment</p>\r\n<p> 49) Determine the appropriate response to risks and create a plan for those responses</p>\r\n<p> 50) Describe the key components of reporting, monitoring, and evaluation of a risk management program</p>\r\n<p> 51) Assign people to an appropriate crisis team role</p>\r\n<p> 52) Conduct a crisis audit</p>\r\n<p> 53) Establish the means for business continuity</p>\r\n<p> 54) Determine how to manage incidents</p>\r\n<p> 55) Help your team recover from a crisis</p>\r\n<p> 56) How to apply the process</p>\r\n<p> 57) Better organize yourself and your workspace for peak efficiency.</p>\r\n<p> 58) Understand the importance of, and the most useful techniques for, setting and achieving goals.</p>\r\n<p> 59) Identify the right things to be doing and develop plans for doing them.</p>\r\n<p> 60) Learn what to delegate and how to delegate well.</p>\r\n<p> 61) Take control of things that can derail your workplace productivity.</p>\r\n<p> 62) Learn ways to prioritize, plan, and manage your time.</p>\r\n<p> 63) Identify your primary leadership style and techniques for maximizing that style.</p>\r\n<p> 64) Develop more flexibility to use other leadership styles.</p>\r\n<p> 65) Search for ways to overcome communication barriers.</p>\r\n<p> 66) Determine ways you can meet the needs of employees and co-workers through communication and coaching.</p>\r\n<p> 67) Explore ways to engage in productive rather than toxic debate, and to make conflict a powerful force for creative, well-rounded solutions to problems.</p>\r\n<p> 68) Define self-leadership and what it means on an individual level</p>\r\n<p> 69) Assume responsibility for their results by understanding who they are, what they want, and how to reach they goals</p>\r\n<p> 70) Describe the four pillars of self-leadership</p>\r\n<p> 71) Use techniques related to adjusting to change, cultivating optimism, and developing good habits to build self-leadership</p>\r\n<p> 72) Identify common communication problems that may be holding you back</p>\r\n<p> 73) Develop skills to ask questions that give you information you need</p>\r\n<p> 74) Learn what your non-verbal messages are telling others</p>\r\n<p> 75) Develop skills in listening actively and empathetically to others</p>\r\n<p> 76) Enhance your ability to handle difficult situations</p>\r\n<p> 77) Deal with situations assertively</p>\r\n<p> 78) Define and create a Work Breakdown Structure</p>\r\n<p> 79) Identify and understand task relationships</p>\r\n<p> 80) Estimate task durations and determine project duration</p>\r\n<p> 81) Construct a network diagram</p>\r\n<p> 82) Calculate the critical path of a project</p>\r\n<p> 83) Use the Program Evaluation and Review Technique (PERT) to create estimates</p>\r\n<p> 84) Plan for risks</p>\r\n<p> 85) Create a communication plan</p>\r\n<p> 86) Effectively allocate project resources</p>\r\n<p> 87) Update and monitor the project schedule</p>\r\n<p> 88) Define knowledge and knowledge management.</p>\r\n<p> 89) Explain the difference between explicit and tacit knowledge.</p>\r\n<p> 90) Identify various knowledge management theoretical models.</p>\r\n<p> 91) Explain how a properly implemented knowledge management program can improve efficiency.</p>\r\n<p> 92) Describe the steps for employing a new knowledge management program in an organization.</p>\r\n<p> 93) Identify the required components for implementing a knowledge management framework within an organization.</p>\r\n<p> 94) Learn in-depth details of Lifecycle phases and process </p>\r\n<p> 95) Use techniques to best align organizational goals with projects and project manager competencies</p>\r\n<p> 96) Get the right information to the right people the right way</p>\r\n<p> 97) Lean how to better manage project scope</p>\r\n<p> 98) Establish valuable project cost management processes</p>\r\n<p> 99) The Leadership way to establish personal goals </p>\r\n<p> 100) Identify different aspects of culture</p>\r\n<p> 101) Identify the differences between culture & civilization </p>\r\n<p> 102) Recall ways in which culture manifests </p>\r\n<p> 103) Recognize different levels of culture </p>\r\n<p> 104) Identify various dimensions of culture </p>\r\n<p> 105) Identify what is culture and various cultural differences </p>\r\n<p> 106) Recognizing cultural competence </p>\r\n<p> 107) Identify culture competence from cultural awareness </p>\r\n<p> 108) Identifying ways to acquire cultural competence </p>\r\n<p> 109) Identifying ways to achieve cultural competence in an organization. </p>\r\n<p> 110) Identify different cultural barriers and ways to overcome them. </p>\r\n<p> 111) Identify things to keep in mind during cross-cultural communication</p>\r\n<p> 112) Identify ten tips for cross cultural communication </p>\r\n<p> 113) Recognize the ways to engage an interpreter </p>\r\n<p> 114) Recognize different negotiation methods </p>\r\n<p> 115) Recognize various elements of negotiation </p>\r\n<p> 116) Recognize cultural dimension of negotiation </p>\r\n<p> 117) Identify the cultural effects on Negotiation </p>\r\n<p> 118) Identify the ways to develop a negotiation strategy </p>\r\n<p> 119) Recognize what, when and why of culture shock </p>\r\n<p> 120) Identify the symptoms of culture shock </p>\r\n<p> 121) Recognize the various stages of culture shock </p>\r\n<p> 122) Identify various stages of adjustment stage with strategies to overcome the adjustment process </p>\r\n<p> 123) Identify cultural intelligence </p>\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n<p></p>\r\n<p></p>\r\n<p>Candidates must complete all the required courses i.e. PPM-001, CPD-001 and CCM (course only). Each course is valued 80, 25 and 15 credits respectively.</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p> Module 1 – Project Management Fundamentals    (Credits  4)</p>\r\n<p> Module 2 – Project Management Training    (Credits 7)</p>\r\n<p> Module 3 – Intermediate Project Management    (Credits 5)</p>\r\n<p> Module 4 – Effective Planning & Scheduling	    (Credits 6)</p>\r\n<p> Module 5 – Advanced Project Management    (Credits 5)</p>\r\n<p> Module 6 – Team Building    (Credits 6)</p>\r\n<p> Module 7 – Building Better Teams    (Credits 5)</p>\r\n<p> Module 8 – Risk Management	    (Credits 4)</p>\r\n<p> Module 9 – Crisis Management    (Credits 4)</p>\r\n<p> Module 10 – Time Management    (Credits 5)</p>\r\n<p> Module 11 – Leadership Skills     (Credits 8)</p>\r\n<p> Module 12 – Self-Leadership    (Credits 5)</p>\r\n<p> Module 13 – Communication Strategies    (Credits 8)</p>\r\n<p> Module 14 – Knowledge Management    (Credits 8)</p>\r\n<p> Module 15 – Directing Projects Introduction    (Credits 5)</p>\r\n<p> Module 16 – Aligning Goals, Projects and Competencies    (Credits 5)</p>\r\n<p> Module 17 – Organizing Multi-Project Communications     (Credits 5)</p>\r\n<p> Module 18 – Managing Risk Communications    (Credits 5)</p>\r\n<p> Module 19 – Tools for Managing Multiple Projects    (Credits 5)</p>\r\n<p> Module 20 – Leadership	    (Credits 5)</p>\r\n<p> Module 21 – Cross Culture Management    (Credits 15) </p>\r\n<p></p>\r\n<p></p>\r\n<p><b> Total Credits: 120</p></b>\r\n<br></br>\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n\r\n', '<u><p><b>Potential Career Options</b></p></u>\r\n<P></P>\r\n<P></P>\r\n<p>The MBA in Project Management degree is a popular area of study equally in business and information technology. Highest level positions are achieved by project supervisors who usually make starting at basic level facility. Both in campuses and online MBA in Project Management degree can show the way to careers like:</p>\r\n<p></p>\r\n<p></p>\r\n<p> 1) Industrial administrators</p>\r\n<p> 2) Construction executives</p>\r\n<p> 3) Project Analyst</p>\r\n<p> 4) Manufacturing</p>\r\n<p> 5) Project Managers</p>\r\n<p> 6) Operations management</p>\r\n<p> 7) Software development</p>\r\n<p> 8) Information management systems</p>\r\n<p> 9) General Manager</p>\r\n<p> 10) Regional Director</p>\r\n<p> 11) Business Analyst</p>\r\n<p> 12) Director of Sales</p>\r\n<p> 13) Project Sponsors </p>\r\n<p> 14) Project/Business Owners </p>\r\n<p> 15) Senior Stake Holders </p>\r\n<p> 16) Project Board Members </p>\r\n', 'MBA in Project Management', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '1900 USD       ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=MBAPM', '-', '-', '-', '-', 'MBA-Project-Management.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p></p>\r\n<p></p>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Codes</p></b></u>\r\n<h6><a href=\"http://www.gaqm.org/professional-in-project-management\" target=\"_blank\">1) PPM-001</span></a></h6>\r\n<h6><a href=\"http://www.gaqm.org/certified-project-director-cpd\" target=\"_blank\">2) CPD-001 </span></a></h6>\r\n\r\n\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) PPM-001 exam comprises of 150 questions out of which the candidate needs to score 75% (113 out of 150 correct) to pass. </p>\r\n<p>2) CPD-001 exam comprises of 100 questions out of which the candidate needs to score 80% (80 out of 100 correct) to pass. </p>\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of PPM-001 exam is 2 hours (120 Minutes) </p>\r\n<p>2) The total duration of CPD-001 exam is 1 hour 10 minutes (70 Minutes) </p>\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n<u><b><p>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n\r\n<u><b><p>Taking the Exam </p></b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p></p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA.</p>\r\n<p></p>\r\n<p> 3) You may retake any examination as often as necessary </p>\r\n\r\n');
INSERT INTO `pl_coursecontent` VALUES ('3', 'MBA in Six Sigma', '<p><b><u>Overview of Master of Business Administration in Six Sigma</p></b></u>\r\n<p></p>\r\n\r\n<p>Six Sigma is one of the most widely used quality management approaches in the business world, utilized to gain production and operational efficiencies, as well as customer service improvements, across multiple industries. Business, engineering, and technical professionals can prepare for Six Sigma certification and earn a respected MBA in as few as 12 months.</p>\r\n\r\n<p>MBA in Six Sigma courses are taught trainer with extensive experience in Six Sigma applications or via E-Learning Mode. Through business case-study analysis and computer technology, students will learn quality management approaches, how to use statistical tools, and effective quality improvement techniques. As part of the MBA in Six Sigma Quality studies, students gain a thorough understanding of define, measure, analyze, improve, control (DMAIC)—the statistical and analytical method used to reduce defects by finding the root causes of defects, eliminating them, and sustaining that improvement level. </p>\r\n\r\n<p><b>What is Six Sigma</p></b>\r\n<p></p>\r\n<p>Six Sigma is a set of practices to systematically improve processes by eliminating defects. A defect is defined as failure of a product, process or service in meeting requirements of internal or external customers. </p>\r\n<p>The Six Sigma ensures the quality control, total quality management and zero defects. Through the implementation of the Six Sigma it is made sure that the goals are set on the improvement of all processes to reach the level of better quality. “The Six Sigma” shows the organization’s ability of highly capable processing in producing the outputs within the limited specifications. Therefore it can be said that the processes that operates with the Six Sigma quality, is able to produce a quality products at a low rate of defects.</p>\r\n<p>Six Sigma approach is being widely used all over the world for reduction in process variation and waste elimination. A large number of organizations are using Six Sigma approach in the following areas:- </p>\r\n<p> 1) Reduce rejection, scrap and rework</p>\r\n<p> 2) Reduce customer complaints</p>\r\n<p> 3) Reduce field failures</p>\r\n<p> 4) Optimize processes to improve productivity and reduce manufacturing costs in terms of energy consumption</p>\r\n<p> 5) Set appropriate tolerances on dimensions process and parameters.</p>\r\n\r\n<u><p><b>MBA Degree Requirement </p></b></u>\r\n\r\n<p> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<u><p><b>Delivery Mode </p></b></u>\r\n<p>Self E-Learning </p>\r\n', '<u><p><b>What is the Learning Outcome of the MBA in Six Sigma E-Course?</b></p></u>\r\n<p></p>\r\n\r\n<p> 1) Illustrate the seven principles of Lean Six Sigma </p>\r\n<p>  2) Gain and extensive knowledge base of Six Sigma</p>\r\n<p> 3) Distinguish between the importance of eliminating waste, reducing defects, and improving process flow </p>\r\n<p> 4) Develop a thorough understanding of the Lean concepts and tools and how to practically apply them in facilitating a Lean Action Workout</p>\r\n<p> 5) Apply DMAIC thinking to improvement </p>\r\n<p> 6) Describe the key elements of Change Acceptance </p>\r\n<p> 7) Identify the types of improvement opportunities most suitable for your initial Lean Six Sigma projects.  </p>\r\n<p> 8) Define Lean, its key terms, and the five critical improvement concepts</p>\r\n<p> 9)  Describe the Toyota Production System and the TPS house</p>\r\n<p> 10) Use the Kano model to understand, describe, analyze, and improve value</p>\r\n<p> 11) Identify and reduce various types of waste</p>\r\n<p> 12) Create a plan for a more environmentally Lean organization</p>\r\n<p> 13) Use the PDSA and R-DMAIC-S models to plan, execute, and evaluate Lean changes</p>\r\n<p> 14) Use Lean thinking frameworks, including 5W-2H, Genchi Genbutsu and Gemba</p>\r\n<p> 15) Prepare for and complete a basic 5-S</p>\r\n<p> 16) Describe the key elements of Kaizen events, particularly a Kaizen blitz</p>\r\n<p> 17) Gather, analyze, and interpret data using flow charts, Ishikawa and SIPOC diagrams, and value stream maps</p>\r\n<p> 18) Go back to your organization with a plan to begin incorporating Lean into your corporate culture\r\n<p>  19) Review key measures of performance, observe and apply widely-used methodologies</p>\r\n<p> 20) Develop the skills needed to manage large strategic projects and mentor team members and Green Belts </p>\r\n<p> 21) Understand the idea of confounding and be able to identify which two factor interactions are confounded with the significant main effects</p>\r\n<p> 22) Gain a strong understanding of Change Management principles and acquire the skills to engage stakeholders </p>\r\n<p> 23) To identify patterns in residuals from an improper regression model and to apply the correct remedy.</p>\r\n<p> 24) Demonstrate the ability to compute the probability of failure.</p>\r\n<p> 25) Demonstrate the ability to create and read an FMEA analysis. </p>\r\n<p> 26) Recognize Data Distribution Models (Normal, Binomial and Poisson Distribution discussed) and Graphical Tools understand Data distribution </p>\r\n<p> 27) Understand the idea of Measurement Systems Analysis</p>\r\n<p> 28) Apply DOE with Regression and Example </p>\r\n<p> 29) Understand Taguchi’s Loss Function </p>\r\n<p> 30) Demonstrate the ability experiment with Full Factorial and Screened Designs </p>\r\n\r\n', '<u><p><b>Credit Requirements</p></b></u>\r\n\r\n<p>Candidates must complete all the required courses i.e. CLSSYB, CLSSGB and CLSSBB. Each course is valued 25, 50 and 60 credits respectively.</p>\r\n<p>Module 1 – INTRODUCTION    (3 Credits)</p>\r\n<p>Module 2 – DEFINE    (3 Credits)</p>\r\n<p>Module 3 – MEASURE    (3 Credits)</p>\r\n<p>Module 4 – BASIC STATISTICS    (3 Credits)</p>\r\n<p>Module 5 – ANALYZE    (3 Credits )</p>\r\n<p>Module 6 – IMPROVE    (3 Credits )</p>\r\n<p>Module 7 – CONTROL    (3 Credits)</p>\r\n<p>Module 8 - Lean Process Improvement     (4 Credits )</p>\r\n<p>Module  9 - Overview: Six sigma and Organizational Goals    (3 Credits)</p>\r\n<p>Module  10 - Lean Principles in the organization    (3 Credits)</p>\r\n<p>Module 11 - Design for Six Sigma (DFSS) in the organization    (3 Credits)</p>\r\n<p>Module 12 - Introduction to the Define Phase     (3 Credits)</p>\r\n<p>Module 13 - Project Management Basics    (3 Credits) </p>\r\n<p>Module 14 - Other Tools and Techniques    (3 Credits) </p>\r\n<p>Module 15 - Process Analysis and Documentation    (3 Credits) </p>\r\n<p>Module 16 - Collecting and Summarizing Data    (3 Credits) </p>\r\n<p>Module 17 - Multi-vari Studies    (3 Credits) </p>\r\n<p>Module 18 - Simple linear correlation and regression    (3 Credits) </p>\r\n<p>Module 19 - Introduction to Improve and Control Phase    (3 Credits) </p>\r\n<p>Module 20 - Design of Experiments    (3 Credits) </p>\r\n<p>Module 21 - Statistical Process Control (SPC)    (3 Credits)</p>\r\n<p>Module 22 - Implement and Validate Solution    (3 Credits) </p>\r\n<p>Module 23 - Control Plan    (3 Credits) </p>\r\n<p>Module 24 - Lean Process Improvement    (5 Credits) </p>\r\n<p>Module 25 - Section I – Organizational Roadblocks and Lean Management    (10 Credits) </p>\r\n<p>Module 26 Section II – Pre-define DMAIC and Define    (8 Credits) </p>\r\n<p>Module 27 Section III – Measure    (9 Credits) </p>\r\n<p>Module 28 Section IV – Analyze    (9 Credits) </p>\r\n<p>Module 29 Section V – Improve    (9 Credits) </p>\r\n<p>Module 30 Section VI – Control    (10 Credits) </p>\r\n<p>Module 31 - Lean Process Improvement    (5 Credits) </p>\r\n\r\n\r\n<b><p>Total Credits: 135</b></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<br></br>\r\n\r\n\r\n\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n', '<u><p><b>Potential Career Options</b></p></u>\r\n<P></P>\r\n<p>1) Quality professionals, engineers, production managers, and front line supervisors; process owners and champions charged with the responsibility of improving quality, Mid to upper-level managers responsible for top-line growth will gain skills to implement cost reductions and improved organizational capability and capacity and processes at the organizational or departmental level </p>\r\n<p></p>\r\n<p> 2) Anyone who will be leading a Lean Six Sigma process improvement project or would like to master the principles involved to further their professional skills. It applies to staff, line supervisors, managers and directors in such areas as manufacturing, operations, customer service, engineering, IT, marketing, logistics, sales, quality, purchasing, health care, education, and health and safety, The certification is important to those who are a full time Project Managers.</p>\r\n', 'MBA in Six Sigma ', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '2100 USD            ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=MBASS', '-', '-', '-', '-', 'MBA-in-Six-Sigma.png', '<u><p><b>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><p><b>Exam Codes</p></b></u>\r\n<p><a href=\"http://www.gaqm.org/lean-six-sigma-yellow-belt\" target=\"_blank\">1) CLSSYB </span></a></p>\r\n\r\n<p><a href=\"http://www.gaqm.org/lean-six-sigma-green-belt\" target=\"_blank\">2) CLSSGB </span></a></p>\r\n\r\n<p><a href=\"http://www.gaqm.org/lean-six-sigma-black-belt\" target=\"_blank\">3) CLSSBB</span></a></p>\r\n\r\n\r\n<u><p><b>Passing Score</p></b></u>\r\n<p>1) CLSSYB exam comprises of 50 questions out of which the candidate needs to score 70% (35 out of 50 correct) to pass. </p>\r\n<p>2) CLSSGB exam comprises of 100 questions out of which the candidate needs to score 70% (70 out of 100 correct) to pass. </p>\r\n<p>3) CLSSBB exam comprises of 150 questions out of which the candidate needs to score 75% (112 out of 150 correct) to pass. </p>\r\n<u><p><b>Duration of Exam</p></b></u>\r\n<p>1) The total duration of CLSSYB exam is 1 hour (60 Minutes) </p>\r\n<p>2) The total duration of CLSSGB exam is 2 hours (120 Minutes) </p>\r\n<p>3) The total duration of CLSSBB exam is 2 hours (120 Minutes) </p>\r\n\r\n\r\n<u><p><b>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n<u><p><b>Taking the Exam </strong></p></u></b> \r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA.</p>\r\n<p> 3) You may retake any examination as often as necessary </p>\r\n\r\n');
INSERT INTO `pl_coursecontent` VALUES ('4', 'MBA in Business Management', '<u><p><b>Overview of Master of Business Administration in Business Management </u></p></b>\r\n\r\n\r\n<p> Business administration deals with the performance or management of business operations and therefore is all about making or implementing major decisions. It is mostly about organizing people and resources efficiently so as to channel activities toward common goals. A degree in Business Administration can help you obtain those particular abilities and master the latest methods to manage a group or business. Problem-solving, theorizing and analytical thinking skills are much needed and favoured. In addition, this major will encourage you to think about issues such as diversity, ethics, politics and other dynamics that play a role in every work environment.</p>\r\n<p>MBA in Business Management program is geared towards persons interested in pursuing a career in management or improving their managerial skills. The certificate demonstrates the essential information and skills required by professionals who have to make decisions that are important to the direction and performance of an organization or business. It also demonstrates that a candidate has the required practical approach to manage business in any environment.</p>\r\n<p>Change is a hallmark of today’s business world. In particular, our workforce is constantly changing – people come and go, and move into new roles within the company. Succession planning can help you make the most of that change by ensuring that when someone leaves, there is someone new to take their place.</p>\r\n<p> MBA in Business Management also covers Business process management which helps organizations leverage processes to achieve their goals and be successful. Once processes are implemented, they must be monitored, evaluated, and optimized to make sure they are still meeting the goals that they were designed to accomplish. A business that can successfully manage its processes is able to maintain a competitive edge, while increasing productivity and efficiency and decreasing costs. </p>\r\n<u><b><p>MBA Degree Requirement </p></b></u>\r\n\r\n<P> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<u><b><p>Delivery Mode </p></b></u>\r\n<p>Self E-Learning </p>\r\n\r\n', '<u><p><b>What is the Learning Outcome of the MBA in Business Management E-Course?</b></p></u>\r\n<p></p>\r\n\r\n<p> 1) How to apply the best methods for creating, leading, and managing their own business</p>\r\n<p> 2) Ways to establish an organizational framework through operations, finance, and leadership</p>\r\n<p> 3) Techniques for setting up an effective and efficient system for hiring, retaining, and succession planning</p>\r\n<p> 4) How to start researching and designing a strategic plan</p>\r\n<p> 5) How to describe the essential elements of marketing, sales, and their company brand</p>\r\n<p> 6) Demonstrate an understanding of the value of succession planning for successful businesses. </p>\r\n<p> 7) Demonstrate expertise with the key elements of a succession plan. </p>\r\n<p> 8) Create and discuss aspects of a succession plan. </p>\r\n<p> 9) Discuss the elements of a succession plan in terms of roles, responsibility, function, scope, and evaluation. </p>\r\n<p> 10) Understand the basic principles of negotiation</p>\r\n<p> 11) Prepare for negotiation</p>\r\n<p> 12) Respond to challenges</p>\r\n<p> 13) Create win-win situations</p>\r\n<p> 14) Develop sustainable agreements</p>\r\n<p> 15) Define your role as a manager and identify how that role differs from other roles you have had. </p>\r\n<p> 16) Understand the management challenge and the new functions of management. </p>\r\n<p> 17) Discover how you can prepare for and embrace the forces of change. </p>\r\n<p> 18) Identify ways to get you and your workspace organized and get a jump on the next crisis. </p>\r\n<p> 19) Identify your leadership profile and explore ways to use this knowledge to improve your success as a manager. </p>\r\n<p> 20) Enhance your ability to communicate with others in meetings and through presentations. </p>\r\n<p> 21) Create an action plan for managing your career success. </p>\r\n<p> 22) Understand conflict</p>\r\n<p> 23) Be able to identify the stages of conflict</p>\r\n<p> 24) Use LECSR to resolve conflict</p>\r\n<p> 25) Identify other ways to resolve conflict</p>\r\n<p> 26) Develop personal skills necessary to resolve conflict</p>\r\n<p> 27) Recognize how your own attitudes and actions impact others. </p>\r\n<p> 28) Find new and effective techniques for dealing with difficult people. </p>\r\n<p> 29) Learn some techniques for managing and dealing with anger. </p>\r\n<p> 30) Develop coping strategies for dealing with difficult people and difficult situations. </p>\r\n<p> 31) Understand the difference between ethics and morals</p>\r\n<p> 32) Understand the value of ethics</p>\r\n<p> 33) Identify some of your values and moral principles</p>\r\n<p> 34) Be familiar with some philosophical approaches to ethical decisions</p>\r\n<p> 35) Identify some ways to improve ethics in your office</p>\r\n<p> 36) Know what is required to start developing an office code of ethics</p>\r\n<p> 37) Know some ways to avoid ethical dilemmas</p>\r\n<p> 38) Have some tools to help you make better decisions</p>\r\n<p> 39) Effective networking, including making introductions, shaking hands, and using business cards appropriately</p>\r\n<p> 40) How to dress appropriately for every business occasion</p>\r\n<p> 41) How to feel comfortable when dining in business and formal situations</p>\r\n<p> 42) How to feel more confident of your business communication in every situation</p>\r\n<p> 43) That extra edge that establishes trust and credibility</p>\r\n<p> 44) Define business process management and related concepts</p>\r\n<p> 45) Recognize the vital role processes play in a business</p>\r\n<p> 46) Appreciate the role of technology in process management</p>\r\n<p> 47) Develop a vision to guide process improvement</p>\r\n<p> 48) Understand how to design or enhance an existing process using the business process life cycle </p>\r\n<p> 49) Construct a process map </p>\r\n<p> 50) Perform a what-if analysis to improve your processes</p>\r\n<p> 51) Implement and monitor process changes</p>\r\n<p> 52) Identify how Lean and Six Sigma methods can assist in managing and improving processes</p>\r\n<p> 53) Use a variety of tools and techniques to eliminate waste and redundancies </p>\r\n<p> 54) How to apply financial and accounting terms correctly </p> 	\r\n<p> 55) Introduction to Business Process Analysis</p>\r\n<p> 56) Understand what is Business Analysis </p>\r\n<p> 57) Understand what is Domain Knowledge </p>\r\n<p> 58) Understand what is Business communication scheduling </p>\r\n<p> 59) Perform estimation</p>\r\n<p> 60) Define RASCI Matrix </p>\r\n<p> 61) Understand Stakeholder identification and management </p>\r\n<p> 62) Perform Root cause, GAP, SWOT, Decision and Strategy analysis </p>\r\n<p> 63) Know what is supplier management </p>\r\n<p> 64) know what is conflict management </p>\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n\r\n<p>Candidates must complete all the required courses i.e. BMP-001, BPM-001, CBAF, Business Ethics (course only) and Business Etiquette (course only). Each course is valued 60, 15, 20, 15 and 10 credits respectively.</p>\r\n<p> Module 1 – Business Management Fundamentals (14 Credits) </p>\r\n<p> Module 2 – Business Leadership (12 Credits) </p>\r\n<p> Module 3 – Core Negotiation Skills (9 Credits) </p>\r\n<p> Module 4 – Business Succession Planning (8 Credits) </p>\r\n<p> Module 5 – Conflict Resolution (9 Credits) </p>\r\n<p> Module 6 – Dealing With Difficult People (8 Credits) </p>\r\n<p> Module 7 – Business Process Management (15 Credits) </p>\r\n<p> Module 8 – Business Ethics (15 Credits) </p>\r\n<p> Module 9 – Business Etiquette (10 Credits) </p>\r\n<p> Module 10 - Introduction to Business Process Analysis     (5 Credits)</p>\r\n<p> Module 11 - Business Process Analysis Planning and Stakeholder Management    (3 Credits)</</p>\r\n<p> Module 12 - Business Requirements Management    (3 Credits) </p>\r\n<p> Module 13 - Organizational Analysis    (3 Credits) </p>\r\n<p> Module 14 - Business Solutions Evaluation and Implementation    (3 Credits) </p>\r\n<p> Module 15 - Business Analyst Competencies    (3 Credits) </p>\r\n<b><p>Total Credits: 120</b></p>\r\n<br></br>\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n', '<p><u><b>Potential Career Options</b><p></u>\r\n<P></P>\r\n<p> 1) Business Owners</p>\r\n<p> 2) Managers and Supervisors</p>\r\n<p> 3) Department Heads</p>\r\n<p> 4) Intermediate-level Professionals</p>\r\n<p> 5) Entry-level Professionals</p>\r\n<p> 6) New College Graduates</p>\r\n<p> 7) New High School Graduates</p>\r\n<p> 8) Aspiring Professionals, Managers, Supervisors and Department Heads</p>\r\n<p> 9) Technology consultants</p>\r\n<p> 10) System administrators</p>\r\n<p> 11) Process Onwers</p>\r\n<p> 12) Process Designers</p>\r\n<p> 13) Business Leaders</p>\r\n<p> 14) Senior Executives</p>\r\n<p> 15) Team Leaders</p>\r\n<p> 16) Business Analysts Onwers</p>\r\n<p> 17) Decision Makers</p>\r\n<p> 18) Middle- and Senior-level Line-of-business managers</p>\r\n<p> 19) Requirement Engineers </p>\r\n<p> 20) Product Managers</p>\r\n<p> 21) System and Business Analysts </p>\r\n\r\n', 'MBA in Business Management', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '2400 USD     ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=MBABM', '-', '-', '-', '-', 'MBA-in-Business-Management.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n\r\n<u><b><p>Exam Codes</p></b></u>\r\n<p><a href=\" http://www.gaqm.org/business-management\" target=\"_blank\">1) BMP-001</span></a></p>\r\n<p><a href=\" http://www.gaqm.org/business-process-manager-bpm\" target=\"_blank\">2) BPM-001 </span></a></p>\r\n<p><a href=\" http://www.gaqm.org/certified-business-analyst-cba-foundation\" target=\"_blank\">3) CBAF-001 </span></a></p>\r\n\r\n\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) BMP-001 exam comprises of 100 questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass. </p>\r\n<p>2) BPM-001 exam comprises of 50 questions out of which the candidate needs to score 70% (35 out of 50 correct) to pass. </p>\r\n<p>3) CBAF-001 exam comprises of 40 questions out of which the candidate needs to score 70% (28 out of 40 correct) to pass. </p>\r\n\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of BMP-001 exam is 1 hour 30 minutes (90 Minutes) </p>\r\n<p>2) The total duration of BPM-001 exam is 1 hour (60 Minutes) </p>\r\n<p>3) The total duration of CBAF-001 exam is 1 hour (60 Minutes) </p>\r\n\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n\r\n<p><b><u>Taking the Exam </strong></p></b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA.</p>\r\n<p></p>\r\n<p> 3) You may retake any examination as often as necessary </p>\r\n\r\n');
INSERT INTO `pl_coursecontent` VALUES ('5', 'MBA in Human Resource Management', '<u><p><b>Overview of Master of Business Administration in Human Resource Management</p></b></u>\r\n<p> </p> \r\n<p>The human resource issues facing today’s business owners and managers. You do not always have the expertise to deal with the many employee relationship issues you face, and yet you will be expected to make decisions that are both effective and legal. The MBA in Human Resource Management will walk you through the hiring process, from performing a skills inventory to conducting the interview; discuss orientation; and cover some issues that arise after the hiring process (such as diversity issues, compensation, and discipline).</p>\r\n<p> Organizations recognize that they do better business when their people are engaged, motivated, and yes, talented. Having the right people in place at the right time is a key aspect to continued growth, success, or even just stability. The MBA in Human Resource Management will provide you with just what it takes to have the right people ready. It will help you create a program to measure the talents of your people and how to help them grow in preparation for the future. It will also help you support and grow your organization by teaching you how to apply the most current research and adapt your organization to the ever-changing marketplaces. </p>\r\n<p>The MBA in Human Resource Management will develop the business expertise through a deeper understanding of managing people and organisations, decision making and problem-solving, international business environment, strategies to manage globalisation, strategic marketing and operations management. It focuses on Strategic Human Resource Management.</p>\r\n<p> The course also provides Candidates with strategic functional aspects of key management issues with emphasis on global, local and virtual aspects of modern business practice.  </p>\r\n<b><p><u>MBA Degree Requirement </p></b></u>\r\n\r\n<p> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n\r\n<u><b><p>Delivery Mode </p></b></u>\r\n<p>Self E-Learning </p>\r\n\r\n', '<u><p><b>What is the Learning Outcome of the MBA in Human Resource Management E-Course?</b></p></u>\r\n<p></p>\r\n\r\n<p> 1) The latest trends in the human resource field and the changing role of the human resource professional.</p>\r\n<p> 2) How to write job specifications and identify core competencies.</p>\r\n<p> 3) Methods of finding, selecting, and keeping the best people using behavioral description interviewing techniques.</p>\r\n<p> 4) How to get employees off to a good start.</p>\r\n<p> 5) How to deal with compensation and benefits.</p>\r\n<p> 6) How to maintain healthy employee relations.</p>\r\n<p> 7) How to make performance appraisals a cooperative process</p>\r\n<p> 8) What the peer review process is</p>\r\n<p> 9) A process for employees to file grievances and for management to respond</p>\r\n<p> 10) How to choose a facilitator and panel</p>\r\n<p> 11) What is involved in the hearing process, from preliminary meetings to the hearing, and the decision process</p>\r\n<p> 12) What responsibilities and powers a panel should have</p> \r\n<p> 13) How to apply professional questioning and probing techniques</p>\r\n<p> 14) Why peer review panels fail and how to avoid those pitfalls</p>\r\n<p> 15) Apply the multifaceted aspects of talent management in their own organization</p>\r\n<p> 16) Describe the skills required to manage high potential candidates</p>\r\n<p> 17) Recognize and foster talent within an organization</p>\r\n<p> 18) Explain the principles of competency-based management</p>\r\n<p> 19) Use the language for talent management</p>\r\n<p> 20) The importance of having a performance review process for employees.</p>\r\n<p> 21) How to work with employees to set performance standards and goals. </p> \r\n<p> 22) Skills in observing, giving feedback, listening, and asking questions.\r\nAn effective interview process and have the opportunity to practice the process in a supportive atmosphere.</p>\r\n<p> 23) How to make the performance review legally defensible. </p>\r\n<p> 24) What conflict is and how it can escalate.</p>\r\n<p> 25) The types of conflict and the stages of conflict. </p>\r\n<p> 26) The five most common conflict resolution styles and when to use them. </p>\r\n<p> 27) How to increase positive information flow through non-verbal and verbal communication skills. </p>\r\n<p> 28) Effective techniques for intervention strategies. </p>\r\n<p> 29) Ways to manage conflicts to enhance productivity and performance. </p>\r\n<p> 30) Recognize how anger affects your body, your mind, and your behavior. </p>\r\n<p> 31) Use the five-step method to break old patterns and replace them with a model for assertive anger. </p>\r\n<p> 32) Use an anger log to identify your hot buttons and triggers.</p>\r\n<p> 33) Control your own emotions when faced with other peoples’ anger. </p>\r\n<p> 34) Identify ways to help other people safely manage some of their repressed or expressed anger. </p>\r\n<p> 35) Communicate with others in a constructive, assertive manner. </p>\r\n<p> 36) Identify ways to establish links between excellence in customer service and your business practices and policies. </p>\r\n<p> 37) Develop the skills and practices that are essential elements of a customer service focused manager. </p>\r\n<p> 38) Recognize what employees are looking for to be truly engaged. </p>\r\n<p> 39) Recognize who the customers are and what they are looking for. </p>\r\n<p> 40) Develop strategies for creating engaged employees and satisfied customers in whatever business units you manage. </p>\r\n<p>  41) How to identify the values that support their company</p> \r\n<p> 42) How to define the vision for their company</p> \r\n<p> 43) How to write a mission statement that explains what the company’s purpose is</p>\r\n<p> 44) How to complete meaningful SWOT analyses</p>\r\n<p> 45) Tools and techniques to create a strategic plan that directs the organization from the executive to the front line</p>\r\n<p> 46) Ways to implement, evaluate, and review a strategic plan</p>\r\n<p> 47) How related tools, such as the strategy map and balanced scorecard, can help them develop a strategic plan</p>\r\n\r\n<p> 48) Identify different aspects of culture</p>\r\n<p> 49) Identify the differences between culture & civilization </p>\r\n<p> 50) Recall ways in which culture manifests </p>\r\n<p> 51) Recognize different levels of culture </p>\r\n<p> 52) Identify various dimensions of culture </p>\r\n<p> 53) Identify what is culture and various cultural differences </p>\r\n<p> 54) Recognizing cultural competence </p>\r\n<p> 55) Identify culture competence from cultural awareness </p>\r\n<p> 56) Identifying ways to acquire cultural competence </p>\r\n<p> 57) Identifying ways to achieve cultural competence in an organization. </p>\r\n<p> 58) Identify different cultural barriers and ways to overcome them. </p>\r\n<p> 59) Identify things to keep in mind during cross-cultural communication</p>\r\n<p> 60) Identify ten tips for cross cultural communication </p>\r\n<p> 61) Recognize the ways to engage an interpreter </p>\r\n<p> 62) Recognize different negotiation methods </p>\r\n<p> 63) Recognize various elements of negotiation </p>\r\n<p> 64) Recognize cultural dimension of negotiation </p>\r\n<p> 65) Identify the cultural effects on Negotiation </p>\r\n<p> 66) Identify the ways to develop a negotiation strategy </p>\r\n<p> 67) Recognize what, when and why of culture shock </p>\r\n<p> 68) Identify the symptoms of culture shock </p>\r\n<p> 69) Recognize the various stages of culture shock </p>\r\n<p> 70) Identify various stages of adjustment stage with strategies to overcome the adjustment process </p>\r\n<p> 71) Identify cultural intelligence </p>\r\n<p> 72) Describe the art of finance and key financial terms</p>\r\n<p> 73) Determine your role in company finances</p>\r\n<p> 74) Find the rules and regulations for your area and industry</p>\r\n<p> 75) Discuss various types of financial reports, including income statements, balance sheets, cash flow statements, and statements of retained earnings</p>\r\n<p> 76) Explain how a chart of accounts is created</p>\r\n<p> 77) Tell the difference between cash and accrual accounting</p>\r\n<p> 78) Explain single-entry and double-entry bookkeeping</p>\r\n<p> 79) Differentiate between debits and credits</p>\r\n<p> 80) Identify and analyze important financial data and make financial decisions</p>\r\n<p> 81) Read annual reports</p>\r\n<p> 82) Determine whether a company is financially high or low risk</p>\r\n<p> 83) Recognize different types of organizational financial plans</p>\r\n<p> 84) Explain what budgets are and how to prepare them</p>\r\n<p> 85) Recognize what computer skills you need to make you a financial whiz</p>\r\n<p> 86) Deal with financial situations that impact the people that work for you</p>\r\n<p> 87) Define basic financial terminology</p>\r\n<p> 88) Prepare a budget of any type or size</p>\r\n<p> 89) Get your budget approved</p>\r\n<p> 90) Perform basic ratio analysis</p>\r\n<p> 91) Make better financial decisions</p>\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n\r\n<p>Candidates must complete all the required courses i.e. CHRM-001, CFM-001 & CCM (Course only). Each course is valued 55, 20 and 15 credits respectively.</p>\r\n<p> Module 1 – HR Training for the Non HR Managers (12 Credits) </p>\r\n<p> Module 2 – Employee Dispute Resolution (8 Credits) </p>\r\n<p> Module 3 – Talent Management (11 Credits) </p>\r\n<p> Module 4 – Conducting Effective Performance Reviews (7 Credits) </p>\r\n<p> Module 5 – Conflict Resolution (8 Credits) </p>\r\n<p> Module 6 – Anger Management (9 Credits) </p>\r\n<p> Module 7 – Accounting  (10 Credits)\r\n<p> Module 8 – Budgets and Managing Money    (10 Credits)\r\n<p> Module 9 – Cross Culture Management    (15 Credits) </p>\r\n<b><p>Total Credits: 90</b></p>\r\n<br></br>\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n', '<p><u><b>Potential Career Options</b></u></p>\r\n<P></P>\r\n\r\n<p>Career opportunities include management positions in an extensive range of commercial and public sector organisations, human resource practitioner or</p>\r\n<p> 1) Team Leaders</p>\r\n<p> 2) Supervisors</p>\r\n<p> 3) Human Resources Directors</p>\r\n<p> 4) Organizational Development Directors</p>\r\n<p> 5) Employees and non-HR Managers</p>\r\n', 'MBA in Human Resource Management', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '1900 USD       ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=MBAHRM', '-', '-', '-', '-', 'MBA-in-Project-Management.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Codes</p></b></u>\r\n<p><a href=\"http:// http://www.gaqm.org/certified-human-resources-manager\" target=\"_blank\">1) CHRM-001</span></a></p>\r\n<p><a href=\" http://www.gaqm.org/certified-finance-manager-cfm-level-1\" target=\"_blank\">2) CFM-001 </span></a></p>\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) CHRM-001 exam comprises of 100 questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass. </p>\r\n<p>2) CPD-001 exam comprises of 40 questions out of which the candidate needs to score 70% (28 out of 100 correct) to pass. </p>\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of PPM-001 exam is 1 hour 30 minutes (90 Minutes) </p>\r\n<p>2) The total duration of CFM-001 exam is 1 hour (60 Minutes) </p>\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n<p><b><u>Taking the Exam </strong></p></b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA.</p>\r\n<p></p>\r\n<p> 3) You may retake any examination as often as necessary </p>');
INSERT INTO `pl_coursecontent` VALUES ('6', 'MBA in Sales and Marketing', '<p><b><u>Overview of Master of Business Administration in Sales and Marketing </p></b></u>\r\n<p></p>\r\n<p> The MBA in Sales Marketing is ideal for those with relevant work experience who would like to receive more focused marketing management education. The Marketing MBA will provide the education and credentials needed to qualify for advancement to most management positions. </p>\r\n<p> Though MBA programs differ by school, you can generally expect to receive in-depth instruction on key points in international marketing as well as integrated marketing communication strategies like advertising, promotions, and public relations. Students may also receive an understanding of Social Media Marketing, Customer Relationship Management (CRM), Telemarketing, Branding and overall marketing strategy. </p>\r\n<p>Virtually everybody in sales today sells over the phone at least part of the time. Perhaps it is time for you to evaluate how you use the telephone and where it fits into your sales and marketing mix. This MBA program will show you how the telephone can supplement, enhance, and sometimes replace other means of marketing and selling, and how this personal approach can dramatically increase your sales success. We will also talk about how to hone your communication skills, your ability to persuade, and techniques to personalize each sales call.</p>\r\n<p>The course is an ideal start for business owners and people new to marketing to learn the basics of Internet marketing. We’ve included information on how to market online, and even more importantly, how to determine what results you are getting. Then, you can figure out whether you are reaching your target market, where your qualified prospects are, and how they are engaged as a result of your efforts. This one-day course includes sessions on search engine optimization, e-mail campaigns, pay per click advertising, and more.</p>\r\n<p>While many companies promise to deliver an incredible customer experience, some are better at delivering than others. This MBA is also designed around six critical elements of customer service that, when the company lives them, bring customers back to experience service that outdoes the competition.</p>\r\n<b><p><u>MBA Degree Requirement </p></b></u>\r\n\r\n<p>Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<b><p><u>Delivery Mode </p></b></u>\r\n<p>Self E-Learning </p>\r\n\r\n', '<u><p><b>What is the Learning Outcome of the MBA in Sales and Marketing E-Course?</b></p></u>\r\n<p></p>\r\n\r\n\r\n<p> 1) Recognize what we mean by the term “marketing.” </p>\r\n<p> 2) Discover how to use low-cost publicity to get your name known. </p>\r\n<p> 3) Know how to develop a marketing plan and a marketing campaign. </p>\r\n<p> 4) Use your time rather than your money to market your company effectively.\r\n<p> 5) Understand how to perform a SWOT analysis. </p></p>\r\n<p> 6) Apply your knowledge of body language to improve communication</p>\r\n<p> 7) Understand the impact of space in a conversation</p>\r\n<p> 8) Understand the nuances of body language from a range of areas including your face, hands, arms, legs, and posture</p>\r\n<p> 9) Use mirroring and matching techniques to build rapport</p>\r\n<p> 10) Shake hands with confidence</p>\r\n<p> 11) Dress for success</p>\r\n<p> 12) Identify the key elements of a quality proposal</p>\r\n<p> 13) Perfect your first impression, including your dress and your handshake</p>\r\n<p> 14) Feel more comfortable and professional in face-to-face presentations</p>\r\n<p> 15) Write a winning proposal</p>\r\n<p> 16) Feel more comfortable and professional in face-to-face presentations</p>\r\n<p> 17) Discover the benefits of developing a support network of connections. </p>\r\n<p> 18) Understand how building relationships can help you develop your business base. </p>\r\n<p> 19) Learn how to apply communication techniques to build your network. </p>\r\n<p> 20) The key elements in strong working relationships, and how to put more of these elements in working relationships. </p>\r\n<p> 21) Recognize key interpersonal skills and practice using them. </p>\r\n<p> 22) Describe the value of social media to their marketing plan</p>\r\n<p> 23) Create and launch a social media marketing plan</p>\r\n<p> 24) Select the right resources for a social media marketing team </p>\r\n<p> 25) Define how to use social media to build an internal community</p>\r\n<p> 26) Use metrics to measure the impact of a social media plan</p>\r\n<p> 27) Manage difficult social media situations</p>\r\n <p> 28) Describe features of some of the key social media sites, including Facebook, LinkedIn, and Twitter</p>\r\n<p> 29) Decide whether a blog adds value to a social media plan</p>\r\n<p> 30) Speak about specialty sites and social medial management tools </p>\r\n<p> 31) Stay on top of social media trends and adjust their plan as the online world evolves</p>\r\n<p> 32) Determine how your Internet marketing strategy fits with your overall marketing plan</p>\r\n<p> 33) Apply techniques to influence and engage your target market</p>\r\n<p> 34) Weigh the value of using a distribution service for e-mail marketing campaigns</p>\r\n<p> 35) Get started with search engine optimization</p>\r\n<p> 36) Use online advertising to boost your marketing results</p>\r\n<p> 37) Adjust your Internet marketing plan based on metrics and reporting</p>\r\n<p> 38) Build trust and respect with customers and colleagues. </p>\r\n<p> 39) Warm up your sales approach to improve success with cold calling. </p>\r\n<p> 40) Identify ways to make a positive impression. </p>\r\n<p> 41) Identify negotiation strategies that will make you a stronger seller. </p>\r\n<p> 42) Create a script to maximize your efficiency on the phone. </p>\r\n<p> 43) Learn what to say and what to ask to create interest, handle objections, and close the sale. </p>\r\n<p> 44) Define what a brand is and what branding is about</p>\r\n<p> 45) Define various types of brand architecture and brand extension</p>\r\n<p> 46) Identify your brand’s products, its features, and their values</p>\r\n<p> 47) Write a mission, vision, and style statement for a brand</p>\r\n<p> 48) Describe the basics of positioning a brand</p>\r\n<p> 49) Understand the basics of creating a visual identity, including a brand name, slogan, and logo</p>\r\n<p> 50) Help your employees live the brand by empowering them to be ambassadors and creating strong brand touchpoints</p>\r\n<p> 51) Effectively plan an internal and external brand launch</p>\r\n<p> 52) Monitor and evaluate your brand, and understand how to respond to the results</p>\r\n<p> 53) Make decisions about using persuasion versus manipulation</p>\r\n<p> 54) Apply the concepts of pushing and pulling when influencing others</p>\r\n<p> 55) Describe different techniques for getting persuasive conversations and presentations underway</p>\r\n<p> 55) Make a persuasive presentation by using the 5 S’s</p>\r\n<p> 56) Apply storytelling techniques to extend influence</p>\r\n<p> 57) Leverage concepts of neuro linguistic programming in everyday influence and persuasion</p>\r\n<p> 58) Identify ways to establish links between excellence in customer service and your business practices and policies. </p>\r\n<p> 59) Develop the skills and practices that are essential elements of a customer service focused manager. </p>\r\n<p> 60) Recognize what employees are looking for to be truly engaged. </p>\r\n<p> 61 Recognize who the customers are and what they are looking for. </p>\r\n<p> 62) Develop strategies for creating engaged employees and satisfied customers in whatever business units you manage. </p>\r\n<p> 63) Demonstrate a customer service approach </p>\r\n<p> 64) Understand how your own behavior affects the behavior of others</p>\r\n<p> 65) Demonstrate confidence and skill as a problem solver</p>\r\n<p> 66) Apply techniques to deal with difficult customers</p>\r\n<p> 67) Make a choice to provide customer service</p>\r\n\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n\r\n<p>Candidates must complete all the required courses i.e. CSMP-001 and CCCA-001. Each course is valued 60 and 20 credits respectively.</p>\r\n<p> Module 1 – Marketing and Sales    (10 Credits) </p>\r\n<p> Module 2 – Body Language    (10 Credits) </p>\r\n<p> Module 3 – Dynamite Sales Presentations    (8 Credits) </p>\r\n<p> Module 4 – Building Relationships for Success in Sales    (9 Credits) </p>\r\n<p> Module 5 – Marketing with Social Media   (10 Credits) </p>\r\n<p> Module 6 – Basic Internet Marketing (5 Credits) </p>\r\n<p> Module 7 – Telemarketing  (8 Credits) </p>\r\n<p> Module 8 – Call Center Training (10 Credits) </p>\r\n<p> Module 9 – Customer Service Relationship (10 Credits) </p>\r\n<b><p>Total Credits: 80</b></p>\r\n<br></br>\r\n\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>', '<u><p><b>Potential Career Options</b></p></u>\r\n<P></P>\r\n<p> 1) Corporate Members (Sales Managers, Marketing Managers, Executives) </P>\r\n<p> 2) Small Business Owners and Managers</P>\r\n<p> 3) Consultants</P>\r\n<p> 4) Service Providers</P>\r\n<p> 5) Sales Representatives, Account Managers, Business Development, Distributor Representatives</P>\r\n<p> 6) Customer Service Representative </p>\r\n\r\n\r\n', 'MBA in Sales and Marketing', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '1800 USD       ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=MBASM', '-', '-', '-', '-', 'MBA-in-Sales-and-Marekting.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Codes</p></b></u>\r\n<p><a href=\" http://www.gaqm.org/what-is-csmp\" target=\"_blank\">1) CSMP-001</span></a></p>\r\n<p><a href=\" http://www.gaqm.org/certified-call-centre-associate\" target=\"_blank\">2) CCCA-001 </span></a></p>\r\n\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) CSMP-001 exam comprises of 80 questions out of which the candidate needs to score 70% (56 out of 80 correct) to pass. </p>\r\n<p>2) CCCA-001 exam comprises of 50 questions out of which the candidate needs to score 70% (35 out of 50 correct) to pass. </p>\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of CSMP-001 exam is 1 hour (60 Minutes) </p>\r\n<p>2) The total duration of CCCA-001 exam is 1 hour (60 Minutes) </p>\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n<p><b><u>Taking the Exam </strong></p></b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA.</p>\r\n<p></p>\r\n<p> 3) You may retake any examination as often as necessary </p>');
INSERT INTO `pl_coursecontent` VALUES ('7', 'MBA Supervisor', '<u><p><b>Overview of Master of Business Administration Supervisor </p></b></u>\r\n<p></p>\r\n<p> The MBA Supervisor is designed to help you overcome many of the supervisory problems you will encounter in your first few weeks as a boss, whether you are a team leader, a project manager, or a unit coordinator. Dealing with the many problems a new supervisor encounters isn’t easy, but it doesn’t have to lead to discouragement.\r\n<p>In today’s changing workplace, many new supervisors are unsure of their roles and responsibilities. They have little experience dealing with the challenges of managing work through others. They haven’t had the opportunity to develop those critical skills of planning work, leading their group, and communicating with their employees, their colleagues, and their manager. Our MBA Supervisor will give you just that opportunity.</p>\r\n<p> Effective delegation is one of the most valuable skills you can master. It reduces your workload and develops employee skills. Delegating prepares employees who work for you to be able to handle your responsibilities and simultaneously allows you to advance to other career opportunities within your organization.</p>\r\n<p> Delegation is often one of the hardest skills for a manager to master. However, the skill can be learned. The MBA Supervisor will explore many of the facets of delegation, including when to delegate and to whom to delegate. We will also go through the delegation process step by step and learn about techniques to overcome problems.</p>\r\n<p>Supervisors represent an important force in the North American economy. You have the power to turn on or turn off the productivity of the people who work for you. You are the crucial interface between the employee on the shop floor or the service desk and the managers of the organization. You usually have more experience and more skill than the employees you supervise, because management tends to look for super people to fill those roles.</p>\r\n\r\n<b><p><u>MBA Degree Requirement </p></b></u>\r\n\r\n<p> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<u><b><p>Delivery Mode </p></b></u>\r\n<p>Self E-Learning </p>\r\n\r\n\r\n', '<u><p><b>What is the Learning Outcome of the MBA Supervisor E-Course?</b></p></u>\r\n\r\n<p> 1) Effective networking, including making introductions, shaking hands, and using business cards appropriately</p>\r\n<p> 2) How to dress appropriately for every business occasion</p>\r\n<p> 3) How to feel comfortable when dining in business and formal situations</p>\r\n<p> 4) How to feel more confident of your business communication in every situation</p>\r\n<p> 5) That extra edge that establishes trust and credibility</p>\r\n<p> 6) You will understand the scope and nature of the supervisory position. </p>\r\n<p> 7) You will learn some ways to deal with the challenges of the role. </p>\r\n<p> 8) You will recognize the responsibilities you have as a supervisor, to yourself, to your team, and to your organization. </p>\r\n<p> 9) You will identify key techniques to help you plan and prioritize effectively</p>\r\n<p> 10) You will acquire a basic understanding of and develop strategies for leadership, team building, communication, and motivation and what part they play in effective supervision. </p>\r\n<p> 11) The role of goal setting in performance management. </p>\r\n<p> 12) Tools to help your employees set and achieve goals. </p>\r\n<p> 13) A three-phase model that will help you prepare employees for peak performance, activate their inner motivation, and evaluate their skills. </p>\r\n<p> 14) Motivational tools and techniques</p>\r\n<p> 15) How delegation fits into their job and how it can make them more successful</p>\r\n<p> 16) Different ways of delegating tasks</p>\r\n<p> 17) How to use an eight-step process for effective delegation</p>\r\n<p> 18) How to give better instructions for better delegation results</p>\r\n<p> 19) Common delegation pitfalls and how to avoid them</p>\r\n<p> 20) Ways to monitor delegation results</p>\r\n<p> 21) Techniques for giving effective feedback</p>\r\n<p> 22) Understand how coaching can be used to develop your team. </p>\r\n<p> 21) Develop the coaching skills that help improve individual performance. </p>\r\n<p> 22) Demonstrate the behaviors and practices of an effective coach. </p>\r\n<p> 23) Recognize employees’ strengths and give them the feedback they need to succeed. </p>\r\n<p> 24) Identify employee problems and ways you can help to correct them. </p>\r\n<p> 25) Learn ways to prioritize, plan, and manage your time. </p>\r\n<p> 26) Identify your primary leadership style and techniques for maximizing that style. </p>\r\n<p> 27) Develop more flexibility to use other leadership styles. </p>\r\n<p> 28) Search for ways to overcome communication barriers. </p>\r\n<p> 29) Determine ways you can meet the needs of employees and co-workers through communication and coaching. </p>\r\n<p> 30) Explore ways to engage in productive rather than toxic debate, and to make conflict a powerful force for creative, well-rounded solutions to problems. </p>\r\n<p> 31) Plan a complete corporate event, including an agenda, budget, goals, venue, audience, food, and whatever else your client needs</p>\r\n<p> 32) Keep your event on budget</p>\r\n<p> 33) Design an advertising and marketing plan that includes a comprehensive use of media, take aways, and/or swag bags</p>\r\n<p> 34) Determine whether partners, sponsors, and volunteers can help to make your event unforgettable</p>\r\n<p> 35) Create an atmosphere of service that delegates will remember</p>\r\n<p> 36) Select speakers and a master of ceremonies to add impact to your event</p>\r\n<p> 37) Create a diversity plan</p>\r\n<p> 38) Evaluate the process once it\'s all wrapped up</p>\r\n<p> 39) How to distinguish facilitation from instruction and training</p>\r\n<p> 40) How to identify the competencies linked to effective small group facilitation</p>\r\n<p> 41) The difference between content and process</p>\r\n<p> 42) The stages of team development and ways to help teams through each stage </p>\r\n<p> 43) Common process tools to make meetings easier and more productive</p>\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n\r\n<p>Candidates must complete all the required courses i.e. CPS-001 and Facilitation Skills (Course Only) . Each course is valued 70 and 10 credits respectively.</p>\r\n\r\n<p>Module 1 – Foundation     (Credits 10) </p>\r\n<p> Module 2 – Supervisor Professional    (Credits 12) </p>\r\n<p> Module 3 – Performance Management     (Credits 10)</p>\r\n<p> Module 4 – Delegation    (Credits 8)</p>\r\n<p> Module 5 – Coaching (Credits 8) <p>\r\n<p> Module 6 – Leadership Skills for Supervisors    (Credits 10) </p>\r\n<p> Module 7 - Conference and Event Management    (Credits 12) </p>\r\n<p> Module 8 – Facilitation Skills    (Credits 10)</p>\r\n<p> <b>Total Credits: 80 </b></p>\r\n<br></br>\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>', '<p><u><b>Potential Career Options</b><p></u>\r\n<P></P>\r\n<p> 1) Managers </p>\r\n<p> 2) Department Heads</p>\r\n<p> 3) Supervisors in any field </p>\r\n', 'MBA Supervisor', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '1700 USD      ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=MBASV', '-', '-', '-', '-', 'MBA-Supervisor.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exam is online based and is available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Codes</p></b></u>\r\n<p><a href=\" http://www.gaqm.org/certified-professional-supervisor\" target=\"_blank\">1) CPS-001</span></a></p>\r\n\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) CPS-001 exam comprises of 100 questions out of which the candidate needs to score 70% (70 out of 100 correct) to pass. </p>\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of CPS-001 exam is 1 hour 30 minutes (90 Minutes) </p>\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n<p><b><u>Taking the Exam </strong></p></b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA.</p>\r\n<p></p>\r\n<p> 3) You may retake any examination as often as necessary </p>\r\n\r\n');
INSERT INTO `pl_coursecontent` VALUES ('8', 'MBA in Sports Management', '<u><p><b>Overview of Master of Business Administration in Sports Management</p></b>\r\n<p></p></u>\r\n\r\n<p>Sport and its associated industries of recreation and fitness have entered a period of rapid growth. The recent Skills Audit conducted by the Tourism, Hospitality and Sport Sector Education and Training Authority in 2007, highlights the need for capacity building in sport to promote competence in managing sport organisations, tournaments and events, sport teams and sport facilities. The bridging of the current skills gap will have a positive impact on the management of sport organisations and sport teams as well as the growth of sport at all levels across the globe.</p>\r\n\r\n<p>In addition, the sport marketing industry represents a multi-million dollar industry and the current ten TV channels dedicated to sport are evident of its reach and public demand in terms of access. Managerial competencies are acquired in a variety of contexts, ranging from private fitness facilities and sport clubs to local government initiatives in sport and recreation and on to the marketing and promotional world of sport sponsorships, media, athlete representation as well as sport tourism. </p>\r\n\r\n<p>Increased pressure to deliver efficient and effective management of sport entities, athletes, facilities and events comes from participants, federations, spectators and the media as well as athletes with special needs. </p>\r\n\r\n<p>The industry specific technical skills required within the operational sport and related environments require specific contextualisation within the operational environment in particular for the areas for which specialization streams were designed within the qualification. </p>\r\n\r\n\r\n<p> The MBA in Sports Management is aimed at developing specific competencies in a range of self-organisational and life-long learning skills with an in depth knowledge of sport requirements and technical know-how applicable to a sport specific context. </p>\r\n\r\n<p>The MBA in Sports Management will enable the assuming of job responsibilities as a sport manager in schools, clubs and private institutions in a range of areas, which includes, but is not limited to sport team management, federation management or facility management. </p>\r\n\r\n<p>Candidates will be exposed to establishing of commitment, policy and planning to achieve racial, disability and gender equity through sport programmes whilst maintaining a safe environment for sport activities, events and tournaments within the selected operational environment and community. Candidates meeting the requirements of this qualification will be positioned to further their learning, practice, experience and career within the sport or fitness industries, either at further levels or in other areas of practice. </p>\r\n\r\n<p>This MBA will serve as a stepping-stone to equip the learner to specialise in one of the various disciplines of choice in order to take up a leadership role and expand training and development into the area of management. </p>\r\n\r\n\r\n<b><p><u>MBA Degree Requirement </p></b></u>\r\n\r\n<P> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n\r\n<u><b><p>Delivery Mode </p></b></u>\r\n<p>Self E-Learning  (E-Courseware)</p>\r\n', '<u><p><b>What is the Learning Outcome of the MBA in Sports Management E-Course?</b></p></u>\r\n<p></p>\r\n\r\n<p> 1) Organise and establish a sport organisation or structure in order to enhance operational effectiveness. </p>\r\n<p> 2) Maintain operations in a sport organisation or structure. </p>\r\n<p> 3 Plan, coordinate and implement sport tournaments and/or events.</p>\r\n<p>4) Drafting budgets according to project plans</p>\r\n<p>5) Monitoring income and expenditure according to budgets</p>\r\n<p>6) Supervising financial management of projects against given requirements</p>\r\n<p>7) Evaluating projects according to budget</p>\r\n<p>8) Understand the legislative and company procedures to maintaina safe working environment. </p>\r\n<p>9) Explain organisational procedures to ensure the safety of staff and customers. </p>\r\n<p>10) Implement organisational procedures to ensure the security of staff and customers. </p>\r\n<p>11) Reflect on the effectiveness of the health, safety and security procedures of the organisation. </p>\r\n<p>12) Explaining why companies record and keep information</p>\r\n<p>13) Describing the type of records used in a specific business sector</p>\r\n<p>14) Locating and providing records to users on request</p>\r\n<p>15) Creating a record keeping system</p>\r\n<p>16) Maintaining and updating the record keeping system </p>\r\n<p>17) Involve the community in the utilisation of the facility</p>\r\n<p>18) Manage the programme of activities at the facility</p>\r\n<p>19) Administer the operations of a sport facility</p>\r\n<p>20) Define management principles and processes</p>\r\n<p>21) Develop and present a business plan</p>\r\n<p>21) Identify legislation and regulations for best practices in managing the finances of a sports organization</p>\r\n<p>22) Apply the principles of risk management in the sports environment</p>\r\n<p>23) Demonstrate an understanding of communication channels in business and everyday life. </p>\r\n<p>24) Conduct written and verbal communication within the business environment. </p> \r\n<p>25) Use communication in a business environment</p>\r\n<p>26) Understand own and others intra-personal dynamics </p>\r\n<p>27) Understand interpersonal dynamics</p>\r\n<p>28) Utilize enhanced understanding to bring about personal behavioural changes </p>\r\n<p>29) Identify customer needs and expectations. </p>\r\n<p>30) Recognise customer dissatisfaction and take action to resolve the situation. </p>\r\n<p>31) Identify and use opportunities to enhance the quality of customer service. </p>\r\n<p>32) Communicate with all customers</p>\r\n<p>33) Plan and prepare for facilitation</p>\r\n<p>34) Facilitate learning and Evaluate learning and facilitation</p>\r\n<p>35) Recognise the human and legal rights of people living with HIV/AIDS. </p>\r\n<p>36) Support sport and fitness participation for people living with HIV/AIDS.</p>\r\n<p>37) Encourage healthy living for people affected by HIV/AIDS. </p>\r\n<p> 38) Describe the basic concept of classification and how functional and medical classification operates. </p>\r\n<p>39) Define the core components needed for a basic database for use in disability sport. </p>\r\n<p>40) Understand the specific needs of the disabled in relation to the logistics of a simple event. </p>\r\n<p>41) Demonstrate the values, attitudes and sensitivity issues necessary for dealing with people with disabilities and understand and promote the concept of inclusion in sport. </p>\r\n<p>42) Describe the structures catering for sport for the disabled in South Africa and internationally. </p>\r\n<p>43) Define the concepts of physical and leisure activities. </p>\r\n<p>44) Identify physical activity resources and barriers.  </p>\r\n<p>45) Explain the history and role of sport, recreation and fitness in society </p>\r\n<p>46) Explain the concept of marketing</p>\r\n<p>47) Conduct basic market research</p>\r\n<p>48) Develop and execute a marketing plan for a sport or fitness organisation</p>\r\n<p>49) Plan a promotional campaign for the organisation</p>\r\n<p>50) Prepare and present a sponsorship proposal for the organisation</p>\r\n<p>51) Define management principles, framework of tournament and procedures required</p>\r\n<p>52) Conduct needs analysis to stage the tournament</p>\r\n<p>53) Operational plan and budget for the tournament</p>\r\n<p>54) Identify, implement, organise and co-ordinate the systems and processes</p>\r\n<p>55) Apply leading and guiding skills within the context of a team</p>\r\n<p>56) Monitor and evaluate the sport tournament</p>\r\n<p>57) Strategies to recruit, select and induct volunteers for sports organisations</p>\r\n<p>58) Manage volunteers and maximise their retention in a sport environment</p>\r\n<p> 59) Plan a framework for a sport tournament within a community. </p>\r\n<p> 60) Prepare a comprehensive operational plan and budget for the sport tournament</p>\r\n<p> 61) Select and appoint volunteers to suitable positions. </p>\r\n<p> 62) Induct and train volunteers in a sport environment. </p>\r\n<p> 63) Manage volunteers in a sport environment. </p>\r\n<p> 64) Maximise volunteer retention. </p>\r\n<p> 65) Establish policies on behaviour and discipline. </p>\r\n<p> 66) Establish consequences to ethical and disciplinary transgressions. </p>\r\n<p> 67) Ensure application of fair play practices. </p>\r\n<p> 68) Maintain procedures for team discipline. </p>\r\n<p>69) Plan and facilitate for the establishment of structures. </p>\r\n<p>70) Promote the benefits and values of sport. </p>\r\n<p>71) Compile a participation profile. </p>\r\n<p>72) Facilitate the establishment of committees and/or clubs. </p>\r\n<p>73) Develop written statement or policy on equity, reflecting aims and objectives of organisation. </p>\r\n<p>74) Ensure that all communities are aware of the organisations commitment to equity. </p>\r\n<p>75) Develop a profile and assess equity training needs of all staff of the organisation. </p>\r\n<p>76) Develop a complaints and disciplinary procedure. </p>\r\n<p>77) Assess personal and the organisation\'s values, beliefs and philosophy. </p>\r\n<p>78) Apply appropriate cross-cultural management skills. </p>\r\n<p>79) Explain the need for, the function of governance structures in sport. </p>\r\n<p>80) Explain the boundaries between elected leaders and appointed managers.</p>\r\n<p>81) Explain the role of a governance structure in relation to its stakeholders.</p>\r\n<p>82) Apply suitable processes in the formation of a sport structure at different levels. </p>\r\n<p>83) Explain the purpose of a constitution in the context of a sport organisation.</p>\r\n<p>84) In addition they will be well positioned to extend their learning and practice into other areas of Sport, Recreation or Fitness disciplines, or to strive towards professional standards and practices at higher levels.</p>\r\n<p>85) Formulating performance standards for team members in a unit. </p>\r\n<p>86) Establishing systems for monitoring performance of team members. </p>\r\n<p>87) Preparing for a performance review of a team member. </p>\r\n<p>88) Conducting performance review interview. </p>\r\n<p>89) Collect and manage personal information relating to the team members. </p>\r\n<p>90) Plan for the travel requirements of a team. </p>\r\n<p>91) Organise and schedule the logistical and legal requirements. </p>\r\n<p>91) Co-ordinate athlete and team support. </p>\r\n<p>92) Manage sport kit and equipment. </p>\r\n\r\n<p>93) Explain the meaning of public relations. </p>\r\n<p>94) Identify the various public relations media and prepare for media appearance. </p>\r\n<p>95) Describe protocols and etiquette of the sport or the organisation that would be appropriate for media appearances or presentations. </p>\r\n<p>95) Deal effectively with the media. </p>\r\n<p>96) Orientate participants to utilise fitness facilities. </p>\r\n<p>97) Purpose and function of apparatus and equipment is explained. </p>\r\n<p>98) Instruct participant/s in using apparatus and equipment. </p>\r\n<p>99) Supervise use of facilities, apparatus and equipment. </p>\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n\r\n<p>Candidates must complete all the required Modules. </p>\r\n<b><p> Module 1 – Sports Business Administration</p></b>\r\n<p> Unit 1 - Create, maintain and update record keeping systems (5 Credits)</p>\r\n<p> Unit 2 - Manage project finances  (15 Credits)</p>\r\n<p> Unit 3 - Manage the business components of a sport organisation  (6 Credits)</p>\r\n<p> Unit 4 - Monitor and maintain health, safety and security  (4 Credits)</p>\r\n<p> Unit 5 - Manage a sport or recreation facility (8 Credits) \r\n<p><b>Module 2 - Communication, Customer Care and Self-development </p></b>\r\n<p> Unit 1 - Conduct communication within a business environment (8 Credits)</p>\r\n<p> Unit 2 - Utilise personal development training for personal growth (5 Credits)</p>\r\n<p> Unit 3 – Care for Customers (3 Credits )</p>\r\n<p> Unit 4 - Facilitate learning using a variety of given methodologies (10 Credits)</p>\r\n<p><b>Module 3 - Fitness Participation and Disabilities</p></b>\r\n<p> Unit 1 - Manage participants with disabilities in sport (8 Credits)\r\n<p> Unit 2 - Support sport or fitness participation for people living with HIV/AIDS (3 Credits)\r\n<p> Unit 3 - Explain the principles of physical activity in the context of sport or fitness (3 Credits)\r\n<p><b>Module 4 - Marketing, volunteer management and tournament planning</b></p>\r\n<p>Unit 1 - Apply principles of marketing to sport  (5 Credits)</p>\r\n<p>Unit 2 - Manage Volunteers in sports (5 Credits)</</p>\r\n<p>Unit 3 - Organise and administer a sport tournament (10 Credits)</ </p>\r\n<p>Unit 4 - Plan a sport tournament (5 Credits)</</p>\r\n<p><b>Module 5 - Governance, Structures and Ethical Behaviour in Sport</b> </p>\r\n<p>Unit 1 - Establish sustainable organisational structures for sport (5 Credits) </p>\r\n<p>Unit 2 - Explain the role of governance structures in sport (5 Credits) </p>\r\n<p>Unit 3 - Promote an understanding of diversity and equity in sport and fitness organisations (5 Credits) </p>\r\n<p>Unit 4 - Develop and implement team ethical behaviour and discipline (5 Credits)</p>\r\n<b><p>Module 6 – Team Management </p></b>\r\n<p>Unit 1 - Conduct a screening procedure (5 Credits)</p>\r\n<p>Unit 2 - Monitor and evaluate team members against performance standards (8 Credits)</p>\r\n<p>Unit 3 - Coordinate the logistics of a sports team on tour (8 Credits)</p>\r\n<p>Unit 4 - Co-ordinate public relations and liaison with the media for athletes and sport teams (5 Credits)</p>\r\n<p>Unit 5 - Supervise the use of a fitness facility and equipment (8 Credits)</p>\r\n<p>Unit 6 - Maintain a sport or fitness environment and equipment (5 Credits)</p>\r\n<p><b>Total Credits: 162</p></b>\r\n\r\n\r\n<br></br>\r\n\r\n\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n', '<u><b><p>The competencies that will be acquired from this MBA can be applied to areas such as: </p></b></u>\r\n<p>1) Sport team management</p>\r\n<p>2) Sport event management</p>\r\n<p>3) Sport tournament management</p>\r\n<p>4) Sport facility management</p>\r\n<p>5) Fitness facility management</p>\r\n<p>6) Sport sponsorship management</p>\r\n<p>7) Financial management in the Sport environment</p>\r\n<p>8) Sport Project management</p>\r\n<p>9) Sport organisation management</p>\r\n<p>10) Volunteer management</p>\r\n<p> 11) Gym Managers </p>\r\n\r\n<P></P>\r\n', 'MBA in Sports Management', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '1800 USD               ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CSM-002', '-', '-', '-', '-', 'MBA-in-Sports-Management.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Code</p></b></u>\r\n<p>1) CSM-002</p>\r\n\r\n<u><b><p>Passing Score</u></b></p>\r\n<p>1) CSM-002 exam comprises of 100 questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass. </p>\r\n\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of CSM-002 exam is 2 hours (120 Minutes) </p>\r\n\r\n<u><b><p>Closed Book</p></b></u>\r\n\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n\r\n\r\n\r\n<p><b><u>Taking the Exam </p></u></b> \r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p></p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA.</p>\r\n<p></p>\r\n<p> 3) You may retake any examination as often as necessary </p>\r\n\r\n\r\n\r\n');
INSERT INTO `pl_coursecontent` VALUES ('9', 'MBA in Real Estate Management', '<u><p><b>Overview of Master of Business Administration in Real Estate Management</p></b></u>\r\n<p></p>\r\n<p>The Real Estate industry is a multi-million rand sector which requires professionals who are well-trained and knowledgeable to meet the housing needs of private citizens and the business community by providing office space and business premises. A wide range of legislation applies to this sector and employees/agents need to understand the relevant legislation and be able to apply it in their execution of their work. This MBA strives to equip the learners to be able to operate effectively and efficiently in the Real Estate sector. </p>\r\n\r\n<p>The MBA in Real Estate Management is designed to provide those learners who are already involved in the field of Property and Real Estate. It is also for learners who wish to seek a career in this industry. The Property and Real Estate Industry is a well-established industry and thus has many learners that would benefit from qualifications aligned to career paths. This means there is a need to develop career paths in this sub-field, an industry constantly in need of skilled people. </p>\r\n\r\n<p>The scope of Real Estate is changing and evolving all the time, with opportunities for learners in this arena to get involved in a wide variety of Real Estate opportunities such as real estate sales, brokerage and leasing, property management, institutional real estate investment, real estate consulting, real estate development. </p>\r\n\r\n<p>The MBA in Real Estate Management is for any individual who is, or wishes to be involved in the property and real estate industry. It serves to support and advance the functioning of individuals in this industry. </p>\r\n\r\n<p>A learner will be able to complete the MBA with a specialisation in Real Estate or Valuation. The core unit standards are relevant to each area of specialisation.  Learners working towards this MBA will find that the acquisition of competence in the Unit Standards that make up the MBA will add value to their understanding of the sector and functioning in the workplace. This MBA is intended to enhance the provision of entry-level service within the Property and Real Estate sector. It will provide the broad knowledge, skills and values needed in the Property and Real Estate sector. </p>\r\n\r\n<p> The MBA in Real Estate Management consists of building blocks that can be developed further and will lead to a more specialised learning path in Property and Real Estate. It focuses on the skills, knowledge, values and attitudes required to progress further. The intention is: </p>\r\n<p>1) To promote the development of knowledge, skills and values that are required in Property and Real Estate. </p>\r\n<p>2) To help learners realise their potential in the field. </p>\r\n<p>3) To provide opportunities for people to progress to levels of authority and responsibility in the Real Estate sector</p>\r\n\r\n<p>A real estate agent with a Professional MBA in Business will offer added insight and resources to clients when seeking property financing advice and direction.</p>\r\n<p>Real estate brokerages negotiate commission percentages based upon successful sales, and expertise in the field. This degree will put the real estate professional at a distinct advantage when discussing moneymaking potential with an employer.</p>\r\n\r\n\r\n\r\n\r\n<u><b><p>MBA Degree Requirement </p></b> </u>\r\n\r\n<P> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<u><b><p>Delivery Mode </p></b></u>\r\n<p>Self E-Learning  (E-Courseware)</p>\r\n', '<u><p><b>What is the Learning Outcome of the MBA in Real Estate Management E-Course?</b></p></u>\r\n<p></p>\r\n<p>1) Using textual features and conventions specific to texts</p>\r\n<p>2) Identifying the intended audience for the communication</p>\r\n<p>3) Identifying the purpose of a text</p>\r\n<p>4) Selecting the appropriate text type, format and layout for the purpose</p>\r\n<p>5) Organising and structuring a technical text appropriately</p>\r\n<p>6) Using appropriate grammar conventions</p>\r\n<p>7) Drafting and editing a technical text</p>\r\n<p>8) Recognising errors and checking for accuracy</p>\r\n<p>9) Presenting the same information in different ways</p>\r\n<p>10) Using plain language in business</p>\r\n<p>11) Critique and use techniques for collecting, organising and representing data. </p>\r\n<p>12) Use theoretical and experimental probability to develop models, make predictions and study problems. </p>\r\n<p>13) Critically interrogate and use probability and statistical models in problem solving and decision making in real-world situations. </p>\r\n<p>14) Use mathematics to plan and control financial instruments including insurance and assurance, unit trusts, stock exchange dealings, options, futures and bonds </p>\r\n<p>15) Use simple and compound interest to make sense of and define a variety of situations including mortgage loans, hire purchase, present values, annuities and sinking funds </p>\r\n<p>16) Investigate various aspects of costs and revenue including marginal costs, marginal revenue and optimisation of profit </p>\r\n<p>17) Use mathematics to debate aspects of the national and global economy, including tax, productivity and the equitable distribution of resources. </p>\r\n<p>18) Measure, estimate, and calculate physical quantities in practical situations relevant to the adult with increasing responsibilities in life or the workplace</p>\r\n<p>19) Explore analyse and critique, describe and represent, interpret and justify geometrical relationships and conjectures to solve problems in two and three dimensional geometrical situations </p>\r\n<p>20) Use a range of reading and viewing strategies to understand the literal meaning of specific texts </p>\r\n<p>21) Use strategies for extracting implicit messages in texts </p>\r\n<p>22) Respond to selected texts in a manner appropriate to the context </p>\r\n<p>23) Explore and explain how language structures and features may influence a reader/viewer</p>\r\n<p>24) Extract meaning from a variety of literary texts  </p>\r\n<p>25) Identify and explain features that influence response to texts </p>\r\n<p>26) Produce own texts in response to literary texts</p>\r\n<p>28) Interact successfully in oral/signed communication </p>\r\n<p>29) Use strategies that capture and retain the interest of an audience </p>\r\n<p>30) Identify and respond to manipulative use of language</p>\r\n<p>31) Write/sign for a specified audience and purpose </p>\r\n<p>32) Use language structures and features to produce coherent and cohesive texts for a wide range of contexts </p>\r\n<p>33) Draft own writing/signing and edit to improve clarity and correctness </p>\r\n\r\n<p>34) Respond critically yet sensitively as a listener/audience </p>\r\n<p>35) Analyse own responses to spoken/signed texts and adjust as required </p>\r\n<p>36) Use strategies to be an effective speaker/signer in sustained oral/signed interactions </p>\r\n<p>37) Evaluate spoken/signed discourse</p>\r\n<p>38) Critically analyse texts produced for a range of purposes, audiences and contexts \r\n<p>39) Identify and explain the values, attitudes and assumptions in texts \r\n<p>40) Evaluate the effects of content, language and style on readers\'/viewers\' responses in specific texts.</p>\r\n<p>41) Demonstrating knowledge of the principles of contract law relating to real estate </p>\r\n<p>42) Demonstrating knowledge of the specific contracts relevant to real estate transactions</p>\r\n<p>43) Demonstrating knowledge of legislation affecting immovable property transactions</p>\r\n<p>44) Demonstrating knowledge of legislation regulating the estate agent and estate agencies </p>\r\n<p>45) Explaining the purpose of the Financial Advisory and Intermediary Services Act (FAIS). </p>\r\n<p>46) Explaining the requirements for licensing under FAIS. </p>\r\n<p>47) Explaining the mechanisms for enforcement and the implications for the intermediary and the industry. </p>\r\n<p>48) Discussing the effects of requirements for transparency and the right to information on the financial services industry. </p>\r\n<p>49) Explaining the purpose of the various money laundering legislation. </p>\r\n<p>50) Explaining the requirements for accountable institutions. </p>\r\n<p>51) Explaining the recording function and how to report suspicious transactions. </p>\r\n<p>52) Demonstrating understanding the consequences of non-compliance. </p>\r\n\r\n<p>54) Marketing a property. </p>\r\n<p>55) Selling a property. </p>\r\n<p>56) Applying after-sales services in the sales process in a real estate context. </p>\r\n<p>57) Letting and hiring a property. </p>\r\n<p>58) Applying a working knowledge of Community Scheme legislation and its related regulations and acts.</p>\r\n<p>59) Describing the factors that influence the development of a code of ethics. </p>\r\n<p>60) Explaining the contents of the Real Estate Code of Conduct. </p>\r\n<p>61) Explaining the implications of the Real Estate Code of Conduct for a Real Estate organisation. </p>\r\n<p>62) Relating a Code of Conduct to ethical values and standards within own organisation and discussing ethical best practices. </p>\r\n<p>63) Applying a Real Estate Code of Conduct and ethics in own work context. </p>\r\n<p>64) Describing and applying self-management skills in a Real Estate environment. </p>\r\n<p>65) Developing an action plan for own personal development within the Real Estate Environment. </p>\r\n<p>66) Describing career development opportunities within Real Estate and defining own career development plan. </p>\r\n<p>67) Identifying the various trends in Real Estate career development and how these impact on own development plan. </p>\r\n<p>68) Applying the principles of budgeting to Real Estate transactions</p>\r\n<p>69) Making the necessary provisions for own personal financial planning in line with targets and achievable income within Real Estate context</p>\r\n<p>70) Demonstrating an understanding of taxation in the context of Real Estate from organisational and personal perspectives</p>\r\n<p>71) Applying the principles of business planning to the Real Estate function </p>\r\n<p>72) Describing the demographic environment affecting Real Estate</p>\r\n<p>73) Describing the economic environment affecting Real Estate</p>\r\n<p>74) Describing the legal/regulatory environments that impact on the Real Estate function</p>\r\n<p>75) Identifying the various stakeholders that operate within the Real Estate environment in relation to the role they fulfil</p>\r\n<p>76) Advising sellers and lessors on financing real estate transactions</p>\r\n<p>77) Advising purchasers and lessees on financing real estate transactions</p>\r\n<p>78) Facilitating financing and conveyancing in real estate transactions</p>\r\n<p>79) Demonstrate knowledge of marketing concepts applicable to a new venture. </p>\r\n<p>80) Analyse the product/service requirements of the target market of a new venture. </p>\r\n<p>81) Demonstrate an understanding of the market research process and interpretation of research findings relevant to the new venture. \r\n<p>82) Develop a marketing plan for a new venture.</p>\r\n<p>83) Explaining the importance of motivating a team.  </p>\r\n<p>84) Demonstrating an understanding of self and team members in a workplace. </p>\r\n<p>85) Applying theories of motivation and group dynamics. </p>\r\n<p>86) Implementing a plan of action to strengthen a team. </p>\r\n<p>87) Providing feedback and recognising achievements</p>\r\n<p>88) Controlling and dealing with confidential information and documents </p>\r\n<p>89) Controlling and evaluating ordering and distribution of office stationery</p>\r\n<p>90) Implementing control measures with individuals. </p>\r\n<p>91) Identify and assess own business ideas/opportunities for a new venture</p>\r\n<p>92) Analyse the viability of a selected idea/opportunity against specific screening variables</p>\r\n<p>93) Research the potential of a particular idea/opportunity as a new venture</p>\r\n<p>94) Analyse a range of risks associated with a new venture</p>\r\n<p>95) Evaluate new venture ideas/opportunities based on research findings. </p>\r\n\r\n\r\n\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n\r\n<p>Candidates must complete all the required Modules</p>\r\n<b><p> Module1- Fundamental Mathematics and Business Writing  </p></b>\r\n<p> Unit 1 - Apply knowledge of statistics and probability to critically interrogate and effectively communicate findings on life related problems (6 Credits)</p>\r\n<p> Unit 2 - Represent analyse and calculate shape and motion in 2-and 3-dimensional space in different contexts (4 Credits)</p>\r\n<p> Unit 3 - Use mathematics to investigate and monitor the financial aspects of personal, business, national and international issues (6 Credits)</p>\r\n<p> Unit 4 - Use the writing process to compose texts required in the business environment (5 Credits) </p>\r\n\r\n<b><p>Module 2 - Fundamental Business Communication</p></b>\r\n<p> Unit 1 - Accommodate audience and context needs in oral/signed communication (5 Credits)</p>\r\n<p> Unit 2 - Interpret a variety of literary texts (5 Credits)</p>\r\n<p> Unit 3 - Interpret and use information from texts (5 Credits) </p>\r\n<p> Unit 4 - Write/present/sign texts for a range of communicative contexts (5 Credits)</p>\r\n\r\n<p><b>Module 3 - Business Communication</p></b>\r\n\r\n<p> Unit 1 - Engage in sustained oral/signed communication and evaluate spoken/signed texts (5 Credits)</p>\r\n<p> Unit 2 - Read/view, analyse and respond to a variety of texts (5 Credits)</p>\r\n<p> Unit 3 - Write/present/sign for a wide range of contexts (5 Credits)</p>\r\n\r\n\r\n<p><b>Module 4 -  Real Estate Environment</p></b>\r\n<p>Unit 1 - Advise role players on Real Estate financing options (6 Credits)</p>\r\n<p>Unit 2 - Apply business principles to the Real Estate function (8 Credits)</p>\r\n<p>Unit 3 - Demonstrate an understanding of the Real Estate environment (8 Credits)</p>\r\n<p>Unit 4 - Demonstrate knowledge and understanding of the legislation applicable to real estate practice (12 Credits)</p>\r\n\r\n<p><b>Module 5 – Real Estate Legislation <p></b>\r\n<p>Unit 1 - Demonstrate knowledge and understanding of the Financial Advisory and Intermediary Services Act 2002 (FAIS) (Act 37 of 2002) as it impacts on a specific financial services sub-sector (2 Credits) </p>\r\n<p>Unit 2 - Explain laundering legislation and the implications for accountable institutions in transacting with clients (3 Credits)</p>\r\n<p>Unit 3 - Manage self-development in a Real Estate environment (8 Credits)</p>\r\n<p>Unit 4 - Market, sell and lease property (20 Credits)</p>\r\n<p>Unit 5 - Demonstrate knowledge of and apply the Real Estate Code of Conduct and ethics (6 Credits)</p>\r\n\r\n\r\n<b><p> Module 6 - Real Estate Strategies</p></b>\r\n<p> Unit 1 - Employ a systematic approach to achieving objectives (8 Credits) </p>\r\n<p> Unit 2 - Motivate and Build a Team (10 Credits) </p>\r\n<p> Unit 3 - Develop, implement and evaluate a marketing strategy for a new venture (10 Credits) </p>\r\n\r\n<p><b>Total Credits: 157</b></p>\r\n\r\n<br></br>\r\n\r\n\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n\r\n\r\n', '<p><u><b>Potential Career Options</b></u></p>\r\n\r\n<p>The MBA in Real Estate Management will facilitate access to, mobility within and progression along a learning path for learners who: </p>\r\n\r\n<p>1) Were previously disadvantaged or who were unable to complete their schooling and were therefore denied access to Further Education and Training. </p>\r\n<p>2) Have worked in Real Estate for many years, but have no formal Qualification in real estate or property. </p>\r\n<p>3) Wish to extend their range of skills and knowledge of the industry so that they can become competent workers in the property industry. </p>\r\n\r\n<p>Listed below are possible career paths and opportunities routinely available to students, which successfully complete a Master’s of Business with an emphasis in Real Estate degree. This list should serve as a guide to potential job titles, and not be considered a final list of job descriptions. </p>\r\n\r\n<p> 1) Real estate office area manager</p>\r\n<p> 2) Real estate broker</p>\r\n<p> 3) Property Manager</p>\r\n<p> 4) Real Estate Accountant</p>\r\n<p> 5) Real Estate Appraisal</p>\r\n<p> 6) Real Estate Development</p>\r\n\r\n', 'MBA in Real Estate Management', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '2100 USD           ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CREM-001', '-', '-', '-', '-', 'MBA-in-Realestate-Managemen.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Code</p></b></u>\r\n<p>1) CREM-001 </p>\r\n\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) CREM-001 exam comprises of 100 questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass. </p>\r\n\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of CREM-001 exam is 2 hours  (120 Minutes) </p>\r\n\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n\r\n<u><b><p>Taking the Exam </strong></p> </b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p></p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA. /p>\r\n<p></p>\r\n<p>3) You may retake any examination as often as necessary </p>\r\n\r\n\r\n');
INSERT INTO `pl_coursecontent` VALUES ('10', 'MBA in General Management', '<u><p><b>Overview of Master of Business Administration in General Management</p></b></u>\r\n<p></p>\r\n\r\n<p>General Management studies help in understanding the managerial, functional and operational demands of commercial organizations to trigger production effectively and efficiently. This subject extensively covers several topics on marketing, investment, functional administration, human resource, sales, advertising etc. Imbibing the core tenets of this module will enable transformation into an effective business manager to understand the nuances of optimizing capital growth.</p>\r\n<p>General Management and further develops the key concepts, principles and practices of management that will enable learners to lead, manage, organise and control first line managers and team leaders. </p>\r\n<p>The learners will typically be managers who have other junior managers or team leaders reporting to them. In smaller organisations or entities, the managers could primarily be responsible for managing the supervisors and staff within their section, division or business unit. </p>\r\n\r\n<p>The scope of generic management covers five domains: leadership, managing the environment, managing relations, managing knowledge and the practice of management. This qualification addresses each of these domains with generic competencies, so that it allows learning programmes to be contextualised for specific sectors and industries. </p>\r\n<p>MBA in General Management provides opportunities for learners to transfer between various specialisations within management. This leads to the strengthening of management competencies and will enable managers at this level to manage successfully systems, processes, resources, managers and teams in their various occupations and contexts. </p>\r\n\r\n<p>This qualification is further intended to empower learners to acquire the knowledge, skills, attitudes and values required to operate confidently as individuals in international communities and to respond to the challenging economic environment and constantly changing world of work. </p>\r\n<p>Ultimately, this qualification is aimed at improving the effectiveness and leadership abilities of middle managers in various occupations globally, in private and public business entities as well as non-governmental organisations. For this reason, the word \'entity\' includes a company, business unit, public institution, small business or non-profit organisation. </p>\r\n\r\n\r\n\r\n<u><b><p>MBA Degree Requirement </p></b> </u>\r\n\r\n<P> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<u><b><p>Delivery Mode </p></b></u>\r\n<p>Self E-Learning  (E-Courseware)</p>\r\n', '<p><b><u>What is the Learning Outcome of the MBA in General Management E-Course?</b></p></u>\r\n<p></p>\r\n<p>1) Demonstrating knowledge of and insight into the theory of teams and the importance of teams in workplace activities</p>\r\n<p>2) Applying the theory of teams to team dynamics</p>\r\n<p>3) Explaining the process of building teams</p>\r\n<p>4) Analysing the role of team leader in promoting team effectiveness</p>\r\n<p>5) Evaluating the effectiveness of a team and propose ways to improve team effectiveness</p>\r\n<p>6) Analysing education, training and development needs of members of a unit</p>\r\n<p>7) Recording the results of the training needs analysis</p>\r\n<p>8) Compiling a people development plan for a work unit</p>\r\n<p>9) Managing the implementation of a people development plan for a unit. </p>\r\n<p>10) Liaising and networking with internal and external stakeholders</p>\r\n<p>11) Devising and applying a strategy to establish constructive relationships with team members in a unit</p>\r\n<p>12) Devising and applying a strategy to establish constructive relationships with managers</p>\r\n<p>13) Identifying and minimising personal conflict in the workplace </p>\r\n<p>14) Demonstrating knowledge and understanding of diversity in the workplace</p>\r\n<p>15) Demonstrating understanding of the reality of diversity and its value in a unit</p>\r\n<p>16) Managing team members taking into account similarities and differences</p>\r\n<p>17) Dealing with disagreements and conflicts arising from diversity in a unit </p>\r\n<p>18) Demonstrating understanding of the relationship between values, ethics and organisational culture and its impact on achieving goals and objectives</p>\r\n<p>19) Applying the concept of corporate ethics to a unit</p>\r\n<p>20) Analysing the unit in relation to the principles of corporate ethics </p>\r\n<p>21) Formulating recommendations for promoting organisational values, the code of conduct and ethical practices within a unit and entity</p>\r\n<p>22) Developing an operational plan for a unit</p>\r\n<p>23) Implementing an operational plan</p>\r\n<p>24) Monitoring, measuring and evaluating the achievement of goals and objectives </p>\r\n<p>25) Demonstrating knowledge of and insight into the need for change within the context of environment change</p>\r\n<p>26) Analysing an area requiring a change process</p>\r\n<p>27) Selecting a model for implementing a change management process</p>\r\n<p>28) Formulating recommendations on implementing the change process </p>\r\n<p>29) Explaining the concept of leadership</p>\r\n<p>30) Differentiating between leadership and management</p>\r\n<p>31) Analysing and comparing leadership theories</p>\r\n<p>32) Applying the different roles and qualities of leadership in a work context </p>\r\n<p>33) Using mathematical techniques to collect and organise data</p>\r\n<p>34) Applying mathematical analysis to calculate and represent financial and economic data</p>\r\n<p>35) Applying mathematical analysis to indicate economic relationships. </p>\r\n<p>36) Discuss and explain a range of written and oral communication techniques used in the workplace </p>\r\n<p> 37) Lead discussions and chair meetings </p>\r\n<p> 38) Generate a variety of workplace reports using various data gathering techniques </p>\r\n<p> 39) An understanding of a range of written and oral communication techniques used in the workplace and applicable communication theory is demonstrated. </p>\r\n<p> 38) Engage with stakeholders in analysing the issue/problem and developing solutions</p>\r\n<p> 39) Selecting feasible solutions through a systems approach</p>\r\n<p> 40) Formulating and communicating the decision</p>\r\n<p> 41) Demonstrate knowledge and understanding of the concepts and components of knowledge management</p>\r\n<p> 42) Analyse a unit according the entity\'s knowledge management policies and procedures</p>\r\n<p> 43) Develop a knowledge management implementation plan for a unit </p>\r\n<p> 44) Analysing own unit in terms of opportunities for innovation</p>\r\n<p> 45) Demonstrating understanding of the techniques that promote creativity</p>\r\n<p> 46) Developing a plan for creating an environment conducive to innovation</p>\r\n<p> 47) Leading a team through a creative thinking process </p>\r\n<p> 48) Formulating performance standards for team members in a unit</p>\r\n<p> 49) Establishing systems for monitoring performance of team members</p>\r\n<p> 50) Preparing for a performance review of a team member</p>\r\n<p> 51) Conducting performance review interview </p>\r\n<p> 52) Demonstrating an understanding of business processes and potential risks to a unit</p>\r\n<p> 53) Identifying potential risks and assessing the impact thereof in a unit</p>\r\n<p> 54) Developing contingency plans for managing risk</p>\r\n<p> 55) Testing and revising contingency plans</p>\r\n<p> 56) Selecting a first line manager for a specific position</p>\r\n<p> 57) Planning the coaching process of a first line manager</p>\r\n<p> 58) Coaching selected first line manager</p>\r\n<p> 59) Monitoring and measuring the results of coaching sessions</p>\r\n<p> 60 ) Selecting a work-based project for a unit. </p>\r\n<p> 61) Scoping a work-based project for a unit. \r\n<p> 62) Developing a project plan. </p>\r\n<p> 63) Developing tools to measure key performance parameters. </p>\r\n<p> 64) Implementing the plan and evaluate project progress.</p>\r\n<p> 65) Demonstrating an understanding of the key concepts of managerial finance. </p>\r\n<p> 66) Interpreting financial statements. </p>\r\n<p> 67) Drafting financial forecasts. </p>\r\n<p> 68) Drafting budgets according to operational plans of the unit. </p>\r\n<p> 69) Supervising the financial management of a unit against given requirements. </p>\r\n<p> 70) Recognising areas in need of change. </p>\r\n<p> 71) Making recommendations for change. </p>\r\n<p> 72) Implementing change. </p>\r\n<p> 73) Explaining financial analysis</p>\r\n<p> 74) Calculating ratios to measure profitability and resource utilisation</p>\r\n<p> 75) Calculating ratios to measure viability</p>\r\n<p> 76) Identifying growth opportunities through financial results and reporting the results of financial analysis. </p>\r\n<P> 77) Developing a strategy for the department/division</p>\r\n<p> 78) Developing action plans for the department/division</p>\r\n<p> 79) Implementing action plans</p>\r\n<p> 80) Reviewing action plans. </p>\r\n<p> 81) Develop a framework for creating, sharing, capturing and protecting management information and institutional knowledge. </p>\r\n<p> 82) Develop a processes for promoting information and knowledge management in the function. </p>\r\n<p> 83) Evaluate the processes and practices relating to information and knowledge management. </p>\r\n<p> 84) Develop an action plan to address gaps in information and knowledge management processes and practice. </p>\r\n<p> 85) Implement a culture that empowers staff to seek, develop, share, utilise, protect and store knowledge assets. </p>\r\n<p> 86) Identify the strategic partners and key drivers that achieve the strategy of the function. </p>\r\n<p> 87) Evaluate the contribution of strategic partners towards the strategy of the function. </p>\r\n<p> 88) Develop an implementation plan to enhance relationships with strategic partners. </p>\r\n<p> 89) Establish communication processes to promote positive relationships within the policies and procedures of the entity. </p>\r\n<p> 90) Evaluate the effectiveness of the communication processes. </p>\r\n<p> 91) Recommend improvements to the effectiveness of communication processes. </p>\r\n<p> 92) Develop a human capital plan for the nurturing and retention of staff. </p>\r\n<p> 93) Appraise the performance of employees. </p>\r\n<p> 94) Develop an action plan to address identified performance gaps and development needs. </p>\r\n<p> 95) Develop an implementation plan for the action plan. </p>\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n<p>Candidates must complete all the required Modules </p>\r\n<p><b>Module 1 – People Management <p></b>\r\n<p>Unit 1 - Build teams to achieve goals and objectives  (6 Credits)</</p>\r\n<p>Unit 2 - Lead people development and talent management  (8 Credits) <p>\r\n<p>Unit 3 - Devise and apply strategies to establish and maintain workplace relationships (6 Credits)</</p>\r\n<p>Unit 4 - Manage a diverse work force to add value (6 Credits)</p>\r\n<p>Unit 5 - Apply the principles of ethics to improve organisational culture (5 Credits) </p>\r\n\r\n<p><b>Module 2 – Workplace Management</p></b>\r\n<p>Unit 1 - Develop, implement and evaluate an operational plan  (8 Credits) </p>\r\n<p>Unit 2 - Formulate recommendations for a change process  (8 Credits) </p>\r\n<p>Unit 3 - Analyse leadership and related theories in a work context  (8 Credits) </p>\r\n<p>Unit 4 - Apply mathematical analysis to economic and financial information. (6 Credits) </p>\r\n<p>Unit 5 - Use communication techniques effectively (8 Credits) </p>\r\n\r\n<p><b>Module 3 – Decision Making</p></b>\r\n<p>Unit 1  - Apply a systems approach to decision making (6 Credits) </p>\r\n<p>Unit 2 - Apply the principles of knowledge management (6 Credits) </p>\r\n<p>Unit 3 - Create and manage an environment that promotes innovation (6 Credits) </p>\r\n<p>Unit 4 - Monitor and evaluate team members against performance standards (8 Credits) </p>\r\n<p>Unit 5 - Monitor, assess and manage risk (8 Credits) </p>\r\n<p>Unit 6 - Select and coach first line managers(8 Credits) </p>\r\n<p><b>Module 4 – Unit Management <p></b>\r\n<p>Unit  1 - Develop, implement and evaluate a project plan (8 Credits) </p>\r\n<p> Unit  2 - Manage the finances of a unit (8 Credits)</p>\r\n<p> Unit  3 - Recognise areas in need of change, make recommendations and implement change in the team, department or division (3 Credits)</p>\r\n<p>Unit 4 - Develop and implement a strategy and action plans for a team, department or division (4 Credits) </p>\r\n<p> Unit 5 - Apply financial analysis (3 Credits) </p>\r\n\r\n<b><p> Module 5 - Strategic Management</p></b>\r\n<p>Unit  1 - Evaluate and plan the role of self as leader in a function (5 Credits) </p>\r\n<p>Unit  2 - Manage relationships with strategic partners to improve the performance of a function (6 Credits) </p>\r\n<p>Unit  3 - Manage the information and institutional knowledge within a function (5 Credits) </p>\r\n<p>Unit  4 - Manage and improve communication processes in a function (3 Credits) </p>\r\n<p>Unit  5 - Appraise, develop and retain human capital for a function (6 Credits) </p>\r\n\r\n<b><p>Total Credits: 137 </p></b>\r\n<br></br>\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n', '<p><u><b>Potential Career Options</b></u></p>\r\n\r\n<p>A person acquiring this qualification will be able to manage first line managers in an organisational entity. First line managers may include team leaders, supervisors, junior managers, section heads and foremen.  </p>\r\n<p>The focus of this qualification is to enable learners to develop competence in a range of knowledge, skills, attitudes and values including: </p>\r\n<p>1) Initiating, developing, implementing and evaluating operational strategies, projects and action plans, and where appropriate, recommending change within teams and/or the unit so as to improve the effectiveness of the unit.</p>\r\n<p>2) Monitoring and measuring performance and applying continuous or innovative improvement interventions in the unit in order to attain its desired outcomes, including customer satisfaction, and thereby contributing towards the achievement of the objectives and vision of the entity. </p>\r\n<p>3) Leading a team of first line managers, by capitalising on the talents of team members and promoting synergistic interaction between individuals and teams, to enhance individual, team and unit effectiveness in order to achieve the goals of the entity</p>\r\n<p>4) Building relationships using communication processes both vertically and horizontally within the unit, with superiors and with stakeholders across the value chain to ensure the achievement of intended outcomes </p>\r\n<p>5) Applying the principles of risk, financial and knowledge management and business ethics within internal and external regulatory frameworks in order to ensure the effectiveness and sustainability of the unit</p>\r\n<p>6) Enhancing the development of teams and team members through facilitating the acquisition of skills, coaching, providing career direction, and capitalising on diversity in the unit</p>\r\n', 'MBA in General Management', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '2000 USD             ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CGM-001', '-', '-', '-', '-', 'MBA-in-General-Management.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Code</p></b></u>\r\n<p>1) CGM-001 </p>\r\n\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) CGM-001 exam comprises of 100 questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass. </p>\r\n\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of CGM-001 exam is 2 hours  (120 Minutes) </p>\r\n\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n\r\n<u><b><p>Taking the Exam </strong></p> </b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p></p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA. </6>\r\n<p></p>\r\n<p>3) You may retake any examination as often as necessary </p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n');
INSERT INTO `pl_coursecontent` VALUES ('11', 'MBA in Wholesale and Retail Operations', '<u><p><b>Overview of Master of Business Administration in Wholesale and Retail Operations </p></b></u>\r\n<p></p>\r\n\r\n<p>The MBA in Wholesale and Retail Operations qualification consists of at least 120 credits. This programme is going to be an exciting experience for you since it looks at the world of Wholesale and Retail Operations from a practical viewpoint.</p>\r\n\r\n<p>The Student Guidelines and the rest of this book are structured as follows; Each chapter represents a Unit Standard and therefore each has a title that corresponds with a specific Unit Standard, a set of objectives (which corresponds with the Specific Outcomes and Assessment Criteria of that Unit Standard) and a list of the Resource Material that would be of assistance to you to achieve competency. </p>\r\n\r\n<p>These guidelines and information will therefore not only assist you to start your own business but will be the guiding principles by which you could attain the MBA in Wholesale and Retail Operations. </p>\r\n\r\n<p>It makes absolute sense to obtain the qualification since it will also help you should you ever need to find a job again. Businessmen are known to have to find employment during times of hardship but even subsequent to that, most still return to their own enterprises after a while. It will serve as the second in the Wholesale and Retail Operations learning pathway and provide a basis for further learning. While the qualifying learners will experience personal growth and development, workplace succession planning will be more readily achieved.\r\n\r\n<p>The operational process includes; ordering stock, receiving, dispatching, stock control, cash control, sales and marketing and displaying, responsible credit promotion, perishable foods preparation, sales and display and the running of an informal small business. This qualification will serve to provide the Wholesale and Retail sector with personnel that can perform the operation functions to industry standards, optimise productivity and improve service levels. The qualifying learner will undergo personal development that will contribute to social and economic development. </p>\r\n\r\n<p>The learner assessed as competent against this qualification will be able to: </p>\r\n<p>1) Ensure a positive customer experience in a W and R business unit.</p>\r\n<p>2) Explain how employees can influence the objectives of a W and R business unit. </p>\r\n\r\n<u><b><p>MBA Degree Requirement </p></b> </u>\r\n\r\n<P> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<u><b><p>Delivery Mode </p></b></u>\r\n<p>Self E-Learning  (E-Courseware)</p>\r\n', '<p><b><u>What is the Learning Outcome of the MBA in Wholesale and Retail Operations E-Course?</b></p></u>\r\n<p> </p>\r\n<p>1) Convert numbers between the decimal number system and binary number system </p>\r\n<p>2) Work with numbers in different ways to express size/magnitude. </p>\r\n<p>3) Demonstrate the effect of error in calculations.  </p>\r\n<p>4) Pose questions, collect and organise data. </p>\r\n<p>5) Represent and interpret data using various techniques to investigate real life and work problems. </p>\r\n<p>6) Use random events to explore and apply probability concepts in simple life and work related situations.  </p>\r\n<p>7) Measure, estimate, and calculate physical quantities in practical situations relevant to the adult in life or the workplace </p>\r\n<p>8)  Explore describe and represent, interpret and justify geometrical relationships and conjectures to solve problems in two and three dimensional geometrical situations</p>\r\n<p>9) Use mathematics to plan and control personal and/or household budgets and income and expenditure. </p>\r\n<p>10) Use simple and compound interest to make sense of and define a variety of situations including investments, stokvels, inflation, appreciation and depreciation.  </p>\r\n<p>11) Investigate various aspects of financial transactions including costs, prices, revenue, cost price, selling price, loss and profit.  </p>\r\n<p>12) Interact successfully in oral/signed communication </p>\r\n<p>13) Use strategies that capture and retain the interest of an audience </p>\r\n<p>14) Identify and respond to manipulative use of language </p>\r\n<p>15) Access and use suitable learning resources </p>\r\n<p>14) Use learning strategies </p>\r\n<p>16) Manage occupational learning programme materials </p>\r\n<p>17) Conduct basic research, analyse and present findings </p>\r\n<p>18) Function in a team </p>\r\n<p>19) Reflect on how characteristics of the workplace and occupational context affect earning</p>\r\n<p>20) Use a range of reading and viewing strategies to understand the literal meaning of specific texts </p>\r\n<p>21) Use strategies for extracting implicit messages in texts </p>\r\n<p>22) Respond to selected texts in a manner appropriate to the context </p>\r\n<p>23) Explore and explain how language structures and features may influence a reader/viewer</p>\r\n<p>24) Write/sign for a specified audience and purpose </p>\r\n<p>25) Use language structures and features to produce coherent and cohesive texts for a wide range of contexts </p>\r\n<p>26) Draft own writing/signing and edit to improve clarity and correctness </p>\r\n<p>27) Identifying products and ranges in the store. </p>\r\n<p>28) Identifying product features. </p>\r\n<p>29) Explaining the benefits of product features. </p>\r\n<p>30) Explaining post-purchase product care. </p>\r\n<p>31) Explaining customer behaviour. </p>\r\n<p>32) Creating positive customer perceptions. </p>\r\n<p>33) Interact with customers. </p>\r\n<p>34) Resolving customer complaints. </p>\r\n<p>35) Establishing the customer\'s need. </p>\r\n<p>36) Offering products to customer. </p>\r\n<p>37) Overcoming customer objections. </p>\r\n<p>38) Closing the sale. </p>\r\n<p>39) Able to build, ticket and maintain promotional displays throughout the promotional period, subject to stock availability, in order to promote sales and the image of the organisation. </p>\r\n<p>40) Identifying hazards</p>\r\n<p>41) Evaluating hazards</p>\r\n<p>42) Controlling hazards</p>\r\n<p>43) Explaining and using relevant legislation and regulations</p>\r\n<p>44) Gathering and organising occupational health, safety and environmental information from the workplace</p>\r\n<p>45) Carrying out occupational health and safety training </p>\r\n<p>46) Implement security procedures to prevent shrinkage and losses and enhance the efficiency of the supply chain by recording required information on stock being dispatched. </p>\r\n<p>47) Explaining the relationship between the bottom line of a business and the factors that will impact on it. </p>\r\n<p>48) Explaining how net profit is arrived at on a W&R financial report. </p>\r\n<p>49) Identifying how the cash and stock functions of the business impact on each other. </p>\r\n<p>50) Explaining how own job can impact on the bottom line of a business. </p>\r\n<p>51) Explaining how to maintain a safe and secure work area. </p>\r\n<p>52) Responding to an emergency situation. </p>\r\n<p>53) Explaining how to deal with theft in a wholesale and retail outlet. </p>\r\n\r\n\r\n\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n<p>Candidates must complete all the required Modules </p>\r\n<p><b>Module 1 – Business Calculations </p></b>\r\n<p>Unit 1 - Use mathematics to investigate and monitor the financial aspects of personal, business and national issues (5 Credits) </p>\r\n<p>Unit 2 - Investigate life and work related problems using data and probabilities  (5 Credits) </p>\r\n<p>Unit 3 - Demonstrate an understanding of the use of different number bases and measurement units and an awareness of error in the context of relevant calculations (2 Credits) </p>\r\n<p>Unit 4 - Describe, apply, analyse and calculate shape and motion in 2-and 3-dimensional space in different contexts (4 Credits) </p>\r\n<p><b>Module 2 – Business Calculations </p> </b>\r\n<p>Unit 1 - Accommodate audience and context needs in oral/signed communication (5 Credits) </p>\r\n<p>Unit 2 - Interpret and use information from texts  (5 Credits) </p>\r\n<p>Unit 3 - Use language and communication in occupational learning programmes  (5 Credits) </p>\r\n<p>Unit 4 - Write/present/sign texts for a range of communicative contexts (5 Credits) </p>\r\n\r\n<p><b>Module 3 - Customer relations in Wholesale and Retail </p> </b>\r\n<p>Unit 1 - Define the core concepts of the wholesale and retail environment (10 Credits) </p>\r\n<p>Unit 2 - Build customer relations in an operational unit (10 Credits) </p>\r\n<p>Unit 3 - Demonstrate knowledge of products in own area of operation in a Wholesale and Retail environment(8 Credits) \r\n<p>Unit 4 - Sell products to customers in a wholesale and retail outlet (12 Credits)  </p>\r\n<p>Unit 5 - Implement promotional instructions (6 Credits) </p>\r\n\r\n<p><b>Module 4 - Health, Safety and Security in Wholesale and Retail </p> </b>\r\n<p>Unit 1 - Apply theft, fraud and safety controls in a Wholesale and Retail outlet  (8 Credits) </p>\r\n<p>Unit 2 - Explain the factors that impact on the bottom line of a Wholesale and Retail unit (10 Credits)  </p>\r\n<p>Unit 3 - Apply occupational health, safety and environmental principles (10 Credits)  </p>\r\n<p>Unit 3 - Dispatch stock (10 Credits) </p>\r\n\r\n<p><b>Total Credits: 120 </p></b>\r\n', '<p><u><b>Potential Career Options</b></u></p>\r\n<p>The scarce and critical skills list compiled internationally includes many of the competencies in this qualification. The occupations associated with these competencies are listed as: </p>\r\n<p>1) Sellers: Sales Persons and Assistants, Representatives. </p>\r\n<p>2) Cashiers. </p>\r\n<p>3) General and Finance Administrators. </p>\r\n<p>4) Trade Union Officials. </p>\r\n<p>5) Merchandisers. </p>\r\n<p>6) Checkout Operators and Office Cash Clerks. </p>\r\n<p>7) Wholesale Managers</p>\r\n<p>8) Supply Chain Managers</p>\r\n\r\n', 'MBA in Wholesale and Retail Operations', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '1800 USD        ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CWRM-001', '-', '-', '-', '-', 'MBA-in-Wholesale-and-Retail.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Code</p></b></u>\r\n<p>1) CWRM-001 </p>\r\n\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) CWRM-001 exam comprises of 100 questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass. </p>\r\n\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of CWRM-001 exam is 2 hours (120 Minutes) </p>\r\n\r\n\r\n\r\n\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n\r\n<p><b><u>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n\r\n<u><b><p>Taking the Exam </strong></p></b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p></p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA. </6>\r\n<p></p>\r\n<p>3) You may retake any examination as often as necessary </p>\r\n\r\n\r\n\r\n<br></br>\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n');
INSERT INTO `pl_coursecontent` VALUES ('12', 'MBA in International Travel', '<u><p><b>Overview of Master of Business Administration in International Tourism </p></b></u>\r\n<p></p>\r\n<p>The tourist industry provides government with hundreds of million of dollars in tax revenues each year through accommodation and restaurant taxes, airport users fees, sales taxes, park entrance fees and employee income tax. Clearly, this industry offers plenty of opportunities for operating or working in a successful travel consultancy.</p>\r\n\r\n<p>  The MBA in International Tourism  has been designed to develop a broad range of skills appropriate to a person who is undergoing training or operating as a front line worker in the international tourism industry with some supervisory responsibilities. It brings together the theoretical and practical elements of international tourism operations and will help to professionalise the travel and tourism industry.</p>\r\n<p>It makes absolute sense to obtain the MBA in International Tourism  since it will also help you should you ever need to find a job again. Businessmen are known to have to find employment during times of hardship but even subsequent to that, most still return to their own enterprises after a while.</p>\r\n\r\n<p>Travel is the physical transportation of a person from one point to another, is one sector of tourism industry. It is however, a very important sector, for without it the other sectors would most likely not exit .For this reason, it is give its rightful place in the term “Travel and Tourism industry”. Tourism is the activity of people travelling to, visiting and/or staying in places outside their usual environments, for leisure, business or other purposes. </p>\r\n\r\n<p>The Travel and Tourism industry employs over 200 million people worldwide. Many tourism jobs are in small or medium –sized, family-owned enterprises. Research shows that job creation in tourism is growing one-and-a-half times faster than in any other industrial sector. Travel agents or consultants no longer work only in a travel agency. Companies, organizations, associations, educational institutions and societies all need the knowledge and skills of professional travel experts.</p>\r\n\r\n\r\n\r\n\r\n<u><b><p>MBA Degree Requirement </p></b> </u>\r\n\r\n<P> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<u><b><p>Delivery Mode </p></b></u>\r\n<p>Self E-Learning  (E-Courseware)</p>\r\n', '<u><p><b>What is the Learning Outcome of the MBA in International Travel E-Course?</b></p></u>\r\n<p> </p>\r\n<p>1) Describe the importance of tourism. </p>\r\n<p>2) Investigate potential job roles within the tourism industry. </p>\r\n<p>3) Investigate visitor flows, transport routes and world time zones. </p>\r\n<p>4) Explain the importance of customer services within the travel and tourism industry in order to attract and keep customers. </p>\r\n<p>5) Provide excellent customer service. </p></p>\r\n<p>6) Provide information within tourism organisations effectively. \r\n<p>7) Structure and deliver an effective presentation. </p>\r\n<p>8) Explain the importance of marketing in order to ensure that organisations meet their customers\' needs. </p>\r\n<p>9) Describe marketing principles. </p>\r\n<p>10) Carry out market research. </p>\r\n<p>11) Develop promotional materials. </p>\r\n<p>12) Identify a range of visitor attractions throughout the world and examine their appeal and popularity. </p>\r\n<p>13) Explain the process involved when making a reservation and issuing tickets, including costings. </p>\r\n<p>14) Explain how the tourism industry has developed and key factors that have affected its development. </p>\r\n<p>15) Examine the reasons why people travel, the impact of tourism on destinations and future developments and opportunities. </p>\r\n<p>16) Locate major international destinations throughout the world, including gateways, tourist attractions and local languages. </p>\r\n<p>17) Convert local times. </p>\r\n<p>18) Carry out currency transactions. </p>\r\n<p>19) Calculate journey times. </p>\r\n<p>20) Explain the importance of customer services with the travel and tourism industry, focusing on customer service standards, procedures and customer feedback. </p>\r\n<p>21) Investigate organisational structures and staff recruitment, including legal requirements. </p>\r\n<p>22) Explain the day-to-day systems that need to be in place for a business to run effectively and efficiently. </p>\r\n<p>23) Describe the role and importance of marketing in the continued success of travel and tourism organisations. </p>\r\n<p>24) Explain the need for the responsible development of tourism. </p>\r\n<p>25) Describe related services in the travel market, including car hire, travel insurance and the cruise market. </p>\r\n<p> 26) Use effective communication skills within the workplace.  </p>\r\n<p> 27) Use mathematics in real life situations. </p>\r\n<p>28) Describe the development of the tourism industry. </p>\r\n<p>29) Explain how geography impacts on international tourism. </p>\r\n<p>30) Deliver customer services. </p>\r\n<p>31) Present tourism products and services. </p>\r\n<p>32) Develop people within the tourism industry. </p>\r\n<p>33) Implement business systems. </p>\r\n<p>34) Market products and services. </p>\r\n<p>35) Develop a visitor\'s attraction. </p>\r\n<p>36) Develop local tourism destinations. </p>\r\n<p>37) Make reservations. </p>\r\n<p>38) Implement related tourism services </p>\r\n<p>39) Explain the importance of International and National Tourism. </p>\r\n<p>40) Identify and explain various job roles within the International tourism industry. </p>\r\n<p>41) Identify the different types of accommodation and classification systems used worldwide. </p>\r\n<p>42) Carry out research which identifies the different reasons why people travel. </p>\r\n<p> 43) Prepare a presentation investigating the positive and negative economic impacts of tourism using various sources including books, the media and the World Wide Web. </p>\r\n<p>44) Carry out research on the growth and development of new tourism initiatives worldwide ncluding adventure, nature-based and independent travel. </p>\r\n<p>45) Research different tourism jobs in your own area and identify the skills required in each. </p>\r\n<p>46) Carry out research which identifies the different reasons why people travel. </p>\r\n<p>47) With the use of an atlas identify key map features. </p>\r\n<p>48) Identify key features of atlases and maps. </p>\r\n<p>49) Explain how topographical features influence tourism. </p>\r\n<p>50) Prepare a report on two major tourism transportation routes between the candidate\'s country and a destination in the opposite Hemisphere. </p>\r\n<p>51) Research a popular country in your area, explain the positive and negative effects of geographical features on tourism. </p>\r\n<p>52) Convert local times to and from Universal Time Coordinates (UTC)/or Greenwich Mean Time (GMT), using time calculation tools such as time zone charts. </p>\r\n<p>53) State the factors involved in time conversion. </p>\r\n<p>54) Calculate foreign currency exchange transactions with commission charges between: </p>\r\n<p>i) Your own country and eight foreign countries</p>\r\n<p>ii) Three pairs of foreign countries. </p>\r\n<p>55) Carry out research into different tourism organisations which identifies the main types of customer. </p>\r\n<p>56) Explain the service standards used in three different tourism organisations. </p>\r\n<p>57) Give examples for each of the four levels of customer service. </p>\r\n<p>58) Use effective customer service in three different selected situations: deal with a new customer, deal with a customer who has special needs, deal with a customer who has a complaint. </p>\r\n<p>59) Produce a customer service induction document identifying the key components of customer service. </p>\r\n<p>60) Research reference sources and procedures for handling complaints and produce a letter in response to a customer\'s complaint and identify the methods of recording complaints. </p>\r\n<p>61) Produce guidelines for recommendations for the development of customer service in a tourism organisation. </p>\r\n<p>63) Prepare a report comparing customer service in two selected tourism organisations. </p>\r\n<p>64) Collect information identifying the key elements of a verbal presentation and deliver a presentation on a selected tourism product or service. </p>\r\n<p>65) Produce a diagram of organisational structures, explaining the factors which have influenced the development of two tourism organisations. </p>\r\n<p>66) Research various positions within the tourism industry. </p>\r\n<p>67) Prepare a job specification and description in order to produce a job advertisement. </p>\r\n<p>68) Develop a personal curriculum vitae/resume. </p>\r\n<p>69) Prepare a presentation on workplace standards of practice, operation and legislation. </p>\r\n<p>70) Produce a report identifying team member roles, responsibilities and factors influencing the effectiveness of their team.  </p>\r\n<p>71) Collect and identify reasons for different forms of information used by tourism organisations to present different tourism products and services. </p>\r\n<p>72) Explain how financial performance is monitored in tourism organisations. </p>\r\n<p>73) Identify any factors affecting financial performance and the financial terms used. </p>\r\n<p>74) Carry out and describe simple budgeting from given financial data. </p>\r\n<p>75) Prepare a report which explains the impact of future technological developments upon business systems in tourism organisations. </p>\r\n<p>76) Explain what is meant by the term \'marketing mix\' and the functions of each element of the marketing mix. </p>\r\n<p>77) Identify the reasons why market research is carried out and the methods of conducting market research. </p>\r\n<p>78) Carry out a marketing activity involving market research in relation to tourism organisation. </p>\r\n<p>79) Carry out research into identifying promotional methods and media. </p>\r\n<p>80) Match promotional methods with customer groups, products and services. </p>\r\n<p>81) Carry out research into three different tourism organisations and prepare a report comparing their marketing activities. </p>\r\n<p>82) Undertake market research for a new tourism product or service identifying the objectives, the research process and the techniques used. </p>\r\n<p>83) Produce a marketing plan identifying the components for the selected product or service. </p>\r\n<p>84) Select promotional methods appropriate to your marketing plan and produce examples of materials to be used. </p>\r\n<p>85) Select two major visitor attractions one in the Northern, one in the Southern Hemisphere and research how each attraction was developed. </p>\r\n<p>86) Carry out research into the same two visitor attractions and obtain examples of sales and promotional materials both paper-based and via the Internet. </p>\r\n<p>87) Prepare a presentation which compares sales and promotional activities in each attraction. </p>\r\n<p>88) Produce a report on a local tourism destination of your choice. The report should concentrate on the reasons for the tourism development, the stages in its development, organisations which influenced the development, sources of funding and the impact on the local community. </p>\r\n<p>89) Analyse the factors involved in marketing a local tourism destination. </p>\r\n<p>90) Interpret screen information from a computer reservation system. </p>\r\n<p>91) Interpret and analyse costings in different forms of travel. </p>\r\n<p>92) Research how different tickets are completed for different types of international tourism.</p>\r\n<p>93) Produce a guide for customers which explains different types of travel insurance. </p>\r\n<p>94 ) Research car hire including costings, car groups in accordance with client\'s needs.</p>\r\n\r\n\r\n\r\n\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n<p>Candidates must complete all the required Modules </p>\r\n<p><b>Module 1 -  Destinations and Attractions</p></b>\r\n<p>Unit 1 - Tourism Geography (12 Credits) </p>\r\n<p>Unit 2 - Tourism: National and International (12 Credits) </p>\r\n<p>Unit 3 - Local destinations and Tourism development (4 Credits) </p>\r\n<p>Unit 4 - Visitor attractions and destinations (6 Credits) </p>\r\n\r\n<b><p>Module 2 - Job roles, Marketing and Technology </p> </b>\r\n<p> Unit 1 - Job roles, skills and the tourism workplace (12 Credits) </p>\r\n<p> Unit 2 - Marketing and Tourism (16 Credits) </p>\r\n<p> Unit 3 - Technology, Business systems and Finance (8 Credits) </p>\r\n\r\n<b><p>Module 3 - Customer Service and Reservations  </p>  </b>\r\n<p> Unit 1 - Customer service in Travel and Tourism (12 Credits)</p>  \r\n<p> Unit 2 - Presenting Tourism Products and Services (4 Credits)</p>  \r\n<p> Unit 3 - Reservations and Tourism Services (6 Credits)</p>  \r\n<p> Unit 4 - Insurance and Car Hire (4 Credits)</p>  \r\n\r\n<b><p>Module 4 - Communication And Literacy</p>  </b>\r\n<p>Unit 1 – Communication (12 Credits)\r\n<p>Unit 2 - Mathematical Literacy (6 Credits)\r\n\r\n<b><p>Total Credits: 114 </p></b>\r\n\r\n', '<b><p><u>The Job Opportunities are available in principle sectors of tourism, each with some examples given, are as follows: </p> </b></u>\r\n\r\n <p>1) Transportation (aircraft, trains, cruise ships)</p>\r\n <p>2) Accommodation (hotels)</p>\r\n <p>3) Attractions (museums, culture sites, theaters)</p>\r\n <p>4) Events and conferences (festivals, trade shows, the Olympic games)</p>\r\n <p>5) Food and Beverage (restaurants)</p>\r\n <p>6) Services (Information centers, tourism association)</p>\r\n <p>7) Travel trade (tour companies, travel agencies).</p>\r\n', 'MBA in International Travel', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '1800 USD     ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=PGDIT-001', '-', '-', '-', '-', 'MBA-in-International-Travel.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Code</p></b></u>\r\n<p>1) PGDIT-001 </p>\r\n\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) PGDIT-001 exam comprises of 100 questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass. </p>\r\n\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of PGDIT-001 exam is 2 hours  (120 Minutes) </p>\r\n\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n\r\n\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n\r\n<u><b><p>Taking the Exam </strong></p> </b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p></p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA. </6>\r\n<p></p>\r\n<p>3) You may retake any examination as often as necessary </p>\r\n\r\n\r\n\r\n<br></br>\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n');
INSERT INTO `pl_coursecontent` VALUES ('13', 'MBA in  Property and Facilities Management', '<u><p><b>Overview of Master of Business Administration in Property and Facilities Management </p></b></u>\r\n<p></p>\r\n<p>Commercial Property Management is a multi-million dollar sector which requires professionals who are well-trained and knowledgeable to meet the commercial property needs of the business community through the provision of office space and business premises. </p>\r\n\r\n<p>A wide range of legislation applies to this sector and employees/agents need to understand the relevant legislation and be able to apply it in the execution of their work. This qualification strives to equip the learners with the knowledge and skills necessary to be able to operate effectively and efficiently in the Commercial Property Management sector.</p>\r\n\r\n<p>The knowledge and skills required by practitioners, managers, brokers and facility managers in the Commercial Property Management sector are specialised. </p>\r\n<p>A practitioner in the field of Commercial Property Management needs to have a broad knowledge of the concepts, principles and theory underpinning the skills and specialized knowledge required to practice within this field. </p>\r\n\r\n<p>The course brings together a range of built environment disciplines from sustainable construction to property management to provide a broad perspective on issues of relevant international significance, while case studies provide opportunity for critical reflection and analysis.</p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n<u><b><p>MBA Degree Requirement </p></b> </u>\r\n\r\n<P> Applicants must have a recognized Bachelor degree in any discipline from an accredited college or university; Postgraduate Diploma or a recognized Graduate Certificate; or a recognized Diploma and 2 years work experience.</p>\r\n<u><b><p>Delivery Mode </p></b></u>\r\n<p>Self E-Learning  (E-Courseware)</p>\r\n', '<u><p><b>What is the Learning Outcome of the MBA in Property and Facilities Management?</b></p></u>\r\n<p> </p>\r\n<p>1) Explain the concept of the customer as a source of revenue for the business, and therefore the source of salaries </p>\r\n<p>2) Explain the impact on the organisation and on oneself of losing regular customer business</p>\r\n<p>3) Describe possible ways that customers could react to poor service</p>\r\n<p>4) Describe methods to satisfy irate customers and deal correctly with customers complaints</p>\r\n<p>5) Describe information that may not be given to the customer, and explain the reasons for confidentiality</p>\r\n<p>6) Explain why complaints and customer feedback are good for the organisation</p>\r\n<p>7) Explain why it is important to anticipate customers` needs</p>\r\n<p>8) Greet customers in a polite and friendly manner that is suited to the situation and organisation</p>\r\n<p>9) Deal with customers directly or refer them to the appropriate person. (If referred, give a clear and concise explanation of the problem to the person dealing with the issue and reasons for the referral)</p>\r\n<p>10) Refer customer complaints that occur outside the individual`s authority/work area to the appropriate person, and explain why</p>\r\n<p>11) Deal with customer complaints and irate customers in line with organisational requirements and decide what follow up action to take</p>\r\n<p>12) Promote establishment services in a manner that suits the situation</p>\r\n<p>13) Given an entirely different field (e.g. agriculture, manufacturing or information technology), describe the importance of customer care in that field</p>\r\n<p>14) Make suggestions to improve customer care in a particular context </p>\r\n<p>15) Describe ways to obtain customer feedback</p>\r\n<p>16) Explain the importance of interpersonal skills and the reasons for cultural considerations when interacting with customers</p>\r\n<p>17) Describe the methods used to monitor staff-customer relations</p>\r\n<p>18) Describe products and services provided by the organisation and explain the importance of promoting them</p>\r\n<p>19) Explain the importance of evaluating/dealing with complaints by using effective negotiating and communication skills, and describe alternative ways to resolve complaints</p>\r\n<p>20) Given complaints about products and service, explain the importance of understanding company standards and identify the person responsible for resolving complaints</p>\r\n<p>21) Describe ways of establishing rapport with customers and maintaining a professional relationship</p>\r\n<p>22) Identify customer requirements and decide how best to deal with the request</p>\r\n<p>23) Given a range of products and services, decide how best to promote the features and benefits, taking resources, the type of customer and environment into account</p>\r\n<p>24) Given a range of complaints, describe ways to rectify the complaints and explain reasons why these particular solutions have been chosen. Range: Products, services, environment, personnel</p>\r\n<p>25) Suggest possible ways to improve the procedure for handling customer complaints and give reasons for each suggestion</p>\r\n<p>26) Suggest ways of increasing customer satisfaction </p>\r\n<p>27) Describing the factors that influence the development of a code of ethics</p>\r\n<p>28) Explaining the contents of the Real Estate Code of Conduct</p>\r\n<p>29) Explaining the implications of the Real Estate Code of Conduct for a Real Estate organisation</p>\r\n<p>30) Relating a Code of Conduct to ethical values and standards within own organisation and discussing ethical best practices</p>\r\n<p>31) Applying a Real Estate Code of Conduct and ethics in own work context </p>\r\n<p>32) Utilise communication skills to enhance customer service</p>\r\n<p>33) Adhere to ethical standards in all dealings with clients</p>\r\n<p>34) Provide adequate responses to a client\'s query or complaint</p>\r\n<p>35) Assist clients with constructive advice and information</p>\r\n<p>36) Use a range of reading and viewing strategies to understand the literal meaning of specific texts </p>\r\n<p>37) Use strategies for extracting implicit messages in texts </p>\r\n<p>38) Respond to selected texts in a manner appropriate to the context </p>\r\n<p>39) Explore and explain how language structures and features may influence a reader/viewer</p>\r\n<p>40) Extract meaning from a variety of literary texts </p>\r\n<p>41) Identify and explain features that influence response to texts </p>\r\n<p>42) Produce own texts in response to literary texts</p>\r\n<p>43) Critically analyse texts produced for a range of purposes, audiences and contexts </p>\r\n<p>44) Identify and explain the values, attitudes and assumptions in texts </p>\r\n<p>45) Evaluate the effects of content, language and style on readers\'/viewers\' responses in specific texts. </p>\r\n<p>46) Using textual features and conventions specific to texts</p>\r\n<p>47) Identifying the intended audience for the communication</p>\r\n<p>48) Identifying the purpose of a text</p>\r\n<p>49) Selecting the appropriate text type, format and layout for the purpose</p>\r\n<p>50) Organising and structuring a technical text appropriately</p>\r\n<p>51) Using appropriate grammar conventions</p>\r\n<p>52) Drafting and editing a technical text</p>\r\n<p>53) Recognising errors and checking for accuracy</p>\r\n<p>54) Presenting the same information in different ways </p>\r\n<p>55) Using plain language in business</p>\r\n<p>56) Gather and analyse information to assist event planning. </p>\r\n<p>57) Plan an event. </p>\r\n<p>58) Identify and procure supporting resources needed. </p>\r\n<p>59) Arrange logistical elements of the event. </p>\r\n<p>60) Evaluate the event against client requirements.  </p>\r\n<p>61) Analyse the situation. </p>\r\n<p>62) Set specific objectives for the public relations programme. </p>\r\n<p>63) Analyse the target audience. </p>\r\n<p>64) Develop the programme message. </p>\r\n<p>65) Plan the evaluation of the programme. </p>\r\n<p>66) Interact successfully with audience in oral communication </p>\r\n<p>67) Use strategies that capture and retain the interest of an audience </p>\r\n<p>68) Identify and respond to manipulative use of language </p>\r\n<p>69) Write for a specified audience and purpose</p>\r\n<p>70) Use language structures and features to produce coherent and cohesive texts for a wide range of contexts</p>\r\n<p>71) Draft own writing and edit to improve clarity and correctness </p>\r\n<p>72) Write/sign effectively and creatively on a range of topics </p>\r\n<p>73) Choose language structures and features to suit communicative purposes </p>\r\n<p>74) Edit writing/signing for fluency and unity</p>\r\n<p>75) Respond critically yet sensitively as a listener/audience </p>\r\n<p>76) Analyse own responses to spoken/signed texts and adjust as required </p>\r\n<p>77) Use strategies to be an effective speaker/signer in sustained oral/signed interactions </p>\r\n<p>78) Evaluate spoken/signed discourse </p>\r\n<p>79) Use mathematics to plan and control financial instruments including insurance and assurance, unit trusts, stock exchange dealings, options, futures and bonds </p>\r\n<p>80) Use simple and compound interest to make sense of and define a variety of situations including </p>\r\n<p>81) mortgage loans, hire purchase, present values, annuities and sinking funds </p>\r\n<p>82) Investigate various aspects of costs and revenue including marginal costs, marginal revenue and optimisation of profit </p>\r\n<p>83) Use mathematics to debate aspects of the national and global economy, including tax, productivity and the equitable distribution of resources. </p>\r\n<p>84) Gather, organise, record and manage information </p>\r\n<p>85) Engage in active communication techniques. </p>\r\n<p>86) Apply basic knowledge of relevant legislation. </p>\r\n<p>87) Interpreting a sales or marketing strategy </p>\r\n<p>88) Implementing the sales or marketing strategy  </p>\r\n<p>89) Monitoring the sales or marketing strategy</p>\r\n<p>90) Demonstrate an understanding of the nature, role, history and sources of International Law </p>\r\n<p>91) Assess the legal rules that relate to the validity of various contracts </p>\r\n<p>92) Demonstrate an understanding of the rights, duties of parties to a contract. </p>\r\n<p>93) Demonstrate an understanding of the relevant terms and concepts used within contracts </p>\r\n<p>94) Develop workplace sustainability policy. </p>\r\n<p>95) Communicate workplace sustainability policy. </p>\r\n<p>96) Implement workplace sustainability policy. </p>\r\n<p>97) Review workplace sustainability policy implementation.  </p>\r\n<p>98) Measure, estimate, and calculate physical quantities in practical situations relevant to the adult with increasing responsibilities in life or the workplace</p>\r\n<p>99) Explore analyse and critique, describe and represent, interpret and justify geometrical relationships and conjectures to solve problems in two and three dimensional geometrical situations</p>\r\n<p>100) Identify and assess own business ideas/opportunities for a new venture</p>\r\n<p>101) Analyse the viability of a selected idea/opportunity against specific screening variables</p>\r\n<p>102) Research the potential of a particular idea/opportunity as a new venture</p>\r\n<p>103) Analyse a range of risks associated with a new venture</p>\r\n<p>104) Evaluate new venture ideas/opportunities based on research findings </p>\r\n<p>105) Identifying elements and resources to be costed through interpreting the project scope statement, work breakdown structure and other project data</p>\r\n<p>106) Participating in the preparation and production of a cost budget </p>\r\n<p>107) Contributing to the monitoring and controlling of cost budget performance by maintaining records and communicating</p>\r\n<p>108) Explaining the concept of risk in risk management</p>\r\n<p>109) Demonstrating knowledge and understanding of the risk management process</p>\r\n<p>110) Describing risk management in the context of an organisation</p>\r\n<p>111) Proposing a model to manage risk in a specific organisation or business unit </p>\r\n<p>112) Explaining the basic principles of the Act and accompanying Regulations </p>\r\n<p>113) Explaining the requirements for minimum compliance stipulated in the Act </p>\r\n<p>114) Interpreting the management controls required to achieve compliance </p>\r\n<p>115) Explaining the obligations of managers in terms of communication and training </p>\r\n<p>116) Developing and maintaining own knowledge of laws/policies and their interpretation and application in housing development projects</p>\r\n<p>117) Identifying opportunities for greater community involvement and participation</p>\r\n<p>118) Liaising and coordinating with key stakeholders for housing development project</p>\r\n<p>119) Analysing and presenting results of consultation in according to organisational policies and procedures </p>\r\n<p>120) Actioning planned maintenance programmes through technical specialists that ensures that all assets and investments are maintained to operational efficiency</p>\r\n<p>121) Providing preventative maintenance of assets</p>\r\n<p>122) Controlling the use of asset and investment resources </p>\r\n<p>123) Explaining property as an investment asset class</p>\r\n<p>124) Interpreting the risk and return of property as an investment</p>\r\n<p>125) Assessing the impact of the various drivers on return of property investments</p>\r\n<p>126) Demonstrating knowledge and understanding of how property is valued for investment purposes</p>\r\n<p>127) Establish requirements and plan the agreement</p>\r\n<p>128) Organising resources and support processes</p>\r\n<p>129) Reviewing the management agreement</p>\r\n<p>130) Determine space use requirements</p>\r\n<p>131) Review space use</p>\r\n<p>132) Record and report results</p>\r\n<p>133) Determine tenancy mix requirements</p>\r\n<p>134) Develop tenancy mix strategy</p>\r\n<p>135) Implement tenancy mix strategy </p>\r\n<p>136) Review tenancy mix strategy</p>\r\n', '<u><b><p>Credit Requirements</p></b></u>\r\n<p>Candidates must complete all the required Modules </p>\r\n<p><b>Module 1 -  Customer Service</p></b>\r\n<p> Unit 1 -  Interpret a variety of literary texts (5 Credits)</p>\r\n<p> Unit 2 -   Interpret and use information from texts (5 Credits)</p>\r\n<p> Unit  3 -  Provide Customer Service (8 Credits)</p>\r\n<p> Unit 4 -  Monitor customer satisfaction (3 Credits)</p>\r\n<p> Unit 5 - Apply the principles of customer care in client interactions (5 Credits)</p>\r\n<p> Unit 6 - Demonstrate knowledge of and apply the Real Estate Code of Conduct and ethics (6 Credits)</p>\r\n<p> Unit 7 - Read/view, analyse and respond to a variety of texts (5 Credits)</p>\r\n<p><b>Module 2  -  Public Relations</p></b>\r\n<p> Unit 1 - Plan a public relations programme (12 Credits)</p>\r\n<p> Unit 2 - Arrange a Public Relations / Communication event (5 Credits)</p>\r\n<p> Unit 3 - Accommodate audience and context needs in oral/signed communication (5 Credits)</p>\r\n<p> Unit 4 - Write/present/sign texts for a range of communicative contexts (5 Credits)</p>\r\n<p> Unit 5 - Engage in sustained oral/signed communication and evaluate spoken/signed texts (5 Credits)</p>\r\n<p> Unit 6 - Use the writing process to compose texts required in the business environment  (5 Credits)</p>\r\n<p> Unit 7 - Write/present/sign for a wide range of contexts (5 Credits)</p>\r\n<p><b>Module 3 – Business Relations</p></b>\r\n<p> Unit 1 - Apply knowledge of statistics and probability to critically interrogate and effectively communicate findings on life related problems  (6 Credits)</p>\r\n<p> Unit 2 - Represent analyse and calculate shape and motion in 2-and 3-dimensional space in different contexts (4 Credits)</p>\r\n<p> Unit 3 - Use mathematics to investigate and monitor the financial aspects of personal, business, national and international issues (6 Credits)</p>\r\n<p> Unit 4 - Assess legal contracts for business (8 Credits)</p>\r\n<p> Unit 5 - Ensure implementation of workplace policy and procedures for sustainability (5 Credits)</p>\r\n<p> Unit 6 - Recruit and select candidates to fill defined positions (10 Credits)</p>\r\n<p> Unit 7 -  Implement sales and marketing strategies (5 Credits) </p>\r\n<p><b>Module 4 – Project Management in Property</p> </b>\r\n<p> Unit 1 - Implement project plans (5 Credits)  </b>\r\n<p> Unit 2 - Participate in the estimation and preparation of cost budget for a project or sub project and monitor and control actual cost against budget  (6 Credits) </b>\r\n<p> Unit 3 -  Manage a consultant property project team (4 Credits) </b>\r\n<p> Unit 4 - Research the viability of new venture ideas/opportunities (5 Credits) </b>\r\n<p> Unit 5 -  Consult with interested parties to promote community participation on housing development projects (10 Credits) </b>\r\n<p> Unit 6 - Demonstrate knowledge and application of the nature of risk and the risk management process (4 Credits) </b>\r\n<p> Unit 7 -  Demonstrate knowledge and application of the OHS Act, 85 of 1993 (OHSA) and the responsibilities of management in terms of the Act (4 Credits) </b>\r\n\r\n<p><b>Module 5 – Property and Tenants</p> </b>\r\n<p>Unit 1 - Coordinate fit-out of premises for user occupation (5 Credits) </p>\r\n<p>Unit 2 - Develop a tenancy mix strategy (5 Credits) </p>\r\n<p>Unit 3 - Develop strategy for managing community management agreements (4 Credits) </p>\r\n<p>Unit 4 - Implement and manage customer specific workplace requirements (6 Credits) </p>\r\n<p>Unit 5 - Apply technical knowledge and insight into property as an investment  (3 Credits) </p>\r\n<p>Unit 6 - Maintain and control the use of asset and investment resources (6 Credits) </p>\r\n\r\n<b><p>Total Credits: 190 </p></b>\r\n<br></br>\r\n<span style=\"color:red\"> Please note, you will only get credits if you pass the exams required to achieve the MBA Degree.</span>\r\n', '<p><b><u>The Job Opportunities are available in principle sectors of property and facilities.</p></u></b>\r\n\r\n<p>The aim of this MBA is therefore to provide learners already operating in Commercial Property management or who want to practice within this field with a broad understanding of the knowledge base on which their practice should be founded. </p>\r\n\r\n<p>1) Candidates completing this MBA will have developed the knowledge and skills required to:</p>\r\n<p>2) Analyse, evaluate and apply the Real Estate Code of Conduct and Ethics. </p>\r\n<p>3) Perform the functions related to general business in the Commercial Property Industry. </p>\r\n<p>4) Perform the specific functions related to an area of specialisation within the Commercial Property Industry. </p>\r\n\r\n<p>Rural Property Broker/Consultant, Property Developer, Business Broker, Property Finance Consultant, Property Consultant, Property Researcher, Asset Manager, Sales and Leasing Negotiator, Portfolio Manager, Property Manager, Valuer (real property and plan/machinery).</p>\r\n', 'MBA in Property and Facilities Management', '-', '-', '-', '-', 'One (1) Year', '-', '-', '-', '-', '2100 USD         ', '-', '-', '-', '-', 'http://gaqm.org:8080/gaqm/elearn/showdetails?id=CPFM-001', '-', '-', '-', '-', 'MBA-in-Property-and-Facilit.png', '<u><b><p>Mode of Exam</p></b></u>\r\n<p>Exams are online based and are available via Pearson Vue Testing Centers across the globe</p>\r\n\r\n<u><b><p>Exam Codes</p></b></u>\r\n<p>1) CPFM-001 </p>\r\n\r\n<u><b><p>Passing Score</p></b></u>\r\n<p>1) CPFM-001 exam comprises of 100 questions out of which the candidate needs to score 75% (75 out of 100 correct) to pass. </p>\r\n\r\n<u><b><p>Duration of Exam</p></b></u>\r\n<p>1) The total duration of CPFM-001 exam is 2 hours  (120 Minutes) </p>\r\n\r\n\r\n\r\n\r\n\r\n<u><b><p>Closed Book </p></b></u>\r\n<p>No external sources of information may be accessed during the exam at Pearson Vue Test Center. </p>\r\n<u><p><b>Retaking of exam</p></b></u>\r\n<p> 1) If a Candidate does not pass the exam in the second (2nd) attempt, the candidate must wait for a period of at least fourteen (14) calendar days from the date of their attempt to retake the exam for third (3rd) time or any subsequent time.</p>\r\n<p> 2) The exam can be taken any number of times.</p>\r\n\r\n\r\n<u><b><p>Taking the Exam </strong></p> </b></u>\r\n<p></p>\r\n<p>1) You will get credits only if you pass the exams. </p>\r\n<p></p>\r\n<p>2) Exams can be taken separately (one at a time) and in any sequence to earn a MBA. </6>\r\n<p></p>\r\n<p>3) You may retake any examination as often as necessary </p>\r\n\r\n');
